(41, 3, 2143797875822052400, NULL, 'B3ATM9KnEPT', 191, 1270, 8522, 0, 0, 0, 0, 0, '0.72', 'Früher war ich ein richtiger Serienjunkie, saß ganze Tage nur vor dem Rechner und habe mir eine Staffel nach der anderen reingezogen, jeden Spannungsbogen mitgefiebert, jeder Cliffhanger hat mich erwischt, ich konnte gar nicht ausschalten ..⁣⁣⁣\n⁣⁣⁣\nBis ich irgendwann gemerkt habe, dass ich mehr bei Abenteuern anderer mitfiebere als eigene zu erleben und das hat mir Angst gemacht: Will ich mein ganzes Leben vor dem Rechner verbringen? Im Popcornmodus über fiktive Welten staunen, die Erfolge anderer sehen, während mein Leben immer mehr zum Drama wird dabei?⁣⁣⁣\n⁣⁣⁣\nIch hab von heute auf morgen alles geändert. Radikal. Das funktionierte nur, weil ich es realisiert habe, etwas das ich lange nicht konnte.⁣⁣⁣\n⁣⁣⁣\nAm 16.11.2019 werde ich mein einziges Event dieses Jahr hosten und möchte meiner Community zeigen, wie man es schaffen kann. Wie man sein Leben in die eigenen Hände nimmt und was mir zum Durchbruch verholfen hat .. das wird das intimste Business Event, welches es jemals gab.⁣⁣⁣\n⁣⁣⁣\nKeine Geheimnisse. 100%ige Transparenz!⁣⁣⁣\n⁣⁣⁣\nWir sprechen über die richtige Einstellung, das Mindset, aktuelle Businesstrends und Möglichkeiten, den Businessaufbau, sowie Social Media - alle Kanäle, wie man sie aufbaut und schlussendlich sprechen wir über den Branding Part - das, was bei mir am Ende alles veränderte.⁣⁣⁣\n⁣⁣⁣\nEs gibt leider nur sehr wenige Tickets, da wir uns in einer Premium Location in München befinden werden, die nur 330 Plätze umfasst, aber für diejenigen, die die Reise antreten, wird danach die eigene erst beginnen .. ⁣⁣⁣\n⁣⁣⁣\nLink findet ihr in der Bio !⁣⁣\n⁣⁣\n⁣⁣\nTeile diesen Trailer in deiner Story, markiere mich @torbenplatzer und eine Person, die das interessieren könnte und du kannst eine SELFMADE Box aus Hoodie, Shirt und Kaffee gewinnen!⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n⁣⁣⁣\n_____⁣⁣⁣\n#tpa #torbenplatzer #selfmade #selfmadesociety #münchen #money #