(82, 5, 2455396014524247600, NULL, 'CITUap8oK0j', 12, 113, 1057, 0, 0, 0, 0, 0, '1.43', '🆙 Elevator Pitch.\nEin Mann wohnt in einem Hochhaus im 19. Stockwerk.\n\nJeden Tag wenn er das Haus verlässt, fährt er mit dem Fahrstuhl vom 19. Stock nach unten.\n\nWenn er wieder nach Hause kommt fährt er mit dem Fahrstuhl bis in die 16. Etage und geht die restlichen drei über die Treppe.\n\nWieso tut er das? Die Auflösung gibts in der Story heute Abend.\n\n#elevatorselfie #elevator #stuttgart #0711 #feeddesign #motiondesign #inspiration #rätsel #aufzug #design #magician #adobe #adobephotoshop #thyssenkrupp', 1606926126, '{\"city_name\":\"Stuttgart\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/129143151_688983568644114_8287400353130792462_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/129489232_2051447014985421_5669834388564712833_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=BCmSSB6bZ6QAX8Ek_5h&edm=AOQ1c0wBAAAA&vs=17956389859374908_1740787393&_nc_vs=HBksFQAYJEdGRFp0d2ZOanBxNngwa0hBSUdkc1JsV1RLOU9ia1lMQUFBRhUAAsgBABUAGCRHRGRaa0FjNEZkXzhvczRBQUs5RWE3UWNSODBFYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACb4nvCluc%2FlPxUCKAJDMywXQBQAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMl92MREAdeoHAA%3D%3D&_nc_rid=158000d7de&ccb=7-5&oh=00_AfAQ4Jr1LoiC-F8uSGsvCl4-oTfYMWDLfINNMSmriN80IA&oe=6423E2C4&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CITUap8oK0j', 0, 0, '[\"#elevator\",\"#stuttgart\",\"#0711\",\"#feeddesign\",\"#motiondesign\",\"#inspiration\",\"#r\\u00e4tsel\",\"#aufzug\",\"#design\",\"#magician\",\"#adobe\",\"#adobephotoshop\",\"#thyssenkrupp\"]', 'post', 'profile_scrape', 0, 1679945638, 1679945638),
