(329, 19, 3073332727689382801, NULL, 'Cqmq9UmgguR', 0, 27, 0, 0, 0, 0, 0, 0, '1.3', '🗳️ VOTE FOR US AS NEWCOMER 2023 🗳️\n\nWir sind in diesem Jahr zum ersten Mal Teil des @food_innovation_camp und freuen uns riiiiiesig dabei zu sein. Gemeinsam mit @rewe nord werden in jedem Jahr die besten Food Innovationen gekrönt und ihr könnt ab sofort auch für unsere veganen Specialty Lattes abstimmen. Auf dem zweiten Bild könnt ihr sogar schon unser brandneues Design sehen. 🆕😍\n\nWir freuen uns wirklich wahnsinnig über jede Stimme von euch & unter allen Teilnehmer*innen werden zusätzlich tolle Preise verlost. 🥳 Den Link zum Voting findet ihr in unserer Bio. 👆\n\n#foodinnovation #foodinnovationcamp #messehamburg #rewe #rewenord #newcomer #newcomer2023 #startup #vegan #plantbased #specialtylattes', 1680589850, NULL, 'IMAGE', 'images/content/posts/339338489_1186580488699030_8504404846196315379_n.jpg', NULL, NULL, 'https://instagram.com/p/Cqmq9UmgguR', 0, 0, '[\"#foodinnovationcamp\",\"#messehamburg\",\"#rewe\",\"#rewenord\",\"#newcomer\",\"#newcomer2023\",\"#startup\",\"#vegan\",\"#plantbased\",\"#specialtylattes\"]', 'post', 'profile_scrape', 0, 1680707503, 1680707503),
