(365, 21, 3073617017978259520, NULL, 'CqnrmSkMIhA', 1, 8, 85, 0, 0, 0, 0, 0, '0.22', 'Wie definiert sich Greenwashing konkret und wie können wir das von Aktivismus unterscheiden? Mit dieser Frage beschäftigt sich Christoph Bals, Geschäftsführer von Germanwatch, im Interview mit Alma. \n \nNa, neugierig geworden? 👀 \nDann schau vorbei. Den Link zum ganzen Interview findest du in der Bio. 👆🏽\n \n#UnternehmenKlimaaktivismus #wetell #nachhaltigkeit #mobilfunk #klimaschutz #klimaaktivismus', 1680623700, NULL, 'VIDEO', 'images/content/posts/339291181_974168363954519_6745237216495737864_n.jpg', NULL, NULL, 'https://instagram.com/p/CqnrmSkMIhA', 0, 0, '[\"#wetell\",\"#nachhaltigkeit\",\"#mobilfunk\",\"#klimaschutz\",\"#klimaaktivismus\"]', 'post', 'profile_scrape', 0, 1680711214, 1680711214),
(366, 21, 3071439997018213112, NULL, 'Cqf8mdzMor4', 5, 86, 0, 0, 0, 0, 0, 0, '2.25', 'Wer kennt es auch: Das Problem mit der Sinnsuche? Und die Frage: „Was mache ich hier eigentlich?“ \nTatjana hat ihre Antwort darauf bei WEtell gefunden. Das finden wir natürlich MEGA! 🙌\n#wetell #klimapositiv #klimaschutz #crewlove #socialmediamarketing #teamwork #fairness #transparenz', 1680367800, NULL, 'IMAGE', 'images/content/posts/339290183_520280066743765_605337625619855106_n.jpg', NULL, NULL, 'https://instagram.com/p/Cqf8mdzMor4', 0, 0, '[\"#klimapositiv\",\"#klimaschutz\",\"#crewlove\",\"#socialmediamarketing\",\"#teamwork\",\"#fairness\",\"#transparenz\"]', 'post', 'profile_scrape', 0, 1680711214, 1680711214),
(367, 21, 3069345185297335907, NULL, 'CqYgS8WtAZj', 5, 69, 0, 0, 0, 0, 0, 0, '1.83', 'Typisch Wegwerf-Gesellschaft! 😬 Funktioniert etwas nicht, schmeißen wir es weg oder legen es in irgendeine Schublade, wo es dann vor sich hin staubt – STATT es zu reparieren oder zu recyclen.\nWarum wir das hier veröffentlichen: Mach dir Gedanken über deinen eigenen Konsum und denk dran, dass man Dinge auch reparieren kann. \nUnd nicht vergessen: Grafik speichern oder an Freund*innen schicken, die das interessieren könnte. \n#klimaschutz #nachhaltigkeit #nachhaltigleben #smartphone #wetell #mobilfunk #studien #konsum #refurbished \nWo haben wir die Zahlen her? Statista', 1680114483, NULL, 'IMAGE', 'images/content/posts/338451701_777087106867949_4398753835586244633_n.jpg', NULL, NULL, 'https://instagram.com/p/CqYgS8WtAZj', 0, 0, '[\"#klimaschutz\",\"#nachhaltigkeit\",\"#nachhaltigleben\",\"#smartphone\",\"#wetell\",\"#mobilfunk\",\"#studien\",\"#konsum\",\"#refurbished\"]', 'post', 'profile_scrape', 0, 1680711214, 1680711214),
(368, 21, 3068583154457985961, NULL, 'CqVzB71N0Op', 1, 24, 428, 0, 0, 0, 0, 0, '0.62', 'Dürfen Unternehmen klimaaktivistisch sein? 🌍 Wie stehen NGO’s dazu? Das klärt Martin Köppel, Geschäftsführer von @protecttheplanetorg im Interview mit Alma. \n \nNa, neugierig geworden? 👀 \nDann schau vorbei. Den Link zum ganzen Interview findest du in der Bio. 👆🏽\n \n#UnternehmenKlimaaktivismus #wetell #nachhaltigkeit #mobilfunk #klimaschutz #klimaaktivismus', 1680023906, NULL, 'VIDEO', 'images/content/posts/338117774_1851168848616335_1753874372682258561_n.jpg', NULL, NULL, 'https://instagram.com/p/CqVzB71N0Op', 0, 0, '[\"#wetell\",\"#nachhaltigkeit\",\"#mobilfunk\",\"#klimaschutz\",\"#klimaaktivismus\"]', 'post', 'profile_scrape', 0, 1680711214, 1680711214),
(369, 21, 3066417274156014244, NULL, 'CqOGkOnMNqk', 3, 54, 5564, 0, 0, 0, 0, 0, '1.41', 'WHAT? Nachhaltige Smartphone Nutzung? 🌱📲 \nIn diesem Video geben wir dir 3 Tipps wie das funktioniert. 💡 \nDu hast Bock das gleich umzusetzen? Dann gönn dir einen unserer nachhaltigen Mobilfunktarife. Damit tust du nicht nur dir etwas Gutes, sondern auch der Umwelt. 💚 Mega oder? \nMehr Infos gibt’s hier: www.wetell.de \n👉🏼 Was tust du, um dein Smartphone nachhaltig zu nutzen? Schreib‘s in die Kommentare. \n@fairphone @shiftphones\n\n#mobilfunk #nachhaltig #gruenfunken #wetell #freiburg #berlin #klimaschutz #tipps #howtoklimaschutz', 1679765400, NULL, 'VIDEO', 'images/content/posts/337183537_594201389037984_4612880707526928410_n.jpg', NULL, NULL, 'https://instagram.com/p/CqOGkOnMNqk', 0, 0, '[\"#nachhaltig\",\"#gruenfunken\",\"#wetell\",\"#freiburg\",\"#berlin\",\"#klimaschutz\",\"#tipps\",\"#howtoklimaschutz\"]', 'post', 'profile_scrape', 0, 1680711215, 1680711215),
(370, 21, 3065687152524446927, NULL, 'CqLgjj2sszP', 3, 51, 0, 0, 0, 0, 0, 0, '1.33', 'Klimabericht: Das Problem ist real und löst sich nicht von selbst! \n \nDiese Woche veröffentlichte der Weltklimarat ihren Klimabericht, der drastische und direkte Maßnahmen fordert, um den CO2-Ausstoß zu verringern. Das Tempo und der Umfang der bisherigen Maßnahmen reicht nicht aus, um den Klimawandel zu verhindern ❗️ \n \nWas können wir tun, um unseren Beitrag zum Klimawandel zu leisten? Ein paar Tipps: \n\n🌱 Nachhaltigen Banken: Geld regiert die Welt, also lass dein Geld für nachhaltige Projekte wirken\n🌱 Gehe privat oder mit deinen Kolleg*innen auf die Straße und beteilige dich zum Beispiel bei den @fridaysforfuture.de \n🌱 Unterstütze Unternehmen, die sich für eine enkel*innentaugliche Zukunft einsetzen \n🌱 Nutze Wind-, Wasser- oder Solarenergie privat und im Unternehmen\n \nWie setzt du dich aktiv gegen den Klimawandel ein? Schreib´s in die Kommentare 👇🏽\n \nQuelle: Tagesschau \n \n#ipcc #klimawandel #klima #climatechange #veränderung #actnow #wetell #klimaschutz', 1679678400, NULL, 'IMAGE', 'images/content/posts/337289852_752806989572162_7383814406124764156_n.jpg', NULL, NULL, 'https://instagram.com/p/CqLgjj2sszP', 0, 0, '[\"#klimawandel\",\"#klima\",\"#climatechange\",\"#ver\\u00e4nderung\",\"#actnow\",\"#wetell\",\"#klimaschutz\"]', 'post', 'profile_scrape', 0, 1680711215, 1680711215),
(371, 21, 3062783042078190910, NULL, 'CqBMPMPKS0-', 0, 62, 0, 0, 0, 0, 0, 0, '1.53', 'Berliner*innen kämpfen für einen Klimaneustart! \nZiel: eine Änderung des Berliner Klimaschutz- und Energiewendegesetzes. Berlin soll damit statt 2045 bereits 2030 klimaneutral sein ❗️\n\nFinden wir mega! Konkrete Konsequenzen davon werden dann sein: \n🌱 Sanktionsmechanismen bei Pflichtverstößen werden direkt möglich\n🌱 Sozial gerechter Ausgleich: Die Umsetzung der Klima-Verpflichtungen darf nicht auf Kosten der Mieter*innen gehen\n🌱 Verminderung ALLER Treibhausgase \n🌱 Reduktion vor Kompensation: Nur, wenn keine weiteren Reduktionen möglich sind, werden die noch verbleibenden Emissionen kompensiert\n\nMehr Infos gibt\'s auf: www.berlin2030.org\n\nAm liebsten würden wir auch direkt unser Kreuzchen setzen. Allerdings gibt es bisher in keiner anderen deutschen Stadt einen Klimaneustart. Finden wir super schade – wünschen wir uns von weiteren Städten in Deutschland! \n\nWürdest du dein Kreuz für einen Klimaneustart in deiner Stadt setzen? ❌\n\n#berlin #klimaneustart #volksentscheid #DuMachstDasGesetz #berlin2030', 1679332212, NULL, 'IMAGE', 'images/content/posts/336500941_2852248554905230_8905902759938158426_n.jpg', NULL, NULL, 'https://instagram.com/p/CqBMPMPKS0-', 0, 0, '[\"#klimaneustart\",\"#volksentscheid\",\"#dumachstdasgesetz\",\"#berlin2030\"]', 'post', 'profile_scrape', 0, 1680711215, 1680711215),
