(382, 21, 2611726231601327329, NULL, 'CQ-tyuNKqzh', 0, 30, 208, 0, 0, 0, 0, 0, '0.74', '#gemeinsammehr – Du erzählst von WEtell und wir installieren mehr Solarmodule! ☀️\nWie im Video von @studio.wilma erklärt, bekommst du bei WEtell fairen, sicheren und nachhaltigen Mobilfunk, damit du mit richtig gutem Gewissen mobilfunken kannst. Und mit #gemeinsammehr kannst du sogar noch mehr für die Umwelt und deinen Geldbeutel tun! 🌱💰\n\nDu teilst den #gemeinsammehr Rabattcode und bekommst 5€ Mobilfunkguthaben pro neues WEtell Mitglied, das durch dich zu uns kommt, und wir erlassen allen neuen WEtell Mitgliedern, die so einen Vertrag abschließen, die Bereitstellungsgebühr oder investieren 40€ in die Installation von weiteren Solarmodulen.\n\n#gemeinsammehr findest du ne coole Sache und willst es allen deinen Freund*innen und Bekannten erzählen? Das kannst du ganz einfach über verschiedene Teilemöglichkeiten, die wir vorbereitet haben: \nÜbers Handy kannst du #gemeinsammehr per E-Mail, Facebook, Threema, Telegram und Whatsapp teilen, in der Desktop-Ansicht klappt es über E-Mail und Facebook. Oder du nimmst einfach direkt diesen Text und schickst ihn an alle deine Freund*innen:\n\nIch hab die klimaneutralen Mobilfunktarife von WEtell für mich entdeckt und find\'s super cool! Wenn du auch fair und zuverlässig telefonieren willst, wechsel doch jetzt im Rahmen der #gemeinsammehr-Aktion! Gut für dich, weil du dir die Anschlussgebühr sparen kannst! Gut für mich, weil ich einen kleinen Bonus bekomme! Und sowieso gut für\'s Klima, weil WEtell für uns Solaranlagen baut! Dein Wechselcode lautet WE-GMM-AB-2021 und weitere Infos findest du auf wetell.de/gemeinsammehr \nLiebe Grüße\n\nUnd natürlich kannst du dich auch mit dem Megafon in deine Straße stellen, dafür haben wir aber leider keinen Text vorbereitet. 😉 \nMach deinen Mobilfunk nachhaltig mit WEtell und bewege die Welt mit #gemeinsammehr!\nFür weitere Infos klick den Link in der Bio.\n\n#wetell #endlichgruenfunken #thechange #mobil