(386, 21, 2501124830589044800, NULL, 'CK1x8gqK0hA', 2, 51, 733, 0, 0, 0, 0, 0, '1.31', 'Naaa? Wie steht es um deine Vorsätze? Eher 1:0 für den Schweinehund? Oder hast du schon zu WEtell gewechselt? 🧐🌵\n\nWarum zu WEtell wechseln? Ganz einfach!\n1. Du bist total unabhängig! Du möchtest ja sicherlich nicht nochmal 24 Monate in deinem Vertrag stecken, oder? Mit einem WEtell Vertrag und unseren monatlich kündbaren Tarifen entscheidest alleine du!\n2. Du schützt das Klima! Mit unseren 1.000 Solarmodulen, kompensieren wir bereits jetzt den CO2 Verbrauch von unseren 3.000 Kund*innen zu 200 %.\n3. Du bekommst den besten Service! 99 % unserer Kund*innen sind super zufrieden mit unserer Hilfe!\n\n🤳 Zu den Tarifen findest du über unsere Bio bzw. über diesen Link: https://www.wetell.de/tarife/\n\n#wechselzuwetell #2021 #esistniezuspät #nachhaltigkeit #fairness #datenschutz #klimapositiv', 1612377341, NULL, 'VIDEO', 'images/content/posts/146385875_244922997101656_5458575878381305244_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/146634403_860552581397448_2405357641141324547_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQyNi5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=S-IAfwzEhJoAX84Yc9w&edm=AOQ1c0wBAAAA&vs=17867245697331665_3514492374&_nc_vs=HBkcFQAYJEdLTjJ2UWpJdV93Q3F3NERBQU1MQU00SGpHRWhia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJqLTrb7Jir0%2FFQIoAkMzLBdAFAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB16gcA&_nc_rid=efeff7df2e&ccb=7-5&oh=00_AfA17bkC1V1CRnRQ1L-0_nKLRTGu0KBh06sjM4xqMBkSkw&oe=642F3E81&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CK1x8gqK0hA', 0, 0, '[\"#2021\",\"#esistniezusp\\u00e4t\",\"#nachhaltigkeit\",\"#fairness\",\"#datenschutz\",\"#klimapositiv\"]', 'post', 'profile_scrape', 0, 1680711215, 1680711215),
(387, 21, 2388480234328161632, NULL, 'CEllh5QK_1g', 20, 110, 821, 0, 0, 0, 0, 0, '3.21', 'Uuuund - Wir sind live!😇\nWEtell ist offiziell am Markt! Unsere Pauken und Trompeten schallen durch die Täler und über die Berge Deutschlands. WOOOOW! Wir haben viel getüftelt, geprobt und verhandelt, um heute in die Welt zu rufen: Mobilfunk geht auch nachhaltig! Mit WEtell. 🌵\n\nSeit unserem Softstart haben schon knapp 1000 Menschen einen grünen Vertrag abgeschlossen. Danke an jede*n Einzelne*n für die Unterstützung! Euer Vertrauen! Und euren Wunsch etwas Gutes für die Welt zu tun! 💯 \n\nFür uns war das erst der Anfang, wir haben noch viel mehr vor! Und ihr wisst: Um unsere Ziele zu erreichen brauchen wir jede*n von euch! 🙏🏼\nErzählt all euren Freund*innen und Bekannten vom neuen, grünen Stern am Mobilfunkhimmel, damit wir genauso schnell weiterwachsen wie bisher! 🤞\n\nDu. Wir. WEtell. 💪🏽\n.\n.\n.\n#wetell #myphonemyrules #bethechange #wetellchange #grünfunken #Datenschutz #Nachhaltigkeit #Fairness #Transparenz #startup #Mobilfunk #endlichgrünfunken #bethechange #wetellthechange #gwö #sustainability #greenstagram #climatejusticenow #Nachhaltigkeit #ourplanetourhome #umweltschutz #gogreen #fair', 1598949256, '{\"city_name\":\"Kreativpark Lokhalle\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/118600407_397516481229641_7962168815656215338_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/118542271_2729177224004855_2886410765935402728_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQ4MC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=SWE95zzx2KgAX-UptWF&edm=AOQ1c0wBAAAA&vs=17858049068113010_1915048510&_nc_vs=HBksFQAYJEdMLVBFQWYzUlBjV0xMSUpBT2hlY1h0TWx3NG9ia1lMQUFBRhUAAsgBABUAGCRHQnZ6RHdmS0syT0NXSklBQUtKckZpTWM2QTVLYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbki%2FG9ofO4PxUCKAJDMywXQESRBiTdLxsYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=efeff11766&cc