(388, 21, 2353924669635030788, NULL, 'CCq0gPxn-8E', 7, 90, 530, 0, 0, 0, 0, 0, '2.39', 'Die letzten Wochen waren für uns unglaublich spannend. Wir haben den für uns bislang wichtigsten Vertrag ausgehandelt, unsere Systeme aufgebaut und sind im Teamgeist nochmal ein „Stückle“ zusammengewachsen. Wir sind überglücklich, dass wir mit dem heutigen Tag eines unserer großen Ziele erreicht haben, nämlich allen eine echt starke, grüne Alternative im Mobilfunk anzubieten. Denn jetzt mal Budder bei de Tofuwürstle: Mobilfunk funktioniert sehr wohl nachhaltig! \nEin riesiges Chin-chin geht aber natürlich auch an euch! 🥂 Wenn es mal holprig wurde, dann habt ihr uns so richtig angefeuert! 🎉Ohne euch würde es WEtell nicht geben! \nIhr. Wir.  WEtell💚🌵\n\nAb HEUTE kannst du zu WEtell wechseln und endlich grünfunken! Bist du dabei?\n\nDen Link zu unseren Tarifen findest du in unserer Bio 😊🎉\n⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀\n#wetell  #grünfunken #wetellchange #Datenschutz #Klimaschutz #Fairness #Transparenz #startup #Mobilfunk #workinprogress #workworkwork #endlichgrünfunken #bethechange #wetellthechange #gwö #sustainability #greenstagram #climatejusticenow #Nachhaltigkeit #ourplanetourhome #myphonemyrules #umweltschutz #gogreen #fair #bethechange #Minimalismus', 1594829716, '{\"city_name\":\"Kreativpark Lokhalle\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/109530513_171981574335131_5329360717967999810_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/108977016_295007901739545_7392947356585377287_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=GGAo1JJkVEYAX-33zxb&edm=AOQ1c0wBAAAA&vs=18101427073167659_2193275033&_nc_vs=HBkcFQAYJEdIamJmZ1laYWpEaFRnd0JBQWNfYjRoekJwbG1ia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJta2r43dyadAFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB16gcA&_nc_rid=efeffda225&ccb=7-5&oh=00_AfD6L2ZS39ObSe