(401, 23, 2932251600941687655, NULL, 'Cixc0uaMyNn', 17, 608, 0, 0, 0, 0, 0, 0, '2.17', '#KeineGewaltGegenKinder\nAm heutigen Weltkindertag startet der Deutsche Kinderverein zu seinem 10jährigen Bestehen eine landesweite Kampagne gegen Gewalt an Kindern. Als Botschafter des Vereins zeige ich gerne Flagge mit dem mahnenden Symbol dieser schwarzen Fläche.\nSetz auch du mit dem Tragen dieses T-Shirts ein solidarisches Erkennungszeichen für dein persönliches Nein zu Gewalt an Kindern. Und teile es in deinen sozialen Medien! Wir brauchen die Kraft der Vielen. https://www.keinegewaltgegenkinder.de/maxmutzke\nDer Verkaufserlös des T-Shirts fließt zu 100% in das Projekt Auberge des Deutschen Kindervereins.\n#keinegewaltgegenkinder #misshandlung #sexuellegewalt #missbrauch #vernachlässigung #kinderschutz #kindeswohl #kinderrechte #indubioproinfante #jugendamt #kindeswohlgefährdung #kindzentriert #armedangels #bewegung #t-shirt #gesichtzeigen #kampagne #vowtothenew #gegenjedegewalt #deutscherkinderverein', 1663771651, NULL, 'IMAGE', 'images/content/posts/308445722_412682790972807_3311707956058632135_n.jpg', NULL, NULL, 'https://instagram.com/p/Cixc0uaMyNn', 0, 0, '[\"#keinegewaltgegenkinder\\nam\",\"#misshandlung\",\"#sexuellegewalt\",\"#missbrauch\",\"#vernachl\\u00e4ssigung\",\"#kinderschutz\",\"#kindeswohl\",\"#kinderrechte\",\"#indubioproinfante\",\"#jugendamt\",\"#kindeswohlgef\\u00e4hrdung\",\"#kindzentriert\",\"#armedangels\",\"#bewegung\",\"#t-shirt\",\"#gesichtzeigen\",\"#kampagne\",\"#vowtothenew\",\"#gegenjedegewalt\",\"#deutscherkinderverein\"]', 'post', 'profile_scrape', 0, 1681214247, 1681214247),
(402, 23, 2931635633531328473, NULL, 'CivQxODgxfZ', 7, 430, 6225, 0, 0, 0, 0, 0, '1.52', 'Werbung. Ich habe das Glück meine Leidenschaft zum Beruf zu machen und so meinen Traum leben zu dürfen. Mit @alwa.mineralwasser hast auch du die Möglichkeit, deine Leidenschaft zu fördern und dich zu verwirklichen. Und so einfach gehts: Teile dein Talent/Leidenschaft in Form eines Reels mit dem Hashtag #wasschlummertindir und verlinke den Account @alwa.mineralwasser in deiner Caption und folge dem Account @alwa.mineralwasser. Weitere Infos findest du hier:  https://www.alwa-mineralwasser.de/wasschlummertindir/ Zeit, deine Träume zu erfüllen! 🎼🎤🎬\n#wasschlummertindir @alwa.mineralwasser', 1663698396, NULL, 'VIDEO', 'images/content/posts/307631233_187238043767983_412734575835405862_n.jpg', NULL, NULL, 'https://instagram.com/p/CivQxODgxfZ', 0, 0, '[\"#wasschlummertindir\"]', 'post', 'profile_scrape', 0, 1681214247, 1681214247),
