(419, 24, 2658242810174187499, NULL, 'CTj-cB7Kyfr', 0, 15, 0, 0, 0, 0, 0, 0, '2.84', 'The God who gave me this life\nIs the real devil\nCause my face sinks\nAt the end of the night\nI blink and then I remember the fight\nGoodnight my dreams\nSleep tight\nI\'ll need you tomorrow\nIn my mind\nWherever you are\nI\'ll be there for you\nWhatever you say\nWhatever you do\nYou hold a special place\nIn my heart\nTomorrow or today\nStay the fuck away\nYou looked at a screen overnight\nAnd thought\nIt was love at first sight\nBut in the end\nYou saw\nNothing was less right\nI\'m not alone in this world\nI know there are\nOther people by my side\nOh and I see them\nI see them everyday when I look outside\nRose petals on the bathroom floor\nDying while I\'m waiting for you\nIt\'s a memory I don\'t want to forget about you\nAbout you\nAbout you\nI don\'t want to forget\nOh oh\nOh I\'m all alone\nOh oh\nOh yeah you\'re all alone🖖🏼\n\nStay the fuck away song by Henrik', 1631107258, NULL, 'IMAGE', 'images/content/posts/241161847_2942796492653897_2863933054963806950_n.jpg', NULL, NULL, 'https://instagram.com/p/CTj-cB7Kyfr', 0, 1, NULL, 'post', 'profile_scrape', 0, 1682070972, 1682070972),
