(442, 25, 3061160476113303407, NULL, 'Cp7bTv7Mvdv', 11, 113, 0, 0, 0, 0, 0, 0, '4.7', 'Hinter mir liegen Erinnerungen an eine schöne Zeit, an Momente der Freiheit und an Tage mit einem Lächeln auf dem Gesicht. Hinter mir liegt die Vergangenheit. Aber vor mir liegt eine noch viel schönere Zukunft. Noch viel mehr Tage mit Sonnenschein und lächelnden Momenten, mit unvergesslichen Tagen des Glücks, mit Marmeladenglasmomenten & ich bin mir sicher, dass die Zukunft noch viel mehr Freiheit für mich bereit hält./ 💐\n\n#freiheit #freiheitsgefühl #sealavie #lieblingsplatz #girl #luckygirl #happygirl #happyelli #potd #karokauer #carmushka #carmushkis #marykay #marykaydeutschland #blogger #bloggerlife #bloggerstyle', 1679138787, '{\"city_name\":\"breitunger See\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/336165709_612147263668084_5398815151121557177_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp7bTv7Mvdv', 0, 0, '[\"#freiheitsgef\\u00fchl\",\"#sealavie\",\"#lieblingsplatz\",\"#girl\",\"#luckygirl\",\"#happygirl\",\"#happyelli\",\"#potd\",\"#karokauer\",\"#carmushka\",\"#carmushkis\",\"#marykay\",\"#marykaydeutschland\",\"#blogger\",\"#bloggerlife\",\"#bloggerstyle\"]', 'post', 'profile_scrape', 0, 1682411622, 1682411622),
