(446, 25, 3049787705936405302, NULL, 'CpTBcKUsWM2', 4, 98, 0, 0, 0, 0, 0, 0, '3.86', 'Ich kenn\' Dich zur Hälfte, nein, ich kenn\' Dich dreiviertel und eigentlich kenn\' ich Dich überhaupt nicht.\nIch schreibe große Zeilen in klitzekleine Lieder und sing\' sie dann heimlich für Dich. \nDu lachst und Du weinst und Du bist, so wie Du bist - ein rudimentäres Unikat.\nVielleicht hab\' ich einmal Glück und es ist so wie es ist, es gewinnt der, der alte Träume wahrt.\nUnd Du drehst Dich in Deiner kleinen Welt.\nMit Deinen großen Farben, wie sie Dir gefällt. \nOb trist, ob manchmal grau, ob blau und wunderschön, oh, ich würd mich so gerne in Deinen Welten dreh\'n./ 🤍\n\n#foto #fotoshooting #überdenwolken #girl #luckygirl #happygirl #happyelli #potd #karokauer #carmushka #carmushkis #marykay #marykaydeutschland #blogger #bloggerlife #bloggerstyle', 1677783047, '{\"city_name\":\"Breitungen\",\"region_name\":\" Thuringen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/334199708_568036915278461_5712604741435222634_n.jpg', NULL, NULL, 'https://instagram.com/p/CpTBcKUsWM2', 0, 0, '[\"#fotoshooting\",\"#\\u00fcberdenwolken\",\"#girl\",\"#luckygirl\",\"#happygirl\",\"#happyelli\",\"#potd\",\"#karokauer\",\"#carmushka\",\"#carmushkis\",\"#marykay\",\"#marykaydeutschland\",\"#blogger\",\"#bloggerlife\",\"#bloggerstyle\"]', 'post', 'profile_scrape', 0, 1682411622, 1682411622),
