(473, 27, 3039724566982372108, NULL, 'CovRWN2AysM', 3, 83, 461, 0, 0, 0, 0, 0, '1.81', 'There are times when you need the silence of animals to recover from humans! 🤍🐮\n\n#cowsofinstagram #cowlove #beauties #cuteanimals', 1676584011, '{\"city_name\":\"M\\u00e9rida\",\"country_name\":\"spain\",\"country_code\":\"ES\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/331475129_556643796493641_628190483370011501_n.jpg', NULL, NULL, 'https://instagram.com/p/CovRWN2AysM', 0, 0, '[\"#cowlove\",\"#beauties\",\"#cuteanimals\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(474, 27, 3033938094609083173, NULL, 'Coatp9fsysl', 2, 94, 0, 0, 0, 0, 0, 0, '2.02', 'Ich glaube, mittlerweile habe ich verstanden, warum das Surfen so etwas einzigartiges für mich ist. Etwas das mich von Anfang an gefesselt hat & mir gleichzeitig so einen Respekt vor der Natur verschafft. Beim Surfen ist kein Platz für andere Gedanken. Du fokussierst dich nur auf dich, deinen Körper & die Welle. Der Kopf ist frei. Die Wellen kommen so & so, die Natur ist unglaublich gewaltig & wer sich nicht anpasst wird mitgenommen und einmal komplett durchgespült. Du kannst die Wellen nicht stoppen - aber du kannst lernen sie zu surfen. Und dann fühlst du dich einfach unglaublich frei. 🏄🏽‍♀️', 1675893626, '{\"city_name\":\"Taghazout\",\"country_name\":\"morocco\",\"country_code\":\"MA\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/329427354_918159995857095_878248922968444831_n.jpg', NULL, NULL, 'https://instagram.com/p/Coatp9fsysl', 0, 0, NULL, 'post', 'profile_scrape', 0, 1682678709, 1682678709),
