(478, 27, 2285869745714249859, NULL, 'B-5Cmw0HECD', 45, 261, 988, 0, 0, 0, 0, 0, '6.43', 'This is how I spent my Easter Sunday!🦝\nAnd it couldn\'t have been any better.\nI still can\'t get over how lucky I am to be able to work with animals and make a living from something I love so much! If you don\'t like what you do - try your best to change it. And that will change everything I promise ❤️ #gutaiderbichl #waschbär #henndorfamwallersee #henndorf #salzburgerland #passion #animallove #animalsanctuary #rescues #ilovemyjob #believeinyourself #happyeaster #happyme #easterbrunch #happyanimals #tieresinddiebesserenmenschen #gutaiderbichlhenndorf', 1586716948, '{\"city_name\":\"GUT AIDERBICHL\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/93450058_181031959540404_3939311336248864680_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/92791923_146730796851837_4928217740315153199_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=cqt1VY1vKTgAX-PpMz2&edm=AOQ1c0wBAAAA&vs=17883764782558897_3955206412&_nc_vs=HBksFQAYJEdIUGtod1Y5SWdadGM0VUFBQzlUUTR2c2kyUkVia1lMQUFBRhUAAsgBABUAGCRHQ3hKZ1FVd09TLXY3b2dBQUdVN2I4UnhPZlZIYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbit9nOjczEPxUCKAJDMywXQDYIcrAgxJwYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=a2c6c304d0&ccb=7-5&oh=00_AfBDLFJX2Ah4mFTfOpxw9gAn0zSXFwsa5sTvInyg-N9iog&oe=644D97F3&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/B-5Cmw0HECD', 0, 0, '[\"#gutaiderbichl\",\"#waschb\\u00e4r\",\"#henndorfamwallersee\",\"#henndorf\",\"#salzburgerland\",\"#passion\",\"#animallove\",\"#animalsanctuary\",\"#rescues\",\"#ilovemyjob\",\"#believeinyourself\",\"#happyeaster\",\"#happyme\",\"#easterbrunch\",\"#happyanimals\",\"#tieresinddiebesserenmenschen\",\"#gutaiderbichlhenndorf\"]', 'post', 'profile_scrape', 0, 1682678709, 1682678709),
(479, 27, 2241025682914004955, NULL, 'B8ZuPwync_b', 9, 119, 843, 0, 0, 0, 0, 0, '2.69', 'You are not your age, nor the size of clothes you wear.\nYou are not your weight, or the colour of your hair. \nYou are not your name, or the dimples in your cheeks. \nYou are all the books you read, and all the words you speak.\nYou are the croaky morning voice,\nand the smiles you try to hide.\nYou\'re the sweetness in your laughter, and every tear you\'ve cried.\nYou\'re the songs you sing so loudly, when you know you\'re all alone.\nYou\'re the places that you\'ve been to, and the one that you call home. \nYou\'re the things that you believe in, and the people that you love. \nYou\'re the photos in your bedroom, and the future you dream of. \nYou\'re made of so much beauty, but it seems that you forgot. \nWhen you decided that you were defined, by all the things you\'re not.\n\n#tanzania #memories #tbt #africantravel #serengeti #wilderness #happiness #quotes #beyourself #lifegoals #bekind #girlandthebackpack #backpacking #africa #weallsmileinthesamelanguage', 1581371119, '{\"city_name\":\"Serengeti National Park Tanzania\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/84725246_477716439804234_4226493214578754149_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/85751990_141440270284182_5254023778449893449_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjY0MC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=106&_nc_ohc=zxYMy6PaxjcAX_NPz34&edm=AOQ1c0wBAAAA&vs=17931122260356310_2513947947&_nc_vs=HBksFQAYJEdMWjRIQVdXTlJHaG80QUFBRWtvOWh2S0N1cElia1lMQUFBRhUAAsgBABUAGCRHRWx4SGdWMEtYWGlEckFBQU96Wl9OcElrQlZ0YmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACasl%2BmS15DaPxUCKAJDMywXQDjMzMzMzM0YEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=a2c6ce1b58&ccb=7-5&oh=00_AfCKxo_W5mVhR1LMBxGfOudZXNZJEtUlGowxEqZXgeEK5Q&oe=644D058C&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/B8ZuPwync