(484, 28, 3016130355497470918, NULL, 'CnbcpQDswvG', 58, 843, 0, 0, 0, 0, 0, 0, '8.36', 'ᴠᴏƦsᴛᴇʟʟᴜɴɢsƦᴜɴᴅᴇ⁠\nIch bin Miriam und gerade 37 Jahre alt geworden.⁠\nIch bin seit 16 Jahren mit einem wunderbaren Mann verheiratet und wir sind Eltern von 4 Kindern, wobei der älteste mit 18 dieses Jahr schon sein Studium begonnen hat und dafür im Süden Deutschlands ist. \nund die anderen mit 16 und 14 auch nicht mehr so klein sind. Unser jüngster ist allerdings erst 6 seit diesem Jahr ein Schulkind…⁠ 🥰\n⁠\n❤️Wie ich zu Instagram kam (Achtung Realität)⁠\nBis vor ein paar Jahren war ich die Alleinverdienerin in unserer Familie und mein Mann der Hausmann.\nIch habe große Konzerne zum Datenschutz und It Sicherheit beraten.\n\nBis ich einen Schnupfen hatte …\nIhr kennt das. Klar geht man mit einem Schnupfen nicht gleich zum Arzt und erstmal ging ich auch weiter arbeiten.\nAls es nach einer Woche immer schlechter wurde, ging ich doch zum Arzt.\n5 min rein , Medikament - wird bald wieder 👍\n\nWurde aber nicht besser\nAls die Woche darauf meine Motorik immer schlechter wurde , wieder zum Arzt und ab ins Krankenhaus 🏥 \nMittlerweile konnte ich nicht mehr alleine laufen.\n\nWer jetzt auf ein Happy End hofft \nGibt keines.\nIch lag damals 3 Wochen am Stück in der Neurologie und auch zahlreiche Krankenhausaufenthalte und Ärzte später, höre ich nur wie interessant mein Fall ist.\nAuch dem Zentrum für „seltene Erkrankungen“ war er zu selten. 🤔\n\nDann fing auch noch Corona an und da ich zu der Zeit fast nur liegen konnte fing ich an YouTube und Instagram zu schauen (Netflix hatte ich gefühlt schon durch 😅) und ja irgendwie bin ich dann selbst hier gelandet und auch wirklich froh darüber.\n\nIch habe mich mittlerweile arrangiert und auch das laufen geht wieder relativ gut und ich brauche keinen Rollstuhl mehr.\n\nIch habe hier viele tolle Leute kennen gelernt und gerade an Tagen an denen gar nichts geht, freue ich mich immer quasi virtuell an euren tollen Ideen und Geschichten teil zu haben 🥰\n\nSoziale Medien können also tatsächlich auch wirklich sozial sein. Mir hilft Instagram total, weil ich hier nur mache was mir gut tut und ich schön finde.\n\nUmso mehr freut es mich, wenn es auch anderen gefällt 🥰\n\nDanke das ihr da seid ♥️\n\n#mamablogger_de #fürmehrrealitätaufinstagram #vorstellung \n\n⁠', 1673770778, NULL, 'IMAGE', 'images/content/posts/320925456_209536804967139_4853728678249907891_n.jpg', NULL, NULL, 'https://instagram.com/p/CnbcpQDswvG', 0, 1, '[\"#f\\u00fcrmehrrealit\\u00e4taufinstagram\",\"#vorstellung\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(485, 28, 3090192576246324173, NULL, 'CrikcaKthvN', 6, 236, 0, 0, 0, 0, 0, 0, '2.25', '𝘸𝘦𝘳𝘣𝘶𝘯𝘨\nNa kennt ihr noch LÜK ? 🥰\n\nBei uns das tolle miniLÜK-Set @luek.lernspiel für Mathematik und Deutsch im Einsatz…\n\nDas Set enthält Übungen zum sinnerfassenden Lesen von Silben, Wörtern und Sätzen sowie zum Verstehen mathematischer Inhalte der 1. Klasse nach den neuesten didaktisch-methodischen Erkenntnissen. Das Beste daran ist, dass das Lernen an der LÜK-Station besonders motivierend ist, da es spielerisch, eigenverantwortlich und mit Selbstkontrolle erfolgen kann. #montessori\n\nDas miniLÜK-Set ist nicht nur motivierend und fachlich fundiert, sondern auch flexibel einsetzbar. Es ist perfekt geeignet für die Schule, für zu Hause oder unterwegs. Und das Beste daran ist, dass es immer auf dem neuesten Stand der Lernforschung ist und über 200 Themenhefte vom Kindergarten bis zur 4. Klasse erhältlich sind.\n\nEtwas das ich schon selber als Kind genutzt habe und auch bei meinen 4 super gerne nutze 🥰\n\n#miniLÜK #Lernspielzeug #Mathematik #Deutsch #Lernen #Motivation #Kinder #Selbstständigkeit #mamablogger #lernenmitkindern #abendpostig', 1682599683, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343282664_620635209604404_2485241426655507619_n.jpg', NULL, NULL, 'https://instagram.com/p/CrikcaKthvN', 0, 0, '[\"#montessori\\n\\ndas\",\"#lernspielzeug\",\"#mathematik\",\"#deutsch\",\"#lernen\",\"#motivation\",\"#kinder\",\"#selbstst\\u00e4ndigkeit\",\"#mamablogger\",\"#lernenmitkindern\",\"#abendpostig\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(486, 28, 3089402436666146631, NULL, 'CrfwyXVtj9H', 5, 315, 0, 0, 0, 0, 0, 0, '2.97', 'Am 8 Mai gehts los 🌿🌿🌿🌿\n\nIch freue mich, euch meine kommenden Themenwochen zum Thema \'Kindergarten, Vorschule, Einschulung und Schule\' ankündigen zu können! \nUnd am 8 Mai starten wir mit \n🎨Kindergarten und Vorschule🎨\n\nAls Mama von vier Kindern weiß ich, wie wichtig es ist, unsere Kleinen und Großen auch beim lernen zu begleiten, deswegen teile ich in den nächsten Wochen meine Erfahrungen und Tipps mit euch, um euch bei dieser wichtigen Aufgabe zu unterstützen. \n\nAußerdem habe ich einige tolle Überraschungen geplant, darunter zwei Gewinnspiel mit nützlichen und sinnvollen Dingen rund um das Thema „Kindergarten“ und natürlich mit kreative Ideen, um das Lesen und Lernen für eure Kinder noch spannender zu gestalten.\n\nIn welchem Alter sind eure Kinder eigentlich gerade ?\nIch habe ja vom Schulkind bis zu „gerade Erwachsen“ alles dabei 🥰 \n\n#Kindergarten #Vorschule #Schule #Bildung #Lernen\n#Erziehung #Eltern #Kinder #ZukunftdurchBildung\n#bIoggertimes #spielzeugfürkinder #mamaalltag #mamablogger_de #baldkindergartenkind #vorschule', 1682505491, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343409267_1156576921704270_6602894525027971101_n.jpg', NULL, NULL, 'https://instagram.com/p/CrfwyXVtj9H', 0, 0, '[\"#kindergarten\",\"#vorschule\",\"#schule\",\"#bildung\",\"#lernen\\n#erziehung\",\"#eltern\",\"#kinder\",\"#zukunftdurchbildung\\n#bioggertimes\",\"#spielzeugf\\u00fcrkinder\",\"#mamaalltag\",\"#mamablogger_de\",\"#baldkindergartenkind\",\"#vorschule\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(487, 28, 3088707023487338814, NULL, 'CrdSqxWN4k-', 10, 340, 0, 0, 0, 0, 0, 0, '3.25', '❤️❤️❤️ „Manchmal sind es die kleinsten Dinge, welche den meisten Platz in deinem Herzen einnehmen.” ❤️❤️❤️\n#winniethepooh \n\n#mamablogger #lebenmitkindern #mamaleben #endlesslove #mamaliebe #mutterliebe #lebenmitkindern #hitstyleevetues #family \n\n🫶 Das Bild ist aus dem letzten Jahr', 1682422591, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/342740207_1308792189727658_1508201574641230091_n.jpg', NULL, NULL, 'https://instagram.com/p/CrdSqxWN4k-', 0, 0, '[\"#mamablogger\",\"#lebenmitkindern\",\"#mamaleben\",\"#endlesslove\",\"#mamaliebe\",\"#mutterliebe\",\"#lebenmitkindern\",\"#hitstyleevetues\",\"#family\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(488, 28, 3087151000271981608, NULL, 'CrXw3pzNAwo', 6, 445, 0, 0, 0, 0, 0, 0, '4.18', '𝘸𝘦𝘳𝘣𝘶𝘯𝘨\nSonnenkollektoren als Rampe ? \nOder als Hebebühne ? \n\n🌿Kein Problem für die „Holzklötze Stadt Aiden“ von @kidsconcept.germany 🌿\n\nWenn das nicht perfekt zum Earthday passt, denn\ndiese moderne Spielstadt ist inspiriert von grünen Stadtprojekten in der ganzen Welt. Die elektrische Energie wird sowohl durch Sonnenkollektoren als auch durch Windräder erzeugt. Grüne Felder und Bäume wachsen zwischen würfelförmigen Häuser. \n\nDas Set enthält fünf große Häuser, fünf kleine Häuser, drei Birken, fünf Kiefern und ein Windrad. Einen grünen Busch, ein Solardach und verschiedene Wege und Straßen.\n\n🌿Spielideen🌿\n\n🎨\nKreativität: Lass deine Kinder ihre eigene Stadt erschaffen und ihrer Fantasie freien Lauf lassen.\n👷‍♀️👨‍🌾\nRollenspiele: Spiele mit deinen Kindern Rollenspiele in der Stadt Aiden und fördere so ihre sozialen Fähigkeiten.\n🌿\nUmweltbewusstsein: Nutze die Stadt Aiden als Möglichkeit, um mit deinen Kindern über erneuerbare Energiequellen und Umweltbewusstsein zu sprechen.\n🧮\nMathematik: Verwende die Holzklötze Stadt Aiden, um mit deinen Kindern mathematische Konzepte wie Größe, Form und Farbe zu lernen.\n🤝\nGemeinschaft: Nutze die Stadt Aiden als Möglichkeit, um mit deinen Kindern über Gemeinschaft und Zusammenarbeit zu sprechen.\n\nDas Beste daran ist, dass die Stadt von @kidsconcept.germany aus nachhaltigen Materialien hergestellt werden und somit umweltfreundlich sind.\n\n🌎Fazit\nDie tollen Bausteine spielen und fördere die Kreativität, das Umweltbewusstsein und es macht super viel Spaß \neine eigene kleine Welt entstehen zu lassen.\n\n#Holzklötze #StadtAiden #Nachhaltigkeit #Kreativität #Umweltbewusstsein #Kinder #Spielen #Rollenspiele #Gemeinschaft #nachhaltigkeit #kinderzimmer #kinderzimmerideen #holzspielzeug #bIoggersunny #spielenmitkindern #mamaleben #mamablogger_de #Familienalltag #spielideenfürkinder', 1682237099, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/342379151_3501173833538312_3948313098277349635_n.jpg', NULL, NULL, 'https://instagram.com/p/CrXw3pzNAwo', 0, 0, '[\"#stadtaiden\",\"#nachhaltigkeit\",\"#kreativit\\u00e4t\",\"#umweltbewusstsein\",\"#kinder\",\"#spielen\",\"#rollenspiele\",\"#gemeinschaft\",\"#nachhaltigkeit\",\"#kinderzimmer\",\"#kinderzimmerideen\",\"#holzspielzeug\",\"#bioggersunny\",\"#spielenmitkindern\",\"#mamaleben\",\"#mamablogger_de\",\"#familienalltag\",\"#spielideenf\\u00fcrkinder\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843);
INSERT INTO `lookup_media` (`id`, `lookup_id`, `mid`, `username`, `shortcode`, `comments_count`, `like_count`, `view_count`, `play_count`, `reach_count`, `saves_count`, `shares_count`, `total_interactions`, `engagement_rate`, `caption`, `timestamp`, `location`, `media_type`, `display_url`, `video_url`, `carousel`, `permalink`, `has_audio`, `pinned`, `hashtags`, `type`, `origin`, `campaign_id`, `updated_at`, `created_at`) VALUES
(489, 28, 3084393860830639967, NULL, 'CrN99_mNLdf', 8, 521, 0, 0, 0, 0, 0, 0, '4.91', 'Als Mutter von vier Kindern bin ich immer auf der Suche nach neuen Büchern, um das Lernen zu Hause noch interaktiver und lustiger zu gestalten. Und \"So klingt das ABC\" von Kleine Gestalten @littlegestalten ist definitiv ein Buch, das ich jedem Elternteil empfehlen würde! \nIch habe es zuerst bei @dreibuchhoch.de gesehen und wusste sofort das es genau das ist was ich für Noah gesucht habe 😅\n\n📖Inhalt\nIn diesem farbenfrohen Alphabetbuch lernen Kinder nicht nur, wie Buchstaben aussehen, sondern auch, wie sie klingen! Die amüsanten kleinen Bildergeschichten zeigen z.B., wie der Buchstabe A wie ein langgezogenes AAAAH klingt, als würde man einen Freund begrüßen, den man lange nicht gesehen hat. Der Buchstabe R macht Rrrrrr wie ein schlecht gelaunter Tiger . Und der Buchstabe M macht Mmmmmm, wie wenn ihr etwas leckeres esst.\n\n🍿Spielideen🍿\nAußerdem habe ich noch drei Ideen, wie du das Buch verwenden kannst, um das Lernen noch lustiger und interaktiver zu gestalten:\n\n🍿🌿Lautmalerei-Spiele: Lies die Tonbeschreibungen jedes Buchstabens vor und fordere dein Kind auf, Geräusche zu machen, die dazu passen. Zum Beispiel können sie den Buchstaben B machen und dabei Blubbergeräusche wie in der Badewanne machen.\n\n🌿🍿Buchstabenjagd: Blättere durch das Buch und suche gemeinsam nach Gegenständen, die mit jedem Buchstaben beginnen. Zum Beispiel könnt ihr gemeinsam nach einem Apfel suchen, der mit dem Buchstaben A beginnt.\n\n🍿🌿Wörter bilden: Verwende die Buchstaben aus dem Buch, um Wörter zu bilden und sie dann laut auszusprechen. Du kannst auch versuchen, einfache Sätze zu bilden, um das Leseverständnis zu fördern.\n\n🔎Fazit: \nIch kann \"So klingt das ABC\" nur wärmstens empfehlen! Es ist ein einzigartiges und unterhaltsames Buch, das nicht nur das Alphabet, sondern auch die Sprachentwicklung und Kreativität deines Kindes fördert. \n\n#SoKlingtdasABC #LernenDurchSpielen #Sprachentwicklung #Kreativität #Kinderbücher.\n@kirchnerkommunikation #lesenmachtglücklich #lesenmitkindern #deutschlernen #lesenlernen #vorschule #mamablogger_de #middleeves', 1681908422, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/342364079_1664080080707441_2993186706917350619_n.jpg', NULL, NULL, 'https://instagram.com/p/CrN99_mNLdf', 0, 0, '[\"#soklingtdasabc\",\"#lernendurchspielen\",\"#sprachentwicklung\",\"#kreativit\\u00e4t\",\"#kinderb\\u00fccher.\\n@kirchnerkommunikation\",\"#lesenmachtgl\\u00fccklich\",\"#lesenmitkindern\",\"#deutschlernen\",\"#lesenlernen\",\"#vorschule\",\"#mamablogger_de\",\"#middleeves\"]', 'post', 'profile_scrape', 0, 1682678843, 1682678843),
(490, 28, 3083503363450961502, NULL, 'CrKzfjSN35e', 5, 379, 0, 0, 0, 0, 0, 0, '3.56', 'Wir sind immer noch Detektive! \n\nWir haben gerade das Buch \"Die Fuchsbande - Detektive legen los\" von @verlagarsedition @icherzaehldirdiewelt gelesen und ich muss sagen, ich bin total begeistert! \n\nEs ist die perfekte Lektüre für alle kleinen Detektive da draußen, die gerne Rätsel lösen und Geheimnisse aufdecken. \nDer kleine Mann liebt es, Detektiv zu spielen und dieses Buch hat ihm wirklich vieeeeel Input gegeben. \nJetzt braucht er natürlich auch seine eigene Bande 😅\n\nDie Geschichte ist spannend, die Charaktere sind liebenswert und die Illustrationen sind einfach großartig! Ich kann dieses Buch jedem empfehlen, der nach einer unterhaltsamen und „spannenden“Lektüre für seine Kinder sucht.\n\nWelche Themen sind bei euch gerade „angesagt“ ?\n\n#fuchsbande #detektive #arsedition #kinderbuch #bIoggersunny #lesenlernen #kreativität #spaß #familienzeit #bIoggerstyIez #leseliebe #lesenmitkindern #mamablogger_de', 1681802267, NULL, 'IMAGE', 'images/content/posts/341802004_1419983728756505_2372437535255804972_n.jpg', NULL, NULL, 'https://instagram.com/p/CrKzfjSN35e', 0, 0, '[\"#detektive\",\"#arsedition\",\"#kinderbuch\",\"#bioggersunny\",\"#lesenlernen\",\"#kreativit\\u00e4t\",\"#spa\\u00df\",\"#familienzeit\",\"#bioggerstyiez\",\"#leseliebe\",\"#lesenmitkindern\",\"#mamablogger_de\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(491, 28, 3082778556296063437, NULL, 'CrIOsOBN-nN', 10, 489, 0, 0, 0, 0, 0, 0, '4.63', '🌿Einen wunderschönen Start in die Woche 🌿\n\nIch habe mich schon ganz gut von der OP erholt , aber insgesamt soll man sich 4-6 Wochen schonen 🙈\nIn der Zeit darf man zum Beispiel auch nicht Baden gehen 🙁\n\nAnsonsten ist bei uns heute der erste Tag nach den Osterferien und wieder Schule für alle ☺️\n\nUnd wie ist es aktuell bei euch?\n\n#mamaleben #mamablogger_de #einrichtungsideen #esszimmer #esszimmerstühle #wochenstart #montagsmotivation #wohnzimmer #lebenmitkindern', 1681715863, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/341575960_976152640217229_7472239813719021186_n.jpg', NULL, NULL, 'https://instagram.com/p/CrIOsOBN-nN', 0, 0, '[\"#mamablogger_de\",\"#einrichtungsideen\",\"#esszimmer\",\"#esszimmerst\\u00fchle\",\"#wochenstart\",\"#montagsmotivation\",\"#wohnzimmer\",\"#lebenmitkindern\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(492, 28, 3080143257677997672, NULL, 'Cq-3fk7NiZo', 3, 530, 0, 0, 0, 0, 0, 0, '4.95', '𝘞𝘦𝘳𝘣𝘶𝘯𝘨 \nDie neue #TrendBox April von @trendraider ist endlich da und ich bin begeistert! \n\nDiesen Monat dreht sich alles um das Thema \"Bloom and Blossom\" und die Box ist gefüllt mit nachhaltigen Trendprodukten aus den Bereichen Wellness, Food und Lifestyle. Insgesamt sind 12 spannende Marken enthalten\n\nBALI BALM - @bali.balm\nLANATURÉL - @lanatureleu\nSALUS - @salus.de\nBERGLAND - @bergland_naturkosmetik\nFRITT - @fritt_official\nROCKA NUTRITION - @rockanutrition\nZWERGENWIESE - @zwergenwiese_naturkost\nBARNHOUSE - @barnhousenaturprodukte\nECOVER - @ecover_de\nDAILYSOCKS - @dailysocks.de\nUPONMYLIFE - @uponmylife.de\nSEED ME - @seedme.saatgut\nVERBLÜHMEINNICHT - @verbluehmeinnicht\n\nDer Warenwert beträgt über 105 €, aber ihr könnt die Box schon ab 29,95 € ergattern. \n\nMit dem Code FAIRY15 könnt ihr sogar 15% sparen. \n\nHolt sie euch jetzt im Shop, denn die AprilBox ist nur bis zum 30.04.2023 erhältlich. \n\n#trendbox #trendraider #bloomandblossom #lifestyle #nachhaltigkeit #sustainable #unboxing #mysterybox #beauty #beautybloger', 1681401711, NULL, 'IMAGE', 'images/content/posts/341011423_260047316375309_2918465874215998455_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq-3fk7NiZo', 0, 0, '[\"#trendbox\",\"#trendbox\",\"#trendraider\",\"#bloomandblossom\",\"#lifestyle\",\"#nachhaltigkeit\",\"#sustainable\",\"#unboxing\",\"#mysterybox\",\"#beauty\",\"#beautybloger\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(493, 28, 3077253197051749448, NULL, 'Cq0mXqONGRI', 12, 443, 0, 0, 0, 0, 0, 0, '4.22', '🐰🌸🐣 Fröhliche Ostern ihr Lieben! 🐰🌸🐣 \n\nZeit für bunte Eier, Schokohasen und jede Menge Spaß. Aber Vorsicht vor den kleinen und großen Dieben, die euch die Schokolade klauen! 😜 \n\nPs: Das Bild ist aus dem letzten Jahr 😅\n\n#ostern #froheostern #hophophooray #bunteeier #schokohasen #spaß #osterkater #lustig #fröhlich #mamablogger #mamablogger_de #lebenmitkindern #familienleben #familienzeit❤️', 1681057189, NULL, 'IMAGE', 'images/content/posts/340351714_917627522878152_2560282766035120137_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq0mXqONGRI', 0, 0, '[\"#froheostern\",\"#hophophooray\",\"#bunteeier\",\"#schokohasen\",\"#spa\\u00df\",\"#osterkater\",\"#lustig\",\"#fr\\u00f6hlich\",\"#mamablogger\",\"#mamablogger_de\",\"#lebenmitkindern\",\"#familienleben\",\"#familienzeit\\u2764\\ufe0f\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(494, 28, 3074364607493969092, NULL, 'CqqVlJjthTE', 38, 550, 0, 0, 0, 0, 0, 0, '5.46', 'Heute ist ein neues Kapitel in meinem Leben angebrochen. Ich hatte meine Gebärmutter-OP und fühle mich erleichtert, dass ich endlich etwas gegen meine extremen Blutungen und Schmerzen unternehmen konnte. \n\nIch kann es kaum glauben, dass mir das Blut teilweise die Beine hinunterlief und ich dachte, extreme Schmerzen zu haben sei normal. Aber es ist nicht normal, auch wenn zwei Gynäkologen das anderes sahen 🙈,und ich bin froh, dass ich endlich etwas dagegen getan habe (und mein Mann so hartnäckig war ❤️)\n\nDie Ursachen für meine Beschwerden waren Myome, Verwachsungen der Kaiserschnittnabe sowie Endometriose (krankhafte Wucherung der Gebärmutterschleimhaut ausserhalb der Gebärmutterhöhle) und Verwachsungen in meiner Gebärmutter 😬\n\nIch bin dankbar, dass bei der OP der Gebärmutterhals und die Eierstöcke erhalten bleiben konnten und nur der Rest der Gebärmutter entfernt wurde. Dies wurde durch kleine Schnitte in den Bauch durchgeführt, was man LASH nennt. Dafür habe ich halt drei kleine Narben. \n\nIch möchte alle Frauen ermutigen, auf ihre Körper zu hören und sich nicht mit Schmerzen und Beschwerden abzufinden. Es ist wichtig, dass wir auf uns achten und uns um unsere Gesundheit kümmern. Lasst uns gemeinsam stark sein und uns gegenseitig \nunterstützen. 💪🏼❤️ \nMir selbst hätte es sehr geholfen zu sehen, das es anderen auch so geht. Man denkt ja wirklich oft (und hört es auch häufig), das #menstruationsbeschwerden  völlig normal sind und man sich „nicht so anstellen soll“ „sich zusammenreißen muss“ - wir selbst sind da oft unser größter Feind 🤔\n\n#GebärmutterOP #LASH #Myome #endometriose #Frauengesundheit #Gesundheit #Schmerzen #Beschwerden #Körperbewusstsein #mamablogger_de #fürmehrrealitätaufinstagram', 1680712842, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/339828363_554626639985292_8432484010547365907_n.jpg', NULL, NULL, 'https://instagram.com/p/CqqVlJjthTE', 0, 0, '[\"#menstruationsbeschwerden\",\"#lash\",\"#myome\",\"#endometriose\",\"#frauengesundheit\",\"#gesundheit\",\"#schmerzen\",\"#beschwerden\",\"#k\\u00f6rperbewusstsein\",\"#mamablogger_de\",\"#f\\u00fcrmehrrealit\\u00e4taufinstagram\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(495, 28, 3072932337117411159, NULL, 'CqlP630sbdX', 3, 446, 0, 0, 0, 0, 0, 0, '4.17', 'Heute möchte ich euch das wunderschöne Buch \"Heute ist der schönste Tag\" vorstellen 🌧️🌦️☔️\n\nGeschrieben von der talentierten Autorin Britta Sabbag und illustriert von Eefje Kuijl, ist dieses Buch eine zauberhafte Freundschaftsgeschichte über das selbst gemachte Glück und Achtsamkeit im Alltag. \n\n🌧️Die Botschaft des Buches ist so wichtig: Der Tag ist so gut, wie wir ihn uns selbst machen. 🌧️\n\nDie beiden Hauptcharaktere Bär und Biber beschließen, dass heute trotz des Regens der schönste Tag ist und erleben gemeinsam das große Glück der kleinen Dinge. Am Ende wird klar, dass Glücklichsein eine Entscheidung ist. \n\nDie wunderschönen Illustrationen und die liebevolle Geschichte haben mich wirklich berührt und ich denke, dass dieses Buch für Kinder, aber auch für Erwachsene, eine wertvolle Lektion über das Leben und die Bedeutung von Achtsamkeit im Alltag bietet. \n\nWenn ihr also auf der Suche nach einem inspirierenden Kinderbuch seid, dann ist \"Heute ist der schönste Tag\" definitiv eine Empfehlung wert! \n\nDanke an @schneiderbuchverlag für das wunderschöne Rezessionsexemplar ❤️\n\n#HeuteIstDerSchönsteTag #BrittaSabbag #EefjeKuijl #Schneiderbuch #Kinderbuch #Buchempfehlung #Achtsamkeit #Glücklichsein #Freundschaftsgeschichte #Lesevergnügen #lesenmitkindern #achtsamkeitimalltag #achtsamkeitfürkinder #achtsamkeitfürmamas #machdasbestedraus #bIoggerstyIez', 1680542102, NULL, 'IMAGE', 'images/content/posts/339136490_210388994969848_7916437598248724153_n.jpg', NULL, NULL, 'https://instagram.com/p/CqlP630sbdX', 0, 0, '[\"#brittasabbag\",\"#eefjekuijl\",\"#schneiderbuch\",\"#kinderbuch\",\"#buchempfehlung\",\"#achtsamkeit\",\"#gl\\u00fccklichsein\",\"#freundschaftsgeschichte\",\"#lesevergn\\u00fcgen\",\"#lesenmitkindern\",\"#achtsamkeitimalltag\",\"#achtsamkeitf\\u00fcrkinder\",\"#achtsamkeitf\\u00fcrmamas\",\"#machdasbestedraus\",\"#bioggerstyiez\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(496, 28, 2702369984696509452, NULL, 'CWAvy7tg2QM', 8, 63, 680, 0, 0, 0, 0, 0, '0.66', '𝘞𝘦𝘳𝘣𝘶𝘯𝘨 /𝘎𝘦𝘸𝘪𝘯𝘯𝘴𝘱𝘪𝘦𝘭\nEs geht in die nächste, vorerst finale Challenge-Runde von #spielenistvielfältig\n\nAuch dieses Mal gibt es etwas richtig tolles zu gewinnen!\nUnterstützt werden wir großartiger Weise von @malmichbunt \nSchaut unbedingt vorbei, denn hier gibt es zuckersüße Kindertattoos, Ausmaltischdecken (der absolute Hit!) und Prickelsets. \nGenau das könnt ihr übrigens auch gewinnen!\nWas ihr dafür tun müsst? Zeigt uns eure Vielfältigen Weihnachtsideen, denn \"Alle Jahre wieder wirds vielfältig\"\nZeigt eure Geschenkideen, Weihnachtsdeko, Nikolausstiefel, Adventskränzen, Weihnachtsbücher... Wir sammeln all eure Beiträge und Ideen unter dem Hashtag #Spielenistvielfältig Bitte denkt daran @malmichbunt @mrs.ermerson @fairydesigntale und uns auch zu taggen! \n\nBei uns sind die Tischdecken total beliebt. Der kleine Mann ist eher ein Malmuffel, aber darauf malt er total gerne. Allerdings legen wir sie immer auf den Boden ☺️\nUnd Prickeln liebe ich total und ist übrigens auch extrem super für die Feinmotorik.\nUnd man hat danach noch tolle Geschenke für Oma und Opa 🥰\nJa und die Tatoos…. Da muss ich noch viel zu sagen. Hier wird immer die ganze Familie „tätowiert“ 🎄\n \nGuckt euch doch mal unter https://malmichbunt.de/ um!\n \nJetzt warten wir froh und munter auf all euren Weihnachtszauber #hohoho\n \n \n#challenge #weihnachten #christmas #adventszeit #vielfalt #vielfaltimkinderzimmer #bunt #nachhaltig #kreativ #kreativekids #kids #familyofinstagram #instakids #bastelnmitkindern #bastelideen #bastelinspo #bastelnmitkindern #weihnachtsdiy #gewinnspiel \n#mamablogger_de', 1636367737, NULL, 'VIDEO', 'images/content/posts/253936295_176482764685733_8995666788263848434_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/255658232_1308174912944513_5300666897695072578_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJf