(499, 28, 2669185919092823061, NULL, 'CUK2nOTAJQV', 7, 55, 131, 0, 0, 0, 0, 0, '0.58', '#spielenistvielfältig \nUnd wenn etwas vielfältig ist, dann sind es die tollen Mitmachbücher von @vickeybo\nOb Ausrüstung für Superheldinnen und Helden 🦸‍♂️ 🦸 \nTolle Pappbilderbücher für die Allerkleinsten, Anziehpuppen und noch so viel mehr….für jede Altersstufe gibt es wunderschöne Sachen.\nIch werde euch natürlich alles noch ganz in Ruhe und in allen Einzelheiten vorstellen, aber im Video könnt ihr schon das ein oder andere entdecken 🥰 \nWir basteln gerade an einer Welt für die Anziehpuppen, die so unfassbar süß sind und Abends sammeln wir mit dem Traumtier Farben 🌿\nDas tollste ist, das es die Bücher echt  für jedes Alter gibt. \nWirklich von 1 bis ….\nMeine Tochter mit 12 malt gerade genauso fleißig, wie mein Sohn mit 15 und ich auch (36 😅)\n\nWie alt sind denn eure Kinder ?', 1632415716, NULL, 'VIDEO', 'images/content/posts/242529158_391544702414927_3487303581210896305_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/242354337_629128848078789_2178043819394323598_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=Eu_-eZb9KoEAX9YfDQN&edm=AOQ1c0wBAAAA&vs=17914822517000114_220285952&_nc_vs=HBksFQAYJEdLRUljZzdGOTRGNU1Ed0NBSTdVTzJCUTl6a2Via1lMQUFBRhUAAsgBABUAGCRHS0FZZHc0VHZOdnQyYzRKQUh2RnRXbGEzSnRnYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACai17G4%2Bt%2FSPxUCKAJDMywXQECAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMl92MREAdeoHAA%3D%3D&_nc_rid=870f99d272&ccb=7-5&oh=00_AfBu4-cUltQnmecqXkfC3qsr7mPhOtH59iMyiBO4bzxk1Q&oe=644D3B77&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CUK2nOTAJQV', 0, 0, '[\"#spielenistvielf\\u00e4ltig\"]', 'post', 'profile_scrape', 0, 1682678844, 1682678844),
(500, 28, 2617692924739166889, NULL, 'CRT6diOIaKp', 3, 31, 109, 0, 0, 0, 0, 0, '0.32', 'Herzlich Willkommen bei Fairydesigntale\n\nHeute machen wir Knete aus nur 2 Zutaten selber.\nDie Knete ist echt schön und richtig fluffig.\n\nIhr braucht:\n🌿Bodylotion\n🌿Speisestärke\n\nWenn ihr das ganze farbig machen möchtet,\nreichen ganz einfache Farbtuben aus dem Backregal.\n\n🌿Tipp für kleine Kinder\nNehmt einfach Babylotion oder achtet darauf das ihr eine ungiftige kauft, dann ist auch die Knete ungiftig 🥰\n\nIch bin gespannt auf eure Kommentare und freue mich wenn ihr mich durch ein\n❤️, durch speichern und ein Abo unterstützt\n\n#bastelnmitkindern #diy #knete #basteln #beschäftigungfürkinder #mamaleben #lebenmitkindern #mamablogger_de #familienleben #familie #mamablogger #mamasein #mama #momlife #mamablog #schwanger #lebenmitkind #mamaliebe #baby #lebenalsmama #zweifachmama #kleinkind #familienzeit #teamrosa #instamama #family #mädchenmama #babyboy #liebe #mamaglück', 1626273507, NULL, 'VIDEO', 'images/content/posts/217683344_4271329409590169_7955022574652062268_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_1197603300665959_6821944658764218110_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjEyODAuaWd0di5kZWZhdWx0IiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=X-yY_gxVUiUAX9DZIF2&edm=AOQ1c0wBAAAA&vs=17891833580148060_228243312&_nc_vs=HBksFQAYJEdJQ1dtQUJuYWxHLU5rRUVBUDZfQTlfRmFxeGVidlZCQUFBRhUAAsgBABUAGCRHTm51OVF6TVE2ajhsU2tCQUlkS3BhekFYUnRfYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbe3unUkdDQQBUCKAJDMywXQH3QhysCDEoYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=870f95c4bc&ccb=7-5&oh=00_AfBs0rcSWbY97-Fxw1LPmYvg5bq2Nm1lTbLWpP_FhOd0zw&oe=644D8A53&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CRT6diOIaKp', 0, 0, '[\"#diy\",\"#knete\",\"#basteln\",\"#besch\\u00e4ftigungf\\u00fcrkinder\",\"#mamaleben\",\"#lebenmitkindern\",\"#mamablogger_de\",\"#familienleben\",\"#f