(519, 30, 3090395312626845381, NULL, 'CrjSinIp8bF', 3, -1, 378, 0, 0, 0, 0, 0, '0.02', '#gettingready für den WomenRUSH vom 4. bis 7. Mai in den @kitzbueheler.alpen! \n\nGemeinsam mit unserem RUSHdieSERIE Team am Start:\nThaiboxerin und frisch gebackene Mama @christinfiedler. \n\nGemeinsam unter Frauen Rennrad fahren, gemeinsam Ziele erreichen – ohne Leistungsdruck und Stoppuhr.\nEinfach gemeinsam eine gute Zeit haben 🥳 \n\nWir freuen uns auf alle Mädels, \ndie mit uns auf die Reise gehen und vier traumhafte Touren mit uns radeln. \n\nFür kurzentschlossene gibt noch Plätze ⬇️ \nwww.womenrush.at\n\n#cycling #rennrad #roadbike #roadbikegirl #choosecycling #rennradmädchen #rennradfrauen #vonfrauenfürfrauen #cycle #fearlessfemalecyclist #womenridebikes #cycleadventure #cyclistspushharder #cyclinglove \n\n@rh77cycling @stieglbrauerei @redbull @maxinutrition_de @1of1_bikes @wohnzone.com_bauzone.at @alpenbrezl @caffegemelli @krxln @weldtite @fasi.bike', 1682624472, NULL, 'VIDEO', 'images/content/posts/343306722_1212985686274157_7142449474601083638_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjSinIp8bF', 0, 0, '[\"#gettingready\",\"#rennrad\",\"#roadbike\",\"#roadbikegirl\",\"#choosecycling\",\"#rennradm\\u00e4dchen\",\"#rennradfrauen\",\"#vonfrauenf\\u00fcrfrauen\",\"#cycle\",\"#fearlessfemalecyclist\",\"#womenridebikes\",\"#cycleadventure\",\"#cyclistspushharder\",\"#cyclinglove\"]', 'post', 'profile_scrape', 0, 1682679114, 1682679114),
