(581, 33, 2786673508022980652, NULL, 'CasQMqGs5As', 10, 1111, 0, 0, 0, 0, 0, 0, '8.81', 'Für das schönste Lächeln im @zooduisburg ❗️SWIPE ❗️🦓\n\nDas Wetter war gestern einfach perfekt für einen Zoobesuch und es war der Erste für unsere kleine Maus. 💛\n\nSie hat sich so gefreut über all die Tiere, die sie sonst nur aus ihren Büchern kennt \n🦒🐘🦜🦓🐅🦧🦭🦘🦚🐙\n\n#zoobesuch #zooduisburg #sonne #perfekteswetter☀️ #zebra #lachen #lachenmachtglücklich #ersterzoobesuch #zoo #mama #mamaleben #mamablogger_de #mamablogger #mamaalltag #mamaliebe', 1646417390, '{\"city_name\":\"Zoo Duisburg\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/275148301_549522926203637_1873368330535190340_n.jpg', NULL, NULL, 'https://instagram.com/p/CasQMqGs5As', 0, 0, '[\"#zooduisburg\",\"#sonne\",\"#perfekteswetter\\u2600\\ufe0f\",\"#zebra\",\"#lachen\",\"#lachenmachtgl\\u00fccklich\",\"#ersterzoobesuch\",\"#zoo\",\"#mama\",\"#mamaleben\",\"#mamablogger_de\",\"#mamablogger\",\"#mamaalltag\",\"#mamaliebe\"]', 'post', 'profile_scrape', 0, 1683024108, 1683024108),
