(583, 33, 2772903979572550573, NULL, 'CZ7VXpasFut', 39, 869, 0, 0, 0, 0, 0, 0, '7.14', 'Am 𝟏𝟏 Februar 𝟐𝟐 wurde ich 𝟑𝟑 Jahre jung 🎈 \nNa wenn das mal keine Schnapszahlenreihe ist 🥳🥂🧁 \n\nIch habe ein wundervolles Geburtstagswochenenden mit meinen Liebsten hinter mir und bin einfach so dankbar das wir wenigstens im kleinen Kreise ein wenig feiern konnten 💕\n\nAber das allerschönste war, wie meine kleine Maus sich einfach gefreut hat mich lautstark mit ihrem Geburtstagstonie zu wecken und sich gefreut hat die Geschenke mit mir zu öffnen 💗 Da wird der eigene Geburtstag irgendwie zur Nebensache!\n\nWer kennt es??? ☺️\n\n#itsmybirthday #itsmybirthdaybitches👑 #happybirthday #happybirthdaytome #momlife #momlifebelike #112233 #11 #22 #33 #33years #schnapszahl #mamaleben #mamablogger_de #mamablogger', 1644775935, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/273803922_455026949654784_1577721535067050402_n.jpg', NULL, NULL, 'https://instagram.com/p/CZ7VXpasFut', 0, 0, '[\"#itsmybirthdaybitches\\ud83d\\udc51\",\"#happybirthday\",\"#happybirthdaytome\",\"#momlife\",\"#momlifebelike\",\"#112233\",\"#11\",\"#22\",\"#33\",\"#33years\",\"#schnapszahl\",\"#mamaleben\",\"#mamablogger_de\",\"#mamablogger\"]', 'post', 'profile_scrape', 0, 1683024108, 1683024108),
