(585, 33, 2740960249537611172, NULL, 'CYJ2NMhJ8Wk', 13, 1031, 523, 0, 0, 0, 0, 0, '8.21', '✨🎆Ich wünsche euch allen ein guten Rutsch ins Jahr 2022 und puste euch etwas Glück rüber🎆✨\n\nAuch wenn es 2021 sicherlich auch sehr viel Leid und unschöne Dinge gab, möchte ich auf die schönen Dinge zurückblicken.\nSchwere Zeiten machen uns alle stärker, geduldiger, erfinderischer und lassen uns reifen. Am Ende kommt es oft auf die Sichtweise an. \n\nIch bin dankbar \n\n✨ für meine Familie\n✨ für meine Freunde\n✨ das wir gesund sind \n✨ für viele wunderschöne Momente \n\nEinfach dankbar , dass es uns gut geht ✨\n\nDas Jahr 2022 kann kommen, ich freu mich auf die Abenteuer die das Leben für mich bereithält 🎆\n\nWofür seid ihr dankbar? 🥰\n\n#gutenrutsch #gutenrutschinsneuejahr #happynewyear #dankbarkeit #abenteuer #leben #familie #freunde #bye2021 #2022 #mamablogger_de', 1640968245, '{\"city_name\":\"Bottrop\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/270333223_1099930970836723_261663403328608290_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/271016244_467966271427205_246768287076741136_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=AHpZISqBXR8AX8Byiji&edm=AOQ1c0wBAAAA&vs=5782545735095059_1747043919&_nc_vs=HBkcFQAYJEdEUmhKeENGRW1Eam5La0JBQkJ3Q2gxenNtd0RidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJtaojeTMssI%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=a33d36f2c4&ccb=7-5&oh=00_AfBMEZ8DR9NPHhIembJPyzTGdd5aWIpB-eKQtMlwiLTUTg&oe=645250B5&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CYJ2NMhJ8Wk', 0, 0, '[\"#gutenrutschinsneuejahr\",\"#happynewyear\",\"#dankbarkeit\",\"#abenteuer\",\"#leben\",\"#familie\",\"#freunde\",\"#bye2021\",\"#2022\",\"#mamablogger_de\"]', 'post', 'profile_scrape', 0, 1683024108, 1683024108),
