(589, 34, 2955521556826715310, NULL, 'CkEHzJoqnSu', 2, -1, 0, 0, 0, 0, 0, 0, '0.01', 'PLUM BAKED OATS💜 one of my fav brekkies for a cosy day at home. today, it was even accompanied by a wheatgrass shot😏 which is high in chlorophyll, iron, vitamin C, antioxidants, amino acids (and more stuff, but it may get a bit boring if I provided the full list here. check out the website of @kraftgras for more info). \nin summary: great for some extra energy. @kraftgras freezes the shots directly after juicing and does not add anything. hence they are 100% natural. and also organic btw.\nps: with the code „plantyfaby“ you‘ll get 15% off your order from @kraftgras until 30.11. 💚\n#wheatgrass #shot #naturalenergyboost', 1666545646, '[]', 'IMAGE', 'images/content/posts/312367314_126328670038078_5581398487622153721_n.jpg', NULL, NULL, 'https://instagram.com/p/CkEHzJoqnSu', 0, 0, '[\"#shot\",\"#naturalenergyboost\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(590, 34, 2944354365947308034, NULL, 'CjccrIrKOgC', 13, -1, 0, 0, 0, 0, 0, 0, '0.07', 'CREAMY GREEN SMOOTHIEBOWL💚\nfor this bowl, you need to blend together the following:\n-1 handful fresh lettuce\n-1 apple\n-1 frozen banana\n-1/2 cup frozen peas\n-1/3 cup coconut yoghurt\n-1 tbsp protein powder (I used sunflower)\n-a little piece of fresh ginger\n-some grated lemon zest\n💚 enjoyy with your fav toppings. mine are: fresh fig, banana, granola, hempseeds and chocolate sauce.\n#greensmoothiebowl #eatplantsnotfriends #brunchtime', 1665214413, '[]', 'IMAGE', 'images/content/posts/310733932_502602098543927_6897072675741837737_n.jpg', NULL, NULL, 'https://instagram.com/p/CjccrIrKOgC', 0, 0, '[\"#eatplantsnotfriends\",\"#brunchtime\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(591, 34, 2936736157077774059, NULL, 'CjBYfmxqp7r', 0, -1, 0, 0, 0, 0, 0, 0, '-0.01', 'taking some days off at the seaside 🌊\nDie Feldarbeit ist zu Ende & meine Packung Strath Iron ebenso. Es war eine spannende, aber auch intensive Zeit. Wirklich froh, dass mich @bio.strath dabei unterstützte.\nEisenprodukte sind manchmal ja etwas schwer verträglich, bei Strath Iron hatte ich aber keine Probleme. Ist übrigens zu 100% natürlich & vegan, that‘s how I like it 💙\n#natürlichmehrenergie #vegan #eisen #strath #strathiron', 1664306252, '{\"city_name\":\"C\\u00e1diz\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/308801875_763023468122548_1212527368413266013_n.jpg', NULL, NULL, 'https://instagram.com/p/CjBYfmxqp7r', 0, 0, '[\"#vegan\",\"#eisen\",\"#strath\",\"#strathiron\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(592, 34, 2932105788781206779, NULL, 'Ciw7q4QK5z7', 8, -1, 0, 0, 0, 0, 0, 0, '0.04', 'CARROT CAKE OATS🥕 with juicy figs on top🤤🤤 \npretty heavenly, if you ask me. and very easy to make. you only need:\n-1/2 cup oats\n-1 grated carrot\n-1 cup water or plant milk\n-1 mashed banana\n-a few dashes of cinnamon\n-a few raisins\n\n->put all the ingredients (except for the banana) in a pot and bring them to a boil.\n->reduce the heat, add the banana and cook until creamy, constantly stirring.\n->add toppings & enjoy!\n\n#carrotcakeoats #juicy #figs #dessertforbreakfast #eatplantsnotfriends', 1663754269, '{\"city_name\":\"Santa Mar\\u00eda del P\\u00e1ramo\",\"country_name\":\"spain\",\"country_code\":\"ES\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/307788104_808419380306625_3500232845430115179_n.jpg', NULL, NULL, 'https://instagram.com/p/Ciw7q4QK5z7', 0, 0, '[\"#juicy\",\"#figs\",\"#dessertforbreakfast\",\"#eatplantsnotfriends\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(593, 34, 2913235468796218867, NULL, 'Cht5DlQqs3z', 8, -1, 0, 0, 0, 0, 0, 0, '0.04', 'PEACH PORRIDGE🍑\nadding summer fruit while cooking a porridge makes it especially sweet and juicy 🤤 hence a dish I regularly enjoy no matter the temperatures🌞\nhere‘s how to:\n1. bring your oats with ~the double amount of liquid (water or plant milk) to a boil.\n2. reduce the heat, add cut up peach (or any other preferred summer fruit).\n3. constantly stir. add more liquids if needed. at this point I also added a pinch of cinnamon and a mashed banana for taste/ consistency.\n4. when the fruit is soft & the porridge is creamy, serve & enjoy with your fav toppings✌️\n\n#peachporridge #summerbreakfast #juicy #eatplantsnotfriends', 1661504752, '{\"city_name\":\"Santa Mar\\u00eda del P\\u00e1ramo\",\"country_name\":\"spain\",\"country_code\":\"ES\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/301819867_434298218724418_2614421945838350059_n.jpg', NULL, NULL, 'https://instagram.com/p/Cht5DlQqs3z', 0, 0, '[\"#summerbreakfast\",\"#juicy\",\"#eatplantsnotfriends\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(594, 34, 2890684033349067745, NULL, 'CgdxdAVqiPh', 8, -1, 0, 0, 0, 0, 0, 0, '0.04', 'CHOCOLATE SMOOTHIEBOWL🍫\nwith mango muesli & chocolate spread by @naturkostbar on top 😍 a dream combo. I‘ve been a fan of naturkostbar for quite a while, since they care for both ecological & social sustainability. their products are carefully manufactured, as organic and natural as possible. a wide range of deliciousness, definitely worth checking out. (psst: also the pralinés!!) 🍫\n#goodmorning #chocolate #smoothiebowl #creamy #breakfast #veganmuesli #eatplantsnotfriends', 1658816411, '{\"city_name\":\"Bern\",\"country_code\":\"CH\",\"country_name\":\"switzerland\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/295661560_370220478527467_8984802436186818976_n.jpg', NULL, NULL, 'https://instagram.com/p/CgdxdAVqiPh', 0, 0, '[\"#chocolate\",\"#smoothiebowl\",\"#creamy\",\"#breakfast\",\"#veganmuesli\",\"#eatplantsnotfriends\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(595, 34, 2885619100722850974, NULL, 'CgLx0iPquye', 13, -1, 0, 0, 0, 0, 0, 0, '0.07', 'can’t say no to a resfreshing green summer bowl these days💚💦\nmade of:\n-a handful frozen peas\n-a handful fresh lettuce\n-1 apple\n-1 frozen banana\n-a few frozen zucchini slices\n-a little piece of fresh ginger\n-grated zest of 1/2 lemon\n-a few tablespoons of coconut yoghurt\n—>blended together = #yummy\n\n#greensmoothiebowl #breakfasttime #eatplantsnotfriends #summervibes', 1658212624, '{\"city_name\":\"Bern\",\"country_code\":\"CH\",\"country_name\":\"switzerland\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/294464979_1191584974745096_2325391560992221703_n.jpg', NULL, NULL, 'https://instagram.com/p/CgLx0iPquye', 0, 0, '[\"#yummy\\n\\n#greensmoothiebowl\",\"#breakfasttime\",\"#eatplantsnotfriends\",\"#summervibes\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(596, 34, 2885114623838149208, NULL, 'CgJ_HbiKFpY', 2, -1, 0, 0, 0, 0, 0, 0, '0.01', 'my summer essential besides iced coffe & watermelon? ☕️💦 definitely some light and comfy sustainable sneakers. all these criteria are fulfilled by the ones I‘m wearing from @thelovelychickpea 🙏 completely vegan and made of recycled pet bottles and maize waste 🌱 also available in other colors. honestly SO comfortable.\n\nin case you don’t know @thelovelychickpea yet: her swiss online shop with carefully selected sustainable & vegan stuff ranges from shoes, bags, skincare products to sunscreen and other eco living products.\n💦aaaand with the code ‚plantyfaby22’ you can get 15% off your order during the next two weeks.\n#veganshoes #fairfashion #sustainableshoes #vegansneakers #whiteshoes #lightshoes #ecofriendly', 1658152486, '{\"city_name\":\"Bern\",\"country_code\":\"CH\",\"country_name\":\"switzerland\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/293920097_591993179212886_5845247409114889812_n.jpg', NULL, NULL, 'https://instagram.com/p/CgJ_HbiKFpY', 0, 0, '[\"#fairfashion\",\"#sustainableshoes\",\"#vegansneakers\",\"#whiteshoes\",\"#lightshoes\",\"#ecofriendly\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(597, 34, 2853813737614937534, NULL, 'CeayHllqw2-', 6, -1, 0, 0, 0, 0, 0, 0, '0.03', 'CHOCOLATE SMOOTHIEBOWL🍫\nmy current fav! the ingredients of this bowl are:\n-1 frozen banana\n-1 carrot\n-1/2 apple\n-4 tbsp oats\n-4 heaped tbsp coconut/soy yoghurt\n-1 date\n-1 tbsp protein powder\n-1 tbsp chocolate powder\n-1 tsp psyllium husk (optional, for a thicker consistency)\n-a splash of water to blend\n.\nps. don‘t forget to add toppings😛\n.\n#smoothiebowl #smoothiebowls #chocolate #carrot #veganbreakfast #veganbreakfastideas #breakfastbowl #breakfast #eatplantsnotfriends #eatplantsnotanimals', 1654421129, '{\"city_name\":\"Bern\",\"country_code\":\"CH\",\"country_name\":\"switzerland\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/285593148_985495585494357_2931880873972344018_n.jpg', NULL, NULL, 'https://instagram.com/p/CeayHllqw2-', 0, 0, '[\"#smoothiebowls\",\"#chocolate\",\"#carrot\",\"#veganbreakfast\",\"#veganbreakfastideas\",\"#breakfastbowl\",\"#breakfast\",\"#eatplantsnotfriends\",\"#eatplantsnotanimals\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(598, 34, 2831334380308890676, NULL, 'CdK654qqYQ0', 7, -1, 0, 0, 0, 0, 0, 0, '0.04', 'hiiii, let me introduce you to @bio.strath 😏💙☁️😎\nyes I sometimes feel a little bit akward posing with products- but oh wellll... totally worth it for this one! because it has helped me to get back on track after that covid fatigue.\n👉Strath Iron ist seit März im Schweizer Fachhandel erhältlich (also in Apotheken, Drogerien und Reformhäusern.)\n👉Es basiert auf natürlichem Eisen; die Kombi mit fermentierter Kräuterhefe und natürlichem Vitamin C unterstützt die Aufnahme zusätzlich. Eine einzigartige Kombination.\n👉Strath Iron trägt damit zur Reduktion von Müdigkeit und Erschöpfung bei & unterstützt den Energiestoffwechsel.\n👉 Hatte nach meiner Covid-Infektion eine Zeit lang mit Müdigkeit zu kämpfen, ab der Einnahme des Eisens  ging es dann bergaufwärts 🙏\n#biostrath #strathiron #meinestärke \n📷 zom glöck en profi als schwöster @alina.frey merciiii 💙', 1651741381, '{\"city_name\":\"Bern\",\"country_code\":\"CH\",\"country_name\":\"switzerland\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/279769110_1602537433460545_6792621844772900816_n.jpg', NULL, NULL, 'https://instagram.com/p/CdK654qqYQ0', 0, 0, '[\"#strathiron\",\"#meinesta\\u0308rke\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
(599, 34, 2830502463984395500, NULL, 'CdH9v6NqGTs', 7, -1, 0, 0, 0, 0, 0, 0, '0.04', 'CARROT APPLE PORRIDGE🍑 for those rainy spring days. ☁️\nto make such a bowl, just cook all these ingredients together until creamy:\n.\n-1 roughly grated apple\n-1 finely grated carrot\n-60 g oats\n-1 tbsp ground nuts of your choice\n-1 tbsp protein powder (I used pea protein)\n-1/2 tsp cinnamon\n-a few raisins\n-enough water or plant milk to get your desired consistency\n.\n#porridge #veganporridge #porridgebowl #porridgelover #oatmeal #veganoatmeal #oats #oatmealbowl #veganbreakfast #veganbreakfastideas #eatplantsnotfriends #eatplantsnotanimals', 1651642209, '{\"city_name\":\"Bern\",\"country_code\":\"CH\",\"country_name\":\"switzerland\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/279834108_2773863499582180_7650629195499335634_n.jpg', NULL, NULL, 'https://instagram.com/p/CdH9v6NqGTs', 0, 0, '[\"#veganporridge\",\"#porridgebowl\",\"#porridgelover\",\"#oatmeal\",\"#veganoatmeal\",\"#oats\",\"#oatmealbowl\",\"#veganbreakfast\",\"#veganbreakfastideas\",\"#eatplantsnotfriends\",\"#eatplantsnotanimals\"]', 'post', 'profile_scrape', 0, 1683024112, 1683024112),
