(603, 35, 3070711980499401088, NULL, 'CqdXEblM_mA', 152, 436, 0, 0, 0, 0, 0, 0, '13.94', 'Guten Abend!\n\nSo Leute, genug Gedanken bereitet… ich für meinen Teil, bleibe auf der sicheren Seite! Bin dennoch voll geknickt… so viele Reels hab ich archiviert - keine Ahnung, aber ich finds traurig… und Insta scheint mir grad voll fremd..\n\nAber!!!!! Ich denke, dafür werd ich mir irgendwas beklopptes überlegen müssen 😆 \nIrgendwas … pfeifen, flöten, Summen oder Euch voll-labern 🧐 iiiiirgendnen Wunsch oder Ideen!?\n\nUnd damit auch schon Solong und einen schönen kreativen Abend Ihr Sweeties!\n\nWeil so viele gefragt haben - Kranz und Kerzen sind übrigens von @iblaursen - das ist Werbung aus Liebe-hab ich mich selbst reinverliebt und gekauft 😉 \n\n#meandmyhappyhome @maybe.indesign \n#musikaufinsta #unserglücklicheszuhause #livingathome #livingathome_magazin #couchstyle #couchmagazin #solebich #solebenwir #meininteriorzauber #interiorinspo #livingroom #essplatz #liebewasduzeigst #zeigwasduliebst #landhausliebe #meinlandhausstyle #hyggehome #frühlingskranz #osterkranz #kranzliebe', 1680277415, '{\"city_name\":\"Esszimmer\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/338597369_989594108691130_8773780216366466726_n.jpg', NULL, NULL, 'https://instagram.com/p/CqdXEblM_mA', 0, 0, '[\"#meandmyhappyhome\",\"#musikaufinsta\",\"#unsergl\\u00fccklicheszuhause\",\"#livingathome\",\"#livingathome_magazin\",\"#couchstyle\",\"#couchmagazin\",\"#solebich\",\"#solebenwir\",\"#meininteriorzauber\",\"#interiorinspo\",\"#livingroom\",\"#essplatz\",\"#liebewasduzeigst\",\"#zeigwasduliebst\",\"#landhausliebe\",\"#meinlandhausstyle\",\"#hyggehome\",\"#fr\\u00fchlingskranz\",\"#osterkranz\",\"#kranzliebe\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(604, 35, 3066825268610180406, NULL, 'CqPjVVDs6U2', 263, 538, 0, 0, 0, 0, 0, 0, '18.99', '#välkommen \n\nOk, eigentlich ist das weniger der Flur der einen Willkommen heißt, wenn man bei uns rein kommt. \nEr liegt nämlich umme Ecke und trennt quasi den Wohnbereich vom Spabereich 😜 \n\nAber hier will man ja schließlich auch Willkommen geheißen werden 💁‍♀️\n\nUnd damit willkommene Grüße in den Sonntag! \n\n#liebewasduzeigst \n#meandmyhappyhome @maybe.indesign \n#hyggeamsonntag #landlust #landlust_magazin #landleben_magazin @landleben_magazin \n#wohndichhappy #meinteriorzauber #interiorzauber #interior123 #interior444 #streifenliebe #onthewall #wandgestaltung #meinlandhausstyle #meinfröhlicheszuhause #colourfulhome #colourfulinterior #zeigwasduliebst #hygge #nordichome #holzhausliebe #schwedenhaus #skandihome', 1679814083, '[]', 'IMAGE', 'images/content/posts/337562390_1635099880261983_2037821546583506721_n.jpg', NULL, NULL, 'https://instagram.com/p/CqPjVVDs6U2', 0, 0, '[\"#v\\u00e4lkommen\",\"#liebewasduzeigst\",\"#meandmyhappyhome\",\"#hyggeamsonntag\",\"#landlust\",\"#landlust_magazin\",\"#landleben_magazin\",\"#wohndichhappy\",\"#meinteriorzauber\",\"#interiorzauber\",\"#interior123\",\"#interior444\",\"#streifenliebe\",\"#onthewall\",\"#wandgestaltung\",\"#meinlandhausstyle\",\"#meinfr\\u00f6hlicheszuhause\",\"#colourfulhome\",\"#colourfulinterior\",\"#zeigwasduliebst\",\"#hygge\",\"#nordichome\",\"#holzhausliebe\",\"#schwedenhaus\",\"#skandihome\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(605, 35, 3065701706885073500, NULL, 'CqLj3WqMYpc', 208, 457, 0, 0, 0, 0, 0, 0, '15.77', '#einfachmalmachen\n \nIch wollt Euch doch die ganze Zeit mein heiß geliebtes Vertiko, dass quasi schon ausrangiert war, in Gänze zeigen 🫵 \n\nBin so so froh, dass wir es einfach gepackt, die Treppe runter geschleppt und hingestellt haben!!! \nWeil ganz im Gegensatz zur Vorstellung - lieb ich es genau da \n- und Leute - Schande passt da viel rein!\n\nI‘m in love \n\nSo und damit nach 2 Tagen Pause einen extrem chicen Freitagabend Ihr Sweeties \n\n#liebewasduzeigst #meandmyhappyhome @maybe.indesign #wohndichhappy @scandirella \n#hyggeamfreitag #kitti\n#interiorzauber #meininteriorzauber #vertiko #lieblingsstück #livingathome #livingathome_magazin #couch_magazin  #vintage #solebich #solebenwir #hyggehome #nordichome #scandistyle #meinlandhausstyle #wohnenunddekorieren #landhaus_magazin_neu @landhaus_magazin_neu #vertiko #interior123 #interior444 #schwedenhausliebe #holzhausliebe', 1679680144, '{\"city_name\":\"LieblingsTeil\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/337348147_616724973257462_473505826996918367_n.jpg', NULL, NULL, 'https://instagram.com/p/CqLj3WqMYpc', 0, 0, '[\"#einfachmalmachen\",\"#liebewasduzeigst\",\"#meandmyhappyhome\",\"#wohndichhappy\",\"#hyggeamfreitag\",\"#kitti\\n#interiorzauber\",\"#meininteriorzauber\",\"#vertiko\",\"#lieblingsst\\u00fcck\",\"#livingathome\",\"#livingathome_magazin\",\"#couch_magazin\",\"#vintage\",\"#solebich\",\"#solebenwir\",\"#hyggehome\",\"#nordichome\",\"#scandistyle\",\"#meinlandhausstyle\",\"#wohnenunddekorieren\",\"#landhaus_magazin_neu\",\"#vertiko\",\"#interior123\",\"#interior444\",\"#schwedenhausliebe\",\"#holzhausliebe\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(606, 35, 3062541643651703732, NULL, 'CqAVWYbs2O0', 267, 546, 0, 0, 0, 0, 0, 0, '19.28', '#lenaammontag\n\nGanz klassisch - zwar etwas spät.. aber jetzt dann!\n\nWelcher Post hat Euch heute schon lächeln lassen?\nWo schaut Ihr immer gerne vorbei, wo ist es nie langweilig!?\n\nWir wollen es wissen und schauen direkt vorbei 🥰 \nEvtl ist’s auch was für mich für uns!\n\n#sehenundgesehenwerden \n\nMeine Empfehlung für heute\n\n@seelen_dinge \n\n🧡 🧡 🧡 \n\nChicen Montag, viel Spaß beim Bummeln - ich freu mich auf Eure Empfehlung!!!\n\n—— Anleitung zu den Blumen gibt’s in den Reels ——\n\n#papierblume #paperlove #bastelnmitpapier #diyliebe #diyideen #mitmachmontagdiy @klickerkram  #flatwhite #landhaus #landhausliebe #kaffeeliebe #buchseitendeko #liebewasduzeigst #zeigwasduliebst #gooddaymonday #papercraft #meandmyhappyhome #meinedekovibes #meinefrühlingsvibes #frühlingsboten #hygge #hyggehome #nordichome #skandihome', 1679303435, '{\"city_name\":\"\\u00dcberall Auf Der Welt\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/336338374_1224681218176011_7494518506806870158_n.jpg', NULL, NULL, 'https://instagram.com/p/CqAVWYbs2O0', 0, 0, '[\"#lenaammontag\\n\\nganz\",\"#paperlove\",\"#bastelnmitpapier\",\"#diyliebe\",\"#diyideen\",\"#mitmachmontagdiy\",\"#flatwhite\",\"#landhaus\",\"#landhausliebe\",\"#kaffeeliebe\",\"#buchseitendeko\",\"#liebewasduzeigst\",\"#zeigwasduliebst\",\"#gooddaymonday\",\"#papercraft\",\"#meandmyhappyhome\",\"#meinedekovibes\",\"#meinefr\\u00fchlingsvibes\",\"#fr\\u00fchlingsboten\",\"#hygge\",\"#hyggehome\",\"#nordichome\",\"#skandihome\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(607, 35, 3055917164308650803, NULL, 'CpozHhRotsz', 167, 475, 0, 0, 0, 0, 0, 0, '15.22', '#lenaplottet\n\nNachdem ich neulich den Teppich in den „kleinen Flur“ gelegt habe, habe ich direkt mein Schuhschränkchen bisschen aufpoliert - da der kleine Flur unsere, ich nenne es liebevoll unsere Spa-Räumlichkeiten, verbindet, fand ich den Plott sehr passend 😉 - zum für 2 der drei Räume 😆 \n\nGute Idee auch für heute 🧘‍♀️ \n\n#flurinspo #bastelnmitpapier #buchstabenliebe #sprühdiy #plotterliebe #cricutmaker #diyliebe #zeigdein_diy #zeigwasduliebst #liebewasduzeigst #klötzchenliebe #klötzchenfieber #interiorzauber #trockenblumen #colourfulhome #colourfullife #colourfulinterior #landhaus #landhausliebe #meinlandhausstyle #schwedenhausliebe #nordicchic #nordicstyle #nordichome #skandihome', 1678513735, '{\"city_name\":\"Wellness & Lifestyle\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/334450851_1856762414680099_4554374583029804539_n.jpg', NULL, NULL, 'https://instagram.com/p/CpozHhRotsz', 0, 0, '[\"#lenaplottet\\n\\nnachdem\",\"#flurinspo\",\"#bastelnmitpapier\",\"#buchstabenliebe\",\"#spr\\u00fchdiy\",\"#plotterliebe\",\"#cricutmaker\",\"#diyliebe\",\"#zeigdein_diy\",\"#zeigwasduliebst\",\"#liebewasduzeigst\",\"#kl\\u00f6tzchenliebe\",\"#kl\\u00f6tzchenfieber\",\"#interiorzauber\",\"#trockenblumen\",\"#colourfulhome\",\"#colourfullife\",\"#colourfulinterior\",\"#landhaus\",\"#landhausliebe\",\"#meinlandhausstyle\",\"#schwedenhausliebe\",\"#nordicchic\",\"#nordicstyle\",\"#nordichome\",\"#skandihome\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116);
