(608, 35, 3053725153769955701, NULL, 'CphAtkYIiF1', 214, 544, 0, 0, 0, 0, 0, 0, '17.97', '#jetztaber\n\nSonnige Grüße - weils gut tut!\nUnd jetzt muss ich mich sputen, weil ich bin morgen bei #ichfühldenfrühling dran und was soll ich sagen! Ich fühl den schon ganz toll, aber sehen kann man noch nix 🙈 \nLena bastelt dann mal ✌️ 🧶 🏃‍♀️ \n\nTschus und chicen midweekmittwoch 😅\n\n#fensterbank #ausblick #view #frühlingsboten #frühlingszauber #springiscoming #sonne #meinefrühlingsvibes #liebezumdetail #wohndichhappy #meandmyhappyhome #colourfulhome #colourfulinterior #colourfullife #hyggehome #hygge #nordichome #skandihome #schwedenhaus #landhausliebe #meinlandhaus #landlust #liebewasduzeigst #zeigwasduliebst', 1678252427, '{\"city_name\":\"S\\u00fcden\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/333161424_1268219980400707_4528613095543942136_n.jpg', NULL, NULL, 'https://instagram.com/p/CphAtkYIiF1', 0, 0, '[\"#jetztaber\\n\\nsonnige\",\"#ichf\\u00fchldenfr\\u00fchling\",\"#ausblick\",\"#view\",\"#fr\\u00fchlingsboten\",\"#fr\\u00fchlingszauber\",\"#springiscoming\",\"#sonne\",\"#meinefr\\u00fchlingsvibes\",\"#liebezumdetail\",\"#wohndichhappy\",\"#meandmyhappyhome\",\"#colourfulhome\",\"#colourfulinterior\",\"#colourfullife\",\"#hyggehome\",\"#hygge\",\"#nordichome\",\"#skandihome\",\"#schwedenhaus\",\"#landhausliebe\",\"#meinlandhaus\",\"#landlust\",\"#liebewasduzeigst\",\"#zeigwasduliebst\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(609, 35, 3052280629566796851, NULL, 'Cpb4Q-YInQz', 390, 657, 0, 0, 0, 0, 0, 0, '24.83', '#lenaammontag\n\nGanz klassisch!\n\nAuf wessen Post freut Ihr Euch schon!? Wo schaut Ihr immer gerne vorbei, wo ist es nie langweilig!?\n\nWir wollen es wissen und schauen direkt vorbei 🥰 \nEvtl ist’s auch was für mich für uns!\n\n#sehenundgesehenwerden \n\nMeine Empfehlung für heute\n\n@aewohnideen \n\n🧡 🧡 🧡 \n\nChicen Montag, viel Spaß beim Bummeln - ich freu mich auf Eure Empfehlung!!!\n\n—- Die Anleitung der Papierblumen findet ihr in den Reels —-\n\n#papierblume #paperlove #bastelnmitpapier #diyliebe #diyideen #mitmachmontagdiy #kaffeeliebe #flatwhite #landhaus #landhausliebe #meinlandhausstyle #buchseitendeko #liebewasduzeigst #zeigwasduliebst #gooddaymonday #papercraft #meandmyhappyhome #meinedekovibes #meinefrühlingsvibes #frühlingsboten #hygge #hyggehome #nordichome #skandihome', 1678080227, '{\"city_name\":\"Montagsmaler\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/334269898_1312614682714389_3553016869450283170_n.jpg', NULL, NULL, 'https://instagram.com/p/Cpb4Q-YInQz', 0, 0, '[\"#lenaammontag\\n\\nganz\",\"#paperlove\",\"#bastelnmitpapier\",\"#diyliebe\",\"#diyideen\",\"#mitmachmontagdiy\",\"#kaffeeliebe\",\"#flatwhite\",\"#landhaus\",\"#landhausliebe\",\"#meinlandhausstyle\",\"#buchseitendeko\",\"#liebewasduzeigst\",\"#zeigwasduliebst\",\"#gooddaymonday\",\"#papercraft\",\"#meandmyhappyhome\",\"#meinedekovibes\",\"#meinefr\\u00fchlingsvibes\",\"#fr\\u00fchlingsboten\",\"#hygge\",\"#hyggehome\",\"#nordichome\",\"#skandihome\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(610, 35, 3050432483246157833, NULL, 'CpVUC5_MzAJ', 202, 514, 0, 0, 0, 0, 0, 0, '16.98', '#weitblick\n\nIch wollte Euch doch noch meinen anderen Teppich aus meine Koop mit @trendcarpet zeigen 🥰 \n\nEs ist der solar cream in 200x80 \nKlasse, weil ich steh auf Läufer!\n\nWo er wirklich liegen soll… ich bin noch unsicher - weil er an drei Stellen hier so toll ausschaut!\n\nEuch zeige ich die Flurvariation - was auch völliges Instaneuland ist - immer wieder was Neues 😉 \n\nDen verlängerten Blick kennt Ihr aber tatsächlich schon 👀 dafür ganz rüber wischeln! Weniger Teppich, mehr Guck-naaaaa, wohin!?\n\nKleine Erinnerung - mein Code lenaliebtdasso20 läuft noch dieses Wochenende und beschert Euch 20% \n\n#trendcarpet #teppichliebe #flurinspo #diele #korridor #interiorzauber #interiorliebe #livingathome #clourfulhome #colourfulinterior #streifenliebe #zeigwasduliebst #liebewasduzeigst #meandmyhappyhome @maybe.indesign #wohndichhappy @scandirella #landhausdesign #meinlandhausstyle #cottagehome #hyggehome #schwedenhausliebe #landhaus #landleben #landhausliebe', 1677859910, '{\"city_name\":\"HERE NOW\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/329758691_217700424098228_6159177610468276859_n.jpg', NULL, NULL, 'https://instagram.com/p/CpVUC5_MzAJ', 0, 0, '[\"#weitblick\\n\\nich\",\"#trendcarpet\",\"#teppichliebe\",\"#flurinspo\",\"#diele\",\"#korridor\",\"#interiorzauber\",\"#interiorliebe\",\"#livingathome\",\"#clourfulhome\",\"#colourfulinterior\",\"#streifenliebe\",\"#zeigwasduliebst\",\"#liebewasduzeigst\",\"#meandmyhappyhome\",\"#wohndichhappy\",\"#landhausdesign\",\"#meinlandhausstyle\",\"#cottagehome\",\"#hyggehome\",\"#schwedenhausliebe\",\"#landhaus\",\"#landleben\",\"#landhausliebe\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(611, 35, 3047417003585477797, NULL, 'CpKmZ5tMpyl', 224, 474, 0, 0, 0, 0, 0, 0, '16.55', '#lenaammontag\n\nfreut sich über die Kooperation mit @trendcarpet \n\nIch habe mich im Wohnzimmer für den Wollteppich Coastel Cream 160x230 entschieden und naja was soll ich sagen … wer benötigt schon ne Couch, wenn er so einen tollen Teppich hat?! \nEbbi und ich sind uns einig 🥰 (einfach nach links wischen)\n\nWelchen ich in den Flur gelegt habe, zeige ich Euch noch!\n\nWenn Ihr auch einen neuen Teppich benötigt, könnt Ihr von heute an 7 Tage mit dem Code LENALIEBTDASSO20 20% sparen!\n\nViel Spaß beim Bummeln 👀 \n\n#trendcarpet #teppichliebe #gemütlichkeit #hyggehome #hygge #nordichome #skandinavienhome #skandistyle #landhausliebe #landhausliving #meinlandhausstyle #schwedenhaus #holzhausliebe #colourfulhome #colorfulhome #zeigwasduliebst #liebewasduzeigst #interiorzauber #diegedankensindfrei #wohndichhappy #meandmyhappyhome #howwelive #sowohnenwir #hundeliebe #rabattcode', 1677500437, '{\"city_name\":\"On top\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/333914386_881147313109901_174762184939706853_n.jpg', NULL, NULL, 'https://instagram.com/p/CpKmZ5tMpyl', 0, 0, '[\"#lenaammontag\\n\\nfreut\",\"#trendcarpet\",\"#teppichliebe\",\"#gem\\u00fctlichkeit\",\"#hyggehome\",\"#hygge\",\"#nordichome\",\"#skandinavienhome\",\"#skandistyle\",\"#landhausliebe\",\"#landhausliving\",\"#meinlandhausstyle\",\"#schwedenhaus\",\"#holzhausliebe\",\"#colourfulhome\",\"#colorfulhome\",\"#zeigwasduliebst\",\"#liebewasduzeigst\",\"#interiorzauber\",\"#diegedankensindfrei\",\"#wohndichhappy\",\"#meandmyhappyhome\",\"#howwelive\",\"#sowohnenwir\",\"#hundeliebe\",\"#rabattcode\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(612, 35, 3046543636280008325, NULL, 'CpHf0vBMl6F', 286, 531, 0, 0, 0, 0, 0, 0, '19.37', '#odeandievase\n\nSponserd Post \nBy @yourlovedceramics \n\nNachdem ich so lange stolze Blumeninweizenglasstellerin gewesen bin, hab ich mittlerweile ne ganze Hand voll #vasen - dank #instagram und den tollen Menschen hier!\n\nDass ich allerdings einen ganzen Post so einem Teil widme 😯 krasse Nummer!\n\nAber was soll ich sagen!? Ich hab dieses wunderschöne Unikat gesehen - dazu das Wörtchen #schweden gelesen und Zack, da war es um mich geschehen!\n\nUnd dann durfte ich auch noch meine Blümchen reinstellen 🥰 \n\nDie gelben - noch Geburtstagsblumen passen da mega gut rein - die Vase selbst passt klasse aufs #vertiko und das Ganze passt super vor den Hirsch!\n\nIch denke - wir haben uns gefunden 🥰 \n\n#influenced #zeigwasduliebst #liebewasduzeigst #vasenliebe #keramik #keramikliebe #dekoideen #homedecorinspo #landhausdeko #meinlandhausstyle #schwedenhaus #nordichome #mynordicstyle #holzliebe #holzhausliebe #blumenliebe #blumigeszumwochenende #flowers4tinkerwells @tinker_wells #wohndichhappy @scandirella #meandmy @maybe.indesign', 1677396324, '{\"city_name\":\"On top\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/333338114_511256034500574_3593098818300356847_n.jpg', NULL, NULL, 'https://instagram.com/p/CpHf0vBMl6F', 0, 0, '[\"#odeandievase\\n\\nsponserd\",\"#vasen\",\"#instagram\",\"#schweden\",\"#vertiko\",\"#influenced\",\"#zeigwasduliebst\",\"#liebewasduzeigst\",\"#vasenliebe\",\"#keramik\",\"#keramikliebe\",\"#dekoideen\",\"#homedecorinspo\",\"#landhausdeko\",\"#meinlandhausstyle\",\"#schwedenhaus\",\"#nordichome\",\"#mynordicstyle\",\"#holzliebe\",\"#holzhausliebe\",\"#blumenliebe\",\"#blumigeszumwochenende\",\"#flowers4tinkerwells\",\"#wohndichhappy\",\"#meandmy\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(613, 35, 3045789150498295605, NULL, 'CpE0RhYMI81', 215, 539, 0, 0, 0, 0, 0, 0, '17.88', '#inlove\n\nDa überleg ich noch, was ich Euch am Wochenende so zeigen will und dann liegt die Süße da so auf der freien Couch - völlig unbekannt für Euch, dabei lieb ich sie so - die Couch mein ich 😅 \n\nUnd damit war’s entschieden 🥰 \nEbbi auf Couch - und obwohl sie es sonst voll doof findet, wenn ich sie fotografiere, blieb sie einfach liegen 🥰\n- in der Story zeig ich Euch, was das einzige war, was ich bisschen verändert habe) 🦁 \n\nAch UND - vor der Balkontür - übrigens Süden, ne is klar - hängt eine der Buchblumen! (Phantasie an!)\n\nAber hey, Soviel Liebe in einem Bild - yeeeaaaah\n\nSo und jetzt losgeliebt!\n\n#liebewasduzeigst #zeigwasduliebst #hundeliebe #meinhundundich #blumenliebe #papierblume #meinlivingathomemoment #meinzuhause #meandmyhappyhome @maybe.indesign #colourfulhome #colorfulhome #landlust #landleben #meinlandhausstyle #wohnenunddekorieren #landhausdeko #livingroominspo #hyggehome #hygge #nordichome #mynordicstyle #skandistyle #hyggefrühlingsmomente @una.liebtdeko @bullerby_am_waldesrand  @hej_julz', 1677306382, '{\"city_name\":\"In love\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/332930350_872639293942635_3320108520500434708_n.jpg', NULL, NULL, 'https://instagram.com/p/CpE0RhYMI81', 0, 0, '[\"#inlove\\n\\nda\",\"#zeigwasduliebst\",\"#hundeliebe\",\"#meinhundundich\",\"#blumenliebe\",\"#papierblume\",\"#meinlivingathomemoment\",\"#meinzuhause\",\"#meandmyhappyhome\",\"#colourfulhome\",\"#colorfulhome\",\"#landlust\",\"#landleben\",\"#meinlandhausstyle\",\"#wohnenunddekorieren\",\"#landhausdeko\",\"#livingroominspo\",\"#hyggehome\",\"#hygge\",\"#nordichome\",\"#mynordicstyle\",\"#skandistyle\",\"#hyggefr\\u00fchlingsmomente\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(614, 35, 3040739902195234710, NULL, 'Coy4NScs_eW', 181, 504, 0, 0, 0, 0, 0, 0, '16.24', '#hochdiehände\n\nHeute gibts nm die Fensterbank, ist die einzige nach Süden… ich sag Euch, hier stehen die Pflanzen Schlange 🙆‍♀️\nAber meine Klicker dürfen mit drauf - da kommt man auch immer mal vorbei, sie zu schubsen 😜 \n\nUnd jetzt.. nachdem mich so viele im letzten Reel „vermisst“ haben, guck ich mal, was ich da für Euch „machen“ kann 🤗 Wünsche? \n\nSo Long 🐊 \n\n#liebewasduzeigst #zeigwasduliebst #meandmyhappyhome @maybe.indesign #meinwohnmoment #meinwohnliebemoment #fensterbank #diyliebe #diyideen #zeigdein_diy #modelliermasse #modellieren #murmeln #zen #kreativzeit #bunt_und_schön #selbermachen #basteln #dekoideen #landhausideen #meinlandhausstyle #nordichome #holzhausliebe', 1676704465, '{\"city_name\":\"Fensterbank\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/331341295_580734367040254_3258305800855365274_n.jpg', NULL, NULL, 'https://instagram.com/p/Coy4NScs_eW', 0, 0, '[\"#hochdieh\\u00e4nde\\n\\nheute\",\"#liebewasduzeigst\",\"#zeigwasduliebst\",\"#meandmyhappyhome\",\"#meinwohnmoment\",\"#meinwohnliebemoment\",\"#fensterbank\",\"#diyliebe\",\"#diyideen\",\"#zeigdein_diy\",\"#modelliermasse\",\"#modellieren\",\"#murmeln\",\"#zen\",\"#kreativzeit\",\"#bunt_und_sch\\u00f6n\",\"#selbermachen\",\"#basteln\",\"#dekoideen\",\"#landhausideen\",\"#meinlandhausstyle\",\"#nordichome\",\"#holzhausliebe\"]', 'post', 'profile_scrape', 0, 1683024116, 1683024116),
(615, 36, 3093584037293683066, NULL, 'CrunkqZtXF6', 67, 162, 0, 0, 0, 0, 0, 0, '4.4', 'Schoko-Ofenwaffeln mit Erdbeeren 🌱 Vegan Werbung\n\nKann man mit der glutenfreien Pancake-Mischung von KoRo auch Waffeln backen? ❤️ Ja, man kann! Und sie werden verdammt lecker und proteinreich. Bei mir gab es sie in der Schoki-Variante mit frischen Erdbeeren, Raspberry Rumble und Hafer-Cookies. Perfektes Waffelfrühstück! Erdbeeren😍 🍓 \n\n3 Waffeln + Toppings = 585 kcal | 33 g P | 71 g K | 16 g F\n\nZutaten für 3 Waffeln:\n80 g glutenfreie Pancake-Mischung @koro_de ‼️5 %-Code: GINGER\n20 g stark entöltes Kakaopulver\n25 g Erythrit mit Stevia\n100 g Sojajoghurt Natur ungesüßt\n175 ml Wasser\n\n170°C Umluft, ca. 20-30 Min. ohne Vorheizen\n\nToppings:\n150 g Erdbeeren\n15 g Cashewmus Raspberry Rumble @naughtynuts ‼️10%-Code: 10GINGER\n4 Hafer-Cookies Mandel-Vanille @foodloose ‼️15%-Code: Ginger15\n\nEinfache alle Zutaten für den Teig vermengen und in drei Silikon-Waffelformen füllen. Im Ofen gut durchbacken, abkühlen lassen und aus der Form lösen. Mit den Toppings garnieren und genießen.\n\n#gesundesfrühstück #waffelfrühstück #waffeln #glutenfrei #zuckerfrei #vegan #healthybreakfast #glutenfree #nosugaradded #plantbased #whatveganseat #veganwaffles #waffleday #wafflesunday #proteinrecipes #proteinrezepte #fitfood #fitfam #abnehmrezepte #gesundabnehmen #gesundzunehmen #ernährungsumstellung #chocolate #schokolade #erdbeeren #erdbeereliebe #erdbeerzeit #strawberries #korodrogerie #naughtynuts', 1683003976, '[]', 'IMAGE', 'images/content/posts/343964340_2099937380203685_6040023964955713829_n.webp', NULL, NULL, 'https://instagram.com/p/CrunkqZtXF6', 0, 0, '[\"#waffelfr\\u00fchst\\u00fcck\",\"#waffeln\",\"#glutenfrei\",\"#zuckerfrei\",\"#vegan\",\"#healthybreakfast\",\"#glutenfree\",\"#nosugaradded\",\"#plantbased\",\"#whatveganseat\",\"#veganwaffles\",\"#waffleday\",\"#wafflesunday\",\"#proteinrecipes\",\"#proteinrezepte\",\"#fitfood\",\"#fitfam\",\"#abnehmrezepte\",\"#gesundabnehmen\",\"#gesundzunehmen\",\"#ern\\u00e4hrungsumstellung\",\"#chocolate\",\"#schokolade\",\"#erdbeeren\",\"#erdbeereliebe\",\"#erdbeerzeit\",\"#strawberries\",\"#korodrogerie\",\"#naughtynuts\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(616, 36, 3092863327680200974, NULL, 'CrsDs9RNgEO', 97, 313, 0, 0, 0, 0, 0, 0, '7.87', 'Rhabarber-Schokomuffins 🌱 Vegan Werbung\n\nHast du schon etwas mit Rhabarber gebacken? 🙂 Falls dir die Ideen fehlen, probiere doch mal diese leckeren Schokomuffins aus. 👌 Die sind schnell gemacht und trotzdem richtig lecker. Wünsche Dir einen wundervollen 1. Mai ❤️🫶\n\n5 Muffins + Topping = 532 kcal | 32 g P | 55g K | 17 g F\n\nZutaten für 5:\n80 g glutenfreie Pancake-Mischung @koro_de ‼️5 %-Code: GINGER\n20 g stark entöltes Kakaopulver @koro_de\n25 g Erythrit mit Stevia  @koro_de\n50 g Sojajoghurt Natur ungesüßt \n50 g Rhabarber\n175 ml Wasser\n\n170°C Umluft, 25-30 Min.\n\nTopping:\n20 g Cashewmus Raspberry Rumble @naughtynuts ‼️10%-Code: 10GINGER\n\nSchneide den Rhabarber in kleine Stückchen. Vermenge alle anderen Zutaten für den Teig miteinander und fülle ihn in kleine Muffinförmchen. Jetzt den Rhabarber dazugeben. Im Ofen gut durchbacken, abkühlen lassen und aus den Förmchen lösen. Mit Nussmus verzieren.\n\n#frühsück #gesundfrühstücken #glutenfrei #glutenfree #breakfastideas #healthybreakfast #schokomuffins #rhabarber #schokolade #chocolate #muffins #muffinlovers #rhubarb #nosugaradded #zuckerfrei #vegan #vegandeutschland #veganbacken #abnehmenkannsoleckersein #abnehmrezepte #gesundzunehmen #ernährungsumstellung #korodrogerie #naughtynuts #gesundundlecker #leckerschmecker #proteinrezepte #fitfood #plantbased #foodblogger_de', 1682918061, '[]', 'IMAGE', 'images/content/posts/344255536_1309528003241037_2113657055230570457_n.webp', NULL, NULL, 'https://instagram.com/p/CrsDs9RNgEO', 0, 0, '[\"#gesundfr\\u00fchst\\u00fccken\",\"#glutenfrei\",\"#glutenfree\",\"#breakfastideas\",\"#healthybreakfast\",\"#schokomuffins\",\"#rhabarber\",\"#schokolade\",\"#chocolate\",\"#muffins\",\"#muffinlovers\",\"#rhubarb\",\"#nosugaradded\",\"#zuckerfrei\",\"#vegan\",\"#vegandeutschland\",\"#veganbacken\",\"#abnehmenkannsoleckersein\",\"#abnehmrezepte\",\"#gesundzunehmen\",\"#ern\\u00e4hrungsumstellung\",\"#korodrogerie\",\"#naughtynuts\",\"#gesundundlecker\",\"#leckerschmecker\",\"#proteinrezepte\",\"#fitfood\",\"#plantbased\",\"#foodblogger_de\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(617, 36, 3092158066820829236, NULL, 'CrpjWD6NtA0', 84, 310, 0, 0, 0, 0, 0, 0, '7.56', 'Apfel-Erdnuss-Crumble mit Kakaocreme 🌱 Werbung\n\nWurde mal wieder Zeit für ein leckeres Crumble 🫶 Anstatt Butter habe ich Nussmus verwendet, dadurch werden die Streusel schön soft, so mag ich das.😍 Magst du Streusel lieber weicher oder hart und knusprig?🤔\n\n589 kcal | 33 g P | 59 g K | 20 g F\n\nZutaten:\n60 g gemahlene Haferflocken @koro_de ‼️5 %-Code: GINGER\n30 g teilentöltes Erdnussmehl @koro_de\n20 g Erythrit mit Stevia @koro_de\n60 g Sojajoghurt Natur ungesüßt \n20 g Erdnussmus smooth @naughtynuts ‼️10%-Code: 10GINGER\n2 EL Pflanzendrink/Wasser\n100 g Apfelstückchen \n\nKakaocreme:\n15 g stark entöltes Kakaopulver @koro_de\n5 g Erythrit mit Stevia @koro_de\nEtwas Pflanzendrink/Wasser\n\n》Schneide einen kleinen Apfel in Stückchen und gib sie in eine kleine Auflaufform. Vermenge alle Zutaten miteinander und knete einen Teig daraus. Zerbrösele ihn in Streusel und gib diese über den Apfel. Backe es nun  im Ofen gut durch. Danach kurz abkühlen lassen und in eine kleine Schale füllen. Mische die Kakaocreme an und gib sie auf das fertige Crumble.\n\n#frühstück #gesundesfrühstück #breakfast #breakfastideas #glutenfrei #zuckerfrei #veganfrühstücken #veganerezepte #einfacherezepte #schnellerezepte #abnehmrezepte #gesundabnehmen #abnehmenkannsoleckersein #gesundzunehmen #ernährungsumstellung #veganwerdenwaslosdigger #vegandeutschland #korodrogerie #naughtynuts #chocolate #applepie #crumble #gesundnaschen #proteinreich #fitfood #fitfam #gesundundlecker #leckerschmecker #foodblogger_de #foodfotografie', 1682833988, '[]', 'IMAGE', 'images/content/posts/343558524_799493425123347_4110027283686658712_n.webp', NULL, NULL, 'https://instagram.com/p/CrpjWD6NtA0', 0, 0, '[\"#gesundesfr\\u00fchst\\u00fcck\",\"#breakfast\",\"#breakfastideas\",\"#glutenfrei\",\"#zuckerfrei\",\"#veganfr\\u00fchst\\u00fccken\",\"#veganerezepte\",\"#einfacherezepte\",\"#schnellerezepte\",\"#abnehmrezepte\",\"#gesundabnehmen\",\"#abnehmenkannsoleckersein\",\"#gesundzunehmen\",\"#ern\\u00e4hrungsumstellung\",\"#veganwerdenwaslosdigger\",\"#vegandeutschland\",\"#korodrogerie\",\"#naughtynuts\",\"#chocolate\",\"#applepie\",\"#crumble\",\"#gesundnaschen\",\"#proteinreich\",\"#fitfood\",\"#fitfam\",\"#gesundundlecker\",\"#leckerschmecker\",\"#foodblogger_de\",\"#foodfotografie\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(618, 36, 3091410104037557598, NULL, 'Crm5RxSNkVe', 87, 328, 0, 0, 0, 0, 0, 0, '7.97', 'Orangen-Karottenauflauf mit Espresso Roast 🌱 Vegan Werbung \n\nOrange und Karotte mag ich super gern zusammen und daher habe ich beides in diesem leckeren Frühstücksauflauf vereint.🍊🥕 Die Karotte macht ihn richtig saftig. Wenn du kein Buchweizenmehl magst, kannst du auch helles Dinkelmehl verwenden, wobei dieses dann natürlich nicht glutenfrei ist.😉 Ich habe mir noch ein paar getrocknete Süßkirschen reingestreut und on top Espresso-Haselnussmus.😍\n\n559 kcal | 29 g P | 83 g K | 11 g F\n\nZutaten für eine kleine Auflaufform:\n60 g Buchweizenmehl \n (alternativ: Dinkelmehl)\n40 g teilentöltes Erdnussmehl @koro_de ‼️5 % auf alles: GINGER\n (alternativ: Mandelmehl oder Proteinpulver)\n25 g Erythrit mit Stevia @koro_de\n4 g Backpulver\n10 g getrocknete Süßkirschen @koro_de\n40 g Orangen-Scheiben\n70 g geriebene Karotte\n100 g pürierte Orange\n80 ml Wasser\n\n170°C Umluft, 20 Min. ohne Vorheizen \n\nToppings:\n10 g Haselnussmus Espresso Roast @naughtynuts ‼️10% mit: 10GINGER\n\n》Schneide die Orange in Scheiben. Lege zwei beiseite und püriere den Rest. Vermenge es zusammen mit den anderen Zutaten zu einem homogenen Teig. Fülle ihn in eine kleine Auflaufform und drücke die Orangenscheiben und Kirschen hinein. Backe es im Ofen gut durch, kurz abkühlen lassen und danach mit dem Nussmus garnieren.\n\n#frühstück #gesundnaschen #orangenkuchen #gesundzunehmen #frühstücksideen #gesunderezepte #schnellerezepte #einfacherezepte #abnehmrezepte #leckerschmecker #glutenfrei #zuckerfrei #proteinrezepte #fitnessrezepte #fitfood #fitfam #korodrogerie #korolicious #naughtynuts #oranges #vegandeutschland #glutenfreibacken #einfachvegan #proteinreich #foodfotografie #veganerezepte #veganfrühstücken #veganundlecker #vegan #foodiesconnected', 1682744823, '[]', 'IMAGE', 'images/content/posts/343525740_756717349325772_3671081755629005880_n.webp', NULL, NULL, 'https://instagram.com/p/Crm5RxSNkVe', 0, 0, '[\"#gesundnaschen\",\"#orangenkuchen\",\"#gesundzunehmen\",\"#fr\\u00fchst\\u00fccksideen\",\"#gesunderezepte\",\"#schnellerezepte\",\"#einfacherezepte\",\"#abnehmrezepte\",\"#leckerschmecker\",\"#glutenfrei\",\"#zuckerfrei\",\"#proteinrezepte\",\"#fitnessrezepte\",\"#fitfood\",\"#fitfam\",\"#korodrogerie\",\"#korolicious\",\"#naughtynuts\",\"#oranges\",\"#vegandeutschland\",\"#glutenfreibacken\",\"#einfachvegan\",\"#proteinreich\",\"#foodfotografie\",\"#veganerezepte\",\"#veganfr\\u00fchst\\u00fccken\",\"#veganundlecker\",\"#vegan\",\"#foodiesconnected\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(619, 36, 3089957607191072274, NULL, 'CrhvBKLo84S', 137, 432, 0, 0, 0, 0, 0, 0, '10.92', 'Kaiserschmarrn mit Beeren 🌱 Vegan Werbung\n\nSchneller easy-peasy-Kaiserschmarrn: mit der neuen Pancake-Mischung von KoRo 😍 Die Mischung ist proteinreich, glutenfrei und ohne Zucker oder Süßstoffe. Ich habe mir damit eben mal einen leckeren Kaiserschmarrn zubereitet, ein paar Früchte und fancy Nussmus dazu ... perfekt! 🫶\n\nSchmarrn + Toppings = 520 kcal | 30 g P | 61 g K | 15 g F\n\nZutaten:\n100 g glutenfreie Pancake-Mischung @koro_de ‼️5 %-Code: GINGER\n20 g Erythrit mit Stevia @koro_de\n30 g Sojajoghurt Natur ungesüßt\n150 ml Pflanzendrink/Wasser\n\nToppings:\n50 g Beeren (TK oder frisch)\n15 g Mandelmus Blueberry Bash @naughtynuts ‼️10%-Code: 10GINGER\n\n》Geht super easy: Teig anmischen, in eine beschichtete Pfanne gießen und anbacken lassen. Danach in Stücke zerteilen und nochmal anbraten. Danach in eine Schüssel geben, Nussmus und Früchte verteilen, genießen, glücklich sein!\n\n#abnehmen #gesunderezepte #gesundessen #proteinreich #gesundnaschen #cleaneating #healthyfoods #korodrogerie #gesundabnehmen #kaiserschmarrn #breakfast #fitfam #fitnessfood #frühstück #abnehmtagebuch #leckeressen #frühstück #naughtynuts #abspecken #kaloriendefizit #weilsumdichgeht #glutenfrei #korolicious #blogger_de #instagood #foodgram #ernährungsumstellung #ausmeinerküche #ohnezucker #instafood', 1682571672, '[]', 'IMAGE', 'images/content/posts/343276426_3016648871977742_1600195672719572937_n.webp', NULL, NULL, 'https://instagram.com/p/CrhvBKLo84S', 0, 0, '[\"#gesunderezepte\",\"#gesundessen\",\"#proteinreich\",\"#gesundnaschen\",\"#cleaneating\",\"#healthyfoods\",\"#korodrogerie\",\"#gesundabnehmen\",\"#kaiserschmarrn\",\"#breakfast\",\"#fitfam\",\"#fitnessfood\",\"#fr\\u00fchst\\u00fcck\",\"#abnehmtagebuch\",\"#leckeressen\",\"#fr\\u00fchst\\u00fcck\",\"#naughtynuts\",\"#abspecken\",\"#kaloriendefizit\",\"#weilsumdichgeht\",\"#glutenfrei\",\"#korolicious\",\"#blogger_de\",\"#instagood\",\"#foodgram\",\"#ern\\u00e4hrungsumstellung\",\"#ausmeinerk\\u00fcche\",\"#ohnezucker\",\"#instafood\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(620, 36, 3089223526414347011, NULL, 'CrfIG4LtOsD', 110, 378, 0, 0, 0, 0, 0, 0, '9.37', 'Panna Cotta Cheesecake Snack 🌱 Vegan Werbung\n\nDieser Cheesecake to go kommt im Panna Cotta Style und schmeckt so herrlich erbeerig-fruchtig! 😍 Und er ist super easy gemacht, lässt sich mitnehmen oder einfach als Snack zwischendurch löffeln 🫶\n\n275 kcal | 17 g P | 31 g K | 9 g F\n\nZutaten:\n200 g Soja-Quarkalternative (\"Skyr\") Vanille\n10 g Speisestärke \n10 g entöltes Mandelmehl @koro_de ‼️5 %-Code: GINGER\n\n170°C Umluft, ca. 15-20 Min.\n\nToppings:\n40 g pürierte Erdbeeren\n5 g Speisestärke \n5 g gehobelte Mandeln @koro_de\n\n》Die Cheesecake-Masse anrühren und in ein ofenfestes Förmchen füllen. Durchbacken, abkühlen lassen. Erdbeeren pürieren, mit etwas Stärke kurz aufkochen und auf den Cheesecake geben. Abkühlen lassen, mit Mandelblättchen garnieren und genießen.\n\n#kaloriendefizit #eatingwithoutcheating #käsekuchen #vegancheesecake #korodrogerie #cheesecake #kuchentogo #veganbacken #frühstücksideen #gesundesfrühstück #schnellerezepte #gesundnaschen #breakfast #gesundabnehmen #naschenohnereue #gesunderezepte #mealprep #frühstücksideen #gesundeernährung #foodblogger_de #healthyfood #foodie #glutenfrei #frühstücken #vegan #frühstücksliebe #lecker #food #foodblogger #yummy', 1682484163, '[]', 'IMAGE', 'images/content/posts/343281410_623088579673354_5916949740139594642_n.webp', NULL, NULL, 'https://instagram.com/p/CrfIG4LtOsD', 0, 0, '[\"#eatingwithoutcheating\",\"#k\\u00e4sekuchen\",\"#vegancheesecake\",\"#korodrogerie\",\"#cheesecake\",\"#kuchentogo\",\"#veganbacken\",\"#fr\\u00fchst\\u00fccksideen\",\"#gesundesfr\\u00fchst\\u00fcck\",\"#schnellerezepte\",\"#gesundnaschen\",\"#breakfast\",\"#gesundabnehmen\",\"#naschenohnereue\",\"#gesunderezepte\",\"#mealprep\",\"#fr\\u00fchst\\u00fccksideen\",\"#gesundeern\\u00e4hrung\",\"#foodblogger_de\",\"#healthyfood\",\"#foodie\",\"#glutenfrei\",\"#fr\\u00fchst\\u00fccken\",\"#vegan\",\"#fr\\u00fchst\\u00fccksliebe\",\"#lecker\",\"#food\",\"#foodblogger\",\"#yummy\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(621, 36, 3088505166852676629, NULL, 'CrckxXtNlwV', 118, 341, 0, 0, 0, 0, 0, 0, '8.81', 'Blutorangen-Grießbrei 🌱 Vegan Werbung\n\nIch finde Blutorangen so, so lecker! 😍 Außerdem sehen sie einfach nur total schön aus, oder? Bei diesem leckeren Frühstück verstecken sie sich im Grießbrei und auch oben drauf. Dazu noch ein paar passende Toppings... so lecker. Wenn du es glutenfrei magst, nimm einfach 2-Minuten-Polenta anstatt Dinkelgrieß 🫶\n\n590 kcal | 32 g P | 79 g K | 16 g F\n\nZutaten:\n70 g Dinkelgrieß (oder glutenfreie Polenta) @koro_de ‼️5 % auf alles: GINGER\n30 g entöltes Mandelmehl @koro_de\n25 g Erythrit mit Stevia @koro_de\n100 g pürierte Blutorange\n300 ml Wasser\n\nToppings:\n50 g Blutorange\n5 g Quinoa-Pops @koro_de\n5 g Kakaonibs @koro_de\n15 g Erdnussmus Smooth @naughtynuts ‼️10% mit: 10GINGER\n2 hafer-Cookies Haselnuss-Kakao @naughtynuts ‼️10%-Code: 10GINGER\n\n》Koche das Wasser auf und gib alle Zutaten für den Brei dazu. Kurz zusammen aufkochen lassen, dann vom Herd nehmen und quellen lassen. Pürierte Blutorange unterrühren, Brei in eine Schale füllen. Mit dem Toppings garnieren.\n\n#gesundesfrühstück #proteinreich #semolinapudding #grießbrei #zuckerfrei #veganfrühstücken #veganerezepte #frühstücksideen #veganwerdenwaslosdigga #ohnezucker #vegandeutschland #abnehmenkannsoleckersein #ernährungsumstellung #gesundabnehmen #fitundgesund #gesundzunehmen #abnehmenohneverzicht #veganundeinfach #proteinrezepte #naschenohnereue #einfachvegan #fitfam #gesunderezepte #gesundnaschen #schnellerezepte #korodrogerie #fitfood #foodblogger_de #ohnezucker #naughtynuts', 1682398528, '[]', 'IMAGE', 'images/content/posts/342763609_3326111537654224_5026444028409048806_n.webp', NULL, NULL, 'https://instagram.com/p/CrckxXtNlwV', 0, 0, '[\"#proteinreich\",\"#semolinapudding\",\"#grie\\u00dfbrei\",\"#zuckerfrei\",\"#veganfr\\u00fchst\\u00fccken\",\"#veganerezepte\",\"#fr\\u00fchst\\u00fccksideen\",\"#veganwerdenwaslosdigga\",\"#ohnezucker\",\"#vegandeutschland\",\"#abnehmenkannsoleckersein\",\"#ern\\u00e4hrungsumstellung\",\"#gesundabnehmen\",\"#fitundgesund\",\"#gesundzunehmen\",\"#abnehmenohneverzicht\",\"#veganundeinfach\",\"#proteinrezepte\",\"#naschenohnereue\",\"#einfachvegan\",\"#fitfam\",\"#gesunderezepte\",\"#gesundnaschen\",\"#schnellerezepte\",\"#korodrogerie\",\"#fitfood\",\"#foodblogger_de\",\"#ohnezucker\",\"#naughtynuts\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(622, 36, 3086331522281967076, NULL, 'CrU2irctQ3k', 105, 405, 0, 0, 0, 0, 0, 0, '9.79', 'Apfel-Zitronenkuchen mit Blueberry Bash 🌱 Vegan Werbung\n\nHast Du schon einmal Apfel und Zitrone mit Blaubeer kombiniert? 🍎 🍋 Ich kann dir sagen: schmeckt so gut! Habe als Grundrezept wieder meinen Polenta-Mandelkuchen verwendet, ein bisschen Zitronensaft und Äpfel rein ...Träumchen! 😍👍\n\nKuchen + Toppings = 549 kcal | 28 g P | 51 g K | 15 g F\n\nZutaten (Ø12cm):\n70 g 2-Minuten-Polenta\n30 g entöltes Mandelmehl @koro_de ‼️5 % auf alles: GINGER\n25 g Erythrit mit Stevia @koro_de\n4 g Backpulver\n70 g Zitronensaft\n100 g Sojajoghurt Natur ungesüßt\n100 ml Wasser\n50 g Apfelstückchen\n\n170°C Umluft, ca. 30 Min. ohne Vorheizen\n\nToppings:\n15 g Mandelmus Blueberry Bash @naughtynuts ‼️10% mit: 10GINGER\n\nEasy peasy: Zitrone pressen. Bis auf die Apfelstückchen alle Zutaten für den Teig miteinander vermengen. Teig in eine kleine Kuchenform füllen und die Apfelstückchen in den Teig drücken. Im Ofen backen, abkühlen lassen und aus der Form lösen. Mit Nussmus garnieren.\n\n#kuchen #gesundesfrühstück #zuckerfrei #lemoncake #instafood #vegan #vegandeutschland #veganerezepte #abnehmrezepte #applecake #korodrogerie #glutenfree #naughtynuts #fitfood #esstmehrkuchen #gesundzunehmen #foodie #instagood #fitfam #zitronenkuchen #gesundbacken #gesundabnehmen #foodgram #proteinrezepte #gesundessen #schokolade #foodfotografie #gesundundlecker #glutenfrei #foodblogger_de', 1682139409, '[]', 'IMAGE', 'images/content/posts/342361600_617842276901552_6702822057045244254_n.webp', NULL, NULL, 'https://instagram.com/p/CrU2irctQ3k', 0, 0, '[\"#gesundesfr\\u00fchst\\u00fcck\",\"#zuckerfrei\",\"#lemoncake\",\"#instafood\",\"#vegan\",\"#vegandeutschland\",\"#veganerezepte\",\"#abnehmrezepte\",\"#applecake\",\"#korodrogerie\",\"#glutenfree\",\"#naughtynuts\",\"#fitfood\",\"#esstmehrkuchen\",\"#gesundzunehmen\",\"#foodie\",\"#instagood\",\"#fitfam\",\"#zitronenkuchen\",\"#gesundbacken\",\"#gesundabnehmen\",\"#foodgram\",\"#proteinrezepte\",\"#gesundessen\",\"#schokolade\",\"#foodfotografie\",\"#gesundundlecker\",\"#glutenfrei\",\"#foodblogger_de\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(623, 36, 3084886748601776189, NULL, 'CrPuCdGt_g9', 110, 349, 0, 0, 0, 0, 0, 0, '8.81', 'Pancakes mit Kaffee-Joghurt und Beeren 🌱 Vegan Werbung\n\nHast du schonmal Beeren mit Kaffee kombiniert? 🤔 Schmeckt wirklich gut, kann ich definitiv weiterempfehlen. Bei mir landete diese leckere Mischung auf fluffigen, veganen Pancakes, außerdem habe ich das ganze noch mit dem himmlischen Haselnussmus Espresso Roast und ein paar Schokofrüchten getoppt. Frühstücks-Traum! 😍\n\nPancakes + Toppings = 536 kcal | 28 g P | 70 g K | 13 g F\n\nZutaten:\n70 g Buchweizenmehl \n (alternativ: Vollkorn-Dinkelmehl)\n30 g teilentöltes Erdnussmehl @koro_de ‼️5 %-Code: GINGER\n20 g Erythrit mit Stevia @koro_de\n30 g Sojajoghurt Natur ungesüßt\n150 ml Pflanzendrink/Wasser\n\nKaffee-Joghurt:\n50 g Sojajoghurt Natur ungesüßt\n1 TL Instant-Kaffeepulver\netwas Erythrit/Dattelsirup @koro_de\n\nToppings:\n100 g TK-Beeren\n10 g Haselnussmus Espresso Roast @naughtynuts ‼️10%-Code: 10GINGER\n10 g Beeren in Zartbitterschokolade\n\nGeht super easy: Teig anmischen, in einer beschichteten Pfanne ein paar Pancakes daraus backen und auf einem Teller anrichten. Den Kaffee-Joghurt anmixen, in die Mitte der Pancakes geben und darauf die Beeren platzieren. Nussmus und Früchte verteilen, genießen, glücklich sein!\n\n#abnehmen #gesunderezepte #gesundessen #proteinreich #gesundnaschen #cleaneating #healthyfoods #korodrogerie #gesundabnehmen #veganpancakes #pancakes #fitfam #fitnessfood #frühstück #abnehmtagebuch #leckeressen #frühstück #naughtynuts #abspecken #kaloriendefizit #weilsumdichgeht #glutenfrei #korolicious #blogger_de #instagood #foodgram #ernährungsumstellung #ausmeinerküche #ohnezucker #instafood', 1681967179, '[]', 'IMAGE', 'images/content/posts/342184574_1178426576189635_300437156877954555_n.webp', NULL, NULL, 'https://instagram.com/p/CrPuCdGt_g9', 0, 0, '[\"#gesunderezepte\",\"#gesundessen\",\"#proteinreich\",\"#gesundnaschen\",\"#cleaneating\",\"#healthyfoods\",\"#korodrogerie\",\"#gesundabnehmen\",\"#veganpancakes\",\"#pancakes\",\"#fitfam\",\"#fitnessfood\",\"#fr\\u00fchst\\u00fcck\",\"#abnehmtagebuch\",\"#leckeressen\",\"#fr\\u00fchst\\u00fcck\",\"#naughtynuts\",\"#abspecken\",\"#kaloriendefizit\",\"#weilsumdichgeht\",\"#glutenfrei\",\"#korolicious\",\"#blogger_de\",\"#instagood\",\"#foodgram\",\"#ern\\u00e4hrungsumstellung\",\"#ausmeinerk\\u00fcche\",\"#ohnezucker\",\"#instafood\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(624, 36, 3084153555959318376, NULL, 'CrNHVGPtodo', 119, 485, 0, 0, 0, 0, 0, 0, '11.6', 'Schoko-Karamell-Cheesecake 🌱 Vegan Werbung\n\nEs ist #käsekuchenmittwoch 🙂 und hier kommt ein schokoladiger Karamelltraum. Der war einfach so, so gut! Mach es Dir hübsch und hab einen schönen Start in den Tag.\n\nKuchen + Toppings = 516 kcal | 34 g P | 41 g K | 19 g F\n\nZutaten für den Boden (⌀ 12cm):\n20 g gemahlene Haferflocken @koro_de ‼️5%-Code: GINGER\n (alternativ: Dinkelmehl, Buchweizenmehl)\n20 g stark entöltes Kakaopulver @koro_de\n40 ml Pflanzendrink \n5 g Erythrit mit Stevia @koro_de\n\nZutaten Cheesecake-Masse:\n200 g Soja-Quarkalternative Natur,\n100 g Sojajoghurt Natur ungesüßt \n15 g Erythrit mit Stevia @koro_de\n20 g Karamell-Puddingpulver \n10 g entöltes Mandelmehl @koro_de\n\n170°C Umluft, ca. 30 Min. ohne Vorheizen\n\nSchokocreme:\n10 g Cashewmus Choco Dream @naughtynuts ‼️10%-Code: 10GINGER\n20 ml Pflanzendrink \n5 g stark entöltes Kakaopulver @koro_de\n5 g Erythrit mit Stevia @koro_de\netwas Wasser \n\n》Vermenge die gemahlenen Haferflocken mit dem Kakao und dem Joghurt zu einer Masse und drücke den Teig in die Kuchenform. Ist er zu klebrig, feuchte einen Löffel an und verstreiche ihn damit. Gib die Quarkmasse darüber. Im Ofen gut durchbacken, (über Nacht) abkühlen lassen und am nächsten Morgen aus der Form nehmen. Schokocreme anrühren und damit verzieren.\n\n#frühstück #cheesecake #käsekuchenvegan #käsekuchen #cheesecakelovers #veganbacken #veganerezepte #glutenfrei #gesundbacken #naughtynuts #vegandeutschland #frühstücksideen #ernährungsumstellung #gesundabnehmen #fitundgesund #gesundzunehmen #abnehmenohneverzicht #fitfood #breakfast #chocolate #einfachvegan #gesunderezepte #gesundnaschen #schnellerezepte #korodrogerie #esstmehrkuchen #foodblogger_de #proteinrezepte #korolicious', 1681879775, '[]', 'IMAGE', 'images/content/posts/341782980_5817659058363610_5188090537670004098_n.webp', NULL, NULL, 'https://instagram.com/p/CrNHVGPtodo', 0, 0, '[\"#k\\u00e4sekuchenmittwoch\",\"#cheesecake\",\"#k\\u00e4sekuchenvegan\",\"#k\\u00e4sekuchen\",\"#cheesecakelovers\",\"#veganbacken\",\"#veganerezepte\",\"#glutenfrei\",\"#gesundbacken\",\"#naughtynuts\",\"#vegandeutschland\",\"#fr\\u00fchst\\u00fccksideen\",\"#ern\\u00e4hrungsumstellung\",\"#gesundabnehmen\",\"#fitundgesund\",\"#gesundzunehmen\",\"#abnehmenohneverzicht\",\"#fitfood\",\"#breakfast\",\"#chocolate\",\"#einfachvegan\",\"#gesunderezepte\",\"#gesundnaschen\",\"#schnellerezepte\",\"#korodrogerie\",\"#esstmehrkuchen\",\"#foodblogger_de\",\"#proteinrezepte\",\"#korolicious\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(625, 36, 3083436591255203011, NULL, 'CrKkT41NSzD', 110, 363, 0, 0, 0, 0, 0, 0, '9.08', 'Pflaume-Zimt Energy Balls mit Nougatkern 🌱 Vegan Werbung\n\nGefüllte Energy Balls müssen nicht teuer sein: Einfach selber machen! 😅 Diese Variante ist ohne Datteln, stattdessen mit Soft-Pflaumen. Als Füllung habe ich das Cashewmus Choco Dream von Naughty Nuts verwendet, sooo lecker und schnell gemacht 🙂❤️\n\nEins hat 114 kcal | 3 g P | 20 g K | 2 g F\n\nZutaten für 5 Stk.:\n100 g pürierte Soft-Pflaumen\n25 g gemahlene (glutenfreie) Haferflocken @koro_de ‼️5 %-Code: GINGER\n25 g zarte (glutenfreie) Haferflocken @koro_de\netwas Ceylon Zimt @koro_de\n\nFüllung:\n20-25 g Cashewmus Choco Dream @naughtynuts ‼️10%-Code: 10GINGER\n\n》Püriere die Soft-Pflaumen, mahle die Hälfte der Haferflocken und vermenge alle Zutaten zu einem knetbaren Teig. Forme daraus fünf (oder mehr) Bällchen, drücke in die Mitte ein Loch und fülle es mit Nussmus. Schließe die Bällchen nun, rolle sie rund und iss sie am besten gleich auf. Sie halten sich aber natürlich auch ein paar Tage.\n\n#energyballs #healthyfood #glutenfree #gesundnaschen #korodrogerie #vegandeutschland #vegangermany #plantbased #healthysnacks #kaloriendefizit #eatingwithoutcheating #energiebällchen #naughtynuts #einfacherezepte #schnellerezepte #veganbacken #deutschlandistvegan #veganfood #nobake #gesundzunehmen #gesundabnehmen #ernährungsumstellung #snackideas #korolicious #veganwerdenwaslosdigga #naschenerlaubt #gesundesnacks #glutenfrei #zuckerfrei #veganlifestyle', 1681794307, '[]', 'IMAGE', 'images/content/posts/341333268_3499493636936664_5142968694338926961_n.webp', NULL, NULL, 'https://instagram.com/p/CrKkT41NSzD', 0, 0, '[\"#healthyfood\",\"#glutenfree\",\"#gesundnaschen\",\"#korodrogerie\",\"#vegandeutschland\",\"#vegangermany\",\"#plantbased\",\"#healthysnacks\",\"#kaloriendefizit\",\"#eatingwithoutcheating\",\"#energieb\\u00e4llchen\",\"#naughtynuts\",\"#einfacherezepte\",\"#schnellerezepte\",\"#veganbacken\",\"#deutschlandistvegan\",\"#veganfood\",\"#nobake\",\"#gesundzunehmen\",\"#gesundabnehmen\",\"#ern\\u00e4hrungsumstellung\",\"#snackideas\",\"#korolicious\",\"#veganwerdenwaslosdigga\",\"#naschenerlaubt\",\"#gesundesnacks\",\"#glutenfrei\",\"#zuckerfrei\",\"#veganlifestyle\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
(626, 36, 3081269732020041428, NULL, 'CrC3n76N7bU', 118, 405, 0, 0, 0, 0, 0, 0, '10.04', 'Ananaskuchen mit M*lka-Glasur 🌱 Vegan Werbung\n\nIch wollte schon ewig mal was mit Ananas machen und tatdaa: here it is! 😍 Als Topping habe ich das Cashewmus Choco Dream mit etwas Pflanzendrink vermischt, das schmeckt dann halt einfach wie geschmolzene Milchschokolade, ist aber vegan und natürlich auch viel gesünder. Perfekter Kuchen zum Frühstück! ❤️\n\nKuchen + Toppings = 586 kcal | 33 g P | 70 g K | 16 g F\n\nZutaten (Ø12cm):\n60 g Buchweizenmehl\n40 g teilentöltes Erdnussmehl @koro_de ‼️5 % auf alles: GINGER\n4 g Backpulver\n100 g Sojajoghurt Natur ungesüßt\n50 ml Ananassaft\n50 ml Wasser\n20 g Erythrit mit Stevia @koro_de\n60 g Ananasstückchen\n\n170°C Umluft, ca. 30 Min. ohne Vorheizen\n\nM*lka-Glasur:\n20 g Cashewmus Choco Dream @naughtynuts ‼️10% mit: 10GINGER\n20 ml Pflanzendrink\n\n》Einfach alle Zutaten miteinander vermengen und in eine kleine Kuchenform füllen. Im Ofen backen, abkühlen lassen und aus der Form lösen. Die Glasur anrühren und verteilen – genießen!\n\n#frühstück #frühstückskuchen #esstmehrkuchen #gesundundlecker #gesunderkuchen #gesundbacken #veganbacken#vegandeutschland #veganerezepte #glutenfrei #glutenfreierezepte #zuckerfrei #ohnezuckerzusatz #proteinrezepte #fitfood #abnehmrezepte #gesundzunehmen #ernährungsumstellung #veganundlecker #abnehmenkannsoleckersein #foodfotografie #foodblogger_de #fitfood #korodrogerie #korolicous #naughtynuts #veganwerdenwaslosdigga #pflanzlichstark #gesundabnehmen #breakfast', 1681535997, '[]', 'IMAGE', 'images/content/posts/327060629_757299779389785_800380290452014241_n.webp', NULL, NULL, 'https://instagram.com/p/CrC3n76N7bU', 0, 0, '[\"#fr\\u00fchst\\u00fcckskuchen\",\"#esstmehrkuchen\",\"#gesundundlecker\",\"#gesunderkuchen\",\"#gesundbacken\",\"#veganbacken#vegandeutschland\",\"#veganerezepte\",\"#glutenfrei\",\"#glutenfreierezepte\",\"#zuckerfrei\",\"#ohnezuckerzusatz\",\"#proteinrezepte\",\"#fitfood\",\"#abnehmrezepte\",\"#gesundzunehmen\",\"#ern\\u00e4hrungsumstellung\",\"#veganundlecker\",\"#abnehmenkannsoleckersein\",\"#foodfotografie\",\"#foodblogger_de\",\"#fitfood\",\"#korodrogerie\",\"#korolicous\",\"#naughtynuts\",\"#veganwerdenwaslosdigga\",\"#pflanzlichstark\",\"#gesundabnehmen\",\"#breakfast\"]', 'post', 'profile_scrape', 0, 1683024400, 1683024400),
