(673, 39, 2884977669554341983, NULL, 'CgJf-e6uIhf', 15, 474, 0, 0, 0, 0, 0, 0, '1.23', '*WERBUNG* 🍕🌿\n \nHallo Ihr Lieben, heute habe ich noch eine Variante von @BEETGOLD PIZZA für euch\nKöstlicher Lower Carb, glutenfreie & ballaststoffreich Pizza! Ich bin begeistert! Die Vollgemüse Pizzaboden, sich so einfach in deinen Ernährungsalltag zu integrieren, sind voll lecker und gut für dich und die Umwelt! 🍀 \nDie gesamte Rohstoffe kommen aus dem Beet! Die Produkte bestehen aus Gemüsetrester & sind voller Ballaststoffe, Mineralstoffe und Vitamine. Je nach Sorte verwenden werden Karotten- oder Rote-Beete-Trester. Ich finde es großartig, was sagst Du dazu? 💚\n \n🛒 Zutaten:\n1 x VOLLGEMÜSE Pizzaboden von BEETGOLD \nFür die Sauce\n1 Dose geschälte Tomaten \n1 Zehe Knoblauch\n1 Zwiebel\n2 TL Tomatenmark\n1 EL Olivenöl \nSalz & Pfeffer\nPrise Zucker\nGetrocknete Oregano\nDann für Pizzabelag:\n100 g Kochschinken\n1 gelber Paprika klein geschnitten\nPaar Oliven \nGeriebene Mozzarella\nAls Topping: frische Rucola \n👩‍🍳 Tomatensauce selbstgemacht:\nOlivenöl erhitzen, die gehackte Zwiebel und die ebenfalls gehackten Knoblauchzehen darin 5 Minuten dünsten.\nTomaten, Tomatenmark, Zucker, Oregano zufügen. Mit Salz und Pfeffer würzen.\nDie Sauce einmal aufkochen. Dann abdecken und bei schwacher Hitze mindestens eine Stunde köcheln. Zwischendurch umrühren.\nVollständig abkühlen lassen. Die Sauce ist in einem luftdichten Gefäß 1 Woche im Kühlschrank haltbar.\n \nDen Ofen auf 180 °C Umluft vorheizen.\nDen VOLLGEMÜSE Pizzaboden auf ein mit Backpapier ausgelegtes Backblech legen mit der Tomatensauce bestreichen, mit Schinken, Oliven, Paprika & Käse belegen. \nDie Pizza ca. 15-18 Minuten backen, bis der Käse geschmolzen ist.\nSobald die Pizza fertig gebacken ist mit dem frischen Rucola servieren. 😋 \nGuten Appetit! 💚\n\n#beetgold #vollgemüse #pizza #pizzaboden #schnellgekocht #gesundessen #gesunderezepte #gesundundlecker #nachhaltigleben #gemüseliebe #resteverwertung #gemüse #karotten #rotebeete #bio #veganfoods #lowcarb #leckerschmecker #foodschau #goodbrands #beetgoldvollgemüse #goodfood #lecker #foodporn #leckerschmecker', 1658136160, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/294210079_105816852149964_7616546720224175905_n.jpg', NULL, NULL, 'https://instagram.com/p/CgJf-e6uIhf', 0, 0, '[\"#vollgem\\u00fcse\",\"#pizza\",\"#pizzaboden\",\"#schnellgekocht\",\"#gesundessen\",\"#gesunderezepte\",\"#gesundundlecker\",\"#nachhaltigleben\",\"#gem\\u00fcseliebe\",\"#resteverwertung\",\"#gem\\u00fcse\",\"#karotten\",\"#rotebeete\",\"#bio\",\"#veganfoods\",\"#lowcarb\",\"#leckerschmecker\",\"#foodschau\",\"#goodbrands\",\"#beetgoldvollgem\\u00fcse\",\"#goodfood\",\"#lecker\",\"#foodporn\",\"#leckerschmecker\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(674, 39, 2877192660477996897, NULL, 'Cft13sOJu9h', 8, 1162, 509, 0, 0, 0, 0, 0, '2.94', 'Leckere Gnocchi mit Brokkoli und Katenschinkenwürfel in einer cremigen Käse-Soße. 🥦🧀\nZUTATEN\n🔸 140 g Gnocchi aus dem Kühlregal\n🔸 200 g Brokkoli frisch oder TK\n🔸 2 EL Reibekäse \n🔸 120 ml Cremefine \n🔸 125 g magere Katenschinkenwürfel oder Bacon\n🔸 1 Frühlingszwiebel\n🔸 1 TL Öl\n🔸 Salz & Pfeffer\n👩‍🍳 Zubereitung:\nDie Gnocchi und die Katenschinkenwürfel in Öl anbraten, aus der Pfanne nehmen und beiseitestellen.\nBrokkoli klein zupfen und in der Pfanne mit 50 ml Wasser 3-4 Minuten garen, bis dass Wasser verdunstet ist.\nNun alle weiteren Zutaten in die Pfanne geben, kurz köcheln lassen, mit Salz und Pfeffer abschmecken und genießen. 🧡\n#gnocchi #creamy #cheese #cooking #homemade #foodlover #lunch #dinner #recipe #lecker #kochrezepte #gnocchi #foodstagram #foodpics #foodgram #foodlovers #fooddiary #yum #eatfamous #feedyoursoull #foodgasm #foodoftheday #macandcheese #macncheese #cheeselove #cheeselovers #leckerschmeccker #mrsmarzena', 1657208194, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/292122635_163414159535378_9039994935452877812_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/292848828_457393932883217_4765131309938095967_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=AgRk7V5MhUQAX_mZi6J&edm=AOQ1c0wBAAAA&vs=434109675285417_2547392220&_nc_vs=HBkcFQAYJEdMeUVkQkVSVmVSUy01OEJBRl8zOC15dEpTRkNidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJvD%2BxPiVquE%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0edd1f5b&ccb=7-5&oh=00_AfCvEsyDZ98-7WO8I4Z8kHA_uqWU1BiJMkSLZa8qXlb5uQ&oe=645262D2&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cft13sOJu9h', 0, 0, '[\"#creamy\",\"#cheese\",