(675, 39, 2872838550174081629, NULL, 'CfeX3DALKJd', 5, 1212, 467, 0, 0, 0, 0, 0, '3.05', 'Hähnchenbrust mit Knoblauch-Sahne-Sauce und knusprig gebratenen Speck - leckeres Keto Gericht 😋\nZUTATEN:\n🥓 4 Scheiben Speck\n🥓 600 g Hähnchenbrust, klein schneiden \n🥓 1 kleine rote Zwiebel, gehackt\n🥓 250 g Champignons, geschnitten\n🥓 2 Knoblauchzehen, gehackt\n🥓 1 kleiner Bund Thymian\n🥓 1 Chili\n🥓 Salz, frisch gemahlener schwarzer Pfeffer\n🥓 180 ml Hühnerbrühe\n🥓 160 ml Schlagsahne\n🥓 80 g frisch geriebener Parmesan\n🥓 Saft von 1/2 Zitrone\n🥓 Öl\n\n🔸 Speck in einer großen Pfanne bei mittlerer Hitze ca. 8 Minuten knusprig braten. Die Scheiben auf einem mit Küchenpapier ausgelegten Teller abtropfen lassen und etwa 2 Esslöffel Fett in der Pfanne aufbewahren. \n🔸 Hähnchen rundherum mit Salz und Pfeffer würzen. Die Hitze auf mittelhoch erhöhen und gebe das Hähnchen in die Pfanne. Etwa 5 Minuten goldbraun backen, dann umdrehen und auf der zweiten Seite weitere etwa 5 Minuten backen, bis sie angebraten sind. Hähnchen aus der Pfanne nehmen und beiseitestellen. \n🔸 Füge die Zwiebel hinzu und brate, bis sie beginnt, weich zu werden, etwa 5 Minuten. Champignons unterrühren und mit Salz und Pfeffer würzen. \n🔸 Brate unter häufigem Rühren, bis sie goldbraun sind, etwa 5 Minuten. Knoblauch einrühren, dann Hühnerbrühe, Sahne, Parmesan, Thymian und Zitronensaft hinzufügen. Die Mischung zum Köcheln bringen und 5 Minuten kochen lassen. \n🔸 Das Hähnchen wieder in die Pfanne geben und köcheln lassen, bis das Hähnchen gar ist und die Sauce leicht eingedickt ist, etwa 10 Minuten. \n🔸 Speck hacken und vor dem Servieren über das Hähnchen streuen. \nGuten Appetit 🧡\nErnährung (pro Portion): 633 Kalorien, 33 g Protein, 8 g Kohlenhydrate, 1 g Ballaststoffe, 3 g Zucker, 52 g Fett, 22 g gesättigte Fettsäuren, 534 mg Natrium\n\n#hähnchenbrust #hähnchen #hähnchenbrustfilet #chicken #food #foodporn #foodblogger \n#hühnchen #hähnchenbrust #hähnchenbrustfilet #abnehmen #abnehmrezepte #healthyeating #chickenrecipes #chickenbreast #pfannengericht #foodporn #yummyfood #leckeressen #leckerschmecker #yummi #delicious #foodlover #keto #ketofood #mrsmarzena', 1656689079, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/291682665_423864799625799_7542094616409572470_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/290191528_738840614031924_2409940516474509205_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=vzoz1EzscCIAX-oXMCx&edm=AOQ1c0wBAAAA&vs=1208546483212771_1639301491&_nc_vs=HBkcFQAYJEdLajRTeEUwVWxpOF9KOENBSlhYU0o0aDFIRWhidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJprhzqC%2B9bk%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0ed9725d&ccb=7-5&oh=00_AfDjYxI_-SK-sPv3Y23os1xWqnCIoNBxsj6GaW8ivSIb9g&oe=6452676B&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfeX3DALKJd', 0, 0, '[\"#h\\u00e4hnchen\",\"#h\\u00e4hnchenbrustfilet\",\"#chicken\",\"#food\",\"#foodporn\",\"#foodblogger\",\"#h\\u00fchnchen\",\"#h\\u00e4hnchenbrust\",\"#h\\u00e4hnchenbrustfilet\",\"#abnehmen\",\"#abnehmrezepte\",\"#healthyeating\",\"#chickenrecipes\",\"#chickenbreast\",\"#pfannengericht\",\"#foodporn\",\"#yummyfood\",\"#leckeressen\",\"#leckerschmecker\",\"#yummi\",\"#delicious\",\"#foodlover\",\"#keto\",\"#ketofood\",\"#mrsmarzena\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(676, 39, 2869929179181499201, NULL, 'CfUCWIHpENB', 20, 1287, 427, 0, 0, 0, 0, 0, '3.28', 'Marillenkuchen – ein Superflaumiger und lockere Obstkuchen 🥧🍑🧡\n\nZutaten: \n🍑 6 Eier\n🍑 300 g Staubzucker\n🍑 1 Prise Salz\n🍑 1 P. Vanillezucker\n🍑 Abgeriebene Schale v. 1 Zitrone\n🍑 1 Prise Zimt\n🍑 170 ml Öl \n🍑 280 g Mehl\n🍑 1 P. Backpulver\n🍑 2 EL Rum\n🍑 Belag: ca. 15 Marillen.\n\nZubereitung: \n🔸Backblech (ca. 30 x 40 cm) mit Öl ausstreichen und mit Mehl einstauben (oder Backpapier verwenden). \n🔸Backofen auf 160° C (Ober- und Unterhitze) vorheizen. \n🔸Marillen halbieren und Kerne entfernen.\n🔸Mehl und Backpulver vermischen. Eier, Salz, Vanillezucker, abgeriebene Zitronenschale, Zimt und ¾ vom Staubzucker gut schaumig (mind. 10 Min.) schlagen. \n🔸Öl langsam unter ständigem Rühren einlaufen lassen, Mehlmischung mit restlichem Staubzucker vermischen, vorsichtig unterheben und zum Schluss den Rum zugeben.\n🔸Masse auf das Backblech aufstreichen und mit Marillenhälften belegen (halbierte Seite nach oben). Auf unterer Schiene ca. 35 Min. backen.\n \nEin sehr feiner, lockerer Kuchen! 🧡\nLass euch schmecken! 😋\n\n#marillenkuchen #marillen #blechkuchen #kuchenliebe #kuchenrezept #backenistliebe #backenmachtglücklich #backen #leckerschmecker #saisonaleküche #foodblogger #mehlspeise #foodblogfeed #ausmeinerküche #backenfürdiefamilie #rezeptefürjedentag #lieblingskuchen #selbstgebacken #foodartblog #foodblogger #foodphotography #essenmachtglücklich #sommerküche #österreichischeküche', 1656342289, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/290451457_154112690526238_6688327435838231636_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/290377120_602586087735853_5037994322717106330_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=f-5HvenkQ7wAX_7VnS7&edm=AOQ1c0wBAAAA&vs=617190979395056_2831447153&_nc_vs=HBksFQAYJEdLRE5UaEV0d3JTQkRDUUNBSnJnLU9Fa2plcEZidlZCQUFBRhUAAsgBABUAGCRHRGVmU0JGeEFZdlgyWlFDQU1LNUdENmJHa0FTYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACakiL%2FRkpLmPxUCKAJDMywXQBgAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=8e0edca3fa&ccb=7-5&oh=00_AfCVxMKRbjbjTF8ayTfXMyZHF43FeS6jAl7FVzUOqSwZDw&oe=645281C5&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfUCWIHpENB', 0, 0, '[\"#marillen\",\"#blechkuchen\",\"#kuchenliebe\",\"#kuchenrezept\",\"#backenistliebe\",\"#backenmachtgl\\u00fccklich\",\"#backen\",\"#leckerschmecker\",\"#saisonalek\\u00fcche\",\"#foodblogger\",\"#mehlspeise\",\"#foodblogfeed\",\"#ausmeinerk\\u00fcche\",\"#backenf\\u00fcrdiefamilie\",\"#rezeptef\\u00fcrjedentag\",\"#lieblingskuchen\",\"#selbstgebacken\",\"#foodartblog\",\"#foodblogger\",\"#foodphotography\",\"#essenmachtgl\\u00fccklich\",\"#sommerk\\u00fcche\",\"#\\u00f6sterreichischek\\u00fcche\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(677, 39, 2867106750902270874, NULL, 'CfKAmY8p3ua', 20, 1455, 478, 0, 0, 0, 0, 0, '3.7', 'Hähnchenbrust mit Avocado-Karfiol-Püree 🐔🥑🥘 – leichtes Sommer Gericht mit viel Ballaststoffen. Er ist reich an Vitaminen und Mineralstoffen, u. a. enthält das Vitamin C, Vitamin K und E, Folsäure sowie Kalium, Kalzium und Magnesium. \nEinfach lecker, schnell gemacht und nur 310 kcal! 😍\n\n🛒 Zutaten für 4 Personen\n400 g Hähnchenbrust\n10 getrocknete Tomaten ohne Öl\n50 g Erbsen (TK)\n1 große Zwiebel\n0,5 Bund Petersilie\n400 g Karfiol (Blumenkohl) \n1 Avocado\n80 g Feta \n3 EL Olivenöl\n50 ml Milch\nSalz, Pfeffer \n50 ml Gemüsebrühe\nZubereitung:\nFleisch waschen, trocken tupfen und in kleine Stücke schneiden. Tomaten in heißem Wasser einweichen. Zwiebel schälen und fein würfeln. Feta würfeln. Petersilie waschen und in Streifen schneiden. Tomaten abtropfen lassen und klein schneiden.\nKarfiol in Röschen teilen bzw. schneiden, in kochendes Salzwasser geben und für ca. 10-15 Minuten, bei mittlerer Hitze kochen lassen. Avocado halbieren, Stein entfernen und das Fruchtfleisch auslöffeln.\n1 EL Öl in einer Pfanne erhitzen, Zwiebel darin anbraten, Tomaten zugeben, kurz mitbraten. Beides herausnehmen. Restliches Öl erhitzen, Hähnchenteile kräftig darin anbraten. Pro Seite ca. 3 Minuten knusprig bräunen.\nKarfiol abgießen, Milch zufügen und stampfen. Avocado unterheben und nur leicht stampfen. Mit Salz und Pfeffer abschmecken. Petersilie darauf streuen.\nTomaten und Zwiebeln wieder zu Hähnchen zugeben. Brühe angießen, Feta zugeben und in Pfanne mit Deckel noch 10 Minuten schmoren lassen, bis der Feta leicht anschmilzt. Hähnchen mit Püree und Soße anrichten.\nGuten Appetit 😋\n\n#karfiol #karfiolpüree #leckerschmecker #blumenkohl #coliflor #gesunderezepte #kochdichglücklich #blumenkohlstampf #avocado #frischkochenmachtglücklich #hähnchenbrust #eiweiß #kreativeskochen #gesundeernährung #gesunderezepte #ernährungstipps #wenigkalorien #kalorienarm #gesundeernährung #lowcarb #heißhunger', 1656005808, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/289816235_429831498997099_5465258958687898669_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/289599901_627066291666672_2931987703612470884_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=EWv29QiJILMAX-pFjb5&edm=AOQ1c0wBAAAA&vs=569539854565784_1526793966&_nc_vs=HBkcFQAYJEdKM3hRaEh3dnBBLVVEb0NBR1Iyb2pkSWc3QW9idlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJo7wo5L6pfE%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0ed4fe7c&ccb=7-5&oh=00_AfAgtSpbUAK7O4R5Jp0udoL1cmlmc0H_itBhVMMe8HVeDw&oe=6452D62C&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CfKAmY8p3ua', 0, 0, '[\"#karfiolp\\u00fcree\",\"#leckerschmecker\",\"#blumenkohl\",\"#coliflor\",\"#gesunderezepte\",\"#kochdichgl\\u00fccklich\",\"#blumenkohlstampf\",\"#avocado\",\"#frischkochenmachtgl\\u00fccklich\",\"#h\\u00e4hnchenbrust\",\"#eiwei\\u00df\",\"#kreativeskochen\",\"#gesundeern\\u00e4hrung\",\"#gesunderezepte\",\"#ern\\u00e4hrungstipps\",\"#wenigkalorien\",\"#kalorienarm\",\"#gesundeern\\u00e4hrung\",\"#lowcarb\",\"#hei\\u00dfhunger\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(678, 39, 2865463124816208218, NULL, 'CfEK4e3pqFa', 23, 1269, 574, 0, 0, 0, 0, 0, '3.24', 'Kohlrabisuppe – einfach, schnell und köstlich! 🌿🍈 \nEine perfekte Suppe für Berufstätige, wenn es am Abend schnell gehen soll. \nZUTATEN 4 Portionen\n💥 1 Zwiebel\n💥 1 Knoblauchzehe\n💥 2 Kohlrabi (ca. 600 g)\n💥 2 Kartoffel\n💥 2 EL Öl\n💥 800 ml Gemüsebrühe\n💥 100 g Creme a la Cuisine oder Crème fraîche\n💥 etwas frisch gemahlener Pfeffer und Salz nach Bedarf\n💥 Garnierung: Omega 3 Mix, Radieschen und Rote Rettich Kresse \n\n👩‍🍳 Zubereitung:\nKohlrabi, Kartoffeln, Zwiebel und Knoblauch schälen, in kleine Stücke schneiden und in einem Suppentopf in Öl 3 - 4 Minuten dünsten.\nMit Gemüsebrühe auffüllen und 20 - 25 Minuten köcheln lassen, bis die Gemüse weich sind.\nAnschließend die Creme a la Cuisine zufügen, die Suppe pürieren und abschmecken.\nAuf Teller verteilen, mit Topping servieren und sich schmecken lassen! 😋\nGuten Appetit 💚\n\n#kohlrabi #kohlrabipflanzen #kalarepa #kohlrabigemüse #kohlrabiliebe #foodinspo #suppe #rezeptideen #kohlrabisuppe #suppenkasper #gemüsesuppe #mrsmarzena #souprecipe #healingfood #wellnessfood #gesundeernährung #soulfood #leckerschmecker #mrsmarzena #unglaublichlecker #delicious #suppe', 1655809870, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/289276154_717486029466403_6600940870677190480_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/288931880_715351646400795_4072478161847799797_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=C7Qvw2vshMwAX8sIlLf&edm=AOQ1c0wBAAAA&vs=1198602314231029_1124404518&_nc_vs=HBkcFQAYJEdDakFPQkViOGNYSW00b0NBUFZQZWJCUFdZUTRidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJq6cqrWhy%2BU%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_n