(679, 39, 2859766715094919869, NULL, 'Cev7qz5t-q9', 20, 1577, 548, 0, 0, 0, 0, 0, '4.01', 'Einfacher Erdbeerkuchen – sehr fruchtig und flaumig! 🍓🍓🍓\nEin großartiges Rezept für Kochanfänger oder zum Backen mit Kinder. \n\n🛒 Zutaten:\n♦️ 1 Pk. Backpulver\n♦️ 250 g Butter (Zimmerwarm)\n♦️ 5 Eier\n♦️ 1 kg Erdbeeren\n♦️ 350 g Mehl\n♦️ 1 Pk. Vanillezucker\n♦️ 250 g Zucker\n♦️ Prise Salz\n\n👩‍🍳 Zubereitung\nDie Erdbeeren, waschen, verlesen und halbieren.\nDas Backrohr auf 200 Grad, Ober- und Unterhitze vorheizen und die Tortenform (Durchmesser 25cm) mit Backpapier auslegen (oder mit Butter einfetten).\n❗ TIPP ❗: Mache das Backpapier nass, dann brauchst du nie mehr zuschneiden oder einfetten. Das Papier ist einfach in jeder Form zu auslegen!\nAlle Zutaten in einer Schüssel mit dem Mixer zu einem glatten Teig rühren.\nDen Teig in die Tortenform geben, mit der Teigspachtel glattstreichen und mit den Erdbeerhälften dicht belegen. \nIm Backrohr etwa 30 Minuten backen.\nAnschließend die Torte aus dem Backofen nehmen, auskühlen lassen, mit etwas Staubzucker bestreuen und genießen. 😋❤️\nLasst euch schmecken! 😍🍓\n#kuchenbacken #kuchenliebe #backenmitkindern #backenmitliebe #erdbeerkuchen #erdbeerliebe #erdbeerkuchen🍓 #erdbeerliebe🍓 #kuchenliebe #kuchenbacken #backenmachtglücklich #strawberry #cake #cakelove #coffeetime #leckerschmecker #erdbeeren🍓 #erdbeerliebe🍓 #backenmachtglücklich #🍓🍓🍓 #delicious #mrsmarzena', 1655130967, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/287918339_425560536243827_4873450510714389410_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/285453892_174470101693611_8853094757737652581_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=Vly5Xma-sDgAX8Zhi_Z&edm=AOQ1c0wBAAAA&vs=422359496412763_1916946531&_nc_vs=HBksFQAYJEdFU3VBeEdyZEctOHJaNEFBR1ZoMDhYR2d0eDZidlZCQUFBRhUAAsgBABUAGCRHRUpwS1JHb2J4LXdHLUlKQU1oQV9XTHRXeWdwYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaA%2BvTDj5m5QBUCKAJDMywXQCYAAAAAAAAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=8e0ed8a6cd&ccb=7-5&oh=00_AfDdxMaKpOnzx4mcyll7FI5XxzB0WAC5LRDVIO4lk4ABdA&oe=64528743&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cev7qz5t-q9', 0, 0, '[\"#kuchenliebe\",\"#backenmitkindern\",\"#backenmitliebe\",\"#erdbeerkuchen\",\"#erdbeerliebe\",\"#erdbeerkuchen\\ud83c\\udf53\",\"#erdbeerliebe\\ud83c\\udf53\",\"#kuchenliebe\",\"#kuchenbacken\",\"#backenmachtgl\\u00fccklich\",\"#strawberry\",\"#cake\",\"#cakelove\",\"#coffeetime\",\"#leckerschmecker\",\"#erdbeeren\\ud83c\\udf53\",\"#erdbeerliebe\\ud83c\\udf53\",\"#backenmachtgl\\u00fccklich\",\"#\\ud83c\\udf53\\ud83c\\udf53\\ud83c\\udf53\",\"#delicious\",\"#mrsmarzena\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(680, 39, 2856670298831055508, NULL, 'Cek7oBiO-qU', 23, 1489, 620, 0, 0, 0, 0, 0, '3.79', 'One Pot Pasta mit grüner Spargel in Zitronensauce🍋💚 - super einfach, superschnell, vegan und unglaublich lecker! 😋\nZUTATEN\n500 g grüner Spargel\n1 Zwiebel, fein gehackt\n3 Knoblauchzehen, fein gehackt\n250 g Fusilli oder was Du willst 😇\n250 ml Dose Kokosmilch \n600 ml Gemüsebrühe\nSaft von einer Zitrone\n2 TL abgeriebene Zitronenschale\nSalz\nPfeffer\nChiliflocken\nÖl\n\nZubereitung: \nSpargel gut waschen, die holzigen Enden wegschneiden und in Stücke schneiden (ca. 5 cm lang).\nEtwas Öl in einer Pfanne erhitzen und den Spargel bei großer Hitze unter Rühren anbraten und zur Seite stellen.\nIn einem großen Topf etwas Öl erhitzen und die Zwiebel ungefähr 3 Minuten glasig anschwitzen. Dann den Knoblauch eine weitere Minute mit anbraten.\nDie ungekochten Nudeln, die Gemüsebrühe, die Kokosmilch und den Zitronensaft hinzufügen. 15-18 Minuten bei mittlerer Hitze kochen. Gelegentlich umrühren.\nDen Spargel und die abgeriebene Zitronenschale unterrühren und warm werden lassen. Mit Salz, Pfeffer und Chiliflocken abschmecken.\nLasst Euch schmecken 😍💚\n \n#spargel #spargelrezept #spargelzeit #grünerspargel #aspagarus #schnellerezepte #einfacherezepte #instafood #leckeressen #vegetarisch #vegan #yummy #foodblogger #einfachkochen #kochenmachtglücklich #foodie #spargelpasta #grünerspargelrezepte #grünerspargelpasta #food #foodporn #foodie #foodstagram #frühlingsküche #leichteküche #mrsmarzena', 1654761679, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/286414201_254451750232777_5458235807849592211_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/286262624_124980696878817_2897878309261847494_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=YAgWEjY8UU8AX-5aq8a&edm=AOQ1c0wBAAAA&vs=826810815352464_2959850706&_nc_vs=HBkcFQAYJEdHQUZFQkhoamdwV3EzRUFBTWFyM1BuM1ZEY29idlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJvipzNKLhJFAFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0ed66479&ccb=7-5&oh=00_AfDJ8U2FECWNuS_XyYGANXitHXOFVF7gFwAnFQg3unAsIg&oe=64524E34&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/Cek7oBiO-qU', 0, 0, '[\"#spargel\",\"#spargelrezept\",\"#spargelzeit\",\"#gr\\u00fcnerspargel\",\"#aspagarus\",\"#schnellerezepte\",\"#einfacherezepte\",\"#instafood\",\"#leckeressen\",\"#vegetarisch\",\"#vegan\",\"#yummy\",\"#foodblogger\",\"#einfachkochen\",\"#kochenmachtgl\\u00fccklich\",\"#foodie\",\"#spargelpasta\",\"#gr\\u00fcnerspargelrezepte\",\"#gr\\u00fcnerspargelpasta\",\"#food\",\"#foodporn\",\"#foodie\",\"#foodstagram\",\"#fr\\u00fchlingsk\\u00fcche\",\"#leichtek\\u00fcche\",\"#mrsmarzena\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(681, 39, 2839307902242939526, NULL, 'CdnP35pJmKG', 11, 1716, 559, 0, 0, 0, 0, 0, '4.33', 'Süßkartoffelsuppe mit Hähnchenbruststreifen 🍠🍅🐔– für alle, die gerne lecker und pikant mögen. 😍😋\nDie Süßkartoffeln gelten als besonders gesund. Sie enthalten viele Nähr- und Vitalstoffe, wie \nVitamin A, E und mehr Ballaststoffe als herkömmliche Kartoffeln, darum machen sie auch länger satt. \n🛒 Zutaten für 2 Personen:\n🔸 4 Süßkartoffeln (500 g)\n🔸 200 g Kirschtomaten \n🔸 2 Zwiebel\n🔸 2 Knoblauchzehe\n🔸 20 g Ingwer (gerieben)\n🔸 1 Chilischote\n🔸 500 ml Bio-Gemüsebrühe\n🔸 Salz, Pfeffer (nach Bedarf)\n🔸 250 g Hähnchenbrust\n🔸 2 TL Kokosöl\n🔸 2 Frühlingszwiebeln\n🔸 1 TL Kurkuma Pulver \n🔸 Omega 3 Mix Samen\n👩‍🍳 Zubereitung:\nDie Süßkartoffeln schälen und würfeln. 1/10 Gemüsesuppe in einem Suppentopf erhitzen und die Kirschtomaten, Zwiebel, Knoblauch, Chilischote und Ingwer glasig dünsten, dann die Süßkartoffel-Würfel dazu geben und paar Minuten mit dünsten. \nDie restliche Suppe zufügen, zum Kochen bringen und ca. 20 Minuten bei mittlerer Hitze kochen. Danach mit einem Pürierstab pürieren. \nKurkuma mit etwas Salz und Pfeffer n in einer Schüssel vermischen. Hähnchenbrustfilet in Streifen schneiden und mit den Gewürzmischung vermengen.\nKokosöl in einer Pfanne erhitzen und die Hähnchenstreifen auf beiden Seiten anbraten. \nDie Frühlingszwiebel in Ringe schneiden, damit die Suppe garnieren und mit den Hähnchenstreifen anrichten. Ich habe noch die Omega 3 Mix Samen über die Suppe gestreut.\nLass es Euch schmecken! 🧡\n#souprecipe #sweetpotato #süßkartoffel #sweetpotatosoup #süßkartoffelsuppe #healingfood #wellnessfood #gesundeernährung #soulfood #süßkartoffelrezepte #leckerschmecker #suppenkasper #mrsmarzena #unglaublichlecker #delicious', 1652691914, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/280956596_1611398529228918_8721318161231416459_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/280739440_955274535142883_2081896158876790396_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=quvdatcBGRMAX9oAQlp&edm=AOQ1c0wBAAAA&vs=422605372583349_512436476&_nc_vs=HBkcFQAYJEdIQ191eERqaFZRdjBXUURBSHp1R2JHR1llUWNidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJvaD9tG93M0%2FFQIoAkMzLBdAGAAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=8e0edf4614&ccb=7-5&oh=00_AfAcUGgabmpTCIgJ1YaAVffflr-DXmyl5SKNkfL2-PehIg&oe=6452540B&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CdnP35pJmKG', 0, 0, '[\"#sweetpotato\",\"#s\\u00fc\\u00dfkartoffel\",\"#sweetpotatosoup\",\"#s\\u00fc\\u00dfkartoffelsuppe\",\"#healingfood\",\"#wellnessfood\",\"#gesundeern\\u00e4hrung\",\"#soulfood\",\"#s\\u00fc\\u00dfkartoffelrezepte\",\"#leckerschmecker\",\"#suppenkasper\",\"#mrsmarzena\",\"#unglaublichlecker\",\"#delicious\"]', 'post', 'profile_scrape', 0, 1683024422, 1683024422),
(682, 39, 2829991286985845607, NULL, 'CdGJhTiPetn', 4, 1669, 1071, 0, 0, 0, 0, 0, '4.2', '🌟An alle Frauen und Männer, die schlank werden wollen! 🌟\n*Erhält Werbung*\nVersuchst Du auch jeden Tag, jede Woche, jeden Monat, das Abnehmen? 🙁\nDenkst Du auch: „Ich verzichte schon auf alles, was dick macht – Fotos, Spiegel, Waage! 😒 \nUnd es funktioniert immer noch nicht!!! 🥺 \nAuf meiner Personenwaage wütet ständig ein Unwetter. Ein ZUNAHMI😰\nAber, was ich Dir jetzt mitteilen möchte, sind die folgende 3 Tatsachen: \nSport macht nicht schlanker \nEs ist egal, ob wir viel oder wenig Kohlenhydrate essen\nMit jeder Diät werden wir dicker\nAlso müssen wir, was ändern! Wir ändern unsere Essgewohnheiten! \nWillst Du wissen, wie das geht? Wie Du schlau & Diät-Frei Abnehmen kannst? \nDann entdecke den schnellsten Weg zum Abnehmen und versuche mit dem Kalorienbedarfsrechner von YAZIO! 💚\nMit @YAZIO PRO App kannst Du schnell & einfach Kalorien zählen, bekommst Abnehm-Tipps & Rezepte für gesunden Gewichtsverlust! 💚\n🔸JETZT REGISTRIEREN & BIS 50 % RABATT AUF „YAZIO PRO“ SICHERN! \nhttps://YAZIO.me/marzena1110\n🔸LINK IM BIO♨\n\n#motivation #fitnessmotivation #abnehmen #fitness #dukannstallesschaffen #duschaffstdas #weightlosstransformation #gibnichtauf #yazio #yaziodeutschland #abnehmenmitkalorienzählen #kalorienzählen #yazioapp #healthyrecipes #easyrecipes #nutritionmadesimple #eatsmartnotless #mrsmarzena #yaziorezept', 1651581411, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/279732593_734506707990266_50890692361610577_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/279463165_1009484653021381_8527269231090161814_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=UcOyEJ6y5bMAX_Bbr9b&edm=AOQ1c0wBAAAA&vs=1