(683, 39, 2821918388684545461, NULL, 'Ccpd9LGr121', 25, 1813, 633, 0, 0, 0, 0, 0, '4.61', 'Spaghetti mit Kürbiskernpesto und Kirschtomaten – eine wahre Eisenbombe! 🍝🍅\nDie Vollkornpasta und die Kürbiskerne erhalten viel pflanzliches Eisen und das Vitamin C der Tomaten optimiert die Aufnahme von Eisen. \nFazit: Ein gesundes, köstliches und einfaches Gericht. 😋 \n770 kcal, 73,6 g Kohlenhydrate, 23,9 g Eiweiß, 39,7 g Fett\nZutaten für 2 Personen:\n🔸 200 g Vollkornspaghetti\n🔸 100 g Kirschtomaten \n🔸 ½ Bund Basilikum\n🔸 30 g Kürbiskerne\n🔸 20 g gerieben Parmesan\n🔸 1 Bio-Zitrone\n🔸 1 Knoblauchzehe\n🔸 3 EL Gemüsebrühe\n🔸 2 EL Kürbiskernöl\n🔸 1 EL Olivenöl\n🔸 Salz\n👩‍🍳 Zubereitung:\nDie Nudeln nach Packungsanleitung kochen.\nDie Zitrone heiß waschen, abtrocknen und die Schale abreiben. Den Knoblauch schälen, das Basilikum waschen, trockenen und die Blätter abzupfen. Die Kürbiskerne in eine Pfanne ohne Fett anrösten, bis sie zu duften beginnen. Dann die Pfanne von Herd weggeben.\nKnoblauch, Zitronenschale, Parmesan, Basilikum und Kürbiskerne sowie Gemüsebrühe und Kürbiskernöl, in einen Mixbecher geben und mit Pürierstab fein mixen. Das Pesto mit Salz abschmecken.\nOlivenöl in eine kleine Pfanne erhitzen und die gewaschene Tomaten darin ca. 4 Minuten rundherum andünsten.\nDie Nudel abgießen, etwas Nudelwasser auffangen und mit dem Pesto verrühren.\nNudeln mit Pesto vermischen und mit Kirschtomaten servieren.\nLasst Euch schmecken! 💚💚💚\n\n#kürbis #kürbiskerne #kürbiskernpesto #rezept #diy #lecker #kürbisliebe #nachhaltigleben #zerowaste #kürbiskernöl #gesund #food #fit #fitness #healthyfood #instafood #foodblogger #abnehemen #yazio #unglaublichlecker #spaghetti #delicious #mrsmarzena', 1650618933, '{\"city_name\":\"Niendorf\",\"region_name\":\" Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/278881956_659780201982132_5595133634389466692_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/2