(686, 40, 3093549797318106743, NULL, 'CrufyZ8IJ53', 26, 46, 0, 0, 0, 0, 0, 0, '1.49', 'Kirsch-Dessert 🍒 \n.\nAus den Resten der Schwarzwälder Kirsch Cupcakes habe ich schnell ein Dessert gezaubert. \n.\nHier das fixe Rezept 👉🏻 mit Flavour von @morenutrition.de \n.\n#schnellgemacht #dessert #lecker #genuss #zuckerfrei #ohneschlechtesgewissen #quark #quarkdessert #cremig #kirschen #foodie #foodblogger_de #schokolade #chunkyflavour', 1682999895, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/344342995_896757771417424_3962455321925543350_n.jpg', NULL, NULL, 'https://instagram.com/p/CrufyZ8IJ53', 0, 0, '[\"#dessert\",\"#lecker\",\"#genuss\",\"#zuckerfrei\",\"#ohneschlechtesgewissen\",\"#quark\",\"#quarkdessert\",\"#cremig\",\"#kirschen\",\"#foodie\",\"#foodblogger_de\",\"#schokolade\",\"#chunkyflavour\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(687, 40, 3092854355467151327, NULL, 'CrsBqZPo6ff', 37, 94, 0, 0, 0, 0, 0, 0, '2.71', 'Bananen Riegel 🍌 \n.\nWas machst du schönes am Feiertag?\n.\nIch schicke euch diesen Mikrowellenriegel zum #mugcakemonday bei @vreaky_lena aus Holland. \n.\nEin bisschen Energie zum #energiemontag bei @momocats_world ist auch wieder dabei. \n.\nUnd hier das Rezept 👉🏻 ich sag euch, es lohnt sich, denn ich habe sie aufgegessen, bevor ich an das Foto der Innenansicht gedacht habe. \n.\nVerwendet habe ich Instant Oats von @vilgain / @vilgain.de , Proteinmehl von @malubakecake (5% mit „Rebecca5“), Leindotteröl von @_mynatura.eu_ (15% mit „Rebecca15“) und Chunkyflavour von @morenutrition.de .\n.\n#riegel #banane #bananenbrot #kuchenriegel #backen #backenmachtglücklich #backenmitliebe #zuckerfrei #vegan #veganbacken #foodie #foodblogger_de #schnellgemacht #vanille #lecker', 1682916992, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/344104397_1217966542029697_7041103450101474506_n.jpg', NULL, NULL, 'https://instagram.com/p/CrsBqZPo6ff', 0, 0, '[\"#mugcakemonday\",\"#energiemontag\",\"#banane\",\"#bananenbrot\",\"#kuchenriegel\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\",\"#zuckerfrei\",\"#vegan\",\"#veganbacken\",\"#foodie\",\"#foodblogger_de\",\"#schnellgemacht\",\"#vanille\",\"#lecker\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(688, 40, 3092131153002366172, NULL, 'CrpdOadoATc', 46, 111, 0, 0, 0, 0, 0, 0, '3.24', 'Mohn-Cheesecake 🍊 \n.\nHattest du schon mal Mohn im Cheesecake? Mir persönlich ist es viel lieber, als eine feste Mohnfüllung. \n.\nDeswegen habe ich zum #cheesecakesonntag dieses Rezept für euch 👉🏻 mit Mandarinen on top. \n.\nVerwendet habe ich Mohn von @_mynatura.eu_ (15% mit „Rebecca15“), Puddingpulver von @dr.oetker_deutschland und Kokosflavour von @morenutrition.de .\n.\n#cheesecake #mohn #mohncheesecake #mandarinen #backen #backenmachtglücklich #backenmitliebe #foodie #foodblogger_de #quark #frischkäse #chunkyflavour #zuckerfrei #mohnkuchen #käsekuchen', 1682830779, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/344340640_784429926575463_2488121958638893565_n.jpg', NULL, NULL, 'https://instagram.com/p/CrpdOadoATc', 0, 0, '[\"#cheesecakesonntag\",\"#mohn\",\"#mohncheesecake\",\"#mandarinen\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#backenmitliebe\",\"#foodie\",\"#foodblogger_de\",\"#quark\",\"#frischk\\u00e4se\",\"#chunkyflavour\",\"#zuckerfrei\",\"#mohnkuchen\",\"#k\\u00e4sekuchen\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425),
(689, 40, 3091389929073279089, NULL, 'Crm0sL4ogBx', 35, 69, 0, 0, 0, 0, 0, 0, '2.15', 'Apfel-Birne Marmelade 🍏 \n.\nApfel, Birne und Vanille, wie klingt das?\n.\nNeben gerettetem Obst habe ich hier Vanillepulver von @azafran.de (10% mit „Rebecca10“) verwendet. \n.\n#marmelade #lebensmittelretten #resteverwertung #foodsharing #apfel #birne #vanille #marmeladekochen #genuss #frühstück #lecker #foodie #foodblogger_de #einkochen #geschenkeausderküche #selbstgemacht', 1682742418, '{\"city_name\":\"Pulheim\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/344225154_764295438754604_9165849570602409001_n.jpg', NULL, NULL, 'https://instagram.com/p/Crm0sL4ogBx', 0, 0, '[\"#lebensmittelretten\",\"#resteverwertung\",\"#foodsharing\",\"#apfel\",\"#birne\",\"#vanille\",\"#marmeladekochen\",\"#genuss\",\"#fr\\u00fchst\\u00fcck\",\"#lecker\",\"#foodie\",\"#foodblogger_de\",\"#einkochen\",\"#geschenkeausderk\\u00fcche\",\"#selbstgemacht\"]', 'post', 'profile_scrape', 0, 1683024425, 1683024425);
