(702, 41, 3075507840906964594, NULL, 'CquZhYpMC5y', 24, 56, 319, 0, 0, 0, 0, 0, '2.26', '🇲🇺 MAURITIUS 🇲🇺\n.\nAuch als „Paradies auf Erden“ bekannt.\nWieso? Ganz klar:\n🌊 Türkisblaues Meer \n🏝️ Weiße Sandstrände\n☀️ schön warm\n🌿 National parken\n🥘 Gutes creolisches Essen\n☺️ freundliches Multi kulturelles Volk\n🏨 phantastischen Resorts\n.\nEindrücke unserer Reisen siehst du in meiner Stories und Mauritius Highlight auf meinem Profil @thecookingglobetrotter\n.\nFolge mir für mehr Reisen Berichten und einfache Küche und Rezepte aus der ganzen Welt 🌎 \n.\nDeine Laura\n#thecookingglobetrotter\n.\n#mauritius #jwmarriott #jwmarriotmauritius #reisenmitkindern #urlaub', 1680850035, '{\"city_name\":\"JW Marriott Mauritius Resort\",\"country_code\":\"MU\",\"country_name\":\"mauritius\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/339689046_716163800207782_3981847249935735462_n.jpg', NULL, NULL, 'https://instagram.com/p/CquZhYpMC5y', 0, 0, '[\"#jwmarriott\",\"#jwmarriotmauritius\",\"#reisenmitkindern\",\"#urlaub\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
