(704, 41, 3067159075121657735, NULL, 'CqQvO2mPfeH', 23, 61, 169, 0, 0, 0, 0, 0, '2.38', '🐰 OSTERHASEN KEKSE 🐰\n.\nDiese einfachen Mürbeteig Osterhasen Plätzchen lassen sich hübsch dekorieren – perfekte (und leckere) Beschäftigung mit Kindern vor Ostern!\n.\nZutaten:\n150 g	Mehl\n100 g	Butter, kalt\n50 g	Staubzucker\n1	Ei\n1	Prise Salz\n1	Prise Vanille oder Tonka Bohne\n	Schoko Eier, Marzipan Karotten, Zucker Blumen, Giotto, Mandeln nach Belieben zum Dekorieren\nZuckerschrift zum Kleben und Dekoriere\nAuf dem Blog findest du die Zubereitung und auch mehrere Ideen für die Dekoration der Keksen.\n.\nDeine Laura\n#thecookingglobetrotter 🌎\n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Unterstützung!\n💜 Like den Post, lass einen Kommentar da und teile ihn gerne\n💜 Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n💜 Wenn du über meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zusätzliche Kosten für dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke ☺️ \n\n#osterhasen #osterrezepte #kekse #ostern #backenmitkindern', 1679853897, '{\"city_name\":\"Graz\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/337566150_964232604766283_2506439280483216696_n.jpg', NULL, NULL, 'https://instagram.com/p/CqQvO2mPfeH', 0, 0, '[\"#osterhasen\",\"#osterrezepte\",\"#kekse\",\"#ostern\",\"#backenmitkindern\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(705, 41, 3065748686352969706, NULL, 'CqLui_ssG_q', 10, 45, 1443, 0, 0, 0, 0, 0, '1.56', '🥚EIER MIT ROTKRAUT BLAU FÄRBEN 🐣\n.\nSchon deine Eier für Ostern gefärbt?\nWir haben sie mit Rotkraut blau eingefärbt und das hat super geklappt!\nDu brauchst:\n🌿 500 g Rotkraut, klein geschnitten \n💦 800 ml Wasser\n🥄 20 ml Essig\n🥚 4-6 Eier\nUnd so geht es:\nKraut mit Wasser und Essig in einem Topf zum kochen bringen. Hitze runtersetzen und Eier vorsichtig hineinlegen. 15 Minuten köcheln lassen. Eier rausfischen und in eine Schüssel legen. Wasser Kohl Mischung durch ein Sieb über die Eier gießen. 2 Stunden ziehen lassen. Danach Eier mit küchenpapier trocken tupfen. Fertig! 🐰 \n.\nSpeichere das Rezept ab!\n.\nDeine Laura\n#thecookingglobetrotter 🌎\n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Unterstützung!\n💜 Like den Post, lass einen Kommentar da und teile ihn gerne\n💜 Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n💜 Wenn du über meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zusätzliche Kosten für dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke 🫶\n\n#eierfärben #natürlich #rotkraut #ostereierfärben #blaufärben', 1679685865, '[]', 'VIDEO', 'images/content/posts/328224408_758226209027276_5361953763951747856_n.jpg', NULL, NULL, 'https://instagram.com/p/CqLui_ssG_q', 0, 0, '[\"#nat\\u00fcrlich\",\"#rotkraut\",\"#ostereierf\\u00e4rben\",\"#blauf\\u00e4rben\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
