(707, 41, 3060660338211147552, NULL, 'Cp5plyNM88g', 28, 94, 0, 0, 0, 0, 0, 0, '3.45', '🌼 MILCHREIS KUCHEN 🌼\n.\nEinfaches Milchreis Kuchen Rezept, inspiriert von dem traditionellen italienischen Osterkuchen Pastiera di riso napoletana: der knusprige Mürbeteig Boden wird mit einer Milchreis Ricotta Creme gefüllt. Ideal für den Osterbrunch, man kann ihn kalt aus dem Kühlschrank oder gleich nach dem Backen lauwarm geniessen.\n.\nZutaten:\n200 g	Arborio Reis*\n500 ml	Milch\n1	Tonka Bohne* (oder eine Prise Vanille oder Zimt)\n500 g	Mehl\n5	Eier\n150 g	Zucker (2/3 für den Teig, 1/3 für die Füllung)\n50 g	brauner Zucker\n200 g	Butter, kalt\n400 g	Ricotta\n100 g	Sahne\n1 TL	Mandel Extrakt* (optional)\n1	Prise Zimt\nPuder Zucker zum Dekorieren\n.\nDu willst ihn sofort backen? Die Zubereitung findest du auf dem Blog!\n.\nDeine Laura\n#thecookingglobetrotter 🌎\n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Unterstützung!\n💜 Like den Post, lass einen Kommentar da und teile ihn gerne\n💜 Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n💜 Wenn du über meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zusätzliche Kosten für dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke 🫶\n.\n#milchreiskuchen #pastieradiriso #osterkuchen #ostertorte #milchreis', 1679079166, '{\"city_name\":\"Graz\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/336345421_115583228143153_7737330715460818116_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp5plyNM88g', 0, 0, '[\"#pastieradiriso\",\"#osterkuchen\",\"#ostertorte\",\"#milchreis\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(708, 41, 3055595662201017973, NULL, 'CpnqBDGt1Z1', 9, 60, 207, 0, 0, 0, 0, 0, '1.95', '✨ Indische Rezepte ✨\n.\nDu liebst die indische Küche?\n.\nIch auch. Deswegen findest du authentische Rezepte aus Indien 🇮🇳 auf meinem Blog, die man ganz leicht zu Hause zubereiten kann.\n.\n1️⃣ Butter Chicken - das beste Rezept\n2️⃣ Kokos Tomaten 🍅 Suppe - vegan\n3️⃣ Naan - Muss sein!\n4️⃣ Spinat Curry \n5️⃣ Goldene Milch 🥛 \n6️⃣ Kichererbsen Curry - super schnell\n7️⃣ Jeera - Kreuzkümmel Butterkekse\n8️⃣ Kheer - veganer Milchreis\nWas kochst du als erstes?\n.\n🧘‍♀️ Gutes Essen, das gut tut 🧘‍♀️\nMeine Rezepte enthalten Kalorien- und Nährstoffenangaben. Und in jedem Beitrag stelle ich dir ein Super Food vor. Im letzten Beitrag erfährst du die guten Eigenschaften von Joghurt. \n.\nDeine Laura\n#thecookingglobetrotter 🌎\n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Unterstützung!\n💜 Like den Post, lass einen Kommentar da und teile ihn gerne\n💜 Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n💜 Wenn du über meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zusätzliche Kosten für dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke 🫶\n.\n#indischessen #indisch #indischeküche #rezepte #einfacherezepte #butterchicken #curry #naan #indischesbrot #kheer #jeera #goldenemilch', 1678475460, '{\"city_name\":\"Graz Ruckerlberg\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/335524575_238119875231298_1214175204759158463_n.jpg', NULL, NULL, 'https://instagram.com/p/CpnqBDGt1Z1', 0, 0, '[\"#indisch\",\"#indischek\\u00fcche\",\"#rezepte\",\"#einfacherezepte\",\"#butterchicken\",\"#curry\",\"#naan\",\"#indischesbrot\",\"#kheer\",\"#jeera\",\"#goldenemilch\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(709, 41, 3051971431072023758, NULL, 'Cpax9i1sETO', 21, 67, 0, 0, 0, 0, 0, 0, '2.49', '🫓 NAAN 🫓 \n.\nWas darf zum Curry 🍛 auf keinen Fall fehlen? Das indische Fladenbrot Naan!\n.\nDas Rezept ist auf meinem Blog beschrieben, wo du natürlich auch die passenden Curries dazu findest.\n.\n🧘‍♀️ Gutes Essen, das gut tut 🧘‍♀️\nMeine Rezepte enthalten Kalorien- und Nährstoffenangaben. Und in jedem Beitrag stelle ich dir ein Super Food vor. Hier erfährst du die guten Eigenschaften von Joghurt. \n.\nDeine Laura\n#thecookingglobetrotter 🌎\n\nDir gefallen meine Rezepte und du willst mehr davon? Dann brauche ich deine Unterstützung!\n💜 Like den Post, lass einen Kommentar da und teile ihn gerne\n💜 Besuche meinen Blog, bewerte meine Rezepte, kommentiere sie und trage dich beim Newsletter ein\n💜 Wenn du über meine (Affiliate) Links einkaufst, erhalte ich eine kleine Provision (ohne zusätzliche Kosten für dich) - das hilft mir einen Teil der Kosten zu decken.\nDanke 🫶\n\n#naan #naanbrot #fladenbrot #indischefladenbrot #indischkochen #indischeküche #pfannenbrot #einfacherezepte #einfacheküche #joghurtbrot #brot', 1678043367, '{\"city_name\":\"Graz Ruckerlberg\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/331362063_224810383372971_3019357014873736549_n.jpg', NULL, NULL, 'https://instagram.com/p/Cpax9i1sETO', 0, 0, '[\"#naanbrot\",\"#fladenbrot\",\"#indischefladenbrot\",\"#indischkochen\",\"#indischek\\u00fcche\",\"#pfannenbrot\",\"#einfacherezepte\",\"#einfachek\\u00fcche\",\"#joghurtbrot\",\"#brot\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(710, 41, 2709875878563197699, NULL, 'CWbacEHKLMD', 4, 55, 276, 0, 0, 0, 0, 0, '1.67', 'Wir backen die besten Kaiserschmarren mit Apfelmus und verraten, was wir für euch in der Adventszeit organisiert haben.\n.\nBonus: Rundgang in meiner Küche 😂 da ich das live zu früh gestartet habe 😅\n.\n@ahalnisweethome \n@evelynimtortenland \n@zimtliebe_de', 1637262428, '[]', 'VIDEO', 'images/content/posts/258387805_1790794594642839_4854222345501093844_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_2968047333509568_856230479716292258_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjUwNC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=Y03TlAV8NhAAX90XB8L&edm=AOQ1c0wBAAAA&vs=18112133122270681_293269060&_nc_vs=HBksFQAYJEdJQ1dtQURBaWYxZWJJc0tBS0lXV3JVVjhlRUxicUNCQUFBRhUAAsgBABUAGCRHSUNXbUFCVHRwckJjdllBQUxUTUV6ekZ3bHNsYnFDQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaA6ueLx7PPPxUCKAJDMywXQK3FHjU%2FfO4YEmRhc2hfYmFzZWxpbmVfMl92MREAdewHAA%3D%3D&_nc_rid=c22e584d08&ccb=7-5&oh=00_AfAv1bHQMq54y1HM4MV0HWg92sJEbOYM-nBSBKUXGGvnAQ&oe=6452D3CB&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CWbacEHKLMD', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(711, 41, 2630844353430746672, NULL, 'CSCowAplPYw', 16, 72, 424, 0, 0, 0, 0, 0, '2.49', '#LIVEAUSDERKÜCHE mit @coppenrathundwiese und GEWINNSPIEL 🎉🎉🎉\n.\n.Werbung.\n.\nEine wunderschöne personalisierte Torte in 30 Minuten zaubern? Geht das??! Oh ja, es ist sogar einfach und lustig! Wir 4 Mädels von #liveausderküche haben 4 Naked Cakes gemacht. Und wir möchten dir auch die Möglichkeit geben, so was cooles zu zaubern. 🧚‍♀️ wie? Mit einem Gewinnspiel! 🥳\n.\nGewinne ein Überraschungs-Paket von @coppenrath und gestalte damit deine eigene Torte (oder du genießt sie einfach so 😉). Die Teilnahme ist super einfach und du kannst alles in meinem letzten Post lesen!\n.\nDie Aufnahme des gesamten Live findest du bei Belma @ahalnisweethome \n.\nTIPP: erhöhe deine Gewinnchancen in dem du bei allen 4 kommentierst!\n.\n@evelynimtortenland \n@zimtliebe_de \n#coppenrathundwiese #gewinnspiel', 1627841282, '[]', 'VIDEO', 'images/content/posts/230702214_119773963709418_7346157792759162571_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_130358902617427_7330085765217258559_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=DCN7jAQ4hWAAX_cPAHt&edm=AOQ1c0wBAAAA&vs=17917335187870597_526767014&_nc_vs=HBksFQAYJEdJQ1dtQUJUZFJXTWozWUFBRDhNN01BcXNybGxidlZCQUFBRhUAAsgBABUAGCRHRHVZdlEyVnlwaUlDV3NBQUU3c0NucFFxSFY3YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbChbKymoi8PxUCKAJDMywXQHvt2yLQ5WAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c22e51bf26&ccb=7-5&oh=00_AfBfyKs4WynWJXi3XKcgIBInceHAuAd31auEY2iHszaU1w&oe=6452B9AD&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CSCowAplPYw', 0, 0, '[\"#liveausderk\\u00dcche\",\"#liveausderk\\u00fcche\",\"#coppenrathundwiese\",\"#gewinnspiel\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(712, 41, 2614173219725529137, NULL, 'CRHaLFfFFAx', 6, 57, 255, 0, 0, 0, 0, 0, '1.78', 'Wir haben gestern Hummus gemacht. 2 davon, also Hummusse??? Was ist denn bitte der Plural von Hummus?!? 🤔\n.\nEgal. Beide waren super lecker! Und wie immer haben wir eine Menge Spaß dabei gehabt. Insbesondere Evelyn @evelynimtortenland am Strand 🏝 in Frankreich 🇫🇷 \n.\nWie immer sind unsere Rezepte erstaunlich einfach und unkompliziert uns sogar ein wenig planlos 🤪\n.\nJeden Donnerstag um 19 Uhr sind wir vier\nBelma @ahalnisweethome \nEvelyn @evelynimtortenland \nMona @zimtliebe_de\nUnd ich, Laura, @thecookingglobetrotter live nach dem Motto:\n#liveausderküche \n4 Mädels\n4 Küchen\n1 Rezept\nWird es einfach gekocht oder gebacken und natürlich viel getratscht ☺️\n.\nSchaue gerne nächste Woche vorbei! Wir freuen uns!\n.\nÜbrigens, alle Aufnahmen, Rezepte und Abschnitte findest du auf unseren Profilen unter IGTV und bei mir in den Guides 📖 \n.\n#hummus  #liveausderküche #thecookingglobetrotter #einfacherezepte #sommerrezepte #kichererbsen', 1625853997, '[]', 'VIDEO', 'images/content/posts/213682243_531347541630542_8835068668297513475_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_1186634451799507_8846556957803340235_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=8_W5pVuPoOAAX-v79dW&edm=AOQ1c0wBAAAA&vs=17890004663321393_2614596728&_nc_vs=HBksFQAYJEdJQ1dtQURUVGZyY1BEY0VBTXZoSUp1dVNNVjZidlZCQUFBRhUAAsgBABUAGCRHTXo0d3d6RGs4Rk1tOG9PQUVjTlRFaDEzM0FqYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbw3YXLh9rqQBUCKAJDMywXQHcl2yLQ5WAYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c22e5c52d4&ccb=7-5&oh=00_AfBbf4XqD-8AgDVpuAxs7oplq7FI2FeIMElRgrv4G1PuOA&oe=64525D87&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CRHaLFfFFAx', 0, 0, '[\"#liveausderk\\u00fcche\",\"#thecookingglobetrotter\",\"#einfacherezepte\",\"#sommerrezepte\",\"#kichererbsen\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(713, 41, 2609096463633239875, NULL, 'CQ1X2j7lk9D', 2, 47, 208, 0, 0, 0, 0, 0, '1.39', 'Wir haben gestern leckere Cronuts gebacken! Blätterteig Donuts 🍩 im Backofen gebacken und dann ordentlich dekoriert!\n(Werbung) bis nächste Woche kannst du eine Box voller Streuseln von @super_streusel bei uns gewinnen!\nSo geht es:\n🍩 folge uns 4 (@thecookingglobetrotter ,  @ahalnisweethome @evelynimtortenland ,  @zimtliebe_de ) und @super_streusel \n🍩 poste ein Bild in deinem Feed oder Stories mit deinem schönsten Backwerk mit Streuseln\n🍩 verlinke uns und verwende #liveausderküche\n🍩 Du kannst mehrmals teilnehmen, für jedes Bild landet ein Los 🎟 im Topf!\n🍩 Gerne kannst du deine Freunde zum Gewinnspiel einladen, sie markieren, das Bild in deinen Stories teilen oder weiterleiten - wir freuen uns auf deine Unterstützung!\n🍩 Wenn du kein öffentliches Profil hast, schick uns bitte das Bild per DM, wir stellen es in unsere Stories und so bist du auch dabei!\n\nDas Gewinnspiel läuft bis einschließlich Mittwoch 7. Juli 18:55 Uhr.\nTeilnehmen dürfen alle ab 18 Jahren und mit Wohnsitz in Österreich und Deutschland.\nDer Gewinner/in wird live am 8. Juli gezogen und in der Story und per Instagram Nachricht bekanntgeben.\nDas Gewinnspiel steht in keiner Verbindung mit Instagram und wird nicht von Instagram unterstützt, organisiert oder gesponsert\n#cronuts #gewinnspiel #liveausderküche #superstreusel #streusel #streuselliebe', 1625249138, '[]', 'VIDEO', 'images/content/posts/210568208_341260340966503_5980299531452625551_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_315769033522663_6297924856592565704_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjUwNi5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=0htaxufpHnQAX8H7Pzo&edm=AOQ1c0wBAAAA&vs=18016560169311955_248977629&_nc_vs=HBksFQAYJEdJQ1dtQURuLVJLMU1COEJBTWlGVFF0S3VXWlhidlZCQUFBRhUAAsgBABUAGCRHR0Q3cVF4dGhQR2FtVjREQUZ2Y