(717, 41, 2583733547836959660, NULL, 'CPbQ_j5FOus', 15, 34, 215, 0, 0, 0, 0, 0, '1.39', 'Was könnte schief gehen, wenn man keine Ahnung von Fondant hat und man damit Einhorn Kekse machen will?\n➡️ man produziert einen süßen Einhorn 🦄 Drache namens Elliott 🤣🤣🤣\n.\nOk, ich erkläre es kurz: wir haben gestern in unserem #liveausderküche mit Evelyn @evelynimtortenland Einhorn Kekse gemacht. Oder, besser gesagt: Evelyn, Belma @ahalnisweethome und Mona @zimtliebe_de haben Einhörner gemacht. Ich? Bei mir sind es Drachen 🐉 geworden. Mit Horn. 🤷‍♀️\n.\nWie das passieren könnte? Naja, erstens habe ich nicht gelesen, dass in meinem Set keinen weißen Fondant dabei war. Dann war es zu spät. Aber the Show Must Go on!!! Die Zuschauer haben grün für meinen Einhorn ausgesucht. \n.\nIch war etwas angespannt, da solche feine Arbeiten mir überhaupt nicht liegen. Spaß hat es trotzdem gemacht! Sogar so, dass heute Elliott noch eine Truppe bunter Freunden dazu bekommen hat!!! Ich stelle sie euch hier im Video vor!\n.\nWir sind übrigens jeden Donnerstag um 19 Uhr #liveausderküche, machen mit euch einfache Rezepte und haben wir nie Menge Spaß dabei!\nSchaue vorbei!\n.\nLaura', 1622225688, '[]', 'VIDEO', 'images/content/posts/193496611_2751102368513083_5732616677385662604_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_483376209605547_8845532737459603860_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmlndHZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=PAxEo2Ua1yUAX_t06kv&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfD6o_b41uyn3nAiT5GeKxPr9_FNTocTN3LOq77srrDSEg&oe=64529CD8&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CPbQ_j5FOus', 0, 0, '[\"#liveausderk\\u00fcche\",\"#liveausderk\\u00fcche,\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(718, 41, 2578647146900692415, NULL, 'CPJMer4Fx2_', 4, 50, 249, 0, 0, 0, 0, 0, '1.53', 'Werbung.\nWer möchte das schöne Backset von @backefix gewinnen?\nMona @zimtliebe_de \nBelma @ahalnisweethome \nEvelyn @evelynimtortenland\nUnd ich, Laura, @thecookingglobetrotter \nHaben im #liveausderküche nr. 8 die Muffins Formen ausprobiert und Apfel 🍎 Rosen 🌹 Muffins 🧁gebacken.\nIch hatte voll die Panne mit einem klebrigen Blätterteig aber sogar meine Fail Muffins sahen am Ende gut aus und geschmeckt haben sie sowieso lecker!\n.\nMach beim Gewinnspiel mit!\n1. Backe oder koche etwas aus unseren #liveausderküche nach (zur Auswahl hast du: Blätterteig Hasen, Glasnudel Salat, Butterkeks Kugeln, Brezel Pizza, Croffles, Amaretti Küsschen, erdnussbutter Cookies und die Apfelrosen Muffins)\n2. mach ein Bild davon\n3. poste es unter dem #liveausderküche \n4. Markiere uns 4 und @backefix , damit wir das auch sehen - folge uns, wenn du das noch nicht machst 😉\n5. schaue am Donnerstag um 19 vorbei! Wir verlosen Live!\n.\n\nDas Gewinnspiel läuft bis Donnerstag 21. Mai 12:00 Uhr.\nTeilnehmen dürfen alle ab 18 Jahren und mit Wohnsitz in Österreich oder Deutschland.\nDer Gewinner/in wird per Zufallsgenerator gezogen, Live und per Instagram Nachricht bekanntgeben.\nDas Gewinnspiel steht in keiner Verbindung mit Instagram und wird nicht von Instagram unterstützt, organisiert oder gesponsert.\n.\n#apfelrosenmuffins #backefix #muffinsbacken #einfacherezepte #thecookingglobetrotter', 1621619497, '[]', 'VIDEO', 'images/content/posts/188634252_538556097159459_5508517115859871964_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_2980914038850688_7211677354742437697_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=104&_nc_ohc=LkYTxsrmUVMAX9LWiOx&edm=AOQ1c0wBAAAA&vs=17966385961384805_4130910416&_nc_vs=HBksFQAYJEdJQ1dtQUNBUkdRaUlKY0tBRUhYSmxSWUJo