(719, 41, 2567788198400317436, NULL, 'COincMAF1f8', 11, 42, 556, 0, 0, 0, 0, 0, '1.5', 'Muttertagsspecial 💐\nitalienische amaretti Küsschen\n🇮🇹 baci di amaretti\nMit Kaffee oder Batida De Coco\n@evelynimtortenland\n@zimtliebe_de\n@ahalnisweethome\nWir sind jeden Donnerstag um 19 Uhr live:\n4 Mädels\n4 Kuchen\n1 Rezept\n.\n#liveausderküche #italienischeküche #italienischesessen #amaretti #bacidiamaretti', 1620324247, '[]', 'VIDEO', 'images/content/posts/182344902_311369220493716_4503924019713044198_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_503195910726365_808951097559261239_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQzMi5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=8pW0sCiH6CUAX8zkH0d&edm=AOQ1c0wBAAAA&vs=17880252731208133_2441653515&_nc_vs=HBksFQAYJEdJQ1dtQURkNG9KdHA4a0JBRGVncnJxOF9Ea0xicUNCQUFBRhUAAsgBABUAGCRHSUNXbUFBblhfMEcwdlVBQUhodUJlN1JrYTF3YnFDQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaK%2FPvX1%2F%2FCPxUCKAJDMywXQKu1uNT987YYEmRhc2hfYmFzZWxpbmVfM192MREAdewHAA%3D%3D&_nc_rid=c22e53457f&ccb=7-5&oh=00_AfDUfB81rjKMm6jHYHaFsb7JvfB5fJ2wCOK5NXnzEuwg9Q&oe=64527626&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/COincMAF1f8', 0, 0, '[\"#italienischek\\u00fcche\",\"#italienischesessen\",\"#amaretti\",\"#bacidiamaretti\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435),
(720, 41, 2563473355513870686, NULL, 'COTSW9alTle', 8, 34, 292, 0, 0, 0, 0, 0, '1.19', 'Schon Croffles ausprobiert? Mona @zimtliebe_de , Evelyn @evelynimtortenland , Belma @ahalnisweethome und ich waren vom neuen Tiktok Trend begeistert!\n.\nWir haben die ganze Zeit gegessen.  Aber diese Waffeln 🧇 mit Croissant 🥐 Teig (die fertige Rollen aus dem Kühlregal) sind wirklich unwiderstehlich! Gefüllt mit Nutella, Käse, lemon curd, Schoko Bananen 🍌 \n.\nDer Eisen habe ich dann doch sauber bekommen 😉 mit Essig, Seife und Zitronen Öl!\n.\nUnbedingt die Croffles ausprobieren! Und gerne uns zeigen!\n.\nNächste Woche machen wir etwas für Muttertag - da können die Kids auch leicht mitmachen! Am Donnerstag um 19 Uhr!\n.\n#liveausderküche #foodbloggerliebe #thecookingglobetrotter #croffles #waffeln #croissants', 1619810238, '[]', 'VIDEO', 'images/content/posts/179181810_455868619031172_3920734208470543048_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_297589528655033_4192705667998751848_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjYwOC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=aCoYBDCdyzAAX-hqP39&edm=AOQ1c0wBAAAA&vs=17883844223225661_843795260&_nc_vs=HBksFQAYJEdJQ1dtQUM1OUNUMnB3NEJBR2djMVZTWGV5ODZidlZCQUFBRhUAAsgBABUAGCRHRjk4clFwY3V5R1VlWUFBQU16YVl0Zi1mY1JBYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACb62M%2B7xdDEPxUCKAJDMywXQHQEQYk3S8cYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c22e576602&ccb=7-5&oh=00_AfCRouCNYN7q4luZRZgwF7sKJBidWuw_4mw9JWmQE4o1-A&oe=6452A0AE&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/COTSW9alTle', 0, 0, '[\"#foodbloggerliebe\",\"#thecookingglobetrotter\",\"#croffles\",\"#waffeln\",\"#croissants\"]', 'post', 'profile_scrape', 0, 1683024435, 1683024435);
