(741, 42, 2669926356130953658, NULL, 'CUNe-ABo3m6', 2, 92, 389, 0, 0, 0, 0, 0, '0.8', '#Werbung Heute kam mein Paket von @einstueckland.de an.\nDa nun Schmorzeit ist gibt es ein passendes Fleischpaket dazu.\nFleisch vom Bauern direkt zu mir. Kostenloser Versand!\nFleisch von ausgesuchten Bauern die fair mit den Tieren umgehen und somit beste Fleischqualität garantieren. \nIn den nächste Tagen gibt es nach und nach ein Gericht mit Fleisch aus dieser Box. \nDer Geschmack wird beweisen, daß Qualität ihren Preis haben darf.\n\n#Fleisch #fleischgenuss #fleischlust #gutesfleisch #beef #rind #bbq #schmorbraten #würstchen #rouladen', 1632500187, '[]', 'VIDEO', 'images/content/posts/242752041_164062189244961_6512570506330139866_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_342976217607834_2021156736069594300_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=106&_nc_ohc=nSdAPRNSE3wAX8sQnh5&edm=AOQ1c0wBAAAA&vs=18106626349260676_799236430&_nc_vs=HBksFQAYJEdJQ1dtQUNhN3AxZjd6Y0JBTHpzME1oWGx3d2NidlZCQUFBRhUAAsgBABUAGCRHRmo1ZVE0TWM4UVEzdzBDQUt5U1h0Zzc5UFJ5YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbWkZzBk6G1QBUCKAJDMywXQG66p%2B%2Bdsi0YEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=33122bf82f&ccb=7-5&oh=00_AfC4aSmqwSp3t5Ki_MwMz_WKIvR0OtS4RKL0tk1--7r3Ig&oe=64525E4B&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CUNe-ABo3m6', 0, 0, '[\"#werbung\",\"#fleischgenuss\",\"#fleischlust\",\"#gutesfleisch\",\"#beef\",\"#rind\",\"#bbq\",\"#schmorbraten\",\"#w\\u00fcrstchen\",\"#rouladen\"]', 'post', 'profile_scrape', 0, 1683024442, 1683024442),
