(756, 43, 2927739718595645622, NULL, 'Ciha8MhshC2', 6, 2234, 0, 0, 0, 0, 0, 0, '14.1', 'Wie die Zeit vergeht, schone eine Woche sind wir hier auf der schönen Insel Boa Vista. Einfach abschalten und Ruhe genießen. Ganz dem Motto ♥️No Stress ♥️🌴\n\nWar jemand schon mal auf der Insel?\n\n#boavista#iberostarboavista #iberostarboavistacaboverde #kapverden #sonnenuntergangsstimmung #genieseninvollenzügen #urlaubaufderinsel♥️ #auszeit #holiday #elfeeuleblume', 1663233793, '{\"city_name\":\"Iberostar Club Boa Vista\",\"country_code\":\"US\",\"country_name\":\"usa\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/306713708_5405851866171098_2691504048104890742_n.jpg', NULL, NULL, 'https://instagram.com/p/Ciha8MhshC2', 0, 0, '[\"#iberostarboavistacaboverde\",\"#kapverden\",\"#sonnenuntergangsstimmung\",\"#genieseninvollenz\\u00fcgen\",\"#urlaubaufderinsel\\u2665\\ufe0f\",\"#auszeit\",\"#holiday\",\"#elfeeuleblume\"]', 'post', 'profile_scrape', 0, 1683024449, 1683024449),
(757, 43, 2919759925564605867, NULL, 'CiFEi7IswWr', 20, 2009, 0, 0, 0, 0, 0, 0, '12.77', '♥️Schönen Sonntag ♥️\n\nHallo ihr Lieben 🫶🏻wünsche Euch allen einen schönen sonnigen Sonntag. Wir haben jetzt endlich Urlaub und ab Mittwoch geht’s dann nach Kapverden auf die Insel Boa Vista.☀️ Freue mich schon drauf. Wer war denn schon mal dort?\n\n#endlichurlaub☀️ #urlaubboavista #boavista #iberostarboavista #wella #urlaubsreif #elfeeuleblume#kapverden', 1662282528, '{\"city_name\":\"Th\\u00fcringen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/304099466_1017033608974028_8695354257506391671_n.jpg', NULL, NULL, 'https://instagram.com/p/CiFEi7IswWr', 0, 0, '[\"#urlaubboavista\",\"#boavista\",\"#iberostarboavista\",\"#wella\",\"#urlaubsreif\",\"#elfeeuleblume#kapverden\"]', 'post', 'profile_scrape', 0, 1683024449, 1683024449);
