(761, 43, 1940830769724256778, NULL, 'BrvN01Wj_IK', 0, 48, 90, 0, 0, 0, 0, 0, '0.3', 'Sweethome🎄.\n.\n#weihnachtsbaum #christmas #christmastree #cat #🎄', 1545585363, '[]', 'VIDEO', 'images/content/posts/46962002_281238285870773_7750226296613657581_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/49118406_138876367104822_5452675227847538752_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=106&_nc_ohc=xRRTG9kn2fEAX8pMyB2&edm=AOQ1c0wBAAAA&vs=17939121196228230_1704181980&_nc_vs=HBkcFQAYJEdNWjg3UUkyYTRlc1RuNEFBRUM0Yk84Nnk2dExia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJtKys%2FHatN0%2FFQIoAkMzLBdAGB64UeuFHxgSZGFzaF9iYXNlbGluZV8xX3YxEQB16gcA&_nc_rid=90d6c958fc&ccb=7-5&oh=00_AfBRpME_CnCwzPi_xC_77tjoWTaqSKRAEW83djwUveJEUg&oe=6452A365&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BrvN01Wj_IK', 0, 0, '[\"#christmas\",\"#christmastree\",\"#cat\",\"#\\ud83c\\udf84\"]', 'post', 'profile_scrape', 0, 1683024449, 1683024449),
(762, 44, 3090406430700918053, NULL, 'CrjVEZpgtUl', 135, -1, 264, 0, 0, 0, 0, 0, '0.85', 'Falsche Freunde hatte ich viele😕\n\nIch habe falschen Menschen vertraut und leider die falschen zu meinen Freunden gezählt. Ich denke ich bin da nicht allein mit das gute daran ist aber, dass wir alle dadurch stärker werden können🙏🏻\n\nIch bin stärker geworden und stehe zu allem was ich mache und bin stolz drauf wer ich bin!\n\nJa ich wurde gemobbt, geghostet, es wurden Lügen erzählt und auch Geheimnisse, aber ich konnte mich von allen Menschen entfernen!\n\nIch binde mich nicht an Personen und mache mein Glück nicht von anderen abhängig, denn ich kann auch gut allein sein und brauche das sogar! Ich liebe mich selbst und bin lieber allein, als mit falschen Menschen zu sein. \n\nEs sollten viel Menschen reflektieren mit wem sie ihre Zeit verbringen bzw. mit wem sie „befreundet“ sind und warum. Es gibt viele Toxische Freundschaften, die nur existieren aus Gewohnheit.\n\nIch habe mit der Sache abgeschlossen, mit den Menschen, mit dem Mobbing und all dem! Was allerdings sehr spannend ist, ist das ich immer noch interessant für die Personen bin, denn sonst wüssten sie nicht alles was ich poste und von mir preis gebe😅\n\nMir ist egal wer lästert, mir ist egal was ihr tut. Ich lebe mein Leben und bin stolz auf meinem Weg, denn die Steine haben mich nach ganz oben gebracht, ich habe nämlich Berge daraus gebaut und kann nun endlich frei fliegen ohne auf die Meinung anderer Wert zulegen!♥️\n\n#mobbing #falschefreunde #freischwimmen #freiheitsgefühl #freifühlen #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #körperbild #selbstheilung #deutschpop #traurigeslied #emotionenfühlen #schulzeit #toxischebeziehungen #toxischefreunde #toxischefreundschaft', 1682625336, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343288587_959026585251585_7644641416051558253_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjVEZpgtUl', 0, 0, '[\"#falschefreunde\",\"#freischwimmen\",\"#freiheitsgef\\u00fchl\",\"#freif\\u00fchlen\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\",\"#schulzeit\",\"#toxischebeziehungen\",\"#toxischefreunde\",\"#toxischefreundschaft\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(763, 44, 3089575933715293202, NULL, 'CrgYPFDsiQS', 134, -1, 0, 0, 0, 0, 0, 0, '0.84', 'Immer unterwegs zu sein ist für mich mega wertvoll!🙏🏻\n\nIch bin viel privat und beruflich unterwegs. Egal ob zur Fortbildung, TV Projekten, Schulungen die ich für die Verbraucher Checker gebe oder meine Ehrenämter☺️\n\nIch brauch aber immer den passenden Rucksack für meine Reisen, er muss zu allen Outfits passen und zur Zeit am besten Wasserabweisend sein, denn der April macht was er will😅\n\nMein neuer Begleiter ist dieser tolle Rucksack von @newrebelsbags ich fdie Farbe soo schön, die Verarbeitung ist gut und er ist stylisch, wasserabweisend und man hat ein Laptop-Fach und eine Polsterung am Rücken und den Schultern🥰\n\nSeid ihr gern unterwegs für Kurztrips oder ist euch das eher zu stressig?☺️\n\n#ad #unbezahltewerbung #outfitinspo #berserkergang #berserker #berserkerlifestyle #girl #blond #selbstliebe #mindset #glücksgefühle #glücklich #unterwegs #frühlingsgefühle #liebe #outfitliebe #empowerment #womanempowerment #feminismus #dowhatyoulove #dowhatyouwant #doit #rucksack #regenfest #altrosa #wasserabweisend', 1682526173, '{\"city_name\":\"D\\u00f6rverden\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343416866_6892714724089440_7113126733513119557_n.jpg', NULL, NULL, 'https://instagram.com/p/CrgYPFDsiQS', 0, 0, '[\"#unbezahltewerbung\",\"#outfitinspo\",\"#berserkergang\",\"#berserker\",\"#berserkerlifestyle\",\"#girl\",\"#blond\",\"#selbstliebe\",\"#mindset\",\"#gl\\u00fccksgef\\u00fchle\",\"#gl\\u00fccklich\",\"#unterwegs\",\"#fr\\u00fchlingsgef\\u00fchle\",\"#liebe\",\"#outfitliebe\",\"#empowerment\",\"#womanempowerment\",\"#feminismus\",\"#dowhatyoulove\",\"#dowhatyouwant\",\"#doit\",\"#rucksack\",\"#regenfest\",\"#altrosa\",\"#wasserabweisend\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(764, 44, 3087430036009079686, NULL, 'CrYwUKFMVOG', 58, 126, 0, 0, 0, 0, 0, 0, '1.16', 'Lebt im Moment😌\n\nIch bin zur Zeit so viel unterwegs und war dieses Jahr auch schon öfter in Berlin♥️\n\nEs ist irgendwie krass, denn alles ist wie vor der Pandemie, ich bin wieder nur unterwegs und kaum zuhause. Das ist ungewohnt, aber sehr schön🙏🏻\n\nIch genieße zur Zeit mein Leben und ich bin ehrlich die Uni kommt zur Zeit ein bisschen kurz, ich müsste 2 Hausarbeiten schreiben, aber dafür hab ich zur Zeit keinen Kopf.\n\nIch bin jetzt im 6. Semeund habe vor nächstes Jahr fertig zu sein, was ich auch schaffe! Ich hab schon die Themen für die 2 Hausarbeiten und auch schon für meine Bachelorarbeit, also mach ich mir keinen Kopf… in der meisten Zeit😌\n\nEs sind viele Fortbildungen, Beziehung die ich gerne pflege, Ehrenämter, Nebenjobs, Instagram und Familie. \n\nDie Uni ist zur Zeit nicht mein Hauptfokus, sondern ich lebe wieder! Ich erlebe lieber Dinge und bilde mich weiter, als mich jetzt einzusperren und zu schreiben, aber ich weiß, das ich das machen muss und das bis spätestens Oktober🙏🏻\n\nWas ich euch mit diesen Post sagen will, lebt im Moment und nicht nur in der Zukunft! Ich kenne das zu gut, ich bin oft gestresst, weil ich mir Stress mache….\n\nSchaut auf euch und macht euch nicht so viele Gedanken, was andere machen oder leisten! Konzentriert euch auf euch selbst und blickt auf euch♥️\n\n#ad #unbezahltewerbung #outfitinspo #berlin #berserkergang #berserker #berserkerlifestyle #girl #sightseeing #berlintour #hoodiekleid #kniestrümpfe #sneaker #weissesneaker #blond #selbstliebe #mindset #glücksgefühle #glücklich #unterwegs #sonne #frühlingsgefühle #liebe #outfitliebe #empowerment #womanempowerment #feminismus #dowhatyoulove #dowhatyouwant #doit', 1682270362, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342532438_751845093207680_3912050977157643637_n.jpg', NULL, NULL, 'https://instagram.com/p/CrYwUKFMVOG', 0, 0, '[\"#unbezahltewerbung\",\"#outfitinspo\",\"#berlin\",\"#berserkergang\",\"#berserker\",\"#berserkerlifestyle\",\"#girl\",\"#sightseeing\",\"#berlintour\",\"#hoodiekleid\",\"#kniestr\\u00fcmpfe\",\"#sneaker\",\"#weissesneaker\",\"#blond\",\"#selbstliebe\",\"#mindset\",\"#gl\\u00fccksgef\\u00fchle\",\"#gl\\u00fccklich\",\"#unterwegs\",\"#sonne\",\"#fr\\u00fchlingsgef\\u00fchle\",\"#liebe\",\"#outfitliebe\",\"#empowerment\",\"#womanempowerment\",\"#feminismus\",\"#dowhatyoulove\",\"#dowhatyouwant\",\"#doit\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(765, 44, 3085222691662338078, NULL, 'CrQ6bEdghge', 77, -1, 319, 0, 0, 0, 0, 0, '0.48', 'BEENDET: Huhu wer klopft denn da?😜\n\nEin ganz tolles Gewinnspiel, denn ihr könnt eine Glow Box inklusive eines Late Tickets für die Veranstaltung „House of Glow“ am 6.5.2023 ab 14 Uhr in Hamburg gewinnen!😍\n\nWas ihr dafür tun müsst?\n1. Mir @ichbinrachel folgen\n2. Diesen Beitrag Liken und speichern\n3. kommentieren warum ihr gewinnen wollt\n\nDann seid ihr im Gewinntopf, das Gewinnspiel endet am 26.4.2023 um 19 Uhr.😊\n\nAm 27.4. wird der oder die Gewinner*in benachrichtigt! Wichtig ist hier schnell antworten, damit das Paket mit dem Ticket noch rechtzeitig bei euch ankommt!🙏🏻\n\nDen Inhalt der Box seht ihr kurz im Video, aber hier nochmal eine Auflistung☺️\n- 1 Ticket für die Premium Pop-Up Glow\n- Banana Beauty Lip&Cheek Gel\n- Banana Beauty Mascara\n- Banana Beauty Liquid Lipstick (Nana-naked)\n- Feschi Trockenshampoo\n- Kiss Lashes\n- L‘Occitane Shower Öl\n- L‘Occitane Milchkonzentrat für den Körper\n- Vital Proteins Kollagen-Peptide\n- Hipi Faible Lipcare \n- Mermade Hair Bürste\n- Cosmopolitan Zeitschrift Mai\n- Elemis Collagen Rose Cleansing Balm\n\nDieses Gewinnspiel steht in keiner Verbindung zu Instagram. \n\nDanke an die @glowcon für diese tolle Möglichkeit☺️\n\n#ad #unbezahltewerbung #glow #glowcon #beauty #essstörung #essstörungsrecovery #essstörungskampf #essstörungbesiegen #zwangsgedanken #körperheilen #recovery #ﬁtness #selbstliebe #körperbewusstsein #körperbild #körperliebe #recovery #bewusstsein #bewusstleben #bewusstzunehmen #berserkergang #berserkerfit #berserkerlifestyle', 1682007439, '{\"city_name\":\"Hamburg\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/330224380_194868543330457_4753914782814019126_n.jpg', NULL, NULL, 'https://instagram.com/p/CrQ6bEdghge', 0, 0, '[\"#unbezahltewerbung\",\"#glow\",\"#glowcon\",\"#beauty\",\"#essst\\u00f6rung\",\"#essst\\u00f6rungsrecovery\",\"#essst\\u00f