(766, 44, 3083804896604189062, NULL, 'CrL4Db6s_GG', 60, -1, 0, 0, 0, 0, 0, 0, '0.37', 'Erste Moderationserfahrung😍\n\nIch war in Berlin und habe im BMUV @umweltministerium zusammen mit @lisa.rchmnn eine Podiumsdiskussion moderiert.\n\nDie Veranstaltung diente dem Auftakt für ein ganz tolles Projekt der @verbraucherzentrale.bayern und @verbraucherzentrale.nrw.\n\nDas Projekt „Verbraucherschutz in ländlichen Regionen für junge Menschen“.\n\nDa Lisa und ich uns ehrenamtlich engagieren und Verbraucherschutz sehr wichtig finden, moderierten wir die Veranstaltung!\n\nIch habe das erste mal moderiert und es war eine sehr coole Erfahrung und hat sehr viel Spaß gemacht!🙏🏻\n\nIch bin mega dankbar für diese tolle Erfahrung und habe einfach gemerkt, dass mir moderieren so viel Spaß macht und ich das gern öfter machen würde!🙏🏻\n\nDas Feedback an uns beide war auch sehr positiv, was mich sehr glücklich macht und für die Zukunft nur gutes heißen kann☺️\n\n#bmuv #verbraucherschutz #podiumsdiskussion #politik #verbraucherzentrale #berlin #business #moderation #moderatorin #umweltbewusst #bundesumweltministerium #staatssekretärin #jugendverbraucherdialog #umweltministerum #ehrenamt #moderation #ländlicheregion #verbände #berserkerfit #berserkergang #berserkerlifestyle #stolzaufmich #tolleerfahrung', 1681838212, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/342364078_781563146555287_3732932998385038305_n.jpg', NULL, NULL, 'https://instagram.com/p/CrL4Db6s_GG', 0, 0, '[\"#verbraucherschutz\",\"#podiumsdiskussion\",\"#politik\",\"#verbraucherzentrale\",\"#berlin\",\"#business\",\"#moderation\",\"#moderatorin\",\"#umweltbewusst\",\"#bundesumweltministerium\",\"#staatssekret\\u00e4rin\",\"#jugendverbraucherdialog\",\"#umweltministerum\",\"#ehrenamt\",\"#moderation\",\"#l\\u00e4ndlicheregion\",\"#verb\\u00e4nde\",\"#berserkerfit\",\"#berserkergang\",\"#berserkerlifestyle\",\"#stolzaufmich\",\"#tolleerfahrung\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(767, 44, 3083053626827047887, NULL, 'CrJNPBagYPP', 119, -1, 239, 0, 0, 0, 0, 0, '0.75', 'Ein neuer Track vom Herzen♥️ \n\nIch habe lange mein inneres Kind, meine innere Stimme und mein Bauchgefühl sehr lange unterdrückt…😕\n\nHeute hör ich auf mich, höre auf meine Gefühle und vor allem mein Bauchgefühl, denn das hat mich noch nie getäuscht, auch wenn ich es manchmal nicht hören bzw. Fühlen wollte🙏🏻\n\nDieser Song ist an euch alle gerichtet, denn wir alle haben Intuitionen und Gefühle und vor allem ein inneres Kind, das wichtigste ist darauf zuhören!☺️\n\nEs ist mir egal was irgendwer sagt, ich lass mich nicht mehr beeinflussen oder manipulieren! Es ist noch nicht lang her, da hab ich eine Person kennengelernt, mein Bauchgefühl hat geschrien „Lass es und lauf!“, doch ich hab nicht drauf gehört, ich hab mich anfangs manipulieren lassen. Doch dann setzte mein Verstand ein und ich konnte mich zum Glück schnell distanzieren!🙏🏻\n\nDurch diese Person hab ich wieder einmal viel über mich selbst gelernt und hab vor allem näher zu mir selbst gefunden, da ich die ganzen Dinge mal distanziert betrachtet habe🙏🏻\n\nDadurch wurde ich offener und bin jetzt einfach ich und hör auf mein Gefühl, ich hab jemanden kennengelernt wo mein Bauchgefühl direkt positiv reagiert hat und die Energie, Interessen, Einstellungen und Werte einfach passen!☺️\n\nIch bin froh, denn durch die Erfahrung öffne ich mich nun mehr, kommuniziere deutlich was ich will und was nicht. Spreche meine Gefühle frei raus ohne Angst zu haben! Und habe eine Person gefunden, wo zur Zeit einfach alles passt und die es entspannt und ohne Label angeht, genauso wie ich auch möchte☺️\n\nDas Shirt ist von @soulcult_deutschland \n\n#ad #unbezahltewerbung #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #körperbild #selbstheilung #deutschpop #traurigeslied #emotionenfühlen', 1681748857, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/341896579_639759017963829_4291845804103932368_n.jpg', NULL, NULL, 'https://instagram.com/p/CrJNPBagYPP', 0, 0, '[\"#ad\",\"#unbezahltewerbung\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(768, 44, 3080186243102908616, NULL, 'Cq_BRGOMaDI', 66, -1, 0, 0, 0, 0, 0, 0, '0.41', 'Lieb deinen Körper in allen Positionen!♥️\n\nSo viele Menschen auf Social Media suggerieren den „perfekten Körper“ zu haben, obwohl es den überhaupt gar nicht gibt…\n\nIch dachte mir damals immer, „oh wow die Beine sind so dünn, der Po trotzdem schön“ und bei den meisten waren es die Posen, Fotoshop oder Schönheitsops…😅\n\nIch musste erst durch eine ES durch um meinen Körper lieben zu lernen und heute lieb ich ihn! Ich liebe es dass er weich ist am Bauch und nicht mehr wie damals fest! Ich liebe meinen Körper so wie er jetzt ist🙏🏻\n\nDas wichtigste ist dass DU dich wohl fühlst! Egal was andere denken, sagen oder wie sie gucken… \n\nKeine*r hat das Recht deinen Körper oder Ähnliches zu kommentieren und dennoch passiert es tagtäglich… ich mach die Leute darauf aufmerksam, dass es schlimme Folgen haben kann. Weil ich selbst betroffen war, aber die Stärke habe darüber zu sprechen und versuche die Menschen darüber auf zu klären…. Denn Foodcalling und co ist vielen Menschen nicht bewusst…😕\n\nDiese nice Leggings ist von @prozisdeutschland und ich liebe die Farbe so sehr!🥰\n\n#ad #unbezahltewerbung #prozis #prozisleggings #sportlegging #essstörung #essstörungsrecovery #essstörungskampf #essstörungbesiegen #zwangsgedanken #körperheilen #recovery #ﬁtness #selbstliebe #realität #mehrrealitätaufinstagram #körperbewusstsein #körperbild #körperliebe #recovery #bewusstsein #bewusstleben #bewusstzunehmen #berserkergang #berserkerfit #berserkerlifestyle', 1681406835, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/340995784_192281820240163_3370169567331125954_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq_BRGOMaDI', 0, 0, '[\"#unbezahltewerbung\",\"#prozis\",\"#prozisleggings\",\"#sportlegging\",\"#essst\\u00f6rung\",\"#essst\\u00f6rungsrecovery\",\"#essst\\u00f6rungskampf\",\"#essst\\u00f6rungbesiegen\",\"#zwangsgedanken\",\"#k\\u00f6rperheilen\",\"#recovery\",\"#\\ufb01tness\",\"#selbstliebe\",\"#realit\\u00e4t\",\"#mehrrealit\\u00e4taufinstagram\",\"#k\\u00f6rperbewusstsein\",\"#k\\u00f6rperbild\",\"#k\\u00f6rperliebe\",\"#recovery\",\"#bewusstsein\",\"#bewusstleben\",\"#bewusstzunehmen\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(769, 44, 3079459390852537640, NULL, 'Cq8cAAUAZ0o', 98, -1, 302, 0, 0, 0, 0, 0, '0.61', 'Ein neuer Track von mir🙏🏻\n\nIch denke wir alle kennen diese Lüge „alles gut“ oder „mir geht’s gut“, es ist die Lüge, die jede Person erzählt…😕\n\nIch sage es auch oft, einfach weil die Menschen nichts für mich bedeuten, wie Nachbarn oder so. Genauso aber auch zu Menschen, die mir viel bedeuten, denn die möchte ich nicht belasten.\nZudem habe ich mir auch oft selbst etwas vorgemacht…😕\n\nDurch diesen Song versuche ich einfach zeigen, wer ich eigentlich bin. Dass ich innerlich oft nicht glücklich bin, auch wenn ich so wirke. \n\nMenschen die mich kennen, wissen wenn es Fake Lachen ist und wann nicht, denn man sieht es mir an! Außerdem hab ich sehr viele esoterische Freunde, die auch meine Energie spüren😌\n\nDas T-Shirt ist von @dailypride.de und die Rückseite ist echt schön designed mit „Smile with me“☺️\n\n#ad #unbezahltewerbung #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #körperbild #selbstheilung #deutschpop #traurigeslied #emotionenfühlen', 1681320399, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340510226_890033755438323_5625322511046984310_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq8cAAUAZ0o', 0, 0, '[\"#unbezahltewerbung\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(770, 44, 3077979334175142269, NULL, 'Cq3LeWHgLF9', 134, 118, 927, 0, 0, 0, 0, 0, '1.59', 'Mein Berlin Outfit♥️\n\nIch bin zur Zeit sehr viel in Berlin unterwegs, sowohl privat, als auch beruflich!☺️\n\nIch liebe diese Stadt und das Wetter ist zur Zeit einfach herrlich, ich entdecke immer mehr und es macht mich sehr glücklich so viel unterwegs zu sein und vor allem das zu können!🙏🏻\n\nIch studiere, hab dieses Semester aber nur noch einen Tag Uni in präsent. Das ist natürlich super, denn dadurch kann ich auch in der Woche einfach durch die Welt Touren. Die Hausarbeiten schreiben sich zwar nicht von allein, aber mein Kopf hat dazu einfach zur Zeit keinen Kopf und das ist auch okay so! Denn ich lebe das erste mal nur für mich! Tu genau das was mir gut tut und denke nicht nach!🙏🏻\n\nWas sagt ihr zu meinem heutigen Outfit?☺️\n\n#ad #unbezahltewerbung #outfitinspo #berlin #berserkergang #berserker #berserkerlifestyle #girl #sightseeing #berlintour #hoodiekleid #kniestrümpfe #sneaker #weissesneaker #blond #selbstliebe #mindset #glücksgefühle #glücklich #unterwegs #sonne #frühlingsgefühle #liebe #outfitliebe #empowerment #womanempowerment #feminismus #dowhatyoulove #dowhatyouwant #doit', 1681144093, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340678140_598521772313626_1038852260056165311_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq3LeWHgLF9', 0, 0, '[\"#unbezahltewerbung\",\"#outfitinspo\",\"#berlin\",\"#berserkergang\",\"#berserker\",\"#berserkerlifestyle\",\"#girl\",\"#sightseeing\",\"#berlintour\",\"#hoodiekleid\",\"#kniestr\\u00fcmpfe\",\"#sneaker\",\"#weissesneaker\",\"#blond\",\"#selbstliebe\",\"#mindset\",\"#gl\\u00fccksgef\\u00fchle\",\"#gl\\u00fccklich\",\"#unterwegs\",\"#sonne\",\"#fr\\u00fchlingsgef\\u00fchle\",\"#liebe\",\"#outfitliebe\",\"#empowerment\",\"#womanempowerment\",\"#feminismus\",\"#dowhatyoulove\",\"#dowhatyouwant\",\"#doit\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(771, 44, 3074394926716519471, NULL, 'CqqceWiM4Qv', 79, -1, 0, 0, 0, 0, 0, 0, '0.49', 'Die Sonne scheint, doch du musst nicht raus!🌞\n\nEndlich wird das Wetter besser und alle unternehmen etwas. Alle gehen raus und man muss die Sonnenstrahlen ja genießen.\n\nNein. Das muss man nicht. Hier ein kleiner Reminder, egal welches Wetter ist, hör auf deinen Körper und nimm dir was du brauchst! Du musst dich nicht schlecht fühlen, wenn du einen Tag zuhause verbringst, du lange schläfst und nicht viel rausgehst.♥️\n\nUns wird suggeriert, dass es falsch ist, nicht rauszugehen, wenn das Wetter so schön ist. Aber das ist es nicht! Es ist falsch, nicht auf seinen Körper zu hören!🙏🏻\n\nDas Foto ist nicht von heute, denn heute geht’s mir nicht gut. Ich habe Gliederschmerzen und fühl mich einfach nur schlapp. Ich habe Heuschnupfen und habe zu spät angefangen meine Tabletten zu nehmen, da ich nicht wusste, dass wir schon April haben😕\n\nMorgen ist mein erster Uni Tag im 6. Semester. Ich habe die Hausarbeiten aus dem 5. Semester noch nicht geschrieben, komm gar nicht voran. Mein Kopf ist überfordert und ich hab das Gefühl, nichts mehr zu schaffen. Ich bin dauergestresst und brauch einfach mal Urlaub für 2 Wochen, ohne über irgendwas nachzudenken. Denn dann könnte ich auch wieder effektiver arbeiten und Leistung bringen… aber dafür hab ich keine Zeit, denn ich hab die Semesterferien keine Zeit für Urlaub gehabt und jetzt kann ich maximal ein paar Tage wegfahren… ich bin überfordert, denn ich hab nur noch 2 Hausarbeiten und dann meine Bachelorarbeit. Ich hab dieses Semester nur ein Seminar. Es stresst mich, da ich meinen neuen Lebensabschnitt in einem Jahr schon sehen kann, aber bis dahin noch so viel zu tun ist. Es stresst mich alles😕\n\nDer Pulli ist von @clothing.joga und ultrabequem. Ob zuhause auf der Coach, draußen beim spazieren oder im Gym!☺️\n\n#ad #unbezahltewerbung #mentalegesundheit #selbstliebe #berserkergang #berserkerlifestyle #park #berserkerfit #mental #psyche körperbew