(772, 44, 3073657033178883983, NULL, 'Cqn0sloAieP', 63, -1, 809, 0, 0, 0, 0, 0, '0.39', 'Moderation Fashion Look für im Business☺️\n\nIch war in Berlin und habe im BMUV @umweltministerium eine Podiumsdiskussion moderiert, für ein ganz tolles Projekt der @verbraucherzentrale.bayern und @verbraucherzentrale.nrw \n\nEs war ein sehr coole Erfahrung und es hat mega viel Spaß gemacht! Dankeschön für die Vernetzung an die Projektreferent*innen vom  @jugend_verbraucher_dialog🙏🏻\n\nIch möchte später sehr gerne moderieren auch im TV, ich hatte schon immer Freude daran vor Menschen zu stehen und zu sprechen oder zu singen. Besonders der Verbraucherschutz liegt mir sehr am Herzen🙏🏻\n\nIch hatte einfach schicke Sneaker an, einen dunkelblauen Jumpsuits kombiniert mit einem weißen Blazer☺️\n\nSchreibt mir gern, wie euch das Outfit gefällt in die Kommis👇🏻\n\n#ad #unbezahltewerbung #bmuv #verbraucherschutz #podiumsdiskussion #politik #verbraucherzentrale #outfitinspo #businesswoman #businesslook #jumpsuit #berlin #business #moderation #moderatorin #umweltbewusst #bundesumweltministerium #staatssekretärin #berserkergang #berserker #berserkerlifestyle', 1680628581, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/339349015_1148642825820094_8818169717551383412_n.jpg', NULL, NULL, 'https://instagram.com/p/Cqn0sloAieP', 0, 0, '[\"#unbezahltewerbung\",\"#bmuv\",\"#verbraucherschutz\",\"#podiumsdiskussion\",\"#politik\",\"#verbraucherzentrale\",\"#outfitinspo\",\"#businesswoman\",\"#businesslook\",\"#jumpsuit\",\"#berlin\",\"#business\",\"#moderation\",\"#moderatorin\",\"#umweltbewusst\",\"#bundesumweltministerium\",\"#staatssekret\\u00e4rin\",\"#berserkergang\",\"#berserker\",\"#berserkerlifestyle\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(773, 44, 3072197196091835645, NULL, 'CqioxKZAUT9', 66, -1, 283, 0, 0, 0, 0, 0, '0.41', 'Ich versteh die Werte der Gesellschaft nicht…😔\n\nIch habe schon sehr viel schlechte Erfahrung gemacht, denn die Menschen reden immer!\n\nIch habe damals in meiner Wachstumsphase sehr viele gegessen und war trotzdem dünn. Food Calling und Bodyshamimg stand an der Tagesordnung.\n\n„wie kannst du nur so viel essen?“, „wie kannst du so viel essen ohne zuzunehmen?“, „bist du magersüchtig?“, „du bist auch nur am Essen“ usw.\n\nMein Kleidungsstil war nie „Standart“ oder „normal“, ich bin immer aufgefallen und wurde beleidigt. Mein Spitzname war „Alien“, „weil ich anders bin, nicht von dieser Welt“, „Du bist hässlich“, „Dich will eh keiner“. Skizzen mit Y+R im Herz, was dann danach mit 100 Strichen zerstört wurde und solche Sachen…\n\nMein Leben war nie leicht. Ich hab viel durch. Mittlerweile bin ich gefestigt, ich stehe zu mir und stehe für mich ein. Ich spreche Menschen an, wenn sie etwas kommentieren und weise sie darauf hin, dass das keine gute Idee ist und viel auslösen kann.\n\nEs sind so viele psychische Dinge die einen beeinflussen. Es ist für dich eine Situation, ein Blick, ein Spruch und du hast es danach vergessen. Aber ich weiß noch alles, ich fühl noch alles, ich seh noch alles vor meinen inneren Auge. Auch das Mobbing in der 6. klasse ist noch present. Die Tränen meiner Mutter, als ich mir das Leben nehmen wollte. Die Kommentare meines Vaters zu meinen abgekauten Nägeln bis aufs Blut. Die Kommentare von meinem Ex zu mein Doppelkinn. Alles ist in meinen Kopf. Ich habe NICHTS vergessen, gar nichts!!!🙏🏻\n\nEs ist nicht immer leicht damit zu leben, es ist nicht immer leicht zu lächeln und die Tränen müssen nicht immer unterdrückt werden. Steh für dich selbst ein und sag etwas. Druckt deine Gefühle aus. KEINER kann beurteilen ob etwas schlimm für einen selbst ist und so Kommentare wie „so schlimm ist/war das ja gar nicht“ gehen gar nicht!!!!🙏🏻\n\nDer Pulli ist von @soulcult_deutschland und ich lieb ihn sehr! Er spiegelt mich perfekt unperfekt wieder♥️\n\n#ad #unbezahltewerbung #mentalegesundheit #traurigkeit #gesellschaftskritik #heilen #selbstliebe #berserkergang #berserkerfit #berserkerlifestyle #körperbild #selbstheilung #deutschpop #traurigeslied #emotionenfühlen', 1680454664, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/339161070_1401325957336344_8109882083079734169_n.jpg', NULL, NULL, 'https://instagram.com/p/CqioxKZAUT9', 0, 0, '[\"#unbezahltewerbung\",\"#mentalegesundheit\",\"#traurigkeit\",\"#gesellschaftskritik\",\"#heilen\",\"#selbstliebe\",\"#berserkergang\",\"#berserkerfit\",\"#berserkerlifestyle\",\"#k\\u00f6rperbild\",\"#selbstheilung\",\"#deutschpop\",\"#traurigeslied\",\"#emotionenf\\u00fchlen\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459),
(774, 44, 2766392235552631859, NULL, 'CZkMxTNg2wz', 71, -1, 607, 0, 0, 0, 0, 0, '0.44', 'Huhu, dies ist mein erstes englisches Lied🤭\n\nIch weiß mein Englisch ist nicht gut, ich weiß das Lied ist nicht perfekt, ich weiß ich bin nicht perfekt. Genau das ist der Punkt!\n\nDie meisten Accounts auf Instagram sind eine Illusion, perfekte Menschen mit Tonnen von Filtern, Clean Food, perfekte Körper, immer am reisen, reiche Menschen, alle sind immer glücklich. → ne, ne die Leute geben nur die guten Seiten preis.\n\nIch stehe mit meinem Account zu 100% zu mir, ich zeige alles von mir, da ich zu 100% dahinter stehen kann.🙏🏻\n\nIch mache nichts wovon ich nicht überzeugt bin, denn ich lebe nur einmal, wieso sollte ich mich verstellen? Für wem oder was denn bitte?🤷🏼‍♀️\n\nZieh dein Ding durch und du wirst als erstes dir selbst beweisen, dass du stärker bist als du denkst. Und irgendwann sehen es alle und verstehen, dass sie dich nur klein redeten, weil sie selbst unzufrieden waren.❤️\n\nP.s. Macht was ihr wollt und zieht euer Ding durch! Egal was andere sagen, denken oder sonstiges! Die Leute verurteilen und beurteilen eh alles, also scheiss drauf!😊\n\nFree Beat by @matthewmaymusic \n\n#unbezahltewerbung #girl #fashion #beauty #lifestyle #cover #music #musicvideo #holiday #travel #blog #blond #german #germany #summer #view #single #lgbt #bisexual #music #dortmund #love #musik #musikcover #musiccover #happy #life', 1643999802, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/273260048_2253811024759144_1763795519185499515_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_1388387214926743_8057157191872716869_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=tCqdZCy0hQYAX9HFivy&edm=AOQ1c0wBAAAA&vs=1324037938114694_278915129