(778, 44, 2620669353138025576, NULL, 'CRefORLi3Ro', 6, -1, 463, 0, 0, 0, 0, 0, '0.03', 'Ich habe dieses Lied am Mittwoch früh geschrieben, habe nicht gedacht dass sich so schnell eine Situation entwickelt wo Dankbarkeit bei vielen absolut angebracht ist!😕🙏🏻\n\nWas am Mittwoch passiert ist und in welchen Ausmaßen teilweise die Menschen betroffen sind macht mich fassungslos.\n\nEs macht mich so verdammt traurig, wenn man die Bilder sieht bekomme ich Gänsehaut, wie in dem Moment auch wo ich daran denke…😔\n\nIch war am Donnerstag Nachmittag über die Ausmaße bei uns sehr verwundert, da wir eine sehr große Fläche im Mehrfamilienhaus haben und da schon über 20cm alles unter Wasser stand.\n\nIch war echt sauer, genervt und vor allem traurig da teilweise auch Erinnerungen beschädigt wurden, die nun mal Keller gelagert werden und da wir als Bewohner gemeinsam das Wasser entfernen mussten🤷🏼‍♀️\n\nIch gucke momentan nicht viel TV, Nachrichten, Social Media usw. wegen meiner Klausurphase. Aber als ich am Donnerstag Abend 4 Stunden bis Köln brauchte wegen Unwetterschäden war ich schon schockiert.\n\nNach und nach werden immer mehr Bilder veröffentlicht, Bilder die wir nicht in Deutschland vermuten. Menschen haben alles verloren, Häuser wurden weggespült, Menschen sind gestorben, es sind immer noch viele vermisst…😔\n\nIch hoffe einfach dass es dir und deiner Familie gut geht, ich hoffe dass alle die können Dinge spenden. Denn die meisten (auch ich) haben mehr als genug und soziales Engagement ist für mich schon immer sehr wichtig.🙏🏻\n\nAlso bitte seit dankbar für alles was in eurem Leben so läuft! Macht das beste aus der Situation und helft Menschen den es schlechter geht❤️\n\nFree Beat by Ryini Beats\n\n#girl #fashion #beauty #lifestyle #cover #music #musicvideo #holiday #travel #blog #blond #german #germany #summer #view #single #lgbt #bisexual #music #dortmund #love #musik #musikcover #musiccover #happy #life #memories', 1626628229, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/218929403_342014714052890_6296366233934661077_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/218762175_1674561039418303_1789089319894631085_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=cXVUttyfMFsAX9rRwVM&edm=AOQ1c0wBAAAA&vs=17876823728396893_3474846952&_nc_vs=HBksFQAYJEdMOExDZzItd19nZkFmTUZBSzNDd19kQkg5UVlidlZCQUFBRhUAAsgBABUAGCRHRldoRkEyOVZNRW54ZmtLQU5Vc3R6YTNJYVV5YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACb8%2BbT3kYfIPxUCKAJDMywXQFQMzMzMzM0YEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=50b4fd179d&ccb=7-5&oh=00_AfBjXnSUC034Vx8laZ-41y6MFVFEKEu7H3qp0PHcRNiUuw&oe=6452E29A&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CRefORLi3Ro', 0, 0, '[\"#fashion\",\"#beauty\",\"#lifestyle\",\"#cover\",\"#music\",\"#musicvideo\",\"#holiday\",\"#travel\",\"#blog\",\"#blond\",\"#german\",\"#germany\",\"#summer\",\"#view\",\"#single\",\"#lgbt\",\"#bisexual\",\"#music\",\"#dortmund\",\"#love\",\"#musik\",\"#musikcover\",\"#musiccover\",\"#happy\",\"#life\",\"#memories\"]', 'post', 'profile_scrape', 0, 1683024459, 1683024459);
