(783, 44, 2547566264395210702, NULL, 'CNaxgUXC5_O', 2, -1, 500, 0, 0, 0, 0, 0, '0.01', 'Richtig krass, der Song ist grad einfach so entstanden, das ist meine erste Aufnahme davon, zwischen durch einfach was neues eingeworfen und go for it.\n\nUnd dann ab „gefährlich“ war alles ein Freestyle, einfach was mir grad so eingefallen ist, als ich den Schnee fallen hab sehen.\n\nUnd ey nehmt es euch zu Herzen!\nMacht einfach was ihr wollt, solange ihr damit niemanden weh tut!🙏🏻❤️\n\nBeat by @raspobeats \n\n#newcomer #singersongwriter #deutschrap #deutschpop #songwriter #sing #singer #musik #music #dortmund #girl #diagnosekrebs #homerecording #singing #songs #deutsch', 1617913854, '{\"city_name\":\"Dortmund\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/171063810_207828084035786_3853743280320209497_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_813239149626890_4658216967898880463_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=2IgPCSoqFx0AX9UJlTS&edm=AOQ1c0wBAAAA&vs=17998114174325004_1525854070&_nc_vs=HBksFQAYJEdJQ1dtQUFLaHFIX291TUNBTTlaVF9xbVQ2VkFidlZCQUFBRhUAAsgBABUAGCRHSnpySVFyckNsbV9qSjhBQUQ1TVVEbnFzTWNuYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaY6Ovkhcz4PxUCKAJDMywXQGRSHKwIMScYEmRhc2hfYmFzZWxpbmVfM192MREAdewHAA%3D%3D&_nc_rid=50b4f34d99&ccb=7-5&oh=00_AfALQCihr4isGjvkZEVQ4bud3i1BihdyCQzqNP2Srdm8tQ&oe=64529121&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CNaxgUXC5_O', 0, 0, '[\"#newcomer\",\"#singersongwriter\",\"#deutschrap\",\"#deutschpop\",\"#songwriter\",\"#sing\",\"#singer\",\"#musik\",\"#music\",\"#dortmund\",\"#girl\",\"#diagnosekrebs\",\"#homerecording\",\"#singing\",\"#songs\",\"#deutsch\"]', 'post', 'profile_scrape', 0, 1683024460, 1683024460),
