(807, 46, 2945689855946129088, NULL, 'CjhMVEqI_7A', 1, 39, 0, 0, 0, 0, 0, 0, '0.68', 'Gestern haben wir die letzten Sonnenstrahlen im Zoo genossen. \nImmer wieder schön die Kinder so glücklich und zufrieden zu sehen 💕\n#momlife #mom #familytime #autumn #zoo #zoobesuch #mamasein #jungsmama #mädchenmama #happy #mamaleben #mamaalltag #mamasein', 1665373616, '[]', 'IMAGE', 'images/content/posts/310697228_1461792940954922_9153246735776590404_n.jpg', NULL, NULL, 'https://instagram.com/p/CjhMVEqI_7A', 0, 0, '[\"#mom\",\"#familytime\",\"#autumn\",\"#zoo\",\"#zoobesuch\",\"#mamasein\",\"#jungsmama\",\"#m\\u00e4dchenmama\",\"#happy\",\"#mamaleben\",\"#mamaalltag\",\"#mamasein\"]', 'post', 'profile_scrape', 0, 1683024647, 1683024647),
(808, 46, 2870471167580454167, NULL, 'CfV9lGJoj0X', 4, 122, 0, 0, 0, 0, 0, 0, '2.14', 'Kleiner Kämpfer 🦁 \nAuch etwas schlechtere Zeiten gehören dazu . Auch wenn wir die letzten Wochen durch paar Höhen und Ziegen geflogen sind, jetzt geht es endlich wieder bergauf 🥰\nDas wichtigste ist der Zusammenhalt \n#liebe #familie #family #love #mama #mamaleben #mamaalltag #mamaliebe #mamasein #familienzusammenhalt #kämpfer #kämpferlöwe #shinyygood #gesundwerden #gesundheit', 1656406850, '[]', 'IMAGE', 'images/content/posts/290387400_558954685698586_2496708193828678440_n.jpg', NULL, NULL, 'https://instagram.com/p/CfV9lGJoj0X', 0, 0, '[\"#liebe\",\"#familie\",\"#family\",\"#love\",\"#mama\",\"#mamaleben\",\"#mamaalltag\",\"#mamaliebe\",\"#mamasein\",\"#familienzusammenhalt\",\"#k\\u00e4mpfer\",\"#k\\u00e4mpferl\\u00f6we\",\"#shinyygood\",\"#gesundwerden\",\"#gesundheit\"]', 'post', 'profile_scrape', 0, 1683024647, 1683024647),
(809, 46, 2856956544424171685, NULL, 'Cel8tchIVil', 5, 675, 0, 0, 0, 0, 0, 0, '11.54', '*Werbung*\n\nSchaut euch bitte diese wunderschönen Schlüsselanhänger an 💝\nDie sind selbst gemacht von der lieben @arts.of.resin \nSie gibt sich so viel Mühe und jedes Produkt ist einfach ein Unikat. \nAlles wird mit viel Liebe produziert🥰\nSchaut gern mal bei @arts.of.resin vorbei und lasst ihr liebe da. \nWir sind richtig happy und zufrieden. \n#unikat #unikate #selbstgemacht #kooperation #kinder #kids #happy #mamaleben #mamablogger_de #mamablogger #familie #familienblogger #familienblog', 1654795781, '[]', 'IMAGE', 'images/content/posts/287195903_396473039167640_2887520133841913426_n.jpg', NULL, NULL, 'https://instagram.com/p/Cel8tchIVil', 0, 0, '[\"#unikat\",\"#unikate\",\"#selbstgemacht\",\"#kooperation\",\"#kinder\",\"#kids\",\"#happy\",\"#mamaleben\",\"#mamablogger_de\",\"#mamablogger\",\"#familie\",\"#familienblogger\",\"#familienblog\"]', 'post', 'profile_scrape', 0, 1683024647, 1683024647),
(810, 46, 2301820282717072238, NULL, 'B_xtVoAI-tu', 5, 373, 221, 0, 0, 0, 0, 0, '6.42', 'Ich liebe es einfach so sehr die Zeit mit meinen Kinder draußen zu verbringen. Die Mäuse fühlen sich so wohl🥰. Wenn wir bei uns in den Garten gehen, gibt es fast jedes Mal Theater wenn wir wieder rein gehen möchten 😅 und dannach muss fast täglich gebadet werden🛁. Der kleine Mann matscht einfach für sein Leben gern. \nHabt ihr Ideen wie man eine Matschküche selber macht ? Oder kennt ihr Seiten wo man diese bestellen kann? \n#Geschwisterliebe 💕\n#familie #familienzeit #familienleben #family #familytime #mama #mamasein #mamaalltag #babyboy #jungsmama #mädchenmama #nеwwееknеwluсk #Happy #love #loveyou #mаisоnnе', 1588618822, '[]', 'VIDEO', 'images/content/posts/95443894_640581369854116_8051377600124633684_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/94680555_136535777989632_23055069259925720_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=vUa_Dt5nSZMAX9iye82&edm=AOQ1c0wBAAAA&vs=18134254729070070_1981185220&_nc_vs=HBkcFQAYJEdPdTFwQVVBMUl1MkxYd0FBTmlJZ3AxMjZGRUFia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJuzM0oXGwLZAFQIoAkMzLBdAHO6XjU%2FfOxgSZGFzaF9iYXNlbGluZV8xX3YxEQB16gcA&_nc_rid=eb10816716&ccb=7-5&oh=00_AfCP5btFeb-WR4cSbQVejGm8MNwCPUupokHQ8ZnTCOVmwQ&oe=6452D39C&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/B_xtVoAI-tu', 0, 0, '[\"#geschwisterliebe\",\"#familienzeit\",\"#familienleben\",\"#family\",\"#familytime\",\"#mama\",\"#mamasein\",\"#mamaalltag\",\"#babyboy\",\"#jungsmama\",\"#m\\u00e4dchenmama\",\"#n\\u0435ww\\u0435\\u0435kn\\u0435wlu\\u0441k\",\"#happy\",\"#love\",\"#loveyou\",\"#m\\u0430is\\u043enn\\u0435\"]', 'post', 'profile_scrape', 0, 1683024647, 1683024647),
