(902, 52, 3086712868150027280, NULL, 'CrWNP_dtaQQ', 15, 270, 0, 0, 0, 0, 0, 0, '1.48', 'Werbung \nIch habe von @finish_deutschland & @brandsyoulove.de die neuen Spülmaschinen tabs zum Testen bekommen und bin begeistert! Ich liebe sowieso die Produkte von Finish, aber die neuen sind nochmal stärker was Verschmutzungen betrifft! Und das ganz ohne vorspülen😍\nFinish Ultimate All in 1 sorgt für ultimative Finish Reinigung und brillanten Glanz. Selbst hartnäckige, 24 Stunden eingetrocknete Verschmutzungen werden entfernt. Auch erhältlich in weiteren Packungsgrößen und als Citrus Variante. Ein angenehmer Duft ohne, dass es zu stark wird.\n\n#finish#finishquantum#finishquantumultimate#finishultimateplus#ultimateplus#finishspartwasser#bylmeetsfinishultimateplus', 1682184869, '[]', 'IMAGE', 'images/content/posts/342573065_708713224388486_3145077250420653589_n.jpg', NULL, NULL, 'https://instagram.com/p/CrWNP_dtaQQ', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110922, 1683110922),
(903, 52, 3055476029938518552, NULL, 'CpnO0K4NMoY', 36, 403, 0, 0, 0, 0, 0, 0, '2.28', 'Zwar nicht perfekt aber irgendwie doch perfekt. 🤍\n\nWir Mamas leisten täglich so viel, wir sind zwar nicht perfekt keiner von uns aber für unsere Kinder können wir perfekter nicht sein. Wir lesen ihnen vor, wir spielen mit ihnen, geben ihnen Geborgenheit, Sicherheit und Liebe. Wir geben so viel Liebe, dass sie keinerlei Begrenzung hat. \nWie oft aber denken wir Abends nach „war ich vielleicht zu streng?“, „habe ich zu wenig mit ihnen gespielt?“ „ah die Wäsche musste doch noch gemacht werden“ \nWir Mamas haben sowas wie Feierabend garnicht, nicht mal, wenn wir im Bett liegen und die Kinder bereits schlafen. In unserem Kopf gehen wir schon den nächsten Tag Strukturiert durch und planen alles. Jedoch klappt das alles am Ende nicht, was wir uns vorgenommen haben. Das ist aber in Ordnung, ein Tag sollte sich Bedürfnisorientiert richten aber nicht nur den Kindern gegenüber sondern auch uns selbst, denn wir Mamas vergessen uns selbst zu oft. Und jetzt setz dich hin während dein Kind schläft und trinke deinen Kaffee oder Tee in Ruhe warm aus und lass mal alles stehen und liegen. 🤍\n\n#erziehung#mama#bedürfnisorientiert#bedürfnisorientierteerziehung#elternschaft#elternschaftaufaugenhöhe#kinder#baby#zara#zarafashion#kaffeepause#pause#mamasein#mamaleben#alltag#mamaliebe#mamaalltag#3kids#3boys#boysmom', 1678461148, '[]', 'IMAGE', 'images/content/posts/334243832_1527278687795480_3235563538779118032_n.jpg', NULL, NULL, 'https://instagram.com/p/CpnO0K4NMoY', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110922, 1683110922),
