(909, 52, 2909724018375494422, NULL, 'ChhapQNsYsW', 18, 795, 0, 0, 0, 0, 0, 0, '4.23', 'Unser kleiner Schatz ist schon 17 Tage alt, die Zeit fliegt nur so davon. 🙈 Langsam möchte ich auch aktiver hier werden, nur, dass der kleine leider an Koliken leidet wie seine Brüder damals auch.🙈 Bauchmassage ist hier Alltag, leider hilft das aber auch nicht so und er meckert viel. 🫢 Wischt nach rechts, dann findet ihr den Strampler vom Beitrag bevor er da war. 😍\n\nHatten eure kleinen Koliken? Was hat bei euch geholfen? Bei den großen halfen sab simplex Salben und kümmelzäpfchen nie 😅\n\n#koliken#baby#colic#colicbaby#17daysold#augustbaby#augustbaby2022#august#summer#babyoutfit#outfitinspiration#stillen#stillbaby#geburt#babyboy', 1661086154, '[]', 'IMAGE', 'images/content/posts/300164026_727936378302164_9222864054756171666_n.jpg', NULL, NULL, 'https://instagram.com/p/ChhapQNsYsW', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110923, 1683110923),
(910, 53, 3090919387087811393, NULL, 'CrlJs5gvLNB', 0, 25, 295, 0, 0, 0, 0, 0, '1.3', 'Jedes Pelvi Power Beckenboden-Training bringt mich näher an mein Ziel, wieder einen starken, funktionierenden Beckenboden zu haben.\n\nBin so dankbar für diese Möglichkeit!\n\nBraucht Dein Beckenboden auch Unterstützung?\n\n#beckenbodentraining #Beckenboden \n#pelvipower #starkerbeckenboden #dankbarkeit', 1682686593, '[]', 'VIDEO', 'images/content/posts/343423826_1121605955899328_3600340877319414537_n.jpg', NULL, NULL, 'https://instagram.com/p/CrlJs5gvLNB', 0, 0, '[\"#beckenboden\",\"#pelvipower\",\"#starkerbeckenboden\",\"#dankbarkeit\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(911, 53, 3089736517232655535, NULL, 'Crg8v4HNHyv', 0, 167, 0, 0, 0, 0, 0, 0, '8.68', '\"Zergeht auf der Zunge und bleibt lange frisch\" hat meine Mutter bei diesem Rezept dazu geschrieben, das ich mir bei meinem Auszug zuhause, 2001, aus ihrem Kochbuch abgeschrieben habe.\n\nErschreckenderweise hab ich dieses Rezept erst jetzt wieder entdeckt, nachdem uns meine Mutter an Ostern damit verwöhnt hatte 😋\n\nUnd sie hat nicht übertrieben, er zerging auf der Zunge und war drei Tage später noch genau so köstlich ❤️\n\nFalls ihr auch köstlichen Kuchen essen möchtet - hier das Rezept:\n\n*Mandelkuchen vom Blech*\n\nFür den Teig:\n\n* 1/4l Schlagsahne\n* 2 Becher Mehl\n* 1 Becher Zucker\n* 4 Eier\n* 1 Pck Vanillezucker\n* 1 Prise Salz\n\nFür die Glasur: \n\n* 200g Mandelplättchen\n* 1 Becher Zucker\n* 125g Butter\n* 2 EL Milch oder Sahne\n\nSahne schlagen und mit den übrigen Zutaten verrühren. Auf ein eingefettetes Blech geben und bei 160 Grad Umluft ca. 15 Minuten, bis der Kuchen leicht gebräunt ist, backen. \n\nFür die Glasur die Butter bei mäßiger Hitze schmelzen und mit den übrigen Zutaten verrühren. Auf dem Kuchen verteilen und nochmals 15 Minuten goldgelb backen. \n\n#kuchen #mandel #mandelkuchenrezept #backenistliebe #schmecktwiebeimama #yummy #rezept', 1682545316, '[]', 'IMAGE', 'images/content/posts/343186989_6201758123244183_3857357723984318041_n.webp', NULL, NULL, 'https://instagram.com/p/Crg8v4HNHyv', 0, 0, '[\"#mandel\",\"#mandelkuchenrezept\",\"#backenistliebe\",\"#schmecktwiebeimama\",\"#yummy\",\"#rezept\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(912, 53, 3084993720096928829, NULL, 'CrQGXGEsDQ9', 1, 32, 746, 0, 0, 0, 0, 0, '1.72', 'Nach einem Jahr mit viel Arbeit, einem Umzug und ohne Urlaub leg ich nun zwei mal pro Woche die Beine hoch und trainiere meine Beckenbodenmuskeln 😆\n\nEin Wahnsinn, was der Beckenboden alles leisten muss und wie er vor allem das allgemeine Wohlbefinden beeinflussen kann. \nZwei Geburten haben ihn bei mir ziemlich mitgenommen, aber auch das häufige Tragen meiner Kinder (oder schwerer Umzugskisten 🤪), Niesen, weil mein Heuschnupfen mich wieder plagt, aber auch und vor allem Stress 🥴\n\nDer Pelvi Power Beckenboden-Trainer trainiert die Beckenbodenmuskeln, die oft schwer zu finden sind und ein effektives Beckenbodentraining manchmal gar nicht erst zulassen, ohne dass ich irgendwas dafür tun muss. Nur dasitzen und entspannen ist da angesagt 👍\n\nNach ca 25 Minuten hab ich das Gefühl, die Muskeln aus eigener Kraft viel schneller ansteuern und anspannen zu können. So fühlt sich mein Alltag gleich um einiges leichter an!\n\nProbier\'s doch auch mal aus!!! 😊\n\n#pelvipower #beckenboden #beckenbodentraining #geburt #wohlbefinden #ichtuwasfürmich #trainieren #bestestraining #mamaleben #starkerbeckenboden', 1681982499, '[]', 'VIDEO', 'images/content/posts/342067219_542329888050395_2499405016629872148_n.jpg', NULL, NULL, 'https://instagram.com/p/CrQGXGEsDQ9', 0, 0, '[\"#beckenboden\",\"#beckenbodentraining\",\"#geburt\",\"#wohlbefinden\",\"#ichtuwasf\\u00fcrmich\",\"#trainieren\",\"#bestestraining\",\"#mamaleben\",\"#starkerbeckenboden\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(913, 53, 3081789069751462871, NULL, 'CrEttS3N6vX', 10, 708, 0, 0, 0, 0, 0, 0, '37.32', 'Der absolute Traum meiner Kindheit - Zitronenkuchen vom Blech!!!\n\nIch hab ihn viel zu lang nicht gemacht, und das, weil er einfach noch zur ganz alten Backschule gehört. Frei nach dem Motto: mehr ist mehr! \nDie Zutatenliste ist nämlich erschreckend kalorienreich 😋\n\nIch backe ihn daher nur, wenn ich weiß, dass viele Leute zu Besuch kommen und nicht all zu viele Kuchenstücke übrig bleiben, derer ich mich dann schrecklicherweise annehmen muss 🤪\n\nHier das Rezept. Entscheidet selbst, ob und wann ihr ihn nachbacken möchtet 😄\n\nEinfacher, aber himmlisch guter Zitronenkuchen vom Blech: \n\n* 8 Eier\n* 350g Butter\n* 350g Zucker\n* 350g Dinkelmehl\n* Schale von 2 Zitronen\n* 1 Pck. Vanillezucker\n* 3 gestrichene TL Backpulver\n\nFür die Glasur: \n\n* 200g Puderzucker\n* Saft von 2 Zitronen\n* evtl. ein bisschen Wasser\n\nAlle Zutaten vermengen und auf ein eingefettetes Backblech streichen.\nIm Ofen bei 180 Grad Ober/Unterhitze ca 25 Minuten backen, bis der Kuchen hellbraun ist. \nFür die Glasur Puderzucker und Zitronensaft vermengen. Sollte die Glasur zu fest sein, noch ein bisschen Wasser dazu geben. Über den noch warmen Kuchen verteilen, auskühlen lassen. \n\n#zitronenkuchen #einfachesrezept #kindheitserinnerungen #kindheitstraum #rezept #backenistliebe #lecker #yummy #food #blechkuchen #kalorienbombe', 1681597907, '[]', 'IMAGE', 'images/content/posts/341018354_185149877681758_8830777554380087848_n.webp', NULL, NULL, 'https://instagram.com/p/CrEttS3N6vX', 0, 0, '[\"#einfachesrezept\",\"#kindheitserinnerungen\",\"#kindheitstraum\",\"#rezept\",\"#backenistliebe\",\"#lecker\",\"#yummy\",\"#food\",\"#blechkuchen\",\"#kalorienbombe\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(914, 53, 3077197866842104882, NULL, 'Cq0Zyf8tqQy', 40, 237, 0, 0, 0, 0, 0, 0, '14.4', 'Frohe Ostern 🥰🥰🥰\n\nGlauben eure Kinder an den Osterhasen? \nBzw. ab wann wußten sie, dass es den Osterhasen gar nicht gibt?\n\nWir haben dem kleinen Mann erzählt, dass der Osterhase eine \"Phantasiefigur\" ist und tatsächlich WIR die Ostereier verstecken. Ähnlich haben wir das auch mit dem Nikolaus gemacht und dem Weihnachtsmann.\n\nHab aber schon gemerkt, dass das Thema \"Gibts den Osterhasen wirklich?\" ein wenig die Gemüter der Elternschaft erhitzt. \"Du nimmst den Kindern doch jegliche Freude an Ostern\" hab ich schon gehört. Aber tatsächlich macht es für den kleinen Mann keinen Unterschied, wer da was versteckt. Hauptsache es gibt Ostereier 😆\n\nDaher fühlt es sich für uns genau richtig an ohne Osterhasen 😋\n\nWie seht ihr das?\n\n#froheostern #ostern #osterhase #gibtsdenosterhasenwirklich #ostereier #ostereiersuche #easter', 1681050593, '[]', 'IMAGE', 'images/content/posts/340179520_914119519891636_7605460498806768822_n.webp', NULL, NULL, 'https://instagram.com/p/Cq0Zyf8tqQy', 0, 0, '[\"#ostern\",\"#osterhase\",\"#gibtsdenosterhasenwirklich\",\"#ostereier\",\"#ostereiersuche\",\"#easter\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(915, 53, 3072333434017933727, NULL, 'CqjHvr2Memf', 7, 192, 0, 0, 0, 0, 0, 0, '10.34', 'Es wird langsam Frühling, zumindest kulinarisch gesehen. \nMit fruchtigem Himbeer-Tiramisu!!!\nGerade für Kinder eine spannende Alternative zum klassischen Tiramisu. \nUnd, in diesem Fall, nur mit Honig gesüßt!\n\nHier für euch das Rezept: \n\nHimbeer-Tiramisu: \n\n* 1kg Tiefkühl-Himbeeren\n* 500g Mascarpone\n* 5 Eier getrennt\n* 6 EL Honig\n* ca 300g Eierbiskotten (Löffelbiskuit)\n* 300ml Kirsch- oder Traubensaft\n* 1-2 EL Amaretto nach Wunsch\n* Kakaopulver\n\nDie aufgetauten Himbeeren pürieren und durch ein Sieb passieren. \nDas Eigelb mit dem Honig cremig rühren und die Mascarpone dazugeben. \nDas Eiweiß steif schlagen und unter die Mascarpone-Creme heben.\n1/3 der Masse in eine Auflaufform geben. \nBiskotten in Saft-Amaretto-Mischung eintauchen und dicht aneinander auf die Mascarpone-Masse legen, leicht in die Masse drücken.\n1/3 des Himbeer-Pürees darauf verteilen. Noch zwei weitere Schichten machen. \nMindestens 3 Stunden kalt stellen und vor dem Servieren mit Kakaopulver bestreuen. \n\n#himbeertiramisu\n#ohneraffiniertenzucker #fruchtig #yummy #food #dessert #einfachesrezept', 1680470707, '[]', 'IMAGE', 'images/content/posts/339123752_541675594787598_7741246873827235306_n.webp', NULL, NULL, 'https://instagram.com/p/CqjHvr2Memf', 0, 0, '[\"#fruchtig\",\"#yummy\",\"#food\",\"#dessert\",\"#einfachesrezept\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(916, 53, 3058604794495206243, NULL, 'CpyWNr8MYNj', 14, 745, 0, 0, 0, 0, 0, 0, '39.45', '\"Mama, zeig mir die Welt!\"\n\nDrei Monate sind vergangen seit unserem Umzug und noch immer haben wir kein einziges Bild an die Wand gehängt. \n\nIrgendwie \"passen\" manche Bilder, die wir in unserer alten Wohnung geliebt haben, nicht mehr zu uns. Aber irgendwie möchten wir auch unsere schönen neu ausgemalten nagelfreien Wände nicht \"verunstalten\" 🤪\n\nDarum bin ich mittlerweile zum Wandsticker-Fan geworden. Und diesmal hab ich mich gleich in unsere neuen Sticker verliebt, weil sie so pädagogisch wertvoll sind.\n\nAbgesehen von der schönen Zeit, die man mit dem gemeinsamen Aufkleben der Sticker von @wandsticker4u_de verbringt, könnten wir diesmal stundenlang dasitzen und über die Welt reden.\n\n\"Mama, welches Tier ist das?\"\n\"Mama, wo wohnen wir?\"\n\"Mama, kann man das Eis da oben essen?\"\n\nEs ergeben sich großartige Möglichkeiten der Kommunikation und auch die kleine Frau ist mit Begeisterung dabei 🥰\n\nEine Bereicherung fürs Kinderzimmer!!\n\nWenn ihr auch mal Wandsticker ausprobieren möchtet (man kann sie übrigens ganz einfach wieder von der Wand ablösen), nutzt gerne den Code\nInstaLove und spart 10% beim Kauf von 1 Artikel oder 15% beim Kauf von 2 Artikeln.\n\nWerbung selbstbezahlt\n#wandsticker #pädagogischwertvoll #wandsticker4u #spielen #zeigmirdiewelt #mamaleben #mumlife #lebenmitkindern\n#kreativität', 1678834126, '[]', 'IMAGE', 'images/content/posts/335645213_739701491206442_2945758230070758089_n.webp', NULL, NULL, 'https://instagram.com/p/CpyWNr8MYNj', 0, 0, '[\"#p\\u00e4dagogischwertvoll\",\"#wandsticker4u\",\"#spielen\",\"#zeigmirdiewelt\",\"#mamaleben\",\"#mumlife\",\"#lebenmitkindern\\n#kreativit\\u00e4t\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(917, 53, 3047768251378490885, NULL, 'CpL2ROtIN4F', 5, 135, 0, 0, 0, 0, 0, 0, '7.28', 'Schon wieder weht uns ein eisiges Lüftchen um die Nase, wenn wir uns auf den Weg in den Kindergarten machen. Und am Spielplatz ist es auch wieder einfach nicht mehr aushaltbar.\n\nDarum wollte ich uns wenigstens kulinarisch ein wenig Frühling ins Haus bringen und hab endlich mal wieder ein neues Rezept ausprobiert.\n\nDie kleine Frau sollte auch davon naschen dürfen, also hab ich jeglichen raffinierten Zucker durch alternative Süßungsmittel ersetzt. (Wenn ihr ganz normalen Haushaltszucker verwenden möchtet, könnt ihr das beim Nachbacken aber natürlich auch tun.)\n\nHier mein Rezept für herrlich leichte Topfen-Törtchen:\n\n10 kleine Backformen\n\nFür den Boden:\n\n* 4 Eier\n* 80g Kokosblütenzucker\n* 120g Dinkelmehl\n* 15g Kakaopulver ungesüsst\n* 4 EL Mineralwasser\n\nFür die Joghurtcreme:\n\n* 500g Naturjoghurt\n* 300g Schlagobers\n* 6 Blatt Gelatine\n* 1 Vanilleschote\n* Süßungsmittel nach Wahl und Geschmack (ich hab Honig verwendet)\n\nFür das Topping:\n\n* Ca 500g Beeren/Früchte nach Wahl (Ich hab Erdbeeren und Mango verwendet)\n* 4 Blatt Gelatine, aufgelöst \n* Süßungsmittel nach Wahl und    Geschmack (ich hab Reissirup verwendet)\n\nDen Backofen auf 200 Grad Heißluft vorheizen.\n\nFür den Boden, Eier mit Kokosblütenzucker mindest 5 Minuten lang schaumig rühren. Dann mit einem Löffel portionsweise das Mehl und den Kakao dazugeben und vorsichtig unterheben. Zuletzt das Mineralwasser unterheben.\n\nDie Masse auf ein Backblech (ca 30x40cm) streichen und 10 Minuten backen. Auskühlen lassen und mit den Backformen 10 runde Böden ausstechen.\n\nFür die Creme, Joghurt mit dem Mark der Vanilleschote verrühren. Die Gelatine einweichen und dann in 2 EL Wasser auf dem Herd auflösen und unter die Masse ziehen. Das Schlagobers steif schlagen und unterheben. Mit Süßungsmittel nach Geschmack abschmecken.\n\nDie Creme auf die 10 Förmchen verteilen und diese 1 Stunde lang in den Kühlschrank stellen.\n\nFür das Topping, die Beeren/Früchte pürrieren, Gelatine einweichen und in 2EL Wasser auf dem Herd auflösen. Unter die Beerenmasse ziehen und auf den Törtchen verteilen.\n\nFür mindestens 2 Stunden in den Kühlschrank stellen.\n\n#backen #food #yummy #backrezept #Joghurttörtchen #backenistliebe  #lecker\n#backrezepte', 1677542309, '[]', 'IMAGE', 'images/content/posts/333750550_1213227599589006_9150901642356109861_n.webp', NULL, NULL, 'https://instagram.com/p/CpL2ROtIN4F', 0, 0, '[\"#food\",\"#yummy\",\"#backrezept\",\"#joghurtt\\u00f6rtchen\",\"#backenistliebe\",\"#lecker\\n#backrezepte\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(918, 53, 2994927633631916419, NULL, 'CmQHtCiobGD', 60, 880, 0, 0, 0, 0, 0, 0, '48.86', 'GEWINNSPIEL Türchen 17 🎉 \n\nDas Fotoshooting für das Gewinnspielfoto war sehr amüsierlich, wie ihr sehen könnt. Vielleicht ähnlich chaotisch wie es in meinem Leben gerade zugeht? 😄\n\nGewinnen könnt ihr heute jedenfalls gleich 3 Dinge, die meine verschiedenen beruflichen Tätigkeiten widerspiegeln.\n\n1.) Meine Weihnachts-CD *Because it\'s Christmas*\n2.) Einen Handbalsam von Ringana\n3.) Eine Sprach- oder Gesangsaufnahme eurer Wahl, von mir persönlich aufgenommen (nähere Infos dazu in meiner Story 😄)\n\nEs wird also 3 Gewinner geben!!!\n\nWas musst du dafür tun: \n\n🎄FOLGE: @workingmum_aus_leidenschaft, @mkayalisa und @zeyzeystickerei\n🎄Like und Kommentiere das Foto so oft Du magst und schreibe dazu, was Du gerne gewinnen möchtest (1, 2 oder 3)\n🎄Markiere, wenn Du möchtest, einen Freund, der sich ebenfalls über einen Gewinn freuen würde. \n🎄Extralos: TEILE das Gewinnspiel in deiner Story \n\n🤫 PSST.. Umso mehr Kommentare desto höher die Gewinnchance 🎁 \n\n▫️▫️▫️\n      Start: 17.12.2022 00.00uhr \n➡️ Ende: 19.12.2022 23.59Uhr\n\n☘️ VIEL GLÜCK AN ALLE ☘️\n•••••••••••••••••••••••••••••••••••••\nDie Gewinner werden im Anschluss per Zufallsauslosung gezogen & in der Story bekanntgegeben.\n\nDer Rechtsweg ist ausgeschlossen.\nKeine Barauszahlung. \nInstagram steht in keinem Zusammenhang mit dem Gewinnspiel. \n\nVersand außerhalb Europas muss selbst übernommen werden.\nTeilnahme erst ab 18 Jahren möglich.\n\n#adventskalender #weihnachten #advent #christmas #adventszeit #gewinnspiel #weihnachtszeit #xmas #winter #adventcalendar #geschenk #geschenke #giveaway #verlosung #geschenkideen #vorweihnachtszeit #weihnachtsgeschenke #dezember #kalender', 1671243217, '[]', 'IMAGE', 'images/content/posts/320233626_214291664290749_913813192162511519_n.webp', NULL, NULL, 'https://instagram.com/p/CmQHtCiobGD', 0, 0, '[\"#weihnachten\",\"#advent\",\"#christmas\",\"#adventszeit\",\"#gewinnspiel\",\"#w