(919, 53, 2983883804129836416, NULL, 'Clo4oK0Mz2A', 15, 66, 0, 0, 0, 0, 0, 0, '4.21', 'Family Adventskalender 🎄 \n\nDas Jahr neigt sich dem Ende zu.🎆\nUm euch und euren kleinen das Warten auf Weihnachten 🌟 etwas zu versüßen haben wir uns etwas tolles für euch überlegt. \nAb Donnerstag erwartet euch jeden Tag ein anderes Gewinnspiel 🎁\n\n➡️ um nichts zu verpassen, aktiviert die Glocke auf meinem Profil! Ich zeig euch jeden Tag in der Story bei welchem Profil ihr etwas gewinnen könnt. \n\nFolgende Profile haben das Gewinnspiel ermöglicht: \n@schnubsibu \n@mymomlife2014.2020.2022 \n@mami_tinka \n@steffi8909 \n@vannys.mamaleben \n@tanjaweber \n@sellisworld\n@annikaskreativekiste\n@laura_ann2192 \n@zbri89\n@all.about.carmen\n@a.n.n.a._m.a.r.i.e\n@mkayalisa\n@mrs.blik\n@sixcute_design\n@mummy_love2018\n@workingmum_aus_leidenschaft\n@zeyzeystickerei\n@tini.and.the.toon @makidy_muttermilchschmuck\n@idaundrosa\n@stephanies_schokowelt \n@jackilicious_ \n@mrshandmadelove\n\n#adventskalender #weihnachten #advent #christmas  #adventszeit #gewinnspiel #weihnachtszeit  #xmas #winter #adventcalendar #geschenk  #geschenke #giveaway #diy #verlosung #geschenkideen #vorweihnachtszeit #weihnachtsgeschenke #dezember #kalender #weihnachtsdeko', 1669926690, '[]', 'IMAGE', 'images/content/posts/317650405_1134337437450166_8876085591564574517_n.webp', NULL, NULL, 'https://instagram.com/p/Clo4oK0Mz2A', 0, 0, '[\"#weihnachten\",\"#advent\",\"#christmas\",\"#adventszeit\",\"#gewinnspiel\",\"#weihnachtszeit\",\"#xmas\",\"#winter\",\"#adventcalendar\",\"#geschenk\",\"#geschenke\",\"#giveaway\",\"#diy\",\"#verlosung\",\"#geschenkideen\",\"#vorweihnachtszeit\",\"#weihnachtsgeschenke\",\"#dezember\",\"#kalender\",\"#weihnachtsdeko\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(920, 53, 2982964031128734740, NULL, 'CllnftdMgwU', 0, 170, 0, 0, 0, 0, 0, 0, '8.84', 'Der Umzug ist geschafft...\n\n...und als erstes nach den Kinderzimmern musste ich natürlich die Küche einräumen 🙈😄\n\nUnd... tadaaa... ich hab eine eigene Twistshake-Schublade 😆\nMittlerweile haben wir so viele Produkte, dass sich das lohnt 😉\n\nIch liebe ja die Farben und die Muster und selbstverständlich die Erleichterung im Alltag, die man durch die Produkte verspürt.\n\nAber auch, dass es bei @twistshakebaby für JEDES Alter etwas gibt, vom Beißring über Hochstuhl und Buggy zum Essbesteck. So finde ich für meine BEIDEN Kinder immer Produkte und kann Angebote super nutzen.\n\nWie z.B. den aktuellen BLACK FRIDAY SALE, der -50% auf alle Produkte bringt.\n\nUnd mit meinem Code 30workingmumausleidenschaft gibts heute nochmal -30% oben drauf. \n\nDas aber nur mehr wenige Stunden!!!\n\nFolgt gerne dem Link in meiner Bio, um zum Sale zu gelangen!\n\n#twistshake\n@twistshakebaby\n@oliviar.contact\n#igdecembertv\nWerbung', 1669817044, '[]', 'IMAGE', 'images/content/posts/317482685_683069113256271_8208273980883418470_n.webp', NULL, NULL, 'https://instagram.com/p/CllnftdMgwU', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
(921, 53, 2977391812432532961, NULL, 'ClR0hQZMpXh', 3, 341, 0, 0, 0, 0, 0, 0, '17.88', 'Ein richtig herbstliches Rezept hab ich heute für euch....\n\n...und es ist beliebt bei Groß und Klein. \n\nViel Freude beim Nachkochen und vor allem beim Genießen!!!!\n\nKürbisknödel mit Faschiertem und Bergkäse!!!\n\n* 300g Butternusskürbis, geschält, entkernt\n* 100g Kartoffel, geschält\n* 200g Topfen/Quark\n* 90g Dinkelgries\n* 90g Semmelbrösel\n* 50g Butter, geschmolzen\n* 100g Dinkelmehl \n* 2 Eier\n* Salz, Pfeffer\n\nFür die Füllung:\n\n* 40g Zwiebel, fein gewürfelt \n* 1 Knoblauchzehe, fein gewürfelt\n* 2 EL Sonnenblumenöl\n* 300g Faschiertes/Hackfleisch gemischt\n* 1 EL Weißwein\n\nAußerdem:\n\n* 100g Kürbiskerne\n* 50g Butter, geschmolzen \n* 100g Bergkäse, gerieben\n\nKürbis und Kartoffeln weich kochen und fein pürieren. \nMit Topfen, Gries, Bröseln, Butter, Mehl und Eiern zu einem Teig mischen. \nMit Salz und Pfeffer würzen und ca 30 Minuten zugedeckt im Kühlschrank ruhen lassen. \n\nFür die Füllung Zwiebel und Knoblauch im Öl anschwitzen, Faschiertes dazugeben, mitbraten und Weißwein beifügen. Ca 3 Min. bei mittlerer Hitze garen, bis die Flüssigkeit verdampft ist. Mit Salz und Pfeffer würzen. \n\nTeig mit angefeuchtete Händen zu 12 Kugeln formen. In der Mitte jeder Kugel eine Mulde drücken und mit je 1 EL Faschiertem füllen. Gut verschließen, rund drehen und in Mehl wälzen. \n\nDie Knödel in siedendem Wasser 15-20 Minuten garen. Sie sind fertig, wenn sie an der Oberfläche schwimmen. Knödel mit einem Schaumlöffel rausnehmen, abtropfen lassen und sofort in den Kürbiskernen wälzen. Mit geschmolzener Butter anrichten und mit Käse bestreuen. \n\nKennt ihr noch andere gute Knödelvariationen? Möcht gerne öfter Knödel essen 😊\n\n#knödelliebe #kürbisknödel #kürbis #knödel #rezept #yummy #food', 1669152784, '[]', 'IMAGE', 'images/content/posts/316477673_1321367611968217_2263347735686043285_n.webp', NULL, NULL, 'https://instagram.com/p/ClR0hQZMpXh', 0, 0, '[\"#k\\u00fcrbiskn\\u00f6del\",\"#k\\u00fcrbis\",\"#kn\\u00f6del\",\"#rezept\",\"#yummy\",\"#food\"]', 'post', 'profile_scrape', 0, 1683110928, 1683110928);
