(924, 53, 2564192318728331748, NULL, 'COV11QFlmHk', 4, 57, 397, 0, 0, 0, 0, 0, '3.17', 'Nicole gibt Einblicke in ihr Leben als körperlich behinderte Frau und das mit ganz viel Humor und Intelligenz 🥰\n\nNach ca 20 Sekunden geht das Video dann richtig los, erstmal guck ich nur gespannt in die Kamera 😆', 1619895594, '[]', 'VIDEO', 'images/content/posts/180286694_973869946688488_7666969631905530882_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_301566561408369_3322465340217962410_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQzMi5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=TZBJZvO3MmoAX-Acvrn&edm=AOQ1c0wBAAAA&vs=18114224653209033_774420773&_nc_vs=HBksFQAYJEdJQ1dtQUJ4MWNUdlJSSUJBS292UGE2ZnhCc3VicUNCQUFBRhUAAsgBABUAGCRHSUNXbUFCcEdXMlliUjhEQU9NMmdyYm04c2NQYnFDQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaSjvS90rKtQBUCKAJDMywXQKhYVwo9cKQYEmRhc2hfYmFzZWxpbmVfM192MREAdewHAA%3D%3D&_nc_rid=510f403088&ccb=7-5&oh=00_AfDAqJ1lzSmzLNKAst13v5ezTpOwgep89tQbJCnRZewB3Q&oe=6453A1EA&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/COV11QFlmHk', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683110928, 1683110928),
