(926, 54, 3090936379252777454, NULL, 'CrlNkKssaHu', 34, 178, 201, 0, 0, 0, 0, 0, '4.17', 'Kokos-Energie-Kugeln \n\nZutaten: \n\n80 g Kokosmus \n40g  Kokosraspeln \n40 g Ahornsirup oder Agavendicksaft\n8 ganze Mandeln \n\n#energyballs \n#energyball \n#energyballsnacks \n#blissballs \n#blissball \n#blissballsrecipe \n#energiekugeln \n#gesundersnack \n#snack \n#snacktime \n#leckeressen \n#gesundesüßigkeiten \n#gesundundlecker \n#gesundessen \n#leckerabnehmen \n#leckerschmecker \n#tastyfood \n#dessert \n#desserts \n#dessertporn \n#kokos \n#kokosdessert \n#cocos \n#kokosdessert \n#nachtischgehtimmer \n#nachtischliebe \n#deliciousrecipes', 1682689085, '[]', 'VIDEO', 'images/content/posts/343285362_179875324987579_1754601713196679216_n.jpg', NULL, NULL, 'https://instagram.com/p/CrlNkKssaHu', 0, 0, '[\"#energyballs\",\"#energyball\",\"#energyballsnacks\",\"#blissballs\",\"#blissball\",\"#blissballsrecipe\",\"#energiekugeln\",\"#gesundersnack\",\"#snack\",\"#snacktime\",\"#leckeressen\",\"#gesundes\\u00fc\\u00dfigkeiten\",\"#gesundundlecker\",\"#gesundessen\",\"#leckerabnehmen\",\"#leckerschmecker\",\"#tastyfood\",\"#dessert\",\"#desserts\",\"#dessertporn\",\"#kokos\",\"#kokosdessert\",\"#cocos\",\"#kokosdessert\",\"#nachtischgehtimmer\",\"#nachtischliebe\",\"#deliciousrecipes\"]', 'post', 'profile_scrape', 0, 1683110932, 1683110932),
(927, 54, 3090216334017145776, NULL, 'Crip2IUM6uw', 49, 214, 0, 0, 0, 0, 0, 0, '5.17', 'Feigen - Salat\n\nZutaten: \nTomaten \nGurke\nPaprika \nFeigen \nWalnüsse \nBacon \nFeta \nHonig \n\nDressing: \n\nHonig \nOlivenöl \nSenf \nBalsamico Essig \n\nZubereitung: \n\nTomaten, Gurke, Paprika waschen und in Stücke schneiden. \nFeta in Bacon einrollen und solange backen, bis es schön kross ist. \nFeigen waschen, einschneiden und mit Honig beträufeln. Im Backofen backen. \nWalnüsse anrösten und Honig dazugeben. \nDressing vorbereiten. \nAlle Zutaten in einem Salatschälchen anrichten und mit Dressing beträufeln. \nBaguette passt gut dazu. \nGuten Appetit 😋 \n\n#feigen \n#feigenliebe \n#honig \n#salat \n#salatliebe \n#salad \n#sałatka \n#salatbowl \n#saladrecipe \n#saladideas \n#leckerschmecker \n#leckerschmecker \n#bowlfood \n#ig_bowl \n#tastyfood \n#tastyfoods \n#gesundeernährung \n#gesundeküche \n#gesunderezepte \n#neueküche \n#neuerezepte \n#einfacherezepte \n#einfachesrezept \n#kochenmitliebe \n#kochenmachtspass \n#kochenmachtglücklich \n#rezeptefürjedentag \n#rezeptwelt \n#bowlrecipes \n#salatrezepte \n#salatrezept', 1682602500, '[]', 'IMAGE', 'images/content/posts/343295456_894179048546058_1196753266783390254_n.jpg', NULL, NULL, 'https://instagram.com/p/Crip2IUM6uw', 0, 0, '[\"#feigen\",\"#feigenliebe\",\"#honig\",\"#salat\",\"#salatliebe\",\"#salad\",\"#sa\\u0142atka\",\"#salatbowl\",\"#saladrecipe\",\"#saladideas\",\"#leckerschmecker\",\"#leckerschmecker\",\"#bowlfood\",\"#ig_bowl\",\"#tastyfood\",\"#tastyfoods\",\"#gesundeern\\u00e4hrung\",\"#gesundek\\u00fcche\",\"#gesunderezepte\",\"#neuek\\u00fcche\",\"#neuerezepte\",\"#einfacherezepte\",\"#einfachesrezept\",\"#kochenmitliebe\",\"#kochenmachtspass\",\"#kochenmachtgl\\u00fccklich\",\"#rezeptef\\u00fcrjedentag\",\"#rezeptwelt\",\"#bowlrecipes\",\"#salatrezepte\",\"#salatrezept\"]', 'post', 'profile_scrape', 0, 1683110932, 1683110932),
