(955, 56, 2010119904147245292, NULL, 'BvlYWcao4js', 12, 109, 303, 0, 0, 0, 0, 0, '13.38', '🥞🥒 Zucchini Pancakes 🥒🥞 low carb | high protein \nPancakes gehen doch immer, oder!? 😃 Hier in der Low-Carb-aber-trotzdem-super-lecker-Variante. Die Zucchini macht mehr aus dem Ganzen und man schmeckt sie gar nicht raus. Ist ein super High Volume Tipp! ☝🏼 Zutaten:\n• Zucchini (100 g)\n• Eiklar (2 Stück, ca. 70 g)\n• Proteinpulver (30 g)\n• Kokosmehl (10 g)\n• Backpulver (5 g)\n(• Wasser)\n\nAnleitung:\n1. Die Zucchini fein raspeln und das Wasser ein bisschen ausdrücken. \n2. Die restlichen Zutaten hinzufügen und zu einem cremigen Teig vermengen. (Evtl. etwas Wasser und Süßungsmittel hinzufügen.)\n3. In einer beschichteten Pfanne mit Deckel bei mittlerer Hitze mit ein bisschen Öl ausbacken. \n4. Nach Belieben tippen. \n5. Guten Appetit!\n\nNährwerte 🥰: 214 kcal | 34g Eiweiß | 9,9g Kohlenhydrate | 3,7g Fett \nDas Rezept habe ich bei @evasaischegg entdeckt! 👍🏼 #zucchini #pancakes #erdbeeren #schokolade', 1553845435, '[]', 'VIDEO', 'images/content/posts/54247691_412795799496200_2224932385599651424_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/56459227_131084121283215_7360375538655960059_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=N9inbfitrqoAX_ujOfl&edm=AOQ1c0wBAAAA&vs=17849500102388321_3245156903&_nc_vs=HBkcFQAYJEdOdC1YUU9QR254bU9IY0FBUHNiRURPT1RpVm1ia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJqDcm9PO5bk%2FFQIoAkMzLBdALNwo9cKPXBgSZGFzaF9iYXNlbGluZV8xX3YxEQB16gcA&_nc_rid=a5bd7946ac&ccb=7-5&oh=00_AfDJwus_vtwW7hx2-oQsUsjGS356n9-NMXnsitIbflXvjA&oe=6453BE36&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BvlYWcao4js', 0, 0, '[\"#zucchini\",\"#pancakes\",\"#erdbeeren\",\"#schokolade\"]', 'post', 'profile_scrape', 0, 1683110938, 1683110938),
(956, 56, 1841452102745061949, NULL, 'BmOJu5XA_o9', 5, 123, 340, 0, 0, 0, 0, 0, '14.16', 'Manchmal wäre ich gerne wieder ein kleines Kind. Einfach durch Pfützen springen und nicht an morgen denken. 👧🌂 . \nErwachsen sein ist manchmal echt anstrengend. Ständig macht man sich Sorgen, muss Entscheidungen treffen und soll sich benehmen...☝ Wir sollten ab und zu unseren Kopf ausschalten und das tun, wozu wir Lust haben! 🙃 . \nIn diesem Sinne: Ich will ein Eis und danach schaukeln! 🍦🎠 . \n#dowhatyoulovr #lebengenießen #pfützenspringen #kindsein #kopfaus #reset #happy #sommer #berge #natur #allgäu #meinallgäu #tannheimertal #alpen #nature #motivation #glutenfreelifestyle', 1533743417, '{\"city_name\":\"Tannheim\",\"region_name\":\" Tirol\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/37355713_223868478332067_7528338329922699264_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/38099403_310381506200616_8587306322853890982_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjY0MC5mZWVkLiIsInFlX2dyb3VwcyI6IltcImlnX3dlYl9kZWxpdmVyeV92dHNfb3RmXCJdIn0&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=MBhw2-f4koMAX_uckMV&edm=AOQ1c0wBAAAA&vs=17966920354051314_1743453669&_nc_vs=HBkcFQAYJEdNdFpSUUlvQkd4VFNob0JBS1lMTEdlYVBTeDNia1lMQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAEwFQAAJuqqz6fQ2Y0BFQIoAkMzLBdAC5mZmZmZmhgUZGFzaF9iYXNlbGluZV82NDBfdjERAHXqBwA%3D&_nc_rid=a5bd7a5aa3&ccb=7-5&oh=00_AfDfvGmI-Xiz-6Bas6Utp00sqI6KNkX90F1ywoNWkvz5xA&oe=64539ECD&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BmOJu5XA_o9', 0, 0, '[\"#dowhatyoulovr\",\"#lebengenie\\u00dfen\",\"#pf\\u00fctzenspringen\",\"#kindsein\",\"#kopfaus\",\"#reset\",\"#happy\",\"#sommer\",\"#berge\",\"#natur\",\"#allg\\u00e4u\",\"#meinallg\\u00e4u\",\"#tannheimertal\",\"#alpen\",\"#nature\",\"#motivation\",\"#glutenfreelifestyle\"]', 'post', 'profile_scrape', 0, 1683110938, 1683110938),
