(970, 58, 3093712108680309079, NULL, 'CrvEsWLNulX', 6, -1, 0, 0, 0, 0, 0, 0, '0.04', 'ᵂᵉʳᵇᵘᶰᵍ| \n\nLancôme Rénergie🤍\n\n>> RÉNERGIE H.P.N. 300-PEPTIDE CREAM\nStraffende Anti-Aging-Tagescreme – regeneriert Deine Haut schneller, als Du alterst!\n\nRénergie H.P.N. 300-Peptide Cream ist jetzt noch wirksamer und beinhaltet eine höhere Konzentration an aktiven Inhaltsstoffen als die Rénergie Multi-Lift Ultra. \nNeben der Wirksamkeit wurden auch die Textur verbessert und das Design erneuert. Entdecke mit Lancôme eine neue Ära von hochwirksamem Anti-Aging – inspiriert von der regenerativen Wissenschaft. \nZum ersten Mal vereint Lancôme hochwertige Hyaluronsäure, über 300 Arten von Peptiden und geballte Niacinamid-Power in einer einzigartigen Creme. INSERT INTO `lookup_media` (`id`, `lookup_id`, `mid`, `username`, `shortcode`, `comments_count`, `like_count`, `view_count`, `play_count`, `reach_count`, `saves_count`, `shares_count`, `total_interactions`, `engagement_rate`, `caption`, `timestamp`, `location`, `media_type`, `display_url`, `video_url`, `carousel`, `permalink`, `has_audio`, `pinned`, `hashtags`, `type`, `origin`, `campaign_id`, `updated_at`, `created_at`) VALUES
(1000, 59, 3088622134180101860, NULL, 'Crc_XeBNr7k', 30, 173, 0, 0, 0, 0, 0, 0, '1.98', 'Не беги за миром суетливым,\nНе стремись понравиться усердно,\nНо , когда ты можешь быть красивым,\nБудь красивым мыслями и сердцем🪻\n_________________\n#spring #springtime #flowers #nature #sun #sunlight #germany', 1682412472, '{\"city_name\":\"Bielefeld\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343131414_1523664341493267_6410974500502213659_n.jpg', NULL, NULL, 'https://instagram.com/p/Crc_XeBNr7k', 0, 0, '[\"#springtime\",\"#flowers\",\"#nature\",\"#sun\",\"#sunlight\",\"#germany\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
(1001, 59, 3087454351773982759, NULL, 'CrY11_5uOAn', 24, 408, 256, 0, 0, 0, 0, 0, '4.21', '𝐓𝐡𝐞 𝐎𝐫𝐝𝐢𝐧𝐚𝐫𝐲 𝐋𝐚𝐜𝐭𝐢𝐜 𝐀𝐜𝐢𝐝 + 𝐇𝐀 𝐢𝐬 𝐚 𝐰𝐚𝐭𝐞𝐫-𝐛𝐚𝐬𝐞𝐝 𝐬𝐞𝐫𝐮𝐦 𝐨𝐟𝐟𝐞𝐫𝐢𝐧𝐠 𝐚 𝐯𝐞𝐫𝐲 𝐦𝐢𝐥𝐝 (𝟓%) 𝐭𝐨 𝐦𝐢𝐥𝐝 (𝟏𝟎%) 𝐞𝐱𝐟𝐨𝐥𝐢𝐚𝐭𝐢𝐨𝐧.\n\nWerbung @theordinary @deciem \n\n𝐖𝐡𝐚𝐭 𝐢𝐬 𝐋𝐚𝐜𝐭𝐢𝐜 𝐀𝐜𝐢𝐝?\n\nLactic Acid is an alpha hydroxyl acid that exfoliates the skin. Direct acids such as Lactic Acid work by encouraging exfoliation of the top layer of the skin.\n\nContinuous daily use visibly improves skin’s radiance and clarity. This formula contains a derivative of Tasmanian Pepper Berry to reduce signs of inflammation and sensitivity that is often associated with exfoliation.\n\nHow to integrate it into your skin care regimen?\nThe Ordinary recommends a 3-step skincare regimen, 1-Prep 2-Treat 3-Seal, to create an easy skincare regimen. The Ordinary Lactic Acid 5% + HA or 10% + HA are part of the 2-Treat step.\n\nMy skin is noticeably smoother and brighter, and my pores appear smaller after using the 10% concentration. I’ve also noticed a reduction in the appearance of fine lines and wrinkles.\n\nIt’s up to you to choose the concentration that suits you best!\n_____________\n#theordinary #deciem #TheOrdinarygiftedme #complimentaryfromTheOrdinary #reels #beautyaddict #tutorial #aesthetic #contentcreator #influencer #openmyworld', 1682273536, '{\"city_name\":\"NRW\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/342528481_181159728147035_3770475952534051240_n.jpg', NULL, NULL, 'https://instagram.com/p/CrY11_5uOAn', 0, 0, '[\"#theordinarygiftedme\",\"#complimentaryfromtheordinary\",\"#reels\",\"#beautyaddict\",\"#tutorial\",\"#aesthetic\",\"#contentcreator\",\"#influencer\",\"#openmyworld\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
