(1005, 59, 3080175254816312235, NULL, 'Cq--xMlRkur', 41, 369, 205, 0, 0, 0, 0, 0, '4', '𝐄𝐬𝐭𝐞𝐞 𝐋𝐚𝐮𝐝𝐞𝐫\n\nAnzeige @esteelaudergermany \n\n𝐃𝐚𝐲𝐖𝐞𝐚𝐫 𝐌𝐮𝐥𝐭𝐢-𝐏𝐫𝐨𝐭𝐞𝐜𝐭𝐢𝐨𝐧 𝐀𝐧𝐭𝐢-𝐎𝐱𝐢𝐝𝐚𝐧𝐭 𝐒𝐡𝐞𝐞𝐫 𝐓𝐢𝐧𝐭 𝐑𝐞𝐥𝐞𝐚𝐬𝐞 𝐌𝐨𝐢𝐬𝐭𝐮𝐫𝐢𝐳𝐞𝐫 𝐒𝐏𝐅 𝟏𝟓\n\nDie getönte Gesichtscreme eignet sich hervorragend für einen leichten und natürlichen Frühlingslook. Die Moisturizer verleiht jedem Hautton einen gesunden und gleichmäßgen Schimmer. Ausgestattet mit einem spezifischen Komplex aus Antioxidanzien, die für die Hautgesundheit wichtig sind, unterstützt sie die Haut beim Kampf gegen sichtbare Zeichen der Zeit.\n\nDie Haut sind glatter und ebemäßiger aus. Wunderbar durchfeuchtet, intentiv geschützt und gesund strahlend.\n___________\n#esteelauder #esteelaudergermany #lightlook #eingeschenkvonesteelauder #reels #tutorial #skincare #skincareroutine #openmyworld', 1681405914, '{\"city_name\":\"NRW\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/341391045_760163342400907_8018416645530211040_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq--xMlRkur', 0, 0, '[\"#esteelaudergermany\",\"#lightlook\",\"#eingeschenkvonesteelauder\",\"#reels\",\"#tutorial\",\"#skincare\",\"#skincareroutine\",\"#openmyworld\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
(1006, 59, 2776292878830329420, NULL, 'CaHX6nzIN5M', 50, 480, 1384, 0, 0, 0, 0, 0, '5.17', 'Когда она оставалась наедине с собой, она чувствовала себя особенно спокойно. Ее резкий нрав превращался в абсолютную нежность и любовь ко всему вокруг.\n\nЕе не злил гул незнакомцев вокруг, люди, которые проходили мимо.\nОставаясь наедине с собой, она позволяла себе никуда не спешить.\n\nМедленно доесть свой обед с прекрасным видом. Медленно думать. Медленно жить💫\n_______________\n#nature #sunset #sunsetlovers #sky #skyline #landscape #blogger_de #germany #openmyworld #enjoylife', 1645180207, '{\"city_name\":\"Sparrenburg Bielefeld\",\"country_code\":\"DE\",\"country_name\":\"germany\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/274136553_689232375424831_2206064151489273092_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/274006116_693383974996403_5044015825084228277_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=J8NSj7H-gy4AX9n0nn_&edm=AOQ1c0wBAAAA&vs=3171524096462267_1706278185&_nc_vs=HBkcFQAYJEdHUUFWUkN6eVlVSm9YWUNBTFVpbUNlcjhmOUZidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJvzY5L32h9Y%2FFQIoAkMzLBc%2F8AAAAAAAABgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=d285f0e777&ccb=7-5&oh=00_AfCQHjTpMYqV-hKGrMOTM8Uzo8K56SHS6WUj5waAYO7stA&oe=64540833&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CaHX6nzIN5M', 0, 0, '[\"#sunset\",\"#sunsetlovers\",\"#sky\",\"#skyline\",\"#landscape\",\"#blogger_de\",\"#germany\",\"#openmyworld\",\"#enjoylife\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
