(1010, 59, 2575471506674947174, NULL, 'CO96bCcgBRm', 37, 459, 1052, 0, 0, 0, 0, 0, '4.84', 'Казалось бы, такая простая процедура – мытье головы. \nА ведь по статистике 90% людей делают это неправильно.\n\n🤍Хороший шампунь всегда важнее, чем кондиционер.\n⠀\n🤍Чем деликатней шампунь, тем дольше голова чистая.\n⠀\n🤍Если кожа головы «скрипит» после мытья-это плохо, так как полностью разрушился липидный слой, а значит защитная функция кожи даст команду сальным железам выделить максимум сала за короткое время.\n⠀\n🤍Используйте безсульфатные профессиональные серии, так как сульфаты вымывают белок из структуры (то из чего и состоит волос) и приводят к дополнительной пористости помимо природной.\n\n🤍Именно из-за этого свойства сульфатов, после процедуры кератина(белка) запрещено пользоваться сульфатными сериями.\n⠀\n🤍❌Не покупайте литровые упаковки -99% марок выпускают концентрированные составы для салонов(технические серии). У волос будет 2 варианта-либо они высушатся, либо перегрузятся и будут «как будто в воске» на ощупь.\n⠀\n🤍После шампуня всегда отжимайте волосы полотенцем! И когда с них не будет капать вода, наносите кондиционер или маску, не превышая времени выдержки.\n⠀\n🤍Как понять ваше время? На упаковке всегда указан минимум и максимум времени. Максимум-это для плотных стекловидных волос(тип азиатских), таких типов очень мало среди нас. Для тонких/средних/пористых всегда минимум.\n⠀\n❕Если вы передерживаете, вы переводите pH волос из нейтрального баланса 5,5 в кислую среду и ловите обратный эффект.\n\n🤍 Некоторые девушки наносят маску на сухие волосы до мытья головы. Зачем? Вопрос хороший. Если так не сказано в инструкции средства, то так делать не стоит, потому что эффекта от средства ты не увидишь.\n\n🤍Заботься о своих волосах, правильно подбирай средства по уходу за ними, и будет тебе счастье!', 1621240333, '{\"city_name\":\"Kyiv\",\"country_name\":\"ukraine\",\"country_code\":\"UA\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/187413814_489281545699312_367892873262908258_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/187537613_905923269972372_2420363065401045268_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=lFDjn06wEusAX8Rwb4X&edm=AOQ1c0wBAAAA&vs=17932309063543615_1916768495&_nc_vs=HBksFQAYJEdNMllMUXVVVWJPeTdqY0RBQlJ4dEdSaTI1WWhia1lMQUFBRhUAAsgBABUAGCRHRF9LTEFzYTdBVVBYd1lFQUp6amhoaEkyaXRLYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACb%2Bg6Xc4dXaPxUCKAJDMywXQBt2yLQ5WBAYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=d285f8ffe8&ccb=7-5&oh=00_AfDqbiGAGXZSMoyd0QxcYOFYxUrjRGFYC9vJD_eyoBLEHw&oe=6454256D&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CO96bCcgBRm', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
