(1018, 60, 3092286118385325429, NULL, 'CrqAddOOpV1', 2, 38, 443, 0, 0, 0, 0, 0, '2.85', 'Make breakfast with me: Nutbutter toast 🥜\n\nThe ingredients that I used: \n\n- wholegrain bread\n- peanut butter from @koro_de \n- Moroccan Amlou (nut butter made from almonds, including honey and argan oil -> probably the best nut butter I ever ate!)\n- honey - to sweeten up the peanut butter toast\n- fresh fruits, I always vary the fruits I put on top, depending on what I fancy. Banana is my go to option though 🍌\n\n#breakfastinspo #breakfast #nutbuttertoast', 1682849552, '{\"city_name\":\"Frankfurt\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343971627_775906044156573_6339724006788250463_n.jpg', NULL, NULL, 'https://instagram.com/p/CrqAddOOpV1', 0, 0, '[\"#breakfast\",\"#nutbuttertoast\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1019, 60, 3087421423693377708, NULL, 'CrYuW1PLLCs', 4, 110, 0, 0, 0, 0, 0, 0, '8.11', 'Dancing in the rain, or skating, doesn‘t matter 💃🏼\n\nGrowing up I had a waveboard but haven‘t been on anything skateboard-like since then. So getting back on a surfskateboard did cost me overcoming my fears. \nFinal conclusion, It was great to see how quickly my body memorized the movements!\nWuhuuu, fun and a great way to practice the movements needed for surfing! 🛹\n\n#surfskate #surfskateboard #outofcomfortzone', 1682269336, '[]', 'IMAGE', 'images/content/posts/342726920_114864758252482_3124667592647695029_n.jpg', NULL, NULL, 'https://instagram.com/p/CrYuW1PLLCs', 0, 0, '[\"#surfskateboard\",\"#outofcomfortzone\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1020, 60, 3086414778628607382, NULL, 'CrVJeN9rI2W', 1, 31, 291, 0, 0, 0, 0, 0, '2.28', 'Start the day with me: Morning coffee ☕️\n\nFavorite milk to go with my cappucino: Barista oatmilk by @oatly \n\n#goodmorning #morningcoffee #morningroutine #starttheday', 1682149442, '{\"city_name\":\"Frankfurt\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/342522761_895191691709266_8483191562438959812_n.jpg', NULL, NULL, 'https://instagram.com/p/CrVJeN9rI2W', 0, 0, '[\"#goodmorning\",\"#morningcoffee\",\"#morningroutine\",\"#starttheday\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1021, 60, 3084257123592279224, NULL, 'CrNe4NHr5S4', 2, 40, 305, 0, 0, 0, 0, 0, '2.99', 'Make breakfast with me: Quick and easy microwave porridge bowl 🥣\n\n1) In a bowl: Mix 50g of oats, cinnamon, salt, and plant milk (I used oatmilk).\n3) Heat it in the microwave until the desired texture is reached.\n4) Add your favorite toppings. I used: Banana, blueberries, cherries, peanut butter, granola, more oat milk:), honey, cacao powder\n\n#porridge #breakfast #makebreakfastwithme #porridgebowl #porridgerecipe #breakfastinspo', 1681892150, '[]', 'VIDEO', 'images/content/posts/341554719_213107938088635_4511682789296122042_n.jpg', NULL, NULL, 'https://instagram.com/p/CrNe4NHr5S4', 0, 0, '[\"#breakfast\",\"#makebreakfastwithme\",\"#porridgebowl\",\"#porridgerecipe\",\"#breakfastinspo\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1022, 60, 3082115329803273246, NULL, 'CrF35ANtcQe', 1, 45, 489, 0, 0, 0, 0, 0, '3.27', 'Start the day with me ☀️: Weekend morning routine ☕️ \n\nI start my days with a glas of warm water, adding a squeeze of lemon juice. That wakes me up and kick starts my digestion.\nAnother habit I developed is to put on my workout clothes first thing in the morning, that way I set the right tone for the day, and my workout is non-negotiable!\nNext, healthy breakfast -> recipe to follow! I realized that for my body it is better to eat before working out. Otherwise I lack the energy to get through a whole workout.\nWorkout time - I always vary the type of exercise, depending on how my body feels at the end of the week. My options are yoga, pilates, or strength workouts.\nAfter working out I enjoy calm me-time. Especially on weekends I love investing extra time in my beauty routine. \n\n#morningroutine #weekendroutine #starttheday #morninghabits', 1681636836, '[]', 'VIDEO', 'images/content/posts/341557601_209461818456956_4220945503800088794_n.jpg', NULL, NULL, 'https://instagram.com/p/CrF35ANtcQe', 0, 0, '[\"#morningroutine\",\"#weekendroutine\",\"#starttheday\",\"#morninghabits\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
