(1025, 60, 3067100383695455091, NULL, 'CqQh4x8ocNz', 4, 118, 0, 0, 0, 0, 0, 0, '8.68', 'In our zen 🤍🐈‍⬛\n\nReading the following made me become more aware of my thinking patterns. To end the weekend with, I want to share it with you 🤍\n\nPay attention to your thoughts, they will shape your words, your words will shape your actions, your actions will shape your habits, your habits will shape your character, and your character will eventually define your destiny.\n\n#brainfood #sundaythoughts #love #cuddles', 1679846879, '[]', 'IMAGE', 'images/content/posts/329545364_677021904426100_3235746490409266430_n.jpg', NULL, NULL, 'https://instagram.com/p/CqQh4x8ocNz', 0, 0, '[\"#sundaythoughts\",\"#love\",\"#cuddles\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
