(1027, 60, 3061992911020347522, NULL, 'Cp-YlRWIdCC', 2, 29, 309, 0, 0, 0, 0, 0, '2.21', '1) Read a book that inspires or entertains you.\n2) Take a break, maybe even for a whole day, two or longer. You don‘t always need to be productive. \n3) Refresh the air to stimulate your senses. You can use scented candles which on top create a cozy atmosphere. I also really like using essential oils. In the video I used a roomspray with the main ingredient being orange essential oil.\n4) Write down your thoughts. Writing down positive thoughts will visualise you how lucky you are and will make you feel even more grateful. When you write down negative thoughts it helps to let go of them and don‘t repeat the same thought cycles in your head over and over again.\n5) Practice self care. Take some extra time to take care of your body. I promise you will feel amazing after. I barely skip a day of applying body oils to my skin\n6) Lastly, disconnect for a few hours, or even a whole day. It will help you focus on your own needs, and you will realize you will save a whole lot of time not replying to messages or scrolling through social media.\n\n#habits #healthyhabits #selfcare #inspiration #journaling #routines', 1679238000, '{\"city_name\":\"Frankfurt\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/335742486_160728876471749_9079911709281153634_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp-YlRWIdCC', 0, 0, '[\"#healthyhabits\",\"#selfcare\",\"#inspiration\",\"#journaling\",\"#routines\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
(1028, 60, 3060749462487953591, NULL, 'Cp592tqD_C3', 0, 70, 555, 0, 0, 0, 0, 0, '4.98', 'Day of surfing in 📍 Peniche, Portugal\n\n1) After getting up and having breakfast we went to check the waves, see the size and decide which board is best for the current conditions\n2) We did 30 minutes of hip focused Yin Yoga to prepare our bodies and losen up the tightness. We both work in office jobs which is why our bodies are not used to the intensity of surfing\n3) We went to check surf equipement and select the best offer for rental. We both ended up with a 8.2 inch board and 4 inch wetsuit for our first day\n4) Quick pre surf stretch and warm up to mobilize joints, prepare the body, and most importantly prevent injuries\n5) Off in the water!\n6) Done surfing, happy, and ready to take a hot shower! \n\n#surfing #dayofsurfing #surfingvlog #surfinginportugal #surfingpeniche #weekendtrip #portugal #peniche', 1679089822, '[]', 'VIDEO', 'images/content/posts/335915838_241447794920670_4062062297808677862_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp592tqD_C3', 0, 0, '[\"#surfing\",\"#dayofsurfing\",\"#surfingvlog\",\"#surfinginportugal\",\"#surfingpeniche\",\"#weekendtrip\",\"#portugal\",\"#peniche\"]', 'post', 'profile_scrape', 0, 1683111092, 1683111092),
