(1062, 62, 2949516647925353057, NULL, 'CjuycOasQph', 8, 144, 0, 0, 0, 0, 0, 0, '3.42', '𝙷 𝙰 𝙿 𝙿 𝚈 .  𝙷 𝙰 𝙻 𝙻 𝙾 𝚆 𝙴 𝙴 𝙽 . \n\nEin kleiner Geist mit Hexenhut aus Fondant 🤍👻 \n\nWir werden dieses Jahr viel Halloween Deko basteln, Kürbisse schnitzen und draußen schön gruselig schmücken. \nVon Popcorn Handschuhen mit rotem Nagellack, bis bemalte Gruselgläser mit Teelichtern. \n\nLetztes Jahr hat es tatsächlich nicht 1 mal an der Tür geklingelt. \nVielleicht trauen sich die Kinder zu schellen, wenn sie sehen das geschmückt ist. \nBei uns in der Nachbarschaft ist es schon oft vorgekommen, das die Kinder geschellt haben, es wurde geöffnet und dann gesagt, das sie keine Bonbons haben. \nNatürlich blöd dann für die Kinder. \n\nBeim vorbereiten nehme ich euch dann in der Story mit 🧡\n\n#Halloween #Pumpkin #Kürbis #orange #Fondant #lecker #cake #torte #love #work #liebe #bestfoodiehalloween22', 1665829805, '[]', 'IMAGE', 'images/content/posts/311701024_158280613498313_8900562183140858103_n.webp', NULL, NULL, 'https://instagram.com/p/CjuycOasQph', 0, 0, '[\"#pumpkin\",\"#k\\u00fcrbis\",\"#orange\",\"#fondant\",\"#lecker\",\"#cake\",\"#torte\",\"#love\",\"#work\",\"#liebe\",\"#bestfoodiehalloween22\"]', 'post', 'profile_scrape', 0, 1683111107, 1683111107),
(1063, 62, 2941816223483054429, NULL, 'CjTbkTTMEld', 3, 135, 0, 0, 0, 0, 0, 0, '3.11', '𝙷 𝚊 𝚙 𝚙 𝚢 𝙱 𝚒 𝚛 𝚝 𝚑 𝚍 𝚊 𝚢.\n\nWir waren heute auf dem 63. Geburtstag vom Mann meiner Mama. 🤍 Normalerweise wären wir erst am Samstag zur Feier gegangen, wo dann auch meine Geschwister alle da gewesen wären aber da ich Samstag in die Nachtschicht muss, waren wir heute schon da. Es war soo schön 🤍🎈🎁', 1664911843, '[]', 'IMAGE', 'images/content/posts/310891549_5827745703936195_2412813223388156458_n.webp', NULL, NULL, 'https://instagram.com/p/CjTbkTTMEld', 0, 0, '[]', 'post', 'profile_scrape', 0, 1683111107, 1683111107),
