(1070, 62, 2757520581509389562, NULL, 'CZErlvhshz6', 3, 205, 114, 0, 0, 0, 0, 0, '4.69', 'In der Weihnachtszeit habe ich viel gebacken.. wie man sieht 🙈😂\nUnd habe kleine Geschenktüten für die Familie und Angehörigen zusammen gestellt 🥰🍪\nEs wurden Cookies mit Schokostückchen, Plätzchen eingetunkt in Kuvertüre, Marmeladen Plätzchen, Streusel Plätzchen und speziell für meine Mama Cranberrie Kekse 😊\nSie haben sich sehr gefreut. ❤🍪🍪\n\n#cookies #present #dessert #bakery #schokolade #rezept #bake #selbstgebacken #foodie #kuchenbacken #backliebe #delicious #selfmade #torten  #backenmachtspass  #foodstagram #leckerschmecker #pl #hobbyb #t #m #bakinglove #chocolate #sweet', 1642942102, '[]', 'VIDEO', 'images/content/posts/272444267_4639875256111851_7502409501160247656_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/272651292_526330875198580_1151955130320079088_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjQ4MC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=104&_nc_ohc=Jz-t8vIl3MYAX-GB24Y&edm=AOQ1c0wBAAAA&vs=1224198747985779_2340666860&_nc_vs=HBksFQAYJEdCeFVRQkIwdk5uMHNkNEJBUERJNm5NV2tmd1BidlZCQUFBRhUAAsgBABUAGCRHS2hKT2hCcWl0QTZFREVDQUVFR3JGZ1UyeDlBYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbgyr%2BH3MTNPxUCKAJDMywXQDCiDEm6XjUYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=d4985159ac&ccb=7-5&oh=00_AfB7H1V4fwjiK6FsM7LbXdyMzuKl6G0nnALQXGdNPRVyrw&oe=6454274F&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CZErlvhshz6', 0, 0, '[\"#present\",\"#dessert\",\"#bakery\",\"#schokolade\",\"#rezept\",\"#bake\",\"#selbstgebacken\",\"#foodie\",\"#kuchenbacken\",\"#backliebe\",\"#delicious\",\"#selfmade\",\"#torten\",\"#backenmachtspass\",\"#foodstagram\",\"#leckerschmecker\",\"#pl\",\"#hobbyb\",\"#t\",\"#m\",\"#bakinglove\",\"#chocolate\",\"#sweet\"]', 'post', 'profile_scrape', 0, 1683111107, 1683111107),
(1071, 63, 3047392827902473060, NULL, 'CpKg6GWMzNk', 88, 349, 0, 0, 0, 0, 0, 0, '17.75', 'Ich habe gerade durch meinen Feed gescrollt und gesehen, dass es überhaupt nicht viele Fotos von unserer Küche gibt 🙈\n\nDies liegt überhaupt nicht daran, dass ich sie nicht mag oder so. Ich liebe sie mit ihrem schlichten, zeitlosen Design sogar sehr 😍\n\nIch glaube der Grund ist einfach, dass unsere Küche etwas das Zentrum des Geschehens ist und immer mal was rumsteht und es daher auch nicht einfach so schnell, schnell ein Foto gibt 😂 Bei mir ist es nämlich oft so, dass ich im Haus unterwegs bin und plötzlich machts klick und ich sehe ein Foto 📸 \nAber bei der Küche ist das selten so. Mir ist zwar mega wichtig, dass sie immer schön aufgeräumt ist, aber das ein oder andere steht halt doch einfach da. Beispielsweise Trinkflaschen der Kinder, Wasserkocher, Handykabel, etc.\n\nSagt mal wie ist das bei euch? Freue mich über eure Kommentare 💬 😘\n.\n.\n.\n.\n.\n.\n#kitchen #kitchengoals #küche #offeneküche #instaküche #instahome #hausundgartenliebe #interior #interiorblogger #zeitlose #design #kitchendesign #miele #hausbau #traumhaus #hausbau2020 #eigenheim #reallife #momlife', 1677497555, '[]', 'IMAGE', 'images/content/posts/333471615_1618247455278394_4393476213733277848_n.jpg', NULL, NULL, 'https://instagram.com/p/CpKg6GWMzNk', 0, 1, '[\"#kitchengoals\",\"#k\\u00fcche\",\"#offenek\\u00fcche\",\"#instak\\u00fcche\",\"#instahome\",\"#hausundgartenliebe\",\"#interior\",\"#interiorblogger\",\"#zeitlose\",\"#design\",\"#kitchendesign\",\"#miele\",\"#hausbau\",\"#traumhaus\",\"#hausbau2020\",\"#eigenheim\",\"#reallife\",\"#momlife\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1072, 63, 3031405164179469639, NULL, 'CoRtu-NM7VH', 113, 511, 0, 0, 0, 0, 0, 0, '25.35', 'Bei uns hat heute Morgen seit Tagen wieder mal die Sonne geschienen, einfach so schön ☀️☀️☀️\n\nDa musste ich einfach direkt ein Foto machen, zumal meine Fotovorräte auch bald zu Ende gehen 🙈 ja und wie ihr seht sind auch noch die nicht ganz so vorzeigbaren Decken auf dem Sofa, die wir zum Schutz auf‘s Sofa gelegt haben und es einfacher machen Flecken von den Kindern zu entfernen. Sonst werden die ja immer weggeräumt, aber heute hatte ich Angst, dass die Sonne sonst schon wieder weg ist 🤣🤣 Somit sag ich nur #mehrrealitätaufinstagram 🤩\n\nAlso, Hand auf‘s Herz, was räumt ihr jeweils für die Fotos weg? 😉\n.\n.\n.\n.\n.\n.\n#interior #home #hausundgartenliebe #wohnzimmer #scandi #blogger #interiorblogger #viral #design #haus #hausbau2020 #traumhaus #offeneswohnen #parkett #holzboden #lichteinfall', 1675591677, '[]', 'IMAGE', 'images/content/posts/329392633_131184476272168_7298291361649940641_n.jpg', NULL, NULL, 'https://instagram.com/p/CoRtu-NM7VH', 0, 1, '[\"#mehrrealit\\u00e4taufinstagram\",\"#home\",\"#hausundgartenliebe\",\"#wohnzimmer\",\"#scandi\",\"#blogger\",\"#interiorblogger\",\"#viral\",\"#design\",\"#haus\",\"#hausbau2020\",\"#traumhaus\",\"#offeneswohnen\",\"#parkett\",\"#holzboden\",\"#lichteinfall\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1073, 63, 2851146235449551667, NULL, 'CeRTmUmqasz', 25, 325, 0, 0, 0, 0, 0, 0, '14.22', 'Da es heute nicht wirklich Gartenwetter war 💦 mal ein Foto vom Inneren des Hauses. \n\nUnser Eingangsbereich\n\nWir sind so froh uns für diesen grossen Einbauschrank entschieden zu haben. So hält sich das Jacken-Chaos einigermassen in Grenzen 😂\n\nIn diesem Sinne wünsche ich euch einen schönen Abend 💫 \n\n#hausbau2020 #eingangsbereich #einbauschrank #ordnung #hellefarben #sitzbank #interior #scandihome #scandistyle #eingangsinspo #teppich #mybenuta \n@benuta', 1654103138, '[]', 'IMAGE', 'images/content/posts/285217883_168692228898198_1242233069486898506_n.jpg', NULL, NULL, 'https://instagram.com/p/CeRTmUmqasz', 0, 1, '[\"#hausbau2020\",\"#eingangsbereich\",\"#einbauschrank\",\"#ordnung\",\"#hellefarben\",\"#sitzbank\",\"#interior\",\"#scandihome\",\"#scandistyle\",\"#eingangsinspo\",\"#teppich\",\"#mybenuta\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1074, 63, 3094275094687215490, NULL, 'CrxEs3wK2-C', 21, 48, 0, 0, 0, 0, 0, 0, '2.8', 'Ich glaube es ist wieder mal Zei für einen Post 😉\nBei uns soll‘s heute endlich mal etwas frühlingshaft werden ☀️☀️ und wer sitzt im Büro 🙈 \n\nWünsche euch trotzdem einen schönen Tag. Was habt ihr geplant?\n.\n.\n.\n.\n.\n.\n#gutenmorgengruss #monstera #flurinspo #spiegel #spiegelshop #parkett #hausbau #traumhaus #hausundgartenliebe', 1683086357, '[]', 'IMAGE', 'images/content/posts/344646602_2261250854073966_82366279428454673_n.jpg', NULL, NULL, 'https://instagram.com/p/CrxEs3wK2-C', 0, 0, '[\"#monstera\",\"#flurinspo\",\"#spiegel\",\"#spiegelshop\",\"#parkett\",\"#hausbau\",\"#traumhaus\",\"#hausundgartenliebe\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1075, 63, 3090978134689424080, NULL, 'CrlXDyeqaLQ', 33, 131, 3743, 0, 0, 0, 0, 0, '6.66', '3 Dinge die wir beim Hausbau immer wieder so machen würden:\n\n- Flächenbündige Eingangstür\n- offene Galerie über dem Wohnraum \n- Komfortlüftung für optimales Raumklima\n\nHabt ihr noch Fragen dazu? Dann schreibt es in die Kommentare 💬 \n\nIch freue mich über ein 🤍 oder eine 💾 falls euch das Reel gefällt.\n.\n.\n.\n.\n.\n.\n#hausbau2020 #bauherrn #hausbaublog #tippsfürbauherren #hausbau #traumhaus #galerie #luftraum #offeneswohnen #eingangstür #raumklima #komfortlüftung #hausundgartenliebe', 1682693350, '[]', 'VIDEO', 'images/content/posts/343786526_987502689296005_4917867501800989881_n.jpg', NULL, NULL, 'https://instagram.com/p/CrlXDyeqaLQ', 0, 0, '[\"#bauherrn\",\"#hausbaublog\",\"#tippsf\\u00fcrbauherren\",\"#hausbau\",\"#traumhaus\",\"#galerie\",\"#luftraum\",\"#offeneswohnen\",\"#eingangst\\u00fcr\",\"#raumklima\",\"#komfortl\\u00fcftung\",\"#hausundgartenliebe\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1076, 63, 3088508737253133322, NULL, 'CrcllU5qcwK', 47, 98, 0, 0, 0, 0, 0, 0, '5.89', 'Heute zum Thema #bathroom bin ich auch mal wieder bei der #iic dabei. \n\nHeute ein Blick in unser Hauptbad. Wir haben die Toilette mit dieser Wand etwas abgegrenzt was Privatsphäre schafft, obwohl das Bad aber sonst sehr offen gestaltet ist. Für uns die perfekte Lösung 🚽 \n.\n.\n.\n.\n.\n.\n#instagraminteriorchallenge #badezimmer #bathroomgoals #hausundgartenliebe #hausbau #masterbad', 1682398954, '[]', 'IMAGE', 'images/content/posts/342921591_762592138636362_4390935513929013810_n.jpg', NULL, NULL, 'https://instagram.com/p/CrcllU5qcwK', 0, 0, '[\"#bathroom\",\"#iic\",\"#badezimmer\",\"#bathroomgoals\",\"#hausundgartenliebe\",\"#hausbau\",\"#masterbad\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1077, 63, 3085935124180255813, NULL, 'CrTcaU8qkRF', 25, 79, 1141, 0, 0, 0, 0, 0, '4.22', 'Da mir das Reel vom Magnolienbäumchen so gefallen hat gibt‘s das jetzt für euch nochmals einfach mit anderer Musik. Finde einfach das gehört in den Feed 🌸🌸🌸\n\nLeider hat es die Blüten dieses Jahr etwas verhagelt, hoffe aber es wächst nun gut an und kann dann nächstes Jahr wieder in voller Pracht blühen 🙏🏻🙏🏻\n\nMusik 🎵: @thisislioba \n.\n.\n.\n.\n.\n.\n#magnolie #garten #gartensaison2023 #pflanzen #gartenliebe #hausundgartenliebe #gartenblogger #traumhaus #hanglage #springvibes #magnolienblüte #aussicht #garteninspo #magnolienstrauch #lizenfreiemusik #reupload', 1682092188, '[]', 'VIDEO', 'images/content/posts/342378218_885793272514336_5216645277732319187_n.jpg', NULL, NULL, 'https://instagram.com/p/CrTcaU8qkRF', 0, 0, '[\"#garten\",\"#gartensaison2023\",\"#pflanzen\",\"#gartenliebe\",\"#hausundgartenliebe\",\"#gartenblogger\",\"#traumhaus\",\"#hanglage\",\"#springvibes\",\"#magnolienbl\\u00fcte\",\"#aussicht\",\"#garteninspo\",\"#magnolienstrauch\",\"#lizenfreiemusik\",\"#reupload\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1078, 63, 3084542400587738019, NULL, 'CrOfviBqauj', 26, 122, 199, 0, 0, 0, 0, 0, '6.01', 'Heute Abend war ich nach der Arbeit noch kurz im Garten. Der Tag war sehr nervenaufreiben und stressig und da liebe ich es noch kurz im Garten durchzuatmen, all die Pflanzen die blühen anzuschauen oder auch einfach in den Himmel zu schauen. Das gibt mir total viel Energie und erdet mich dann auch wieder. Dabei ist dieses spontane Reel entstanden. \n\nWas ist eure #auszeitimalltag ?\n\nMusik 🎵: @sonnenberg_musik \nDanke für dieses tolle Lied 💕\n.\n.\n.\n.\n.\n.\n#garten #gartenliebe #hausundgartenliebe #gartenreel #spontanesreel #durchatmen #energietanken #metime #batterienaufladen #auszeitimalltag #lizenzfreiemusik', 1681926146, '[]', 'VIDEO', 'images/content/posts/342119070_242125641697713_872343361232965640_n.jpg', NULL, NULL, 'https://instagram.com/p/CrOfviBqauj', 0, 0, '[\"#auszeitimalltag\",\"#gartenliebe\",\"#hausundgartenliebe\",\"#gartenreel\",\"#spontanesreel\",\"#durchatmen\",\"#energietanken\",\"#metime\",\"#batterienaufladen\",\"#auszeitimalltag\",\"#lizenzfreiemusik\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1079, 63, 3083590676276529420, NULL, 'CrLHWHsK0kM', 43, 100, 247, 0, 0, 0, 0, 0, '5.81', 'Heute Morgen habe ich die Zeit mal wieder im Garten genutzt. Und schaut mal was da schönes bei rausgekommen ist 🍃 \n.\n.\n.\n.\n.\n.\n#felsenbirne #kupferfelsenbirne #garten #outdoor #gartenblogger #gartensaison2023 #wildtriebe #äste #dekoäste #dekoinspiration #diy #ausdemeigenengarten #gartenreel', 1681812716, '[]', 'VIDEO', 'images/content/posts/341755317_238256035399823_4983164777763181641_n.jpg', NULL, NULL, 'https://instagram.com/p/CrLHWHsK0kM', 0, 0, '[\"#kupferfelsenbirne\",\"#garten\",\"#outdoor\",\"#gartenblogger\",\"#gartensaison2023\",\"#wildtriebe\",\"#\\u00e4ste\",\"#deko\\u00e4ste\",\"#dekoinspiration\",\"#diy\",\"#ausdemeigenengarten\",\"#gartenreel\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113);
