(1080, 63, 3083044923480997987, NULL, 'CrJLQXyqABj', 35, 80, 0, 0, 0, 0, 0, 0, '4.67', 'Letzte Woche habt ihr abgestimmt über was ich als nächstes zum Thema #momlife schreiben soll und das Ergebnis war eindeutig: \n\nMental Load\n\nBis vor ein paar Jahren habe ich den Begriff Mental Load noch nie gehört resp. schon überhaupt keine Ahnung gehabt was er überhaupt bedeutet. \nIch war aber schon immer ein Mensch der sehr strukturiert und ordentlich und ja auch perfektionistisch veranlagt war. Aus diesem Grund bin ich auch ein sehr kopflastiger Mensch und hatte schon immer einen relativ hohen Mental Load (obwohl ich dazumal nicht wusste, das es dafür einen Begriff gibt). \nMit den Kindern ist das aber alles nochmals mehr geworden, da nun noch 2 weitere Personen „mitorganisiert“ werden müssen. So gibt es dann manchmal Situationen in denen ich mich komlett überfordert fühle mit allem was ich noch sollte und müsste. \nIch probiere da auch an mir zu arbeiten und immer mal öfters etwas abzugeben. Es ist nämlich nicht so, dass mich der Herr des Hauses da nicht unterstützt. Es ist mehr so, dass es mir nicht ganz gelingt gewisse Dinge abzugeben (ja ich bin wohl auch ein kleiner Kontrollfreak) und dann dreht sich das Gedankenkarussel im Kopf und es fallen mir hunderttausend Dinge ein die ich noch zu erledigen hätte oder die gemacht werden müssten 😩\nDas einzige was mir oft hilft sind die Dinge aufzuschreiben und dann diese Liste abzuarbeiten. Ich muss so nicht mehr das Gefühl haben ich habe alles im Kopf und kann wenn etwas erledigt ist, etwas von der Liste streichen. Ein unglaublich gutes Gefühl! 🥰\n\nGeht es euch auch so und wie geht ihr mit Mental Load um oder was macht ihr damit er nicht zu gross wird? Erzählt doch mal, würde mich über einen Ausstausch freuen 💕\n.\n.\n.\n.\n.\n.\n#mentalload #lebenmitkindern #reallife #mamaleben #mamablogger #momblogger #mehrrealitätaufinstagram #austausch #wahrheit #wahreworte #seeleneinblick #überforderung #kopfkarussel #organisstion #chaos #chaosimkopf #listen #struktur', 1681747616, '[]', 'IMAGE', 'images/content/posts/341348523_1288477328713604_3344710869727748052_n.jpg', NULL, NULL, 'https://instagram.com/p/CrJLQXyqABj', 0, 0, '[\"#momlife\",\"#lebenmitkindern\",\"#reallife\",\"#mamaleben\",\"#mamablogger\",\"#momblogger\",\"#mehrrealit\\u00e4taufinstagram\",\"#austausch\",\"#wahrheit\",\"#wahreworte\",\"#seeleneinblick\",\"#\\u00fcberforderung\",\"#kopfkarussel\",\"#organisstion\",\"#chaos\",\"#chaosimkopf\",\"#listen\",\"#struktur\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1081, 63, 3081300849426391024, NULL, 'CrC-swQK1_w', 60, 199, 0, 0, 0, 0, 0, 0, '10.52', 'Zum heutigen Thema #bedroom gibt‘s mal wieder ein Bild von unserem Schlafzimmer mit kleinem Sneak Peek ins Ankleidezimmer.\n\nIn diesem Sinne wünsche ich euch einen schönen Samstag und einen guten Start ins Wochenende ☀️\n.\n.\n.\n.\n.\n.\n#iic #instagraminteriorchallenge #schlafzimmer #ankleidezimmer #hausbau2020 #traumhaus #hausundgartenliebe #interior #myhome #instahome #swisshome', 1681539706, '[]', 'IMAGE', 'images/content/posts/341176864_619171846352130_2637489886418200442_n.jpg', NULL, NULL, 'https://instagram.com/p/CrC-swQK1_w', 0, 0, '[\"#bedroom\",\"#instagraminteriorchallenge\",\"#schlafzimmer\",\"#ankleidezimmer\",\"#hausbau2020\",\"#traumhaus\",\"#hausundgartenliebe\",\"#interior\",\"#myhome\",\"#instahome\",\"#swisshome\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1082, 63, 3080873677565964608, NULL, 'CrBdkldK7FA', 58, 190, 8195, 0, 0, 0, 0, 0, '10.07', '5 Facts zu unserer bodenebenen Dusche\n\n- 85cm breit\n- 145cm tief (könnte etwas mehr sein)\n- Nische für Shampooflaschen\n- Deckenspots für optimale Beleuchtung \n- Regendusche für‘s Wellnessfeeling\n\nWir sind total zufrieden mit unserer bodenebenen Dusche da sie total einfach zu reinigen ist und kein lästiges Glas geputzt werden muss. Das Einzige was wir ändern würden wäre wohl die Tiefe um 10 oder 20cm erhöhen. Aber das ist jammern auf hohem Niveau.\n\nFalla ihr noch Fragen habt, schreibt sie gerne in die Kommentare. \n\nFalls euch das Reel gefallen hat, freue ich mich über ein Like oder eine Speicherung 🤍\n\nMusik 🎵: @officialanaisa 💕💕\n.\n.\n.\n.\n.\n.\n#bodenebenedusche #hausbau #hausbautipps #bathroomgoals #traumhaus #hausbau2020 #bauherrn #regendusche #deckenspots #schampoonische #fliesen #hausundgartenliebe #lizenzfreiemusik #swiss #bauen #bäderwelten', 1681488813, '[]', 'VIDEO', 'images/content/posts/341171109_2279433235577920_7594244985928202166_n.jpg', NULL, NULL, 'https://instagram.com/p/CrBdkldK7FA', 0, 0, '[\"#hausbau\",\"#hausbautipps\",\"#bathroomgoals\",\"#traumhaus\",\"#hausbau2020\",\"#bauherrn\",\"#regendusche\",\"#deckenspots\",\"#schampoonische\",\"#fliesen\",\"#hausundgartenliebe\",\"#lizenzfreiemusik\",\"#swiss\",\"#bauen\",\"#b\\u00e4derwelten\"]', 'post', 'profile_scrape', 0, 1683111113, 1683111113),
(1083, 64, 3088212556216867257, NULL, 'CrbiPU0NRm5', 21, 359, 0, 0, 0, 0, 0, 0, '6.57', 'Ein Wochenende wie es im Buche steht! Auf den Samstag der erste Male (Sonne satt, erste Erdbeeren, Angrillen, endlich Birkis,...) folgte ein Sonntag mit bestem Bio-Hof-Schlemmeressen, Eis, und Lämmchen begrüßen. Kommt gut in die letzte Aprilwoche 🌷\n.\n.\n#vomwochenende #itsbetteroutside #aufdemlande #aesthetelikedu2 #jadasistnochhamburg #deichkinder #hamburgmitkindern #wochenendausflug #weekender #imfrühling #day27atapril #lebenmitkindern #vierlanden #bioland', 1682363646, '{\"city_name\":\"Hof Eggers\",\"country_code\":\"AT\",\"country_name\":\"austria\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/343089145_906745530433834_2832023647278221253_n.webp', NULL, NULL, 'https://instagram.com/p/CrbiPU0NRm5', 0, 0, '[\"#itsbetteroutside\",\"#aufdemlande\",\"#aesthetelikedu2\",\"#jadasistnochhamburg\",\"#deichkinder\",\"#hamburgmitkindern\",\"#wochenendausflug\",\"#weekender\",\"#imfr\\u00fchling\",\"#day27atapril\",\"#lebenmitkindern\",\"#vierlanden\",\"#bioland\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1084, 64, 3082100687504840488, NULL, 'CrF0j7gtpco', 17, 93, 0, 0, 0, 0, 0, 0, '1.9', '\"Hey, Sie können Ihre Hundescheiße direkt wieder mitnehmen!!\" \n\nEs ist 9 Uhr am Sonntagmorgen und ich wünsche mich direkt zurück ins Bett. Ich hab den Mann mit seinem Hund zufällig bei uns vor dem Haus gesehen und vom Fenster aus ziemlich wütend gerufen. Dieser hat sich nicht Mal umgeschaut, irgendwas unverständliches gebrummt, seine Kippe noch dazu geschmissen und ist weitergegangen. Schritt 1 hatte ich gemeistert aber was dann?! Mein Impuls war eigentlich, hinterherzurennen und ihm seinen Kot (in einer Tüte) hinterherzuwerfen oder vor die Füße zu knallen und im selben Moment souverän ein Foto von ihm zu machen für die Anzeige beim Ordnungsamt. Das wäre die Aktion-Leni gewesen 😂 Hatte den Film schon vor Augen. Allerdings war ich noch im Schlafanzug und vermutlich wäre ich nicht schnell genug gewesen und ein bisschen Respekt hatte ich vor dem Typen auch, der sah nicht gerade freundlich aus. Freundlich aussehende Menschen würde ihren Dreck vermutlich auch wegmachen... Was hättet ihr denn gemacht? Mich macht das so wütend! Und dass ich mich über so einen Dreck aufrege auch aber ich muss es jetzt wegmachen 😤\n#aufregerdestages\n.\n.\n#meinemeinung #anallehundebesitzer #lebenmitkindern #moodoftoday #onmymind #happysunday #nothingbeatsbeingamom #itsbetteroutside #day27atapril #runwildmychild #kleinerfeinerfeed #upnorth #tinyadventures #mamagedanken', 1681635055, '[]', 'IMAGE', 'images/content/posts/341119105_909258333615222_1599434969092677926_n.webp', NULL, NULL, 'https://instagram.com/p/CrF0j7gtpco', 0, 0, '[\"#anallehundebesitzer\",\"#lebenmitkindern\",\"#moodoftoday\",\"#onmymind\",\"#happysunday\",\"#nothingbeatsbeingamom\",\"#itsbetteroutside\",\"#day27atapril\",\"#runwildmychild\",\"#kleinerfeinerfeed\",\"#upnorth\",\"#tinyadventures\",\"#mamagedanken\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1085, 64, 3079358571305492855, NULL, 'Cq8FE4yt-F3', 17, 140, 0, 0, 0, 0, 0, 0, '2.71', 'Wo gibt es denn richtig schöne Lampeninspiration? Also ich meine jetzt nicht die 100 wahllos nebeneinander hängenden Lampen im Baumarkt wo man schon von Weitem Kopfschmerzen bekommt (ganz ehrlich - wieso macht man sowas?!) sondern eher so wie beim Schweden. Muss man dafür in \"Lampenstudios\" gehen? Ich brauche bitte Adressen rund um Hamburg oder tolle Profile hier denn das Thema Beleuchtung ist echt ein Brocken und wir müssen bald durch die Elektrobemusterung - aber bevor ich weiß WO es leuchtet muss ich auch in etwa wissen WAS 🫣🤷🏼‍♀️ Hier darf jetzt also gern deine Werbung stehen 😉\n.\n.\n#iic #iichanging #instagraminteriorchallenge #lampen #beleuchtung #elektrobemusterung #hanging #interior_and_living #howwelive #hyggehome #day16atapril #day12atapril #apartementtherapy #atmine #couchstyle #livingwithkids #mylvngrm #scandinaviandesign #meingzh #wohnstagram #altbaucharme #hausbau', 1681308169, '[]', 'IMAGE', 'images/content/posts/340818896_1403735717124471_4969585466573792745_n.webp', NULL, NULL, 'https://instagram.com/p/Cq8FE4yt-F3', 0, 0, '[\"#iichanging\",\"#instagraminteriorchallenge\",\"#lampen\",\"#beleuchtung\",\"#elektrobemusterung\",\"#hanging\",\"#interior_and_living\",\"#howwelive\",\"#hyggehome\",\"#day16atapril\",\"#day12atapril\",\"#apartementtherapy\",\"#atmine\",\"#couchstyle\",\"#livingwithkids\",\"#mylvngrm\",\"#scandinaviandesign\",\"#meingzh\",\"#wohnstagram\",\"#altbaucharme\",\"#hausbau\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1086, 64, 3077882404442291522, NULL, 'Cq21b1RNT1C', 7, 148, 0, 0, 0, 0, 0, 0, '2.68', 'Ich hoffe ihr hattet alle ein fröhliches Eiersuchen, ihr Hoppelhasen! \nHier wirds demnächst wohl sehr viele Schokokuchen geben oder Fondue, aber mit der nahenden Erdbeersaison sollte das wohl kein Problem 🤭🐰\n.\n.\n#froheostern #easterboard #kleinerfeinerfeed #myhappymoments #candyboard #iic #iicspringvibes #springvibes #instagraminteriorchallenge @iic__official #ifeedpeople #hyggehome #onmytable #day12atapril #sweetkitchenideas #fika #shareyourfamilyhome #osterinspiration', 1681132196, '[]', 'IMAGE', 'images/content/posts/340670875_2671914292948351_639466173089379388_n.webp', NULL, NULL, 'https://instagram.com/p/Cq21b1RNT1C', 0, 0, '[\"#easterboard\",\"#kleinerfeinerfeed\",\"#myhappymoments\",\"#candyboard\",\"#iic\",\"#iicspringvibes\",\"#springvibes\",\"#instagraminteriorchallenge\",\"#ifeedpeople\",\"#hyggehome\",\"#onmytable\",\"#day12atapril\",\"#sweetkitchenideas\",\"#fika\",\"#shareyourfamilyhome\",\"#osterinspiration\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1087, 64, 3075806537998229608, NULL, 'Cqvdb__NWBo', 16, 141, 0, 0, 0, 0, 0, 0, '2.71', 'Die bleiben so. Nature\'s best. 🥚\n\nStine @vielebuntezeiten\nich musste hier an dich denken!\n\n.\n.\n#ostereier #imfrühling #naturesbest #kleinerfeinerfeed #iovelykarfreitag #ostern #familientraditionen #lebenmitkindern #naturelovers #landleben #myhappyviews #hyggehome', 1680884733, '[]', 'IMAGE', 'images/content/posts/340029708_2508848055955983_2343687874081627648_n.webp', NULL, NULL, 'https://instagram.com/p/Cqvdb__NWBo', 0, 0, '[\"#imfr\\u00fchling\",\"#naturesbest\",\"#kleinerfeinerfeed\",\"#iovelykarfreitag\",\"#ostern\",\"#familientraditionen\",\"#lebenmitkindern\",\"#naturelovers\",\"#landleben\",\"#myhappyviews\",\"#hyggehome\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1088, 64, 3073492762452268658, NULL, 'CqnPWIls5Zy', 11, 184, 0, 0, 0, 0, 0, 0, '3.37', 'Das ist mein Maximum an Osterdeko und die Federn sind schon echt mutig für meine Verhältnisse 😅 Hab das letztens auf einem schwedischen Markt gesehen und gelernt, dass die Schweden statt Eier Federn an den Strauch hängen. Finde es in Kombination aber auch zulässig 😁 Und Bunt sorgt ja bekanntlich für gute Laune und in Kombi mit der Aussicht auf Urlaub gleich noch viel mehr 🐣#iicmakesmehappy\n.\n.\n @kitschcanmakeyourich #iic #interior123 @iic__official #kleinerfeinerfeed #osterdeko #osterinspiration #livingwithkids #bIoggerfilm #homesweethome #pocketofmyhome #instahome #homedecor #nordiskehjem #finahem #howwelive #wohnklamotte #interiorinspiration #apartementtherapy #interiorinspo #interiorideas  #interior_and_living #skandi #hyggehome #solebich #schönerwohnen #senseofhome #mynordichome #påsk #traditionen #favouriteflowerweek @missberry_loves', 1680608910, '[]', 'IMAGE', 'images/content/posts/339355038_3491959551036876_6287552678967994777_n.webp', NULL, NULL, 'https://instagram.com/p/CqnPWIls5Zy', 0, 0, '[\"#iic\",\"#interior123\",\"#kleinerfeinerfeed\",\"#osterdeko\",\"#osterinspiration\",\"#livingwithkids\",\"#bioggerfilm\",\"#homesweethome\",\"#pocketofmyhome\",\"#instahome\",\"#homedecor\",\"#nordiskehjem\",\"#finahem\",\"#howwelive\",\"#wohnklamotte\",\"#interiorinspiration\",\"#apartementtherapy\",\"#interiorinspo\",\"#interiorideas\",\"#interior_and_living\",\"#skandi\",\"#hyggehome\",\"#solebich\",\"#sch\\u00f6nerwohnen\",\"#senseofhome\",\"#mynordichome\",\"#p\\u00e5sk\",\"#traditionen\",\"#favouriteflowerweek\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1089, 64, 3072315660445076031, NULL, 'CqjDtC6sso_', 29, 212, 0, 0, 0, 0, 0, 0, '4.17', 'Ich wollte diesmal eigentlich gaaaar nichts damit zu tun haben aber mein Feed ist seit gestern voll mit mich angrinsenden Gesichtern, dass ich zurück grinsen muss. Und da haben wir schon Mal zwei facts: ich kann eher semi gut nein sagen und bin ziemlich spontan. Vielleicht, nein hoffentlich! ist das die letzte #instagraminteriorchallenge mit unserer Wohnung denn eigentlich bauen wir gerade ein Haus aber das ist eine etwas längere Geburt. Und obwohl ich unseren Altbau sehr dolle gern hab, freu ich mich auch auf das ganz neue Haus, welchem wir unseren eigenen Stempel aufdrücken werden. Moin an euch alle, ich bin Leni und wohne mit meinen drei Jungs (2x klein plus Mann) hinterm Elbdeich bei Hamburch.\n\nUnd hier noch eben fünf wirklich wichtige Merkmale:\n🌾 Mein Kopf steckt eher in den Wolken als im Sand\n🌾 Ich mag irgendwie keine Zimmerpflanzen \n🌾 Ich kombiniere nicht mehr als drei Farben (an mir)\n🌾 Die besten Ideen habe ich unter der Dusche \n🌾 Von Ostern bis Oktober ist Birkenstock-Saison\n🌾 Brot mag ich nicht sonderlich gern aber unter den Schokoaufstrich gehört grundsätzlich Butter.\nBin gespannt wen ich hier entdecken darf! Schön, dass ihr da seid!\n.\n.\n#iicme @kitschcanmakeyourich #iic #interior123 #bioggermovie #thatsme #imnordensagtmanmoin #staysimple #iic_official', 1680468588, '[]', 'IMAGE', 'images/content/posts/338937078_239972128393803_842085057557012097_n.webp', NULL, NULL, 'https://instagram.com/p/CqjDtC6sso_', 0, 0, '[\"#instagraminteriorchallenge\",\"#iic\",\"#interior123\",\"#bioggermovie\",\"#thatsme\",\"#imnordensagtmanmoin\",\"#staysimple\",\"#iic_official\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1090, 64, 3067539457020434857, NULL, 'CqSFuI2Mpmp', 20, 189, 0, 0, 0, 0, 0, 0, '3.61', 'Das letzte Märzwochenende in fünf Bildern.\n\nEin skandinavischer Kinderflohmarkt, Kaiserwetter am Sonntag, Riesenseifenblasen und der Anbruch der Schokoladennotfallreserve. Ich hab mir die Eskalation extra bis Sonntagnacht aufgehoben, da das Wochenende viel zu schön war für Frust. (Spoiler: baut kein Haus zu diesen Zeiten.)\nUnd bei euch, was habt ihr feines gemacht? 🌷\n.\n.\n#vomwochenende #staysimple #inbetween #seeksimplicity #our_everyday_moments #feelfreefeed #leweekend #mamasein #wirimfrühling #zwergensupport #hausbau #itsbetteroutside #thehappynow #littlethings #bioggermovie #Iovelyangel', 1679899221, '[]', 'IMAGE', 'images/content/posts/338313764_1657342941371437_7242735485028022947_n.webp', NULL, NULL, 'https://instagram.com/p/CqSFuI2Mpmp', 0, 0, '[\"#staysimple\",\"#inbetween\",\"#seeksimplicity\",\"#our_everyday_moments\",\"#feelfreefeed\",\"#leweekend\",\"#mamasein\",\"#wirimfr\\u00fchling\",\"#zwergensupport\",\"#hausbau\",\"#itsbetteroutside\",\"#thehappynow\",\"#littlethings\",\"#bioggermovie\",\"#iovelyangel\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
(1091, 64, 3058427041913436896, NULL, 'CpxtzC8svrg', 19, 165, 0, 0, 0, 0, 0, 0, '3.18', 'Frühling, ick hör dir trapsen! So viel Vogelgezwitscher mischt sich hier im Norden endlich in die milde Frühlingsluft - den Schnee vom Wochenende ignoriere ich am besten. Anderes Thema: was ist denn gerade euer Lieblingsessen? Bin nämlich gerade ziemlich ideenlos 😅🤷🏼‍♀️\n.\n.\n#küstenkind #upnorth #travelgram #imfrühling #alittlebeautyeveryday #mamaglück #meerliebe #staysimple #autumnvacation #itsbetteroutside #day15atmarch #naturelovers #myhappyviews #familienreise #baltyk #vitaminsea #dametraveler #strandspaziergang #inbetween #mytinymoments #kleinerfeinerfeed', 1678812936, '[]', 'IMAGE', 'images/content/posts/336043449_917305513052695_7134354274900378065_n.webp', NULL, NULL, 'https://instagram.com/p/CpxtzC8svrg', 0, 0, '[\"#upnorth\",\"#travelgram\",\"#imfr\\u00fchling\",\"#alittlebeautyeveryday\",\"#mamagl\\u00fcck\",\"#meerliebe\",\"#staysimple\",\"#autumnvacation\",\"#itsbetteroutside\",\"#day15atmarch\",\"#naturelovers\",\"#myhappyviews\",\"#familienreise\",\"#baltyk\",\"#vitaminsea\",\"#dametraveler\",\"#strandspaziergang\",\"#inbetween\",\"#mytinymoments\",\"#kleinerfeinerfeed\"]', 'post', 'profile_scrape', 0, 1683111118, 1683111118),
