(1193, 69, 3062837654105796348, NULL, 'CqBYp5pqq78', 19, 151, 2049, 0, 0, 0, 0, 0, '1.68', 'OSTARA - Live\n\nHeute ist Frühlingstag,- und Nachtgleiche oder Ostara.\n\nIch freue mich sehr, dass sich so viele Menschen heute wieder an den alten Jahreskreis annähern.\n\nWie versprochen, das Rezept für die 9 Kräutersuppe.\nHier nun mein Rezept:\n4 Handvoll Wildkräuter\nEtwas Öl oder Ghee\n1  Zwiebel\n500 ml Gemüsebrühe\nEventuell 2-3 kleine Kartoffel\nSalz, Pfeffer, Muskatnuss und Zitronensaft zum Abschmecken\nSauerrahm (Haferobers oder Schlagobers)\nBrotwürfel\n\nZubereitung:\nDie Zwiebel schneidest du in kleine Würfel. Die Kräuter eventuell etwas waschen und klein hacken. Olivenöl erhitzen und die Zwiebel und Kräuter darin andünsten. Mit der Gemüsebrühe auffüllen und 10 Minuten köcheln lassen. Mit Salz, Pfeffer, Muskatnuss, Zitronensaft und Sauerrahm abschmecken.\n\nMeine Ostara Räuchermischung:\nFichtenharz\nThuja\nPalmkätzchen\nHaselkätzchen\nErlenkätzchen\nEfeu\nMistel\nBeifuß\n\nIch wünsche euch ein schönes Ostara!\n\n#ostara #blessedostara #frühlingsbeginn\n#frühling #brauchtum #ritual #zeremonie\n#jahreskreis #spiritual #naturspiritualität\n#jahreskreisfeste #spirituality\n#gleichgewicht #spiritualität #naturspirit', 1679338741, '[]', 'VIDEO', 'images/content/posts/336525416_233296615819934_1320272281001341513_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_760984102078026_1520583099021823091_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjUwNC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=106&_nc_ohc=jZ0L04I4WoUAX_49ADa&edm=AOQ1c0wBAAAA&vs=17947702400425208_3028952102&_nc_vs=HBksFQAYJEdJQ1dtQUJLaGhWckhMUUNBSE9NcUt4Rk1ob1ZicUNCQUFBRhUAAsgBABUAGCRHSUNXbUFEUWRrSDFuYmNBQUdUVVh5U01ramQ4YnFDQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaeq6jtp4H5PxUCKAJDMywXQKY1VYEGJN0YEmRhc2hfYmFzZWxpbmVfMl92MREAdewHAA%3D%3D&_nc_rid=c7d8a4395e&ccb=7-5&oh=00_AfDrp9C-kQtb1BwRy_rI3yj