(1196, 69, 2797969667163179657, NULL, 'CbUYpaHlEqJ', 42, 229, 6588, 0, 0, 0, 0, 0, '2.68', '🐇 DIE 3 PALMKÄTZCHEN ZU OSTARA🐇 \nKennst du die Geschichte, warum man zu Ostara 3 Palmkätzchen essen sollte?\nEs gibt darüber zwar unterschiedliche Berichte und Meinungen. Die einen sagen am Palmsonntag, die anderen sagen zu Ostara. Ich finde es ist einerlei.\n🐇 \nUnsere Vorfahren machten zu Ostara einen Palmbuschen, den sie auf die Felder stellten. In einem Ritual wurde dieser geweiht und man bittete um eine reiche Ernte fürs Jahr. Heute wird der Palmbuschen nach der Weihe mit nach Hause genommen und dort an verschiedenen Orten aufgestellt: Auf dem Feld soll er die Ernte schützen, unterm Dach vor Unwetter und Feuer bewahren und im Stall Krankheiten abwehren.\n🐇 \nWeidenkätzchen landeten früher im Bettbezug und sogar im Suppentopf - denn sie sind essbar. Einst war es auch üblich, drei Palmkatzerl zu essen – das sollte vor Halsweh bewahren. Nachdem der Palmbuschen geweiht war, sollte man als erstes 3 Palmkätzchen essen, bevor man was anderes aß, nur so war es wirksam. \nKindern, die diese Palmkätzchen nicht essen wollen, mischte meistens die Mutter dieses unter das Essen, so dass sie es aßen, ohne es zu merken.\n🐇\nUnd was macht man mit dem Palmzweig vom Vorjahr? Der wird traditionell am Aschermittwoch verbrannt und die Asche dann für das Aschenkreuz verwendet. Wer seinen Palmbuschen nicht in die Kirche bringen kann, verbrennt ihn daheim oder vergräbt ihn im Garten. \n🐇\nIch wünsche euch ein wundervolles Ostarafest oder Frühlingstag,- und Nachtgleiche.\n🐇\nHast du schon mal Palmkätzchen gegessen? Kanntest du diesen Brauch?\n🐇\n🐇\n#palmkätzchen #ostara #brauchtum #brauch #tradition #brauchtumspflege #palmbuschen #weidenkätzchen #ostern #heiden #heidentum #heidnisch #naturspiritualität #spiritualität #jahreskreis #frühlingsbeginn #frühlingsanfang #frühling #jahreskreisfeste #rituals #ritual #rituale #ostarablessings #witchesofinsta #spring', 1647765886, '[]', 'VIDEO', 'images/content/posts/276147630_1034512984085616_3143858059393893297_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/277058784_2239698716171213_1936476593555361832_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=FL51u-aRXnYAX_zpYKl&edm=AOQ1c0wBAAAA&vs=654531765779174_1907466627&_nc_vs=HBksFQAYJEdPQ1VneERObTJGXy12UUhBQ2pRdWJJenY5OGFidlZCQUFBRhUAAsgBABUAGCRHSWtVY3hBOTJwckRpUFVCQU5DQ0hSQ1NfNVpiYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbWsNbsjKjdPxUCKAJDMywXQEV7peNT988YEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8a4076a&ccb=7-5&oh=00_AfDz0jVD-A7dIYr7ktWiwAjdXq5WS2xx1KMK7I55kllC_w&oe=6454672E&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CbUYpaHlEqJ', 0, 0, '[\"#ostara\",\"#brauchtum\",\"#brauch\",\"#tradition\",\"#brauchtumspflege\",\"#palmbuschen\",\"#weidenk\\u00e4tzchen\",\"#ostern\",\"#heiden\",\"#heidentum\",\"#heidnisch\",\"#naturspiritualit\\u00e4t\",\"#spiritualit\\u00e4t\",\"#jahreskreis\",\"#fr\\u00fchlingsbeginn\",\"#fr\\u00fchlingsanfang\",\"#fr\\u00fchling\",\"#jahreskreisfeste\",\"#rituals\",\"#ritual\",\"#rituale\",\"#ostarablessings\",\"#witchesofinsta\",\"#spring\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1197, 69, 2777930331017471137, NULL, 'CaNMOr_FGSh', 58, 716, 8123, 0, 0, 0, 0, 0, '7.64', '♡ MUNTERMACHERKRÄUTER ♡\nSchön langsam ist es soweit. Jeden Tag strecken mehr und mehr Kräuter ihre Köpfe durch die Erde um empor zu steigen. Zumindest bei uns im Mühlviertel wird es noch ein bisschen dauern, bis die ersten Kräuter zu pflücken sind, doch jeder Tag ist jetzt bereits erkennbar.\n♡\nUnd gerade im Frühjahr, wo wir denken, der Winterschlaf ist vorbei, schon kippen wir in die Frühjahrsmüdigkeit. Doch das muss nicht sein, denn genau die ersten Kräuter und Blüten die ihre Köpfe aus der Erde strecken sind perfekt für eine Frühjahrskur. \n♡\nDie ersten Kräuter des Jahres beschenken uns mit reichlichem Vitamin C, sie stärken uns und man kann diese als eine Art Frühjahrs Putz im Innen und Außen bezeichnen, sie entschlacken und reinigen und sind auch zusätzlich eine Art Schönheitskur. \n♡\nDoch nicht nur das, diese Kräuter sind ganz hervorragend um uns vor der Frühjahrsmüdigkeit zu schützen, daher auch das Wort Muntermacherkräuter. Mit einer Art \"Kur\" die du in Form von Smoothies, Suppen, Kräuterbutter oder auch Aufstrichen machen kannst unterstützt du deinen Stoffwechsel und machst dich sozusagen fit und munter für den Frühling.\n♡\nWelche Kräuter sind das?\n♡ Gänseblümchen\n♡ Vogelmiere\n♡ Giersch\n♡ Bärlauch\n♡ Scharbockskraut\n♡ Brennnessel\n♡ Gundelrebe\n♡ Brunnenkresse\nund viele mehr. Wie viele es sind, bzw. welche gerade jetzt besonders wichtig sind, gibt´s bei mir am Blog. Den Link dazu findest du in meinem Profil.\n♡\n♡\nWie geht es dir mit der Frühjahrsmüdigkeit - trifft sie dich auch jedes Jahr?\n♡\n♡\n♡\n#frühling #frühjahrsmüdigkeit #frühjahr #kräuter #plantbased #frischekräuter #kräuterhexe #kräuterkunde #bärlauch #kräuterfrau #herbs #wildkräuter #kräuterwissen #gesundheit #entgiften #nature #kräuterküche #greens #healthyfood #vitamines #foodblogger #vegan #stoffwechsel #stoffwechselkur #healthylifestyle #wildpflanzen #gesundessen #zeitraffer', 1645376405, '{\"city_name\":\"K\\u00f6nigswiesen\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/274382873_344967214185857_709430879030927114_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/274502045_275862791328744_6742141803809748581_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=sBcRAIbxzggAX9HwAYG&edm=AOQ1c0wBAAAA&vs=655044388878364_636224344&_nc_vs=HBksFQAYJEdKMlJYQkRvRTY5UDVmb0FBR1UyWk1rLTVwQmRidlZCQUFBRhUAAsgBABUAGCRHTjI3V3hDVkFrSzE3azhCQUtDWXRZVzA2SzU0YnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbgmvXondf4PxUCKAJDMywXQD4qfvnbItEYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8ab74ca&ccb=7-5&oh=00_AfCG1zV7F7zeyvfHUcbolr3dqF7eyFRLQxGe5f4h8Bh9iw&oe=64541443&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CaNMOr_FGSh', 0, 0, '[\"#fr\\u00fchjahrsm\\u00fcdigkeit\",\"#fr\\u00fchjahr\",\"#kr\\u00e4uter\",\"#plantbased\",\"#frischekr\\u00e4uter\",\"#kr\\u00e4uterhexe\",\"#kr\\u00e4uterkunde\",\"#b\\u00e4rlauch\",\"#kr\\u00e4uterfrau\",\"#herbs\",\"#wildkr\\u00e4uter\",\"#kr\\u00e4uterwissen\",\"#gesundheit\",\"#entgiften\",\"#nature\",\"#kr\\u00e4uterk\\u00fcche\",\"#greens\",\"#healthyfood\",\"#vitamines\",\"#foodblogger\",\"#vegan\",\"#stoffwechsel\",\"#stoffwechselkur\",\"#healthylifestyle\",\"#wildpflanzen\",\"#gesundessen\",\"#zeitraffer\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1198, 69, 2757648608768869540, NULL, 'CZFIsyNBMSk', 59, 288, 3449, 0, 0, 0, 0, 0, '3.43', '♡ Einblick in mein Handwerk ♡\nHeute habe ich wieder mal ein Video für euch, wo ich festhalte, wie man einen Korb fertigt. Zumindest wie man den Boden macht. In den nächsten Tagen zeige ich euch den Rest. \n♡\nIm Grunde genommen ist das Korbwickeln nicht sehr schwer, mit ein bisschen Übung hat man es schnell heraussen. Ein bisschen Kraft jedoch ist von Nöten. \n♡\nWenn du gerne lernen möchtest, wie man solche Körbe wickelt, dann gerne auf meine Website schauen, bald hab ich alle Termine für euch dort bereit gestellt. Ich mache sowohl Präsenz,- als auch Online Kurse.\nIch freu mich auf dich. \nMan beobachte meine Zehen. 😂🤣\n♡\n♡\nNa, bist du jetzt neugierig geworden?\n.\n.\n.\n.\n#korb #körbe #korbliebe #basket #handgemacht #geschenkideen', 1642957436, '[]', 'VIDEO', 'images/content/posts/272356585_1282482832237001_8093332668960465881_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/10000000_4587056394740525_269505227420500927_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=r9tx16WBwpQAX_ZWhx6&edm=AOQ1c0wBAAAA&vs=17947986787662527_885258229&_nc_vs=HBksFQAYJEdJQ1dtQUF0SS1sSzUwc1FBTF9EZ3BHVGViMERia1lMQUFBRhUAAsgBABUAGCRHTnlyUUJEbXJyLXFka2NDQUZkWm1wU0FvQWtiYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbIvdvrzsfHPxUCKAJDMywXQE33bItDlYEYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=c7d8ab73ba&ccb=7-5&oh=00_AfCgBKFw6587zhFzWRttCoCkLwI8SF9Ot38-vL5nnWzukQ&oe=64542A0A&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CZFIsyNBMSk', 0, 0, '[\"#k\\u00f6rbe\",\"#korbliebe\",\"#basket\",\"#handgemacht\",\"#geschenkideen\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1199, 69, 2730867142786734452, NULL, 'CXl_TKWltl0', 47, 159, 1445, 0, 0, 0, 0, 0, '2.03', '~ AROMA TOFFEES ~\nIch mache schon seit einigen Jahren Aromamelts aus Wachsresten selber. Doch irgendwie hat mir der Name nicht so wirklich gefallen, bis mich Valerie von @blattunddorn auf den Namen Toffees gebracht hat.\n~\nHeute habe ich ein Video für euch, in dem ich euch zeige, wie diese Duft Toffees hergestellt werden. Ich nehme dazu gesunde Wachsreste, weil ich keine tierischen Fette, Erdöl oder auch Palmöl in meinen bedufteten Räumen haben möchte. Ich verwende Rapswachs und Bienenwachs.\n~\nDiese Aromatoffees gebe ich in meine Duftlampe und zünde das Teelicht an. Das Wachs schmilzt langsam und setzt die beigefügten ätherischen Öle frei und natürlich auch die der getrockneten Pflanzenteile. Es ist ein ganz feiner Duft und kein aufdringlicher.\n~\nRäuchern kann so einfach sein. Im Übrigen sind diese Toffees schnell gemacht und vielleicht noch ein Weihnachtsgeschenk, solltest du noch auf der Suche sein.\n~\n~\nSoll ich euch morgen das Rezept posten?\nHast du schon mal mit Räuchertoffees geräuchert?\n.\n.\n.\n.\n#räuchern #räuchernmitkräutern #räuchernfürdieseele #video #kurzvideo #naturvideo #igtv #toffees #melts #kräuter #duftlampe #duftkerze #aromatherapy #ätherischeöle #diychristmas #diy #selbstgemacht #rauhnächte #kräuter #kräuterhexe #kräuterpädagogin #bienenwachs #rapswachs #gesundheit #videos', 1639765789, '{\"city_name\":\"K\\u00f6nigswiesen\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/268416417_244870834402152_638979993526093388_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_1446938035701158_231346253870527228_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=3WXkj1LVahkAX9AaLNL&edm=AOQ1c0