(1200, 69, 2698225185455383637, NULL, 'CVyBYKnFKRV', 33, 222, 1629, 0, 0, 0, 0, 0, '2.52', '♡KÖRBE MIT HENKEL♡\nHeute habe ich wieder einmal ein Gustostückerl für alle lieben Menschen, die schon einmal einen Workshop bei mir besucht haben.\n.\nDa ich immer wieder einmal gefragt werde, wie ich bei meinen Körben einen Griff oder Henkel mache, habe ich für euch ein Video gemacht, damit ihr es vielleicht selber ausprobieren könnt.\n.\nEgal ob man die Henkel mit Gräsern oder wie ich in diesem Fall mit rotem Hartriegel fertige, das spielt keine Rolle. Mit dieser Art und Weise zu nähen kannst du Gräser, Kräuter oder auch dünne Ästchen verwenden.\n.\nIch wünsche euch viel Freude mit diesem Video.\n.\n.\nVielleicht mögt ihr es ausprobieren und mir ein Feedback geben, wie es euch ergangen ist.\nIm übrigen ist das euer Korb ihr lieben von @kraeuterkeller\n.\n.\n.\n#korb #körbe #handarbeit #handwerk #video #handwerker #basket #videos #igtv #instavideo #naturpur #naturmaterial #instavideos #handwerkskunst #kunsthandwerk #handgemacht #mitliebegemacht #handgemachtmitliebe #baskets #naturmaterialien #naturliebe #korbliebe #naturelovers #naturkind #naturelover', 1635874699, '{\"city_name\":\"K\\u00f6nigswiesen\",\"region_name\":\" Oberosterreich\",\"country_name\":\"austria\",\"country_code\":\"AT\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/251080694_642632683558469_2146508159726272780_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_115388560936435_3215218970271007707_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=upt69EDdoPEAX_NiWN7&edm=AOQ1c0wBAAAA&vs=417032730029663_192066302&_nc_vs=HBksFQAYJEdJQ1dtQUR6alMtXzhXZ0FBTnZER1ZhZXdKNHNidlZCQUFBRhUAAsgBABUAGCRHTGhGQkEtd0NheXRDaElDQUFGM2txSklvS0pvYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaM6sDB1ITcPxUCKAJDMywXQHSvdLxqfvoYEmRhc2hfYmFzZWxpbmVfMV9