(1201, 69, 2668475354872882021, NULL, 'CUIVDJzFSNl', 5, 108, 1049, 0, 0, 0, 0, 0, '1.12', 'Das Korbwickeln ist meine Leidenschaft und in diesem kurzen Video möchte ich euch eine schöne  Auftragsarbeit einer Kundin zeigen.\n.\nDie Gräser für meine Körbe werden mit Sorgfalt geerntet und getrocknet, bevor sie zu Körben verarbeitet werden. Meine Kunden dürfen sich auch selber die Farbe des Garns auswählen wenn sie möchten. \n.\nIn diesem Video seht ihr das Set Wiesenflüstern. Es besteht aus:\n1 Brotkorb\n1 Topfuntersetzer\n6 Glasuntersetzer\n.\nMehr Infos über meine Arbeit, bzw. Workshops und Gräserbestimmungswanderungen findet ihr auf meiner Website: www.naturspirit.at\n.\n.\n.\n#korbwickeln #igtv #video #kurzvideo #instavideo #videos #korb #körbe #instavideos #naturvideo #handwerk #alteshandwerk #alteswissen #handwerkskunst #handwerksstolz #kunsthandwerk #handwerksliebe #handwerkerausleidenschaft #basket #baskets #basketmaker #videoinstagram #diy #selbstgemacht #naturmaterialien', 1632327650, '[]', 'VIDEO', 'images/content/posts/242711778_1213483152488368_2562131088046733325_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_853221608661523_316725333823605866_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjEyODAuaWd0di5kZWZhdWx0IiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=ZF-aLwlRGgYAX8uepKZ&edm=AOQ1c0wBAAAA&vs=17951795377488042_3563496292&_nc_vs=HBksFQAYJEdJQ1dtQUFUSXVZaUFBZ0RBR3BNN0ZVRFBHVUVidlZCQUFBRhUAAsgBABUAGCRHSU00Ymc1T3RoYmJzbllLQU8taXREM1FtQXRBYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbWxvHdw5LSQBUCKAJDMywXQE8ZmZmZmZoYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8abcc7b&ccb=7-5&oh=00_AfArOK5t5s5c4I-0kTbcD8zSBpdaS5UKW8gbZhVyHa9Hug&oe=6453E560&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CUIVDJzFSNl', 0, 0, '[\"#igtv\",\"#video\",\"#kurzvideo\",\"#instavideo\",\"#videos\",\"#korb\",\"#k\\u00f6rbe\",\"#instavideos\",\"#naturvideo\",\"#handwerk\"