(1202, 69, 2578649934536330963, NULL, 'CPJNHQEH07T', 20, 103, 681, 0, 0, 0, 0, 0, '1.21', 'Mit Lindenblüten räuchern war schon bei den Germanen und Slawen bekannt und beliebt. Ein Räucherwerk aus Lindenblätter wurde zu damaliger Zeit gegen Dämonen und Hexen verräuchert. \nEin Räucherwerk von Lindenblüten lässt Wohlstand und Reichtum ins Haus fließen. \n.\nEine Lindenblüten-Räucherung öffnet das Herz und lässt geistigen Wohlstand hineinbringen. Wir erreichen dadurch Gelassenheit und unsere Ängste schwinden vor neuen Aufgaben. Wenn diese neuen Aufgaben im Raum stehen und wir uns bei ihrem Gedanken ein bisschen unwohl fühlen, ist die Räucherung der Lindenblüten ein Nährboden unseres Geistes.\nWenn unsere Herzen verhärtet sind, ist diese Räucherung unsere Öffnung für eine andere Sichtweise. Wenn wir von unserem Umfeld nur mentale Kälte erfahren, ist eine Lindenblätter-Räucherung unser Seelentrost. Der Rauch gibt uns ein Gefühl von Geborgenheit und sich fallen lassen. Erschöpfte Seelen finden in diesem Räucherwerk ihre „Auferstehung“. Der Pflanzengeist ist sanft und gütig. Er zeigt uns den richtigen Weg. In Beziehungskrisen sind Linden-Räucherungen sehr wohltuend, zumal dieser schöne Baum auch im Zeichen der Ehe und Liebe steht.\nBeim Räuchern verbreiten die getrockneten Blüten einen aromatisch-weichen, leicht süßlichen und warmen Duft. Ebenfalls lassen sich das getrocknete Holz, die Rinde sowie das Laub im Herbst (Blätter) als Räuchermittel verwenden. Der Rauch der Blüten hat eine beruhigende, entspannende und erkältungshemmende Wirkung auf den Menschen. Eine Lindenblüten Räucherung ist somit das ganze Jahr über geeignet.\n.\nHast du schon einmal mit Lindenblüten geräuchert?\n.\n.\n.\n#lindenblüten #linde #winterlinde #sommerlinde #räuchern #reinigung #räucherung #igtv #instagreen #instavideo #instavideos #kreidlstammtisch #baumdesjahres #video #videos #kurzvideo #naturvideo #räuchernmitkräutern #räuchernfürdieseele #räuchernmitheimischenkräutern #videoclip #waldliebe #baumliebe #baum #wald #instagreen #naturspirit @quendelgruen @lebe.lieber.frisch @wildbluetenzauber', 1621619531, '[]', 'VIDEO', 'images/content/posts/189216036_379116776967116_7281827883163401329_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_466490737785805_7176387381401794826_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjY0MC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=bbzB1abg2DoAX8s5AZZ&edm=AOQ1c0wBAAAA&vs=17955821572442236_3848716724&_nc_vs=HBksFQAYJEdJQ1dtQUROZTdkV1JhZ0JBQXE1REI5TnBwZGpidlZCQUFBRhUAAsgBABUAGCRHRUxqT2d1eXFtWXRtN2NCQUJwRExDRXh1VmtwYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaA8eCxvIbUPxUCKAJDMywXQGw5mZmZmZoYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8a0d3e0&ccb=7-5&oh=00_AfAS-JKop0VmS3-mdqEuEjtFm_uJuZA_gA39EvByNLkKdA&oe=64547663&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CPJNHQEH07T', 0, 0, '[\"#linde\",\"#winterlinde\",\"#sommerlinde\",\"#r\\u00e4uchern\",\"#reinigung\",\"#r\\u00e4ucherung\",\"#igtv\",\"#instagreen\",\"#instavideo\",\"#instavideos\",\"#kreidlstammtisch\",\"#baumdesjahres\",\"#video\",\"#videos\",\"#kurzvideo\",\"#naturvideo\",\"#r\\u00e4uchernmitkr\\u00e4utern\",\"#r\\u00e4uchernf\\u00fcrdieseele\",\"#r\\u00e4uchernmitheimischenkr\\u00e4utern\",\"#videoclip\",\"#waldliebe\",\"#baumliebe\",\"#baum\",\"#wald\",\"#instagreen\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1203, 69, 2576410440760255694, NULL, 'CPBP6U9H2TO', 6, 119, 490, 0, 0, 0, 0, 0, '1.23', 'Diese Woche dreht sich bei uns Damen vom #kreidlstammtisch alles um den Baum des Jahres (gilt nur für Österreich).\nEs ist die wundervoll magische und majestätisch anmutige Linde. Viele Lieder wurden schon von ihr gesungen, Gedichte geschrieben und Gerichtsbarkeiten unter ihr abgehalten. Kaum ein  Baum wurde bei unseren Vorfahren so verehrt wie die Linde.\n.\nIn dieser Woche erfährst du vieles über diesen zauberhaften Baum. Zum einen gibt es von @quendelgruen ein umfangreiches Pflanzenportrait, @lebe.lieber.frisch hat uns mit Lindenblättern wunderbar verkocht und @wildbluetenzauber wird uns etwas Naturkosmetik und für die Gesundheit zaubern.\n.\nIch darf heute etwas Mystik und Magie in diese Woche bringen. Genießt dieses Video, ganz in Ruhe, es ist nämlich auch eine kleine Übung mit eingepackt. Viel Freude damit.\n.\nBist du auch schon im Lindenfieber?\n.\n.\n.\n#linde #lindenbaum #baum #baumliebe #baumdesjahres #essbarebäume #bäume #laubbaum #laubbäume #magie #mystik #poesie #waldhexe #hexenküche #waldliebe #wald #waldfee #waldkind #waldmensch #waldfrau #naturspiritualität #naturalspirit #naturespirit #naturespirituality #alteswissen #kelten #germanen #druidentum #naturspirit', 1621352961, '[]', 'VIDEO', 'images/content/posts/187558772_1480836742253782_3866740545255685635_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_503892183979343_5088979073282700477_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjEyODAuaWd0di5kZWZhdWx0IiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=111&_nc_ohc=AlSki3gBeoEAX8-xNU_&edm=AOQ1c0wBAAAA&vs=18225453868000070_4030796382&_nc_vs=HBksFQAYJEdJQ1dtQUJQbGFHS1Njb0JBTDEwYVN5QnI1OUdidlZCQUFBRhUAAsgBABUAGCRHSXJ1RXd2WWRWM1pJYjhEQU9TS3JXdmswWEJxYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaMy9u6yfzfQBUCKAJDMywXQIA6ZFocrAgYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=c7d8a484c1&ccb=7-5&oh=00_AfBY3AMHypqNvPWM513KOcZ3lvQUbTEUgzvDBYlNgL4ImQ&oe=6454651F&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CPBP6U9H2TO', 0, 0, '[\"#kreidlstammtisch\",\"#lindenbaum\",\"#baum\",\"#baumliebe\",\"#baumdesjahres\",\"#essbareb\\u00e4ume\",\"#b\\u00e4ume\",\"#laubbaum\",\"#laubb\\u00e4ume\",\"#magie\",\"#mystik\",\"#poesie\",\"#waldhexe\",\"#hexenk\\u00fcche\",\"#waldliebe\",\"#wald\",\"#waldfee\",\"#waldkind\",\"#waldmensch\",\"#waldfrau\",\"#naturspiritualit\\u00e4t\",\"#naturalspirit\",\"#naturespirit\",\"#naturespirituality\",\"#alteswissen\",\"#kelten\",\"#germanen\",\"#druidentum\",\"#naturspirit\"]', 'post', 'profile_scrape', 0, 1683130200, 1683130200),
(1204, 70, 2902983177545954972, NULL, 'ChJd9G-j7ac', 46, -1, 0, 0, 0, 0, 0, 0, '1.05', '𝗢𝗔𝗧𝗠𝗘𝗔𝗟 𝗕𝗜𝗥𝗖𝗛𝗘𝗥 𝗔𝗥𝗧\n\nGuten Morgen ☀️🫶,\nIch liebe ja #haferflocken zum Frühstück. - Derzeit am liebsten eingeweicht in Kokosnuss Drink 🥥 zusammen mit einen Apfel 🍎 und getoppt mit allerlei Leckeren 😋. Unter anderem mit meinen Lieblingssnack den Banana Bites 🍌 mit Schokolade 🍫🧡 @soul_bites_ , die sind so lecker - die musst du probieren 🤤. \n\n🤓 Banana Bites 🧡 sind getrocknete Bananen 🍌 ummantelt mit  Bitterschokolade die mit Kokosblütenzucker gesüßt ist - Na Lust drauf bekommen 😊⁉️ Mit meinen Code: „𝗠𝗔𝗜𝗞𝗘𝗟𝗢𝗥𝗘𝗘𝗡𝟭𝟱“ sparst du 15% Rabatt bei @soul_bites_ . 😍\n\n🔥𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Bowl mit Topping\nca. 494kcal / 75g KH / 12g E / 13g F\n\n🍌 𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 1 \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n🍌Für das Oatmeal \n▫️50g Haferflocken \n▫️100g Kokos Drink 🥥\n▫️opt. 50g Wasser/ o. Kokos Drink \n▫️1 TL Leinsaat geschrotet \n▫️1/2 Apfel 🍎 \n▫️1 EL getrocknete Sauerkirschen \n🍌Topping \n▫️1/2 Banane 🍌 \n▫️1 EL Granola @mymuesli \n▫️ein paar Blaubeeren 🫐 \n▫️paar Banana Bites 🧡🤤 @soul_bites_ \n▫️1 TL Haselnussmus Choco Crush @naughtynuts \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧 + 𝗪𝗔𝗥𝗧𝗘𝗭𝗘𝗜𝗧: ca. 40min \n\n👩🏻‍🍳𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🍌Haferflocken und Leinsaat 30min oder über Nacht im Kühlschrank in Kokos Drink einweichen\n🍌Grob gerieben Apfel und Sauerkirschen unterrühren und nach Belieben noch etwas Wasser oder Kokos Drink dazugeben \n🍌Mit den Toppings anrichten und vernaschen 😄\n\n- 🅦🅔🅡🅑🅤🅝🅖 - weil tolle Produkte \n\n#oatmeal #frühstück #birchermuesli #frühstücksideen #vegan #vegandeutschland #banane #haferflockenfrühstück #veggie #foodblogger_de #soulbites #soulbites #snacks #gesundundlecker #breakfastbowl #bowlfood #frühstücksbowl #fitfood #fitindentag #abnehmenmitgenuss #healthyfood #einfacherezepte #rezeptefürjedentag #ohnezuckerzusatz #essenmachtglücklich #gutscheincode #rabattcode #leckerschmecker #gesundesfrühstück #overnightoats', 1660282583, '[]', 'IMAGE', 'images/content/posts/298706236_132272556174424_7063816681362104419_n.jpg', NULL, NULL, 'https://instagram.com/p/ChJd9G-j7ac', 0, 0, '[\"#haferflocken\",\"#oatmeal\",\"#fr\\u00fchst\\u00fcck\",\"#birchermuesli\",\"#fr\\u00fchst\\u00fccksideen\",\"#vegan\",\"#vegandeutschland\",\"#banane\",\"#haferflockenfr\\u00fchst\\u00fcck\",\"#veggie\",\"#foodblogger_de\",\"#soulbites\",\"#soulbites\",\"#snacks\",\"#gesundundlecker\",\"#breakfastbowl\",\"#bowlfood\",\"#fr\\u00fchst\\u00fccksbowl\",\"#fitfood\",\"#fitindentag\",\"#abnehmenmitgenuss\",\"#healthyfood\",\"#einfacherezepte\",\"#rezeptef\\u00fcrjedentag\",\"#ohnezuckerzusatz\",\"#essenmachtgl\\u00fccklich\",\"#gutscheincode\",\"#rabattcode\",\"#leckerschmecker\",\"#gesundesfr\\u00fchst\\u00fcck\",\"#overnightoats\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1205, 70, 2901759661756488224, NULL, 'ChFHwnGjZog', 45, -1, 0, 0, 0, 0, 0, 0, '1.03', '𝗞𝗔𝗥𝗧𝗢𝗙𝗙𝗘𝗟 𝗪𝗔𝗙𝗙𝗘𝗟𝗡\n\nDiese kleinen Mini Waffeln 🧇 sind schnell und einfach im Waffeleisen gemacht, schmecken sowohl süß mit Apfelmus oder auch herzhaft mit Kräuterquark. \n\n🔥𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Portion mit Apfelmus\nca. 350 kcal / 66g KH / 8g E / 4g F\n\n🧇𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 1 \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n▫️200g abgekühlte, gekochte Kartoffeln 🥔 \n▫️30g Magerquark / Sojaquark \n▫️1 kleine Schalotte 🧅 \n▫️1/2 TL Kartoffel Allrounder 💛 @justspices ‼️mit den Code: „𝗝𝗨𝗦𝗧𝗕𝗔𝗖𝗞𝗙𝗘𝗘𝗟𝗢𝗥𝗜“ gibt 5€ Rabatt ab 20€ BW, derzeit gibt es auch den Adventskalender bei @justspices zu kaufen mit nur 2 Gewürzen die auch schon im letzten Kalender waren - es lohnt sich also 🫶 \n▫️30g Stärke \n▫️etwas Öl zum fetten \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: 15min\n\n👩🏻‍🍳𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🧇Das Waffeleisen vorheizen \n🧇Die Zwiebel fein schneiden, die Kartoffeln stampfen und mit den restlichen Zutaten vermengen \n🧇Aus den Teig ca. 30 kleinen Bällchen formen, Waffeleisen leicht fetten und nach und nach die Bällchen darin goldbraun ausbacken \n🧇Auf Küchenpapier abtropfen lassen und vernaschen 😋\n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#kartoffeln #waffeln #kartoffelpuffer #rösti #einfacherezepte #vegandeutschland #veggie #fingerfood #rezeptideen #snacks #mittagessen #einfacheküche #schnellerezepte #kochenfürkinder #rezeptefürjedentag #resteverwertung #hashbrowns #potato #waffles #kartoffelwaffeln #potatowaffles #justspices #justspicesrabattcode #gutscheincode #lustaufgenuss #vegan #foodblogger_de #abnehmenmitgenuss #foodporn #kochen', 1660136729, '[]', 'IMAGE', 'images/content/posts/298780366_1514493782343883_4987269832048230746_n.jpg', NULL, NULL, 'https://instagram.com/p/ChFHwnGjZog', 0, 0, '[\"#kartoffeln\",\"#waffeln\",\"#kartoffelpuffer\",\"#r\\u00f6sti\",\"#einfacherezepte\",\"#vegandeutschland\",\"#veggie\",\"#fingerfood\",\"#rezeptideen\",\"#snacks\",\"#mittagessen\",\"#einfachek\\u00fcche\",\"#schnellerezepte\",\"#kochenf\\u00fcrkinder\",\"#rezeptef\\u00fcrjedentag\",\"#resteverwertung\",\"#hashbrowns\",\"#potato\",\"#waffles\",\"#kartoffelwaffeln\",\"#potatowaffles\",\"#justspices\",\"#justspicesrabattcode\",\"#gutscheincode\",\"#lustaufgenuss\",\"#vegan\",\"#foodblogger_de\",\"#abnehmenmitgenuss\",\"#foodporn\",\"#kochen\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1206, 70, 2900189722041936109, NULL, 'Cg_iy-zjGjt', 16, -1, 0, 0, 0, 0, 0, 0, '0.35', '𝗕𝗟𝗔𝗨𝗕𝗘𝗘𝗥𝗠𝗨𝗙𝗙𝗜𝗡𝗦\n-getoppt mit Haferflocken Streuseln\n\nDiese saftigen Muffins sind vegan 🌱  und soo lecker 😋- die musst du probieren. Gewürz habe ich die Muffins mit den Pancake Spice 💛🥞 @justspices was durch den enthalten Zimt, Kardamom und der Zitronenschale mega gut zu Blaubeeren passt und mit den Code „𝗝𝗨𝗦𝗧𝗕𝗔𝗖𝗞𝗙𝗘𝗘𝗟𝗢𝗥𝗜“ sparst du  @justspices auch noch 𝟱€ ab 20€ BW 🤩🫶 🤓 Derzeit gibt es übrigens auf den Adventskalender von @justspices 30% Rabatt 😉 Super als Geschenk und garantiert gesünder als Süßigkeiten. \n\n \n🔥𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro 🧁\nca. 226 kcal / 34g KH / 4g E / 8g F \n\n🧁𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 7 Stück \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝:\n🫐Für den Teig\n▫️1 EL Leinsaat \n▫️2,5 EL warmes Wasser 💧 \n▫️150g Hafer Drink 🥛 \n▫️1/2 EL Apfelessig 🍎 \n▫️175g Mehl 🌾 \n▫️1 gehäuften TL Backpulver \n▫️1/8 TL Natron \n▫️1 TL Pancake Spice 💛 @justspices \n▫️20g Braunen Zucker \n▫️50g Kokosblüten Sirup 🥥 \n▫️40g Kokosöl 🥥 \n▫️125g frische Heidelbeeren 🫐 \n🫐Für die Streusel\n▫️20g Haferflocken \n▫️20g Brauner Zucker \n▫️1 TL Oatmeal Spice 💛 @justspices \n▫️1 Prise Feines Natursalz 💙 @justspices \n\n⏰𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: ca. 20min \n⏱𝗕𝗔𝗖𝗞𝗭𝗘𝗜𝗧: 25min\n\n👩🏻‍🍳𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚:\n🧁Leinsaat in einen Mörser fein mahlen und mit den Wasser verrühren -15min warten\n🧁Hafermilch und Apfelessig vermengen -15min warten \n🧁Für den Teig alle Zutaten bis auf die Blaubeeren vermengen und die Blaubeeren unterheben \n🧁Alle Zutaten für die Streusel verrühren\n🧁Den Teig in Muffinförmchen verteilen und mit den Streuseln toppen \n🧁Im vorgeheizt Backofen bei 180 Grad Celsius bei Ober-/Unterhitze 25min backen \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#muffins #backen #veganbacken #selbstgebacken #blaubeeren #heidelbeeren #vegan #veganerezepte #einfachbacken #kaffeeundkuchen #foodblogger_de #haferflocken #frühstückskuchen #dessert #blaubeermuffins #blueberrymuffins #cake #kuchen #backrezepte #cupcakes #fingerfood #schnellerezepte #frischausdemofen #gebäck #wissenwasdrinist #partysnacks #rezeptideen #justspices #justspicesrabattcode #einfacherezepte', 1659949578, '[]', 'IMAGE', 'images/content/posts/297854985_1748469948866751_9067896957252530359_n.jpg', NULL, NULL, 'https://instagram.com/p/Cg_iy-zjGjt', 0, 0, '[\"#muffins\",\"#backen\",\"#veganbacken\",\"#selbstgebacken\",\"#blaubeeren\",\"#heidelbeeren\",\"#vegan\",\"#veganerezepte\",\"#einfachbacken\",\"#kaffeeundkuchen\",\"#foodblogger_de\",\"#haferflocken\",\"#fr\\u00fchst\\u00fcckskuchen\",\"#dessert\",\"#blaubeermuffins\",\"#blueberrymuffins\",\"#cake\",\"#kuchen\",\"#backrezepte\",\"#cupcakes\",\"#fingerfood\",\"#schnellerezepte\",\"#frischausdemofen\",\"#geb\\u00e4ck\",\"#wissenwasdrinist\",\"#partysnacks\",\"#rezeptideen\",\"#justspices\",\"#justspicesrabattcode\",\"#einfacherezepte\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1207, 70, 2897302626100841946, NULL, 'Cg1SWNLjA3a', 18, -1, 0, 0, 0, 0, 0, 0, '0.4', '𝗦𝗢𝗠𝗠𝗘𝗥𝗦𝗔𝗟𝗔𝗧 𝗠𝗜𝗧 𝗚𝗘𝗚𝗥𝗜𝗟𝗟𝗧𝗘𝗥 𝗭𝗨𝗖𝗖𝗛𝗜𝗡𝗜 \n\nDieser leichte #sommersalat passt zum #grillen oder für die #mittagspause und ist super erfrischend☀️😎.\n\nBei mir gab dazu ein schnelles Balsamico Dressing mit meinen Lieblingsbalsamico den Bio Birnen Balsamessig 🍐 @adrian_manufaktur und den Balsamico Dressing Mix 💛 @justspices -‼️mit den Code „𝗝𝗨𝗦𝗧𝗕𝗔𝗖𝗞𝗙𝗘𝗘𝗟𝗢𝗥𝗜“ sparst du übrigens derzeit 5€ 💶 ab 20€ BW 😍. \n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Portion \nca. 343 kcal / 21g KH / 13g E / 21g F\n\n🥗𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 1 \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝:\n▫️1 Zucchini (ca. 400g) \n▫️etwas Olivenöl 🫒\n▫️1 gehäuften TL Zucchini Gewürzmix @justspices \n▫️1 EL Pinienkerne (ca. 7g) \n▫️eine Handvoll Rucola (ca. 60g)🥬\n▫️125g  Cherry Tomaten 🍅 \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: ca. 15min \n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚:\n🥗Zucchini in Scheiben schneiden und mit Öl und Zucchini Gewürzmix vermengen und kurz marinieren \n🥗Zwischenzeitlich Pinienkerne in einer fettfreien Pfanne rösten, Salat, Tomaten und Dressing nach Wahl vorbereiten \n🥗Den Zucchini von beiden Seiten kurz grillen entweder in einer Grillpfanne oder auf den Grill \n🥗Alles zusammen anrichten und genießen 😋 \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#sommerküche #schnellerezepte #zucchini #zucchinirezepte #salat #salatliebe #gemüseküche #sommerrezepte #einfacherezepte #feierabendküche #healthyfood #grillenmitfreunden #grillbeilage #bbq #veggie #vegan #feierabendküche #zucchinisalat #frischundlecker #justspices #rabattcode #gutscheincode #leckerundgesund #abnehmenmitgenuss #vegandeutschland #rucola #tomaten #lowcarb', 1659605409, '[]', 'IMAGE', 'images/content/posts/297034418_432973608883291_581651546030802078_n.jpg', NULL, NULL, 'https://instagram.com/p/Cg1SWNLjA3a', 0, 0, '[\"#sommersalat\",\"#grillen\",\"#mittagspause\",\"#sommerk\\u00fcche\",\"#schnellerezepte\",\"#zucchini\",\"#zucchinirezepte\",\"#salat\",\"#salatliebe\",\"#gem\\u00fcsek\\u00fcche\",\"#sommerrezepte\",\"#einfacherezepte\",\"#feierabendk\\u00fcche\",\"#healthyfood\",\"#grillenmitfreunden\",\"#grillbeilage\",\"#bbq\",\"#veggie\",\"#vegan\",\"#feierabendk\\u00fcche\",\"#zucchinisalat\",\"#frischundlecker\",\"#justspices\",\"#rabattcode\",\"#gutscheincode\",\"#leckerundgesund\",\"#abnehmenmitgenuss\",\"#vegandeutschland\",\"#rucola\",\"#tomaten\",\"#lowcarb\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1208, 70, 2890842555246664923, NULL, 'CgeVfzXD1zb', 27, -1, 0, 0, 0, 0, 0, 0, '0.61', '𝗤𝗨𝗔𝗥𝗞𝗔𝗨𝗙𝗟𝗔𝗨𝗙\n-mit Apfel, Mohn und Heidelbeeren 🍎🫐 \n\nDieser süße Auflauf ist schnell gemacht, schmeckt kalt und warm super lecker und eignet sich als #dessert , zum #frühstück oder auch zu #kaffeeundkuchen 😋. \n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Portion \nca. 155kcal / 17g KH / 10g E / 4g F\n\n🫐 𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 5 \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n🍎Für die Mohnmasse \n▫️50ml Mandel Drink / Milch 🥛 \n▫️25g Mohn \n▫️2 TL Vanille Kipferl Zucker 💛@justspices ‼️mit den Code: „𝗝𝗨𝗦𝗧𝗕𝗔𝗖𝗞𝗙𝗘𝗘𝗟𝗢𝗥𝗜“ gratis Gewürz \n🍎Für die Quarkmasse\n▫️250g Magerquark \n▫️2 Eier 🥚 \n▫️1 Prise Feines Natursalz 💙 @justspices \n▫️1 gehäuften TL Grieß\n▫️1 TL Apfelkuchen Gewürz 💛 @justspices \n▫️20g Puderzucker \n🍎Für den Belag \n▫️200g geschälte Äpfel 🍎 \n▫️120g Heidelbeeren 🫐 \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: ca. 15min\n⏱ 𝗕𝗔𝗖𝗞𝗭𝗘𝗜𝗧: 35min \n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🫐Für die Mohmasse die Milch erwärmen und die restlichen Zutaten einrühren und quellen lassen \n🫐Für die Quarkmasse die Eier trennen\n🫐Quark, Eigelbe, Grieß und Apfelkuchen Gewürz @justspices verrühren \n🫐Die Eiweiße mit der Prise Salz steif schlagen und unter die Quarkmasse heben, alles in eine gefettete Form verteilen \n🫐Die Apfel in Spalten schneiden auf die Quarkmasse verteilen, Mohn drauf geben und mit Heidelbeeren toppen \n🫐Bei 170 Grad Celsius im vorgeheizten Backofen bei Umlauft 35min backen \n \n🤓𝗠𝗘𝗜𝗡 𝗧𝗜𝗣𝗣: Wer möchte kann statt Zucker auch Erythrit verwenden oder den Kuchen noch mit Zucker und Zimt bestreuen \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#quarkauflauf #quark #magerquark #quarkkuchen #cheesecake #apfelkuchen #heidelbeeren #blaubeeren #tarte #backen #backenmitliebe #auflauf #rezeptideen #einfachundlecker #schnellerezepte #einfachbacken #leichteküche #sommerküche #justspices #gutscheincode #rabattcode #justspicesgewürze #kuchenrezept #kuchen #blaubeerkuchen #mohn #mohnkuchen', 1658835308, '[]', 'IMAGE', 'images/content/posts/295503160_573803771129528_8572244796177606507_n.jpg', NULL, NULL, 'https://instagram.com/p/CgeVfzXD1zb', 0, 0, '[\"#dessert\",\"#fr\\u00fchst\\u00fcck\",\"#kaffeeundkuchen\",\"#quarkauflauf\",\"#quark\",\"#magerquark\",\"#quarkkuchen\",\"#cheesecake\",\"#apfelkuchen\",\"#heidelbeeren\",\"#blaubeeren\",\"#tarte\",\"#backen\",\"#backenmitliebe\",\"#auflauf\",\"#rezeptideen\",\"#einfachundlecker\",\"#schnellerezepte\",\"#einfachbacken\",\"#leichtek\\u00fcche\",\"#sommerk\\u00fcche\",\"#justspices\",\"#gutscheincode\",\"#rabattcode\",\"#justspicesgew\\u00fcrze\",\"#kuchenrezept\",\"#kuchen\",\"#blaubeerkuchen\",\"#mohn\",\"#mohnkuchen\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1209, 70, 2888789810733721237, NULL, 'CgXCwcDjSaV', 53, -1, 0, 0, 0, 0, 0, 0, '1.22', '𝗙𝗟𝗔𝗠𝗠𝗞𝗨𝗖𝗛𝗘𝗡\n\nIn der fruchtigen, süßen Variante mit Nektarine🍑 & Heidelbeeren 🫐😋.\n\nGetoppt mit Zitronenthymian 🍋, Honig 🍯🐝 & den Blüten Mix ❤️🌹 @justspices . Derzeit bekommst du übrigens mit den Code: „𝙅𝙐𝙎𝙏𝘽𝘼𝘾𝙆𝙁𝙀𝙀𝙇𝙊𝙍𝙄“ passend zur #sommerküche ☀️ 😎 das 𝗕𝗮𝗹𝘀𝗮𝗺𝗶𝗰𝗼 𝗗𝗿𝗲𝘀𝘀𝗶𝗻𝗴 𝗠𝗶𝘅 💛 𝗴𝗿𝗮𝘁𝗶𝘀 ab 20€ BW. 🫶🥰\n\n🔥𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Flammkuchen \n\n🫐𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 2 Flammkuchen\n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n🍑Für den Teig\n▫️200g Dinkelmehl Typ 1150 🌾 \n▫️2 EL Olivenöl \n▫️ca. 110ml Wasser 💧 \n▫️1/2 TL Feines Natursalz 💙🧂 @justspices \n🍑Für den Belag \n▫️80g Camembert 🧀 \n▫️2 Nektarinen 🍑\n▫️100g TK Heidelbeeren 🫐 \n▫️1 TL Vanille Kipferl Zucker @justspices \n▫️Limettensaft und Schale 🍋 \n▫️100g Crème Fraîche light \n▫️100g frische Heidelbeeren 🫐 \n▫️Honig 🍯 \n▫️Zitronenthymian\n▫️Feines Natursalz 💙, Pfeffer 💜 @justspices \n▫️Blüten Mix 🌹❤️ @justspices \n\n⏰𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: 45min\n⏱𝗕𝗔𝗖𝗞𝗭𝗘𝗜𝗧: 10min\n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🫐Aus den Zutaten für den Teig einen Knetteig herstellen & 30min abgedeckt ruhen \n🫐Zwischenzeitlich den Belag vorbereiten & den Ofen auf 250 Grad Celsius O-/ UH vorheizen \n🫐TK Heidelbeeren mit etwas Zitronenthymian,Spritzer Limettensaft + etwas Schale & den Vanille Kipferl Zucker im Topf einkochen & die Heidelbeeren dabei leicht zerdrücken \n🫐Käse & Nektarinen schneiden, Crème Fraîche mit Limettensaft & Schale, Salz & Pfeffer anrühren \n🫐Jeweils die Hälfte des Teiges dünn auf Backpapier ausrollen, mit Crème bestreichen, mit Käse & Nektarinen belegen \n🫐Im Backofen o.  im Grill auf einem Pizzastein 10min backen \n🫐Mit den eingekochten Heidelbeeren, frischen Heidelbeeren, Zitronenthymian, Honig & Blüten Mix dekorieren \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#flammkuchen #sommerrezepte #schnelleküche #einfachundlecker #backen #veggie #dasaugeisstmit #heidelbeeren #blaubeeren #nektarine #familienküche #familienessen #essenmitgenuss #partyfood #rezeptideen #flammkuchenliebe #vegetarischerezepte #pizza #kalorienzählen #gutscheincode #rabattcode #justspices #ofengericht #abendessen #grillenmitfreunden #grillen #mittagessen #feierabendküche #camembert', 1658590602, '[]', 'IMAGE', 'images/content/posts/295492716_1112861909326946_317983242249178186_n.jpg', NULL, NULL, 'https://instagram.com/p/CgXCwcDjSaV', 0, 0, '[\"#sommerk\\u00fcche\",\"#flammkuchen\",\"#sommerrezepte\",\"#schnellek\\u00fcche\",\"#einfachundlecker\",\"#backen\",\"#veggie\",\"#dasaugeisstmit\",\"#heidelbeeren\",\"#blaubeeren\",\"#nektarine\",\"#familienk\\u00fcche\",\"#familienessen\",\"#essenmitgenuss\",\"#partyfood\",\"#rezeptideen\",\"#flammkuchenliebe\",\"#vegetarischerezepte\",\"#pizza\",\"#kalorienz\\u00e4hlen\",\"#gutscheincode\",\"#rabattcode\",\"#justspices\",\"#ofengericht\",\"#abendessen\",\"#grillenmitfreunden\",\"#grillen\",\"#mittagessen\",\"#feierabendk\\u00fcche\",\"#camembert\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1210, 70, 2887152737308124134, NULL, 'CgROh4njCPm', 27, -1, 0, 0, 0, 0, 0, 0, '0.61', '𝗪𝗔𝗟𝗗𝗕𝗘𝗘𝗥𝗘𝗡 𝗣𝗔𝗡𝗖𝗔𝗞𝗘𝗦 𝗖𝗘𝗥𝗘𝗔𝗟\n\nDiese Mini Pancakes 🥞 sind super schnell gemacht mit Hilfe der Soulbowl Waldbeeren @soul_bites_  und so lecker 🤤. Zusammen mit etwas Joghurt und frischen Früchten serviert startet man fit 💪🏻 in den Tag. ☀️ \n\nÜbrigens die Bowls @soul_bites_  bestehen zu 100% aus natürlichen Zutaten, sind ohne Zucker, Bio, Vegan 🌱 und werden unter anderen aus geretteten Bananen 🍌 die an den Handel nicht verkauft werden, wegen Schönheitsmacken, hergestellt. \n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Portion\nca. 427 kcal / 55g KH / 20g E / 11g F\n\n🥞𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 1 Bowl\n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝:\n🥞Für die Pancakes\n▫️50g Soulbowl Waldbeeren 🫐 @soul_bites_  15% Rabatt mit den Code „𝙈𝙖𝙞𝙠𝙚𝙇𝙤𝙧𝙚𝙚𝙣𝟭𝟱“ alternativ gemahlene Haferflocken + Waldfruchtfruchtpulver + evtl. eine Süße nach Wahl\n▫️100ml Mineralwasser 💧 \n▫️1 Ei 🥚 \n▫️1/4 TL Backpulver \n🥞Topping \n▫️150g Joghurt\n▫️80g rote Johannisbeeren\n▫️1 Pfirsich 🍑 \n▫️Süßes Stullen Spice 💛 @justspices mit den Code: „𝙟𝙪𝙨𝙩𝙗𝙖𝙘𝙠𝙛𝙚𝙚𝙡𝙤𝙧𝙞“ gratis 𝑩𝒂𝒍𝒔𝒂𝒎𝒊𝒄𝒐 𝑫𝒓𝒆𝒔𝒔𝒊𝒏𝒈 𝑴𝒊𝒙  ab 20€ BW \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: ca. 10min\n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚:\n🥞Zutaten für die Pancakes vermengen und in einer gefetteten Pfanne ausbacken \n🥞Mit den Toppings anrichten \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#soulbowl #frühstück #pancakes #cerealpancakes #frühstücksideen #frühstücksbowl #justspices #rabattcode #gutscheincode #sommerküche #johannisbeeren #eierkuchen #pfannkuchen #veggie #schnelleküche #gesundundlecker #gesundesfrühstück #fitfood #ohnezucker #einfacherezepte #schnellerezepte #yummy #rezeptefürjedentag #kochenmitliebe #essenmachtglücklich #healthyfood #waldbeeren #pfirsich #leichteküche #soulbites', 1658395448, '[]', 'IMAGE', 'images/content/posts/294459607_411007397720209_160113601953835811_n.jpg', NULL, NULL, 'https://instagram.com/p/CgROh4njCPm', 0, 0, '[\"#soulbowl\",\"#fr\\u00fchst\\u00fcck\",\"#pancakes\",\"#cerealpancakes\",\"#fr\\u00fchst\\u00fccksideen\",\"#fr\\u00fchst\\u00fccksbowl\",\"#justspices\",\"#rabattcode\",\"#gutscheincode\",\"#sommerk\\u00fcche\",\"#johannisbeeren\",\"#eierkuchen\",\"#pfannkuchen\",\"#veggie\",\"#schnellek\\u00fcche\",\"#gesundundlecker\",\"#gesundesfr\\u00fchst\\u00fcck\",\"#fitfood\",\"#ohnezucker\",\"#einfacherezepte\",\"#schnellerezepte\",\"#yummy\",\"#rezeptef\\u00fcrjedentag\",\"#kochenmitliebe\",\"#essenmachtgl\\u00fccklich\",\"#healthyfood\",\"#waldbeeren\",\"#pfirsich\",\"#leichtek\\u00fcche\",\"#soulbites\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263);
