(1211, 70, 2885942931306119653, NULL, 'CgM7c4-jQHl', 40, -1, 0, 0, 0, 0, 0, 0, '0.91', '𝗕𝗨𝗧𝗧𝗘𝗥𝗠𝗜𝗟𝗖𝗛 𝗝𝗢𝗛𝗔𝗡𝗡𝗜𝗦𝗕𝗘𝗘𝗥 𝗞𝗨𝗖𝗛𝗘𝗡\n\nHeute habe ich für dich einen saftig und fluffigen Johannisbeerkuchen, verfeinert mit Zitronenabrieb 🍋 und Vanille Kipferl Zucker 💛 @justspices , das ist ein Vanillezucker mit echter Vanille. 😍 \n\n‼️Mit den Code: „𝒋𝒖𝒔𝒕𝒃𝒂𝒄𝒌𝒇𝒆𝒆𝒍𝒐𝒓𝒊“ gibt es derzeit übrigens das 𝑩𝒂𝒍𝒔𝒂𝒎𝒊𝒄𝒐 𝑫𝒓𝒆𝒔𝒔𝒊𝒏𝒈 𝑴𝒊𝒙 💛𝒈𝒓𝒂𝒕𝒊𝒔 ab 20€ BW 🥰🫶. Der Mix passt zu jeden Salatdressing, für Salatlieberhaber echt ein muss. 🤤 \n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro 1/2 Küchlein oder für pro Stück \nca. 180kcal / 27g KH / 4g E / 6g F\n\n🥧𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: für 6 Gugelhupf Weckgläser à 280ml oder eine 16cm  Gugelhupfform \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n▫️75g Butter 🧈 \n▫️100g Zucker \n▫️1 EL Vanille Kipferl Zucker 💛 @justspices \n▫️2 Eier 🥚 \n▫️200g Johannisbeeren \n▫️Abrieb von 1/2 Zitrone 🍋 \n▫️250g Mehl \n▫️1/4 TL Natron \n▫️2 TL Backpulver \n▫️200g Buttermilch 🥛 \n▫️1 Prise Feines Natursalz 💙 @justspices \n\n⏰𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: 15min\n\n⏱𝗕𝗔𝗖𝗞𝗭𝗘𝗜𝗧: je nach Backform 30-40min\n\n👩🏻‍🍳𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🥧Johannisbeeren waschen und gut abtropfen lassen \n🥧Eine Backform fetten und bemehlen\n🥧Butter mit Zucker, Zitronenabrieb und Salz schaumig rühren, danach ein Ei nach den anderen einrühren \n🥧Mehl mit Backpulver und Natron mischen, sieben und abwechselnd mit der Buttermilch kurz einrühren \n🥧Johannisbeeren unterheben\n🥧Teig in die Backform verteilen und bei 175 Grad Celsius bei Ober-/ Unterhitze 30-40min backen \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#beeren #johannisbeeren #johannisbeerkuchen #kuchen #kuchenrezept #beerenkuchen #obstkuchen #rührkuchen #justspices #gutscheincode #rabattcode #sommerkuchen #sommerküche #bundtcake #ribisel #einfachbacken #backrezepte #buttermilchkuchen #gugelhupf #buttermilkcake #kaffeeundkuchen #sonntagskuchen #backen #kuchenrezept #einfacherezepte #solecker #schnellgemacht #kuchenliebe #foodblogger_de #rotejohannisbeeren #ichliebebacken', 1658251228, '[]', 'IMAGE', 'images/content/posts/294639633_829893874593945_1003363844155167001_n.jpg', NULL, NULL, 'https://instagram.com/p/CgM7c4-jQHl', 0, 0, '[\"#beeren\",\"#johannisbeeren\",\"#johannisbeerkuchen\",\"#kuchen\",\"#kuchenrezept\",\"#beerenkuchen\",\"#obstkuchen\",\"#r\\u00fchrkuchen\",\"#justspices\",\"#gutscheincode\",\"#rabattcode\",\"#sommerkuchen\",\"#sommerk\\u00fcche\",\"#bundtcake\",\"#ribisel\",\"#einfachbacken\",\"#backrezepte\",\"#buttermilchkuchen\",\"#gugelhupf\",\"#buttermilkcake\",\"#kaffeeundkuchen\",\"#sonntagskuchen\",\"#backen\",\"#kuchenrezept\",\"#einfacherezepte\",\"#solecker\",\"#schnellgemacht\",\"#kuchenliebe\",\"#foodblogger_de\",\"#rotejohannisbeeren\",\"#ichliebebacken\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1212, 70, 2882903613041968348, NULL, 'CgCIY_RDoTc', 38, -1, 0, 0, 0, 0, 0, 0, '0.87', '𝗚𝗥𝗜𝗘𝗖𝗛𝗜𝗦𝗖𝗛𝗘𝗥 𝗦𝗖𝗛𝗜𝗖𝗛𝗧𝗦𝗔𝗟𝗔𝗧\n\nUnglaublich wir haben schon Tag 5 unserer MOTTOWOCHE BBQ-Beilagen. Heute darf ich dir mein Rezept dazu vorstellen, einen Griechischen Schichtsalat - bei mir in der vegangen Variante 🌱💚. Du kannst ihn aber auch problemlos vegetarisch oder mit Fleisch zubereiten 🤓. \n\nWenn du wissen willst was die anderen Mädels so leckeres gezaubert haben, schaut gerne bei ihn vorbei, lass ein ❤️ da und lass dich von uns inspirieren für deine nächste #grillparty .Ich verlinke dir alle Accounts im Bild und in meinen Highlights BBQ. 🥰\n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Portion\nca. 210 kcal / 9g KH / 19g E / 11g F\n\n🇬🇷 𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 6 Portionen \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n🇬🇷Für den veganen Feta 🌱 \n▫️200g Tofu Natur Fest \n▫️150ml Birnen Essig 🍐 @adrian_manufaktur \n▫️120ml Mandeldrink 🥛 \n▫️2 TL Griechischer Allrounder ❤️ @justspices mit den ‼️Code: „𝗷𝘂𝘀𝘁𝗯𝗮𝗰𝗸𝗳𝗲𝗲𝗹𝗼𝗿𝗶“ gibt’s derzeit 𝟮𝟭% 𝗥𝗮𝗯𝗮𝘁𝘁 😍🫶\n▫️1 TL Feines Natursalz 💙 @justspices \n▫️2 TL Hefeflocken \n🇬🇷Für den veganen Tzatziki 🌱 \n▫️1/2 Gurke 🥒 \n▫️250g Sojajoghurt oder Sojaquark \n▫️2 TL Tsatsiki Gewürz 💚 @justspices \n▫️1 Knobizehe 🧄 \n▫️etwas Olivenöl\n▫️Spritzer Zitronensaft 🍋 \n🇬🇷Für den Salat \n▫️ca. 1/2 kleinen Eisbergsalat 🥬\n▫️2 Fleischtomaten 🍅 \n▫️1/2 Gurke 🥒 \n▫️1 rote Zwiebel 🧅 \n▫️1 grüne Paprika 🫑 \n▫️schwarze Oliven 🫒 \n▫️Pfefferonen \n▫️veganes Hackfleisch (Bei mir 1 Pck.  Jackfruit Veggie Hack à 75g) \n▫️2 EL Tomatenmark 🥫\n▫️2 TL Griechischer Allrounder ❤️ @justspices \n▫️Krautsalat (bei mir selbstgemacht aus 175g Weißkraut) \n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚\n🇬🇷Am Vortrag den veganen Feta zubereiten, presse den Feta gut aus,schneide ihn in Würfel, rühre aus den übrigen Zutaten eine Marinade an & gebe den Tofu dazu & lass ihn im Kühlschrank durchziehen \n🇬🇷Tzatziki aus den obigen Zutaten herstellen \n🇬🇷Für den Salat das Hack in einer Pfanne mit Öl anbraten, Tomatenmark,  Griechischen Allrounder dazugeben, mit Salz/Pfeffer abschmecken & abkühlen lassen \n🇬🇷Die restlichen Zutaten vorbereiten & alles zusammen in eine Schale hübsch anrichten \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte', 1657888913, '[]', 'IMAGE', 'images/content/posts/294246065_1431142990733600_17185438048903305_n.jpg', NULL, NULL, 'https://instagram.com/p/CgCIY_RDoTc', 0, 0, '[\"#grillparty\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1213, 70, 2881511085013047631, NULL, 'Cf9LxCejZlP', 25, -1, 0, 0, 0, 0, 0, 0, '0.56', '𝗣𝗔𝗦𝗧𝗔 𝗠𝗜𝗧 𝗞𝗡𝗢𝗕𝗟𝗔𝗨𝗖𝗛𝗦𝗔𝗨𝗖𝗘 \n\nNa wo sind meine Knobi-Fans 🧄🙋? Bekommst du auch nicht genug von Knobi, dann habe ich für dich genau das richtige Rezept. \n\nZu der Sauce gab es bei mir selbstgemachte Chili Nudel 🌶, getoppt mit frischer Petersilie 🌿 und weil es nie genug Knoblauch sein kann 😅 noch mit den Knoblauch Pfeffer 💜 @justspices einfach nur geil 🤤. \n\n‼️Mit den Code: „𝙟𝙪𝙨𝙩𝙗𝙖𝙘𝙠𝙛𝙚𝙚𝙡𝙤𝙧𝙞“  sparst du übrigens derzeit 21% bei @justspices  noch bist zum 17.07. auf alles außer Bücher und Gutscheine 📚 🥰‼️\n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Portion \nca. 459kcal / 55g KH / 15g E / 19g F \n\n🧄𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 4 🍝 \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n▫️Nudeln \n▫️3 Knoblauchzehen 🧄\n▫️40g Parmesankäse 🧀 \n▫️250ml Kochsahne 7% Fett 🥛 \n▫️1 TL Mehl 🌾 \n▫️15g Butter/ Margarine 🧈 \n▫️2 gehäufte TL Gemüsebrühe ohne Zuckerzusatz 💚 @justspices \n▫️Petersilie 🌿, Zitronenschale und einen Spritzer Zitronensaft 🍋 \n▫️Feines Natursalz 💙, Knoblauch Pfeffer 💜 @justspices \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: 15min\n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🧄Nudeln in reichlich Salzwasser al dente kochen\n🧄Zwischenzeitlich den Knobi hacken \n🧄In einer Pfanne Butter und Mehl anschwitzen, Knobi dazugeben \n🧄Mit Sahne ablöschen und die Gemüsebrühe einrühren, zum Schluss noch den Parmesankäse dazu reiben\n🧄Die Nudeln abseihen und dabei etwas Nudelwasser auffangen \n🧄Die Nudeln in die Sauce geben, umrühren und nach Belieben etwas Kochwasser dazugeben, mit Salz, Pfeffer, Zitronenschale und Saft abschmecken und mit Petersilie servieren \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#pasta #nudeln #einfacherezepte #schnellerezepte #schnelleküche #rezeptefürjedentag #feierabendküche #kochenmitliebe #kochen #justspices #gutscheincode #rabattcode #knoblauchsauce #knoblauch #pastasauce #sauce #soße #garlic #garlicpasta #knoblauchnudeln #nudelnmachenglücklich #leckerschmecker #mittagessen #abendessen #einfachkochen #einfachundlecker #familienrezepte #pastaliebe #vegetarisch #vegetarischerezepte', 1657722910, '[]', 'IMAGE', 'images/content/posts/293069047_574363714333451_3041299120350980193_n.jpg', NULL, NULL, 'https://instagram.com/p/Cf9LxCejZlP', 0, 0, '[\"#pasta\",\"#nudeln\",\"#einfacherezepte\",\"#schnellerezepte\",\"#schnellek\\u00fcche\",\"#rezeptef\\u00fcrjedentag\",\"#feierabendk\\u00fcche\",\"#kochenmitliebe\",\"#kochen\",\"#justspices\",\"#gutscheincode\",\"#rabattcode\",\"#knoblauchsauce\",\"#knoblauch\",\"#pastasauce\",\"#sauce\",\"#so\\u00dfe\",\"#garlic\",\"#garlicpasta\",\"#knoblauchnudeln\",\"#nudelnmachengl\\u00fccklich\",\"#leckerschmecker\",\"#mittagessen\",\"#abendessen\",\"#einfachkochen\",\"#einfachundlecker\",\"#familienrezepte\",\"#pastaliebe\",\"#vegetarisch\",\"#vegetarischerezepte\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1214, 70, 2880100954505236361, NULL, 'Cf4LI8GjE-J', 27, -1, 0, 0, 0, 0, 0, 0, '0.61', '𝗛𝗔𝗙𝗘𝗥 𝗩𝗢𝗟𝗟𝗞𝗢𝗥𝗡 𝗧𝗢𝗔𝗦𝗧 \n\nDieses  softe Toastbrot ist schnell gemacht, lässt sich super toasten und das Rezept ist wie immer mega easy nach zu backen. 😊\n\n🔥𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro 100g \nca. 257kcal / 43g KH / 7g E / 5g F\n\n🍞 𝗣𝗢𝗥𝗧𝗜𝗢𝗡: Für ein 660g Toastbrot\n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝:\n▫️70g kernige Haferflocken \n▫️160ml kochendes Wasser 💧 \n▫️25g Öl \n▫️120ml Wasser 💧 \n▫️8g Feines Natursalz 💙 @justspices mit den‼️Code „𝙟𝙪𝙨𝙩𝙗𝙖𝙘𝙠𝙛𝙚𝙚𝙡𝙤𝙧𝙞“ sparst du 𝟮𝟭% bis zum 17.07. 🥰\n▫️1 EL Hafersirup oder Honig 🍯\n▫️115g Weizenvollkornmehl 🌾 \n▫️230g Weizenmehl Typ 550 🌾 \n▫️4g frische Hefe \n\n⏰ 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: ca. 3,5h \n\n⏱ 𝗕𝗔𝗖𝗞𝗭𝗘𝗜𝗧: 35min \n\n👩🏻‍🍳 𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚:\n🍞die Haferflocken mit dem kochendem Wasser übergießen und 10min quellen lassen \n🍞Zusammen mit den restlichen Zutaten gut verkneten und 50min abgedeckt aufgehen lassen \n🍞Den Teig in 3 Teile teilen und zylinderförmig aufrollen\n🍞In eine eckige Form geben und abgedeckt ca. 2h aufgehen lassen \n🍞Im vorgeheizt Backenofen bei 175 Grad Celsius bei Ober und Unterhitze 15min mit Dampf 💨 und weitere 20min ohne Dampf backen \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte \n\n#brotbacken #brot #hefe #toastbrot #toast #selbstgebacken #hefeteig #vollkorntoast #vollkorn #vollkornbrot #brotzeit #brotrezept #haferflocken #einfacherezepte #schnellerezepte #backenfürdiefamilie #foodblogger #foodie #oats #selbstgebackenesbrot #justspices #rabattcode #gutscheincode #bakingbread #toastbread #brotundbrötchen #backen #backenmachtglücklich #bread #yeastbread', 1657554810, '[]', 'IMAGE', 'images/content/posts/292763960_1074506266800827_2044520257756759522_n.jpg', NULL, NULL, 'https://instagram.com/p/Cf4LI8GjE-J', 0, 0, '[\"#brotbacken\",\"#brot\",\"#hefe\",\"#toastbrot\",\"#toast\",\"#selbstgebacken\",\"#hefeteig\",\"#vollkorntoast\",\"#vollkorn\",\"#vollkornbrot\",\"#brotzeit\",\"#brotrezept\",\"#haferflocken\",\"#einfacherezepte\",\"#schnellerezepte\",\"#backenf\\u00fcrdiefamilie\",\"#foodblogger\",\"#foodie\",\"#oats\",\"#selbstgebackenesbrot\",\"#justspices\",\"#rabattcode\",\"#gutscheincode\",\"#bakingbread\",\"#toastbread\",\"#brotundbr\\u00f6tchen\",\"#backen\",\"#backenmachtgl\\u00fccklich\",\"#bread\",\"#yeastbread\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
(1215, 70, 2876458747000962467, NULL, 'CfrO_2CDr2j', 40, -1, 0, 0, 0, 0, 0, 0, '0.91', '𝗩𝗘𝗚𝗔𝗡𝗘 𝗦𝗖𝗛𝗢𝗞𝗢 𝗩𝗔𝗡𝗜𝗟𝗟𝗘 𝗖𝗥𝗘𝗠𝗘𝗦𝗖𝗛𝗡𝗜𝗧𝗧𝗘 🌱 \n\nDiese lecker Schnitte besteht aus einen knusprigen Schokoladen-Keks Boden, einer sahnigen Vanillepuddingcreme und getoppt wird das ganze noch von einer Schokoladen Cashew-Mousse. 😋🍫Verziert mit Kakaonibs und dem Blütenmix @justspices ist der #nobakecake ein Traum. 🥰\n\n‼️Übrigens mit den Code: „𝗷𝘂𝘀𝘁𝗯𝗮𝗰𝗸𝗳𝗲𝗲𝗹𝗼𝗿𝗶“ 🫶 lohnt es sich derzeit richtig, denn du bekommst derzeit 𝟮𝟬% 𝗮𝘂𝗳 𝗔𝗟𝗟𝗘𝗦 bei @justspices 😍‼️\n\n🔥 𝗞𝗔𝗟𝗢𝗥𝗜𝗘𝗡: pro Stück \nca. 185 kcal / 15g KH / 3g E / 12g F\n\n🍫 𝗣𝗢𝗥𝗧𝗜𝗢𝗡𝗘𝗡: 12 Stück (für eine Schnittenform) \n\n𝗪𝗔𝗦 𝗗𝗨 𝗕𝗥𝗔𝗨𝗖𝗛𝗦𝗧 📝: \n🍫Für den Boden\n▫️100g vegane  Schokolade 🍫 \n▫️1 TL Kokosöl 🥥 \n▫️100g zerbröselte vegane Kekse 🍪 \n▫️50ml Mandel Drink 🥛 \n🍫Für die Vanillecreme \n▫️1 Pck. Puddingpulver Vanille \n▫️300ml Mandeldrink 🥛\n▫️kalorienarme Süße nach Wahl \n▫️100ml vegane Schlagsahne \n▫️1 TL Vanille Kipferl Zucker 💛 @justspices \n▫️1 Pck. Sahnesteif \n🍫Für die Schokoladenmousse\n▫️60g Cashewkerne \n▫️4 Datteln (ca. 38g) \n▫️100ml Mandel Drink 🥛\n▫️1 TL Vanille Extrakt \n▫️20g Kokosöl 🥥\n▫️20g Backkakao 🍫\n▫️2 TL Flohsamenschalen \n\n⏰𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚𝗦𝗭𝗘𝗜𝗧: 4h\n\n⏱𝗭𝗘𝗜𝗧 𝗭𝗨𝗠 𝗘𝗜𝗡𝗪𝗘𝗜𝗖𝗛𝗘𝗡:6h \n\n👩🏻‍🍳𝗭𝗨𝗕𝗘𝗥𝗘𝗜𝗧𝗨𝗡𝗚: \n🍫Für die Mousse die Cashewkerne mind. 6h oder über Nacht in Wasser einweichen \n🍫Für Vanillecreme aus den Puddingpulver, der Milch und der Süße nach Wahl einen Pudding kochen und diesen abgedeckt abkühlen lassen \n🍫Zwischenzeitlich den Boden herstellen, dazu alle Zutaten bis auf die Kekse in eine Schale geben und über einen Wasserbad schmelzen, die Kekse dazugeben und in einer Schnittenform verteilen, in den Kühlschrank stellen \n🍫Für die Vanillecreme die Sahne mit Zucker und Sahnesteif steif schlagen, den abgekühlten Pudding cremig rühren und die geschlagene Sahne unterheben auf den Boden verteilen und ab in den Kühlschrank \n🍫Für die Mousse die eingeweichten Nüsse mit den restlichen Zutaten in einen Mixer geben und cremig mixen, auf die Vanillecreme verteilen und mind. 3h kühl stellen \n\n-🅦🅔🅡🅑🅤🅝🅖- weil tolle Produkte', 1657120625, '[]', 'IMAGE', 'images/content/posts/292213920_537929944792217_6994057291436709129_n.jpg', NULL, NULL, 'https://instagram.com/p/CfrO_2CDr2j', 0, 0, '[\"#nobakecake\"]', 'post', 'profile_scrape', 0, 1683130263, 1683130263),
