(1229, 71, 2470423543635698138, NULL, 'CJItR_DKuHa', 9, 104, 907, 0, 0, 0, 0, 0, '4.04', 'Hallo meine lieben,\n\nIch dachte mir heute morgen, ich drehe mal ganz spontan ein kurzes schnelles Make Up Video. Ich hoffe es gefällt euch! Ich liebe es ja, mich für Weihnachten ein wenig aufzuhübschen und das mit ganz viel Glitzer! Hihi 🙊 \nIn dem Video seht ihr nur einen ganz einfachen Look, für morgen an Weihnachten wird das noch ein wenig glamouröser! Habt einen tollen 23. Dezember und stimmt doch gerne mal in der Story ab ob ihr solche Make up Videos öfters sehen wollt ? Vielleicht auch von morgen denn Weihnachtslook?❤️\n\n#weihnachten #weihnachtsgeschenke #weihnachtslook #schminken #makeuptutorial #makeuplooks #christmasiscoming #glow #glowingskin', 1608718029, '[]', 'VIDEO', 'images/content/posts/132091628_711320726210013_7807011450252611021_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/10000000_218097136560306_4631571895089947512_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=106&_nc_ohc=jbfFoEDifHoAX_HYYjx&edm=AOQ1c0wBAAAA&vs=18132037588089787_2354759859&_nc_vs=HBkcFQAYJEdJQ1dtQUN5NkZteVc4WUFBSGpqaEhZWnBrWkFidlZCQUFBRhUAAsgBACgAGAAbAYgHdXNlX29pbAExFQAAJvaMsoG7v7VAFQIoAkMzLBdAYUqn752yLRgSZGFzaF9iYXNlbGluZV8xX3YxEQB17AcA&_nc_rid=7be6235088&ccb=7-5&oh=00_AfDxBVEkFJuMIdCXArG1XAe9DIvEyQntmaCSWP_Xke5Rnw&oe=645446DD&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CJItR_DKuHa', 0, 0, '[\"#weihnachtsgeschenke\",\"#weihnachtslook\",\"#schminken\",\"#makeuptutorial\",\"#makeuplooks\",\"#christmasiscoming\",\"#glow\",\"#glowingskin\"]', 'post', 'profile_scrape', 0, 1683130272, 1683130272),
(1230, 71, 2116993654992092433, NULL, 'B1hEoNNjz0R', 86, 297, 1217, 0, 0, 0, 0, 0, '13.71', 'Jeder hat seine eigene Geschichte, ich denke jeder könnte eine erzählen , denn jeder wurde wahrscheinlich schon mal auf irgendeine Art und weiße gedemütigt , gedemütigt wegen eines wohl nicht in der „Normliegenden Körperteils“ oder sonstigen Eigenschaften, diese von der Gesellschaft vorgegeben sind.\nJeder wurde schon einmal irgendwie verletzt , ich meine jetzt nicht körperlich, ich meine mit Worten, mit Sätzen und mit Blicken. Denn Worte können sehr verletzend sein, wenn man sie falsch benützt, sie können eine  jede Menge anrichten. Meine Schwäche war jahrelang mein Gewicht, oft wurde mir zugetragen ich sei Fett, dick, oder nicht schön. Vielen hat es wohl Spaß gemacht oder sie fanden sich dadurch ziemlich cool, das zu mir zu sagen... Der verletzendste Satz war wohl immer „der deutsche Panzer rollt wieder“ diesen einen Satz werde ich wohl nie vergessen mein ganzes Leben lang! Das Resümee des ganzen war, das mein Selbstwertgefühl so in denn Keller gesunken ist, dass ich mich selbst nicht leiden konnte und mein Ventil -die Bulimie entwickelte. Diese Worte, dieses Gefühl hat sich Jahrelang  eingeprägt, dementsprechend dauerte es eben auch genauso lang mein Denken und Handeln wieder umzudrehen. Aber nun sag ich STOP, STOP zu Beleidigungen, STOP mich selbst nieder zu machen, STOP zu zig blödsinnigen Diäten, und STOP zu denen die mich Jahrelang schikaniert haben! Ich bin so wie ich bin! Und so bin ich genau richtig und so seit ihr auch genau richtig, anstatt uns gegenseitig fertig zu machen sollten wir uns Worte des Respekts schenken, Liebe, Achtsamkeit & Einfühlsamkeit! Wir sollten aufhören an idealen festzukleben, wir sollten Worte bewusster wählen, weil verletzende Wörter stärker und härter sein können als alles andere! Nur gemeinsam sind wir stark ! 💋 \nEin rießen Dankeschön an alle die mich immer unterstützten ❤️ Danke @hayslgrey für deine Hilfe bei dem Video 💋\n#togetterwearebetterandstrong #ihrseidperfektsowieihrseid', 1566585356, '[]', 'VIDEO', 'images/content/posts/67590489_130629394879250_3310428059714025055_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/69868473_2634510696579393_2166392514790193169_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5mZWVkLmRlZmF1bHQiLCJxZV9ncm91cHMiOiJbXCJpZ193ZWJfZGVsaXZlcnlfdnRzX290ZlwiXSJ9&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=xN0wDLzEc9AAX_3hi8R&edm=AOQ1c0wBAAAA&vs=17989841851267561_1203691129&_nc_vs=HBksFQAYJEdMa2JLZ1JCQVRyU0Vsd0pBQkY0SXFDRGtoQWVia1lMQUFBRhUAAsgBABUAGCRHRUpKSlFRUXE5bll6NGtBQUNHejlVeWI2QlkwYmtZTEFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMBUAACbSk42mzer0PxUCKAJDMywXQEwzMzMzMzMYEmRhc2hfYmFzZWxpbmVfMV92MREAdeoHAA%3D%3D&_nc_rid=7be620b8df&ccb=7-5&oh=00_AfBS4jgam4QNPVOrxtFNNTnZgKe1uO7H7NyXLLH4tFCuHA&oe=6454610F&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/B1hEoNNjz0R', 0, 0, '[\"#ihrseidperfektsowieihrseid\"]', 'post', 'profile_scrape', 0, 1683130272, 1683130272),
