(1233, 72, 2917156470788035490, NULL, 'Ch70lq7jZOi', 13, 1086, 16358, 0, 0, 0, 0, 0, '13.61', 'Endlich fertig meine Gewürzlade🙌🏼 die Gläser habe ich alle bei Amazon bestellt 😊 umgefüllt, beschriftet und nach Alphabet sortiert 😍👌🏼\nDas große Kochen in meiner neuen Küche und natürlich mit meinem Thermomix kann beginnen 🤍👩🏼‍🍳 \n#gewürze #gewürzlade #mitsovielliebe #kleinermonkinmir #kochenmitleidenschaft #kochenmitthermomix #thermomixberaterin #thermomixberaterinkärnten #sandraumek', 1661972213, '[]', 'VIDEO', 'images/content/posts/302484501_144765591260036_3748328448813610151_n.jpg', NULL, NULL, 'https://instagram.com/p/Ch70lq7jZOi', 0, 1, '[\"#gew\\u00fcrze\",\"#gew\\u00fcrzlade\",\"#mitsovielliebe\",\"#kleinermonkinmir\",\"#kochenmitleidenschaft\",\"#kochenmitthermomix\",\"#thermomixberaterin\",\"#thermomixberaterink\\u00e4rnten\",\"#sandraumek\"]', 'post', 'profile_scrape', 0, 1683130276, 1683130276),
(1234, 72, 3081486116171794001, NULL, 'CrDo0vWt8ZR', 10, 230, 0, 0, 0, 0, 0, 0, '2.97', 'T H E R M O M I X 🫶🏼\n\nDu hast wirklich noch nie davon gehört? 😳 Mein allerliebstes Haushaltsgerät der sehr viele Funktionen besitzt und die Arbeit in der Küche erleichtert.😍\n\nOb Dampfgaren, Zutaten wiegen, kontrolliertes Erhitzen/Kochen, zerkleinern, rühren, mixen, mahlen, pürieren, anbraten, Teig kneten, Kartoffel schälen, slow cooking, sous vide garen und und und…🤩\n\nEs erspart einem sehr viel Zeit, denn man muss nicht dabei stehen und aufpassen dass etwas anbrennt oder überkocht.👩🏽‍🍳\n\nMit der integrierten WLAN Funktion bekommt ihr täglich neue Rezeptvorschläge, mittlerweile befinden sich am Gerät selbst oder auch im App, welches sich Cookidoo nennt, über 80.000 Gerichte.🥦\nDamit können auch individuelle Rezept-, und Einkaufslisten zusammengestellt werden.😋\n\nUnd das BESTE überhaupt: die Gelinggaranantie, denn durch das geführte Kochen, kann nichts schief gehen, es gelingt immer und noch besser - es schmeckt❣️\n\nOb Risotto, Germteig, Beef Tatare, Schokoküchlein, Liköre, Smoothies, alles kein Problem mehr.\nSeit ich selber diesen Küchenhelfer habe, stelle ich mich gerne in die Küche und verwöhne meine Liebsten täglich mit frischen Gerichten.😍\n\nDieser So-Gut-Wie-Alles-Könner nennt sich Thermomix und damit veranstalte ich kleine Showkochen. Ich zeige den Leuten wie es funktioniert und was er alles kann, indem wir gemeinsam schnelle, einfache und leckere Menüs zubereiten und verköstigen.\n\nHast du Interesse an einem Showkochen? Dann melde dich bei mir und wir finden gemeinsam einen Termin an dem DU Zeit hast👩🏽‍🍳\n\n*unbezahlteWerbung\n\n#thermomixliebe #thermomixberaterin #thermomixberaterinkärnten #thermomixshowkochen #thermomixaustria #liebezumkochenentdeckt #meinalleskönner #thermomix', 1681561792, '{\"city_name\":\"K&K K\\u00fcchen und Wohnkonzept\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/341774709_785049119456731_3871872650539177211_n.jpg', NULL