(1246, 73, 3095256806679160911, NULL, 'Cr0j6qSuKhP', 0, 13, 0, 0, 0, 0, 0, 0, '0.06', 'Gewinnspiel mit @nowbiolimo 💚\n\nSchaut doch mal bei @nowbiolimo vorbei! Gemeinsam mit unserer Partnerfirma @neumarkter.lammsbraeu läuft gerade ein großes Gewinnspiel mit tollen Preisen.🎁 Als Hauptgewinn kannst du einen 1.000 € BIO HOTELS® Gutschein gewinnen und dir nachhaltige Erholung in unseren BIO HOTELS® gönnen! Aber es warten noch weitere tolle Gewinne auf dich! Die Plätze 2–8 dürfen sich auf je zwei Übernachtungen für 2 Personen in ausgewählten BIO HOTELS® freuen, Platz 9–15 auf einen 250 € BIO HOTELS® Gutschein. Darüber hinaus gibt es BIO HOTELS® Überraschungspakete, Brauereiführungen bei der Neumarkter Lammsbräu und now Überraschungsboxen zu gewinnen!\n\nZum Gewinnspiel gelangt ihr über den 2. Link in unserer Bio 👆🏼\n\nViel Glück 🍀\n\n@biohotel_eggensberger @biohotelamadeus @biohotelrupertus @theinersgarten.biorefugium @biohotelbayerischerwirt @biohotel.steineggerhof @biohotel_grafenast \n.\n.\n#biohotels #biohotel #hotelsfürdiezukunft #hotelsforfuture #bio #biolimonade #biobier #biologisch #urlaub #gewinnen #bier #lammsbräu #nowbiolimo #nowbiolimonade #nowbio', 1683203389, NULL, 'IMAGE', 'images/content/posts/344758780_567907368779218_8022127274725649798_n.jpg', NULL, NULL, 'https://instagram.com/p/Cr0j6qSuKhP', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#bio\",\"#biolimonade\",\"#biobier\",\"#biologisch\",\"#urlaub\",\"#gewinnen\",\"#bier\",\"#lammsbr\\u00e4u\",\"#nowbiolimo\",\"#nowbiolimonade\",\"#nowbio\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1247, 73, 3093747280234742842, NULL, 'CrvMsKPOQQ6', 3, 87, 518, 0, 0, 0, 0, 0, '0.39', 'Dein nachhaltiges Muttertagsgeschenk! 🌸\n\nVerschenke gemeinsame Zeit und schöne Momente. Mit unserem BIO HOTELS Gutschein machst du deiner Mutter sicher eine Freude! 🌱\n\nZu unseren Gutscheinen gelangst du über unseren #linkinbio 💚\n\n#biohotels #biohotel #hotelsfürdiezukunft #hotelsforfuture #muttertag #muttertagsgeschenk', 1683023494, NULL, 'VIDEO', 'images/content/posts/344786673_194904790058369_6402074237338259559_n.jpg', NULL, NULL, 'https://instagram.com/p/CrvMsKPOQQ6', 0, 0, '[\"#linkinbio\",\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#muttertag\",\"#muttertagsgeschenk\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171),
(1248, 73, 3093066251026871302, NULL, 'Crsx14XNLQG', 1, 124, 0, 0, 0, 0, 0, 0, '0.54', '🧘‍♀️🏔️ Auf der Suche nach einem erholsamen Yoga-Urlaub in den Alpen? Dann bist du in unserem BIO HOTEL @biohotel.stillebach genau richtig! 🌿\n\nWir legen großen Wert auf gesundes und bewusstes Leben und bieten dir daher ein hochwertiges Yoga-Angebot, das dich sowohl als Anfänger, als auch als fortgeschrittener \"Yogi\" herausfordert und inspiriert. 🌱\n\nEntdecke unseren neuen Yogastadl: ausgestattet mit Matten, Kissen, Gurten und Vorrichtungen für Aerial Yoga, bietet dir unser Yogastadl alles, was du für deine Yoga-Praxis benötigst. Unsere professionell ausgebildete Yoga-Lehrerin Daniela leitet sorgsam und mit viel Elan vielseitige und kreative Yogastunden, die dich in Einklang mit dir selbst und der Natur bringen.\n\nErlebe eine Auszeit vom Alltag inmitten der atemberaubenden Bergwelt des Pitztals und tauche in die 2000 Jahre alte Technik des Yoga ein. Wir freuen uns auf dich! 💚\n\n#biohotels #biohotel #hotelsfürdiezukunft #hotelsforfuture #biohotelstillebach #dachtirols #pitztal #yogaurlaub #yogaimurlaub #alpenyoga #gesundesleben #bewusstesleben #yogastadl #aerialyoga #tirol', 1682942252, '{\"city_name\":\"Biohotel Stillebach\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/343775339_546396317689577_198347997536105260_n.jpg', NULL, NULL, 'https://instagram.com/p/Crsx14XNLQG', 0, 0, '[\"#biohotel\",\"#hotelsf\\u00fcrdiezukunft\",\"#hotelsforfuture\",\"#biohotelstillebach\",\"#dachtirols\",\"#pitztal\",\"#yogaurlaub\",\"#yogaimurlaub\",\"#alpenyoga\",\"#gesundesleben\",\"#bewusstesleben\",\"#yogastadl\",\"#aerialyoga\",\"#tirol\"]', 'post', 'profile_scrape', 0, 1683204171, 1683204171);
