(1271, 74, 2779827472927011881, NULL, 'CaT7lvEr7Qp', 10, 94, 804, 0, 0, 0, 0, 0, '3.37', 'Instagram-Update: Likes sind nun auch für Storys möglich! ❤️\n\nDie letzten Wochen bereits rollt Instagram ein neues Feature aus, mit dem User*innen etwas mehr Liebe in der App verteilen können. 🥰⁣\n⁣\nLikes sind auf Instagram der einfachste Weg, um jemanden zu unterstützen oder zu zeigen, dass einem der Content gefällt. Ob Feed Posts, Reels oder Instagram Video: Alle diese Content-Formate können mit einem Like positiv bewertet werden. Bei Stories war dies bisher auf Umwegen möglich. Warum das Feature besonders für Unternehmen und Influencer interessant ist, erkläre ich dir in diesem kurzen Video. 👍🏼⁣\n⁣\nAlso lasst ein bisschen Liebe da, bei den Accounts, bei denen euch die Inhalte gefallen. ❤️⁣\n⁣\n⁣\n⁣\n#video #likes #instagram #storylikes #updates #trends #updates #unternehmen #socialmedia #marketing #business #interaktion #instagramupdate #video', 1645601418, NULL, 'VIDEO', 'images/content/posts/274540760_358526299270049_5639834594061196218_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/274573644_483938880102097_56866997050140960_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=bUI729BUL2wAX-BphNN&edm=AOQ1c0wBAAAA&vs=1359645191141716_2068847133&_nc_vs=HBksFQAYJEdFeXBYUkRSbmdyTkk3Z0JBQ0RwbllZN0NNb0FidlZCQUFBRhUAAsgBABUAGCRHSnkxVmhBdzhpQ3VOS01EQURGNDZRTFlfZE1YYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACaq7%2BW5nvPePxUCKAJDMywXQFJqn752yLQYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=738ebcf843&ccb=7-5&oh=00_AfBaSoiqeUyoFfiOVbLOikNmGzKkku5ewwd5e4zMmenYkA&oe=64556D81&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CaT7lvEr7Qp', 0, 0, '[\"#likes\",\"#instagram\",\"#storylikes\",\"#updates\",\"#trends\",\"#updates\",\"#unternehmen\",\"#socialmedia\",\"#marketing\",\"#business\",\"#interaktion\",\"#instagramupda