(1291, 75, 3060704485541193878, NULL, 'Cp5zoNnIKiW', 14, 165, 1280, 0, 0, 0, 0, 0, '2.76', '5 Jahre schon! Boah! Wir waren in Schottland, England, Luxemburg, Deutschland, Österreich, Schweiz, Italien, Liechtenstein, Frankreich und Polen mit dir, lieber Tio! Auf Bergen, SUPs, und über die Alpen. Auf viele weitere Abenteuer mitm Bert 🐺🤍\n\n#siberianhusky #huskylife #snowboarding #bestfriend #gassi #vannomaden #reachrocket #raketenstart #huskyfriend #reelsinstagram', 1679084700, NULL, 'VIDEO', 'images/content/posts/336003496_134997159299823_8281126395419061275_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp5zoNnIKiW', 0, 0, '[\"#huskylife\",\"#snowboarding\",\"#bestfriend\",\"#gassi\",\"#vannomaden\",\"#reachrocket\",\"#raketenstart\",\"#huskyfriend\",\"#reelsinstagram\"]', 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1292, 75, 3059951366238785234, NULL, 'Cp3IY4mok7S', 2, 111, 0, 0, 0, 0, 0, 0, '1.74', 'Ausblick - oder was wir noch so im Van Vorhaben. \n🛠️ größtes Projekt: das Aufstelldach \n🛠️ neuer, besserer Stromwandler (Tipps? Welche habt ihr?)\n⚒️ Sitzbezüge nähen \n⚒️ ggf einen Schrank in ein Babybett umbauen \n🛠️ Tisch folieren \n⚒️ Schlafkoje filzen \n🛠️ Schränke organisieren \n🛠️ Rausfallschutz verbessern\n\nUnd halt all die kleinen Dinge, die uns dann noch in die Finger fallen. Freuen uns aber richtig drauf. ✌🏻', 1678994650, '{\"city_name\":\"\\u00d6sterreich\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/335826233_769871744735046_6114238467816343332_n.jpg', NULL, NULL, 'https://instagram.com/p/Cp3IY4mok7S', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1293, 75, 3057807453973534576, NULL, 'Cpvg62toldw', 16, 236, 0, 0, 0, 0, 0, 0, '3.88', 'Die kalten Tage sind vorbei. Und zwar gleich im doppelten Sinne.\nWir haben nämlich jetzt endlich unseren Wunsch der Dieselheizung im Bjørn umgesetzt. 🔥\nZusammen mit Christian von @roadandboard hat Paul einen Werkstatttag eingelegt und die neue Heizung unter die Sitzbank gebaut. Schreibt ihn gerne an, wenn ihr selber Hilfe braucht! Wir wären sonst einfach komplett lost gewesen! \nDie Lüftungsrohre unserer Gasheizung wurden smart recycelt und auch die truma bleibt drinnen, damit wollen wir den Boiler betreiben. 🚿\n\nFür uns so die beste und einfachste Lösung. \nJetzt kann uns Väterchen Frost nichts mehr anhaben 😉 Die Gasflasche ging ja bekanntlich auch immer mitten in der Nacht aus. Und freuen wir uns einfach krass, dass wir nicht mehr in jedem Land überlegen müssen, welche Gasflasche und welcher Adapter passt und unserer kleinen Familie einfach ordentlch einheizen können. Finden alle gut. Außer Tio. \n\nHat überhaupt jemand von euch noch einen Gasheizung an Bord? \n\n📸 @raphaelasigg', 1678739075, '{\"city_name\":\"Bodensee\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/335816875_905075257402567_4303658427879499459_n.jpg', NULL, NULL, 'https://instagram.com/p/Cpvg62toldw', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1294, 75, 3056348189098666219, NULL, 'CpqVHwZImjr', 2, 126, 0, 0, 0, 0, 0, 0, '1.97', 'Zugegeben, jetzt waren sowohl wir, als auch der Bjørn im Winterschlaf. Aber wir waren nicht untätig und sind dran unser Rolling Home 🚌 für die nächsten Touren bereit zu machen. Wir haben einige Upgrades gemacht, Verschleißteile mussten repariert werden und wir haben viel kleines und großes geplant, um entspannt zu viert mit Baby und Hund 🐣🐺 unterwegs zu sein.', 1678565117, '{\"city_name\":\"Mountains\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/332394526_1621404084956634_6533086967299961926_n.jpg', NULL, NULL, 'https://instagram.com/p/CpqVHwZImjr', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1295, 75, 2747589341102766280, NULL, 'CYhZfLJFHjI', 9, 369, 4623, 0, 0, 0, 0, 0, '5.83', 'Ein Abstecher ins „Tal des Teufels“ 😈🔥ein Gebiet das gar nicht typisch Toskana ist. Zumindest optisch. Vielmehr fühlt man sich hier wie auf einem Vulkan. Heiße unterirdische Quellen sprudeln aus der Erde, silberne Rohre schlängeln sich durch das geothermische Gebiet und hinterlassen einen skurillen Anblick.', 1641758836, NULL, 'VIDEO', 'images/content/posts/271468813_1087676442035300_3904428401823802214_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.16885-16/271215008_392655315944667_8773471533380170660_n.mp4?efg=eyJ2ZW5jb2RlX3RhZyI6InZ0c192b2RfdXJsZ2VuLjcyMC5pZ3R2LmJhc2VsaW5lIiwicWVfZ3JvdXBzIjoiW1wiaWdfd2ViX2RlbGl2ZXJ5X3Z0c19vdGZcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=103&_nc_ohc=msD85s_GxfsAX_yJBR3&edm=AOQ1c0wBAAAA&vs=685798876135327_426697304&_nc_vs=HBksFQAYJEdLQnBLaERiUktBd0htVUJBS1J6SURMZ29jRjVidlZCQUFBRhUAAsgBABUAGCRHQWRwTEJDSm9PVVFaNklCQUF0VktlZnpVSElWYnZWQkFBQUYVAgLIAQAoABgAGwGIB3VzZV9vaWwBMRUAACbG7peN7sjIPxUCKAJDMywXQAMzMzMzMzMYEmRhc2hfYmFzZWxpbmVfMV92MREAdewHAA%3D%3D&_nc_rid=9f34ffd8e3&ccb=7-5&oh=00_AfATuD8_91PDFuH5lMbWekgIe_LH1MQhIK6xerojONM1Bw&oe=645D5ACE&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/CYhZfLJFHjI', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
