(1301, 75, 1587606122840092413, NULL, 'BYIT1tzHm79', 1, 90, 405, 0, 0, 0, 0, 0, '1.4', 'Neues Interview auf unserer Website - ein Auszug aus dem Artikel im CamperVans Magazin (Ausgabe 5/17) und natürlich auch alle \"Memoiren\" 😄 \nDer Wahnsinn, wie viel da schon zusammengekommen ist. Und ganz viel davon über die tolle Community auf Instagram, auf Facebook und in diversen Gruppen. Dafür nen Knicks und ganz ganz lieben Dank 🎊🙏🏻🎊', 1503477419, '{\"city_name\":\"Vannomaden\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/21042097_1991289447784006_3101103865320177664_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/21102827_254644091715045_6132633113030819840_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=109&_nc_ohc=vAF-O_wQKuUAX9Ngx1F&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfBvxtM3Fj7CS3MOdOwpQuAIG9-6lkui3iO1_squEb56xg&oe=645D413E&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BYIT1tzHm79', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
