(1303, 75, 1558227919066901116, NULL, 'BWf8AlbFCp8', 5, 76, 363, 0, 0, 0, 0, 0, '1.25', 'Wenn ich du wäre ...', 1499975264, '{\"city_name\":\"Vagos\",\"country_code\":\"PT\",\"country_name\":\"portugal\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/20066101_145229309387074_3474680464323641344_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/20082037_1125763414191532_5195810568639873024_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=104&_nc_ohc=EtV8IKiw_o0AX_wO52B&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfBNZZD6tmWZZYMfFcez2Mn1V08k8Ec2Y5HXa_w_3avQDQ&oe=645D7CCB&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BWf8AlbFCp8', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1304, 75, 1554364583225186958, NULL, 'BWSNlpildqO', 6, 41, 503, 0, 0, 0, 0, 0, '0.72', 'Die Musik von Alt-J, während die Sonne untergegangen ist. Etwa eine Stunde danach würden wir Zeuge von einem tragischen Unglück und dem leider sehr enttäuschenden Umgang des Festivalveranstalters damit. \nAus 30m Höhe stürzt ein Akrobat vor 25.000 Zuschauern ab. Danach Dunkel. \nEin passionierter Artist verunglückt. \nWir standen ca. 50 Meter daneben.\n\nUnfassbar war für uns wie der Veranstalter und die Bands die Tragödie im Anschluss behandelt haben - wie als ob nichts gewesen war. \nAuf Social Media haben wir daher unserem Unmut Luft gemacht - lange bevor das erste Statement in einer in unseren Augen unrzueichenden Form vom Veranstalter kam.\nWir haben zu den leider nur traurigen ca. 1% gehört - die nachdem unmittelbar danach eine Reaktion ausblieb und sowohl Zuschauer als auch Band so weiter gemacht haben als wäre nichts gewesen - zumindest den Main Act verlassen haben.\nFür uns ist die fehlende Reaktion, zumindest eines Statements danach, völlig unverständlich und das Verhalten von 95% der Zuschauer (Lemminge) ein menschliches Armutszeugnis.\n\nIn Gedanken bei Pedro. \n#madcool2017', 1499514719, '{\"city_name\":\"Caja M\\u00e1gica\",\"country_code\":\"PE\",\"country_name\":\"peru\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/19534659_150068708893904_4085273914433863680_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/19952350_123882671551454_6703994643937230848_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=gMpBYlklfREAX9o07TA&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfCQFCDk4ahucbaXqlBIuRgJ47-fIYGAqN_c8ef0x-r9vw&oe=645D307D&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BWSNlpildqO', 0, 0, '[\"#madcool2017\"]', 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1305, 75, 1551042747850688007, NULL, 'BWGaSlRFgYH', 5, 124, 658, 0, 0, 0, 0, 0, '1.99', 'Ahoi! Grüße von unserem neuen Burgdomizil - von da aus sieht man sogar die Cristo Rei Statue.\n👉🏻 in unserer Story gibt\'s noch mehr Burggeschichten und Ecken vom schönen Lissabon.', 1499118725, '{\"city_name\":\"Castelo De Sao Jorge\",\"country_code\":\"BR\",\"country_name\":\"brazil\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/19624380_107812359793151_723017874100191232_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/19719867_546518142405338_2770330377812705280_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=IjU_CINRdiYAX9C1ekw&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfC8eC99mckfNFgDtHX8zvH1lCZvqDQUGAx7n8H0zVI9Rw&oe=645D7B5F&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BWGaSlRFgYH', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
(1306, 75, 1526911923173212636, NULL, 'BUwrk3gDEHc', 4, 103, 422, 0, 0, 0, 0, 0, '1.65', 'Durch das digitale Nomadentum sind wir mit total spannenden Leuten vernetzt, die alle eins gemeinsam haben: Herzblut und ne ordentliche Portion Mut. So auch der liebe Geri von @stroncton \nGuckt euch mal allein diese liebevolle detailreiche Verpackung an 😻⚓️\nWir finden, das ist ein tolles, ideenreiches, handgemachtes Label mit guten Textilien und unterstützt sogar noch @skateaid \nAber genug der Worte, jetzt wird ... AUSGEPACKT!! 🎉', 1496242107, NULL, 'VIDEO', 'images/content/posts/18812780_473127133033441_4959660420458610688_n.jpg', 'https://scontent-cph2-1.cdninstagram.com/v/t50.2886-16/18854773_1206135942828079_7711278995857211392_n.mp4?efg=eyJxZV9ncm91cHMiOiJbXCJpZ19wcm9ncmVzc2l2ZV91cmxnZW4ucHJvZHVjdF90eXBlLmZlZWRcIl0ifQ&_nc_ht=scontent-cph2-1.cdninstagram.com&_nc_cat=107&_nc_ohc=DbnjLGD8xvsAX-4H40m&edm=AOQ1c0wBAAAA&ccb=7-5&oh=00_AfDKdka13vLuT3du2-pZBvjSfP0WP0FqJlxO5kdo2eNfoQ&oe=645CFEA8&_nc_sid=8fd12b', NULL, 'https://instagram.com/p/BUwrk3gDEHc', 0, 0, NULL, 'post', 'profile_scrape', 0, 1683727016, 1683727016),
