(188, 11, 3069797603324564972, NULL, 'CqaHKfegZXs', 14, 234, 3411, 0, 0, 0, 0, 0, '0.17', 'Milan has a special place in my heart, for various reasons, one of them being my friends!\n\nI’ve spent a lot of time in the past years in this city, and coming here is always a bit emotional for me.\n\nI came, in fact, to Milan to celebrate the birthday of a dear friend of mine and I had the opportunity to stay in @sonderstays hotel which is located in the Missori district,in the heart of Milan, perfect for those who want to discover the city on foot ! \n\nMilan is one of the cities where I am always in a hurry, that’s why I like to be able to start my day slowly enjoying the peace and some good Italian coffee in my room at @sonderstays with the birds singing out of the window.\n\nSonder offers a great experience, which can be a hotel room or an apartment, in more than 40 cities!\nThe @sonderstays experience is easily managed through their app, which makes it easy to get whatever you need during your stay!!\n\nAd | Werbung @sonderstays \n#Abetterwaytostay #sondermilan\n\n#milan #hotel #hotellife #italy #travel #traveling #bedroom #bedroomdesign #design #interiors #interiores #interiordesigner #apartment #contenporarydesign #modern\n#home #paceful #bedroom #bedroomdecor #bedroominspo #mybdrm #pigletinbed #home #interior #interiordesign #interiorinspiration', 1680168440, '{\"city_name\":\"Milan\",\"country_name\":\"italy\",\"country_code\":\"IT\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/338590988_243149194852875_7376065267136961432_n.jpg', NULL, NULL, 'https://instagram.com/p/CqaHKfegZXs', 0, 0, '[\"#abetterwaytostay\",\"#sondermilan\\n\\n#milan\",\"#hotel\",\"#hotellife\",\"#italy\",\"#travel\",\"#traveling\",\"#bedroom\",\"#bedroomdesign\",\"#design\",\"#interiors\",\"#interiores\",\"#interiordesigner\",\"#apartment\",\"#contenporarydesign\",\"#modern\\n#home\",\"#paceful\",\"#bedroom\",\"#bedroomdecor\",\"#bedroominspo\",\"#mybdrm\",\"#pigletinbed\",\"#home\",\"#interior\",\"#interiordesign\",\"#interiorinspiration\"]', 'post', 'profile_scrape', 0, 1680279326, 1680279326),
(189, 11, 3066281338583847272, NULL, 'CqNnqGvsxFo', 50, -1, 0, 0, 0, 0, 0, 0, '0.03', 'Last year’s sun 🌞\n\n#spring #springtime #kitchen #kitchendesign #kitcheninspiration #kitcheninspo\n#kitchendecor #kitchenset#ikea#architecture #design #interiordesign\n#kitcheninterior #kitchenstories #cream#marmor #marmorkuchen #interior #interiorinspo #interiorinspiration#ikeaideas #solebich #myktchn', 1679749241, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'IMAGE', 'images/content/posts/337575401_3460313760907511_3259557247731775583_n.jpg', NULL, NULL, 'https://instagram.com/p/CqNnqGvsxFo', 0, 0, '[\"#springtime\",\"#kitchen\",\"#kitchendesign\",\"#kitcheninspiration\",\"#kitcheninspo\\n#kitchendecor\",\"#kitchenset#ikea#architecture\",\"#design\",\"#interiordesign\\n#kitcheninterior\",\"#kitchenstories\",\"#cream#marmor\",\"#marmorkuchen\",\"#interior\",\"#interiorinspo\",\"#interiorinspiration#ikeaideas\",\"#solebich\",\"#myktchn\"]', 'post', 'profile_scrape', 0, 1680279326, 1680279326),
(190, 11, 3064035058521295516, NULL, 'CqFo6bagUqc', 19, 1579, 9086, 0, 0, 0, 0, 0, '1.09', 'I have been wanting to change the style of this kitchen for a while now, as it no longer reflects me.\n1 honestly haven’t liked it for months, it doesn’t give me positive emotions and I just want to change the visual as soon as possible, and this moment is coming!\nIt takes years and years of experience and mistakes to find ourselves and our own style, the one we like and feel comfortable with, the one that reflects our personality.\nIt is not easy,it is instead very difficult. I spent years trying to figure out what I like, not feeling good because I couldn’t find my dimension, but it seems like everything is going in the right direction, it seems like all I needed was time. Sometimes you just need time!!!!!\nI am happy that I have made so much progress, i’m sorry I blamed myself for making the mistakes I made, but now I understand the process, and I’m happy to make more mistakes.\nI can’t wait to share with you the biggest change of this year\n#spring #springtime #kitchen #kitchendesign #kitcheninspiration #kitcheninspo\n#kitchendecor #kitchenset#ikea#architecture #design #interiordesign\n#kitcheninterior #kitchenstories #cream#marmor #marmorkuchen #interior #interiorinspo #interiorinspiration#ikeaideas #solebich #myktchn', 1679481477, '{\"city_name\":\"Berlin\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":\"true\"}', 'VIDEO', 'images/content/posts/338165126_965539884890852_5165024382172407633_n.jpg', NULL, NULL, 'https://instagram.com/p/CqFo6bagUqc', 0, 0, '[\"#springtime\",\"#kitchen\",\"#kitchendesign\",\"#kitcheninspiration\",\"#kitcheninspo\\n#kitchendecor\",\"#kitchenset#ikea#architecture\",\"#design\",\"#interiordesign\\n#kitcheninterior\",\"#kitchenstories\",\"#cream#marmor\",\"#marmorkuchen\",\"#interior\",\"#interiorinspo\",\"#interiorinspiration#ikeaideas\",\"#solebich\",\"#myktchn\"]', 'post', 'profile_scrape', 0, 1680279326, 16802793