(826, 48, 3093956105066408946, NULL, 'Crv8K9hImvy', 0, 19, 64, 0, 0, 0, 0, 0, '0.19', 'Ad: LASSE muss noch warten. Eigentlich wollte ich das schöne Wetter nutzen, um Lavendel #lasse in sein neues Plätzchen einzubuddeln. \nQR Code gescannt und hier wird empfohlen Lavendel erst Mitte Mai einzupflanzen. \nGut, dass man bei @wearebloomify alles so toll nachlesen kann. \nDie Eisheiligen 🥶 warte ich noch ab. Aber dann gehts für LASSE ab in den Garten. Dann genieße ich halt die 🌞.\n\n#garten #lavendel #levander #pflanzen #grünerdaumen', 1683048351, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343979074_622561149889198_4781190883916654394_n.jpg', NULL, NULL, 'https://instagram.com/p/Crv8K9hImvy', 0, 0, '[\"#lasse\",\"#lavendel\",\"#levander\",\"#pflanzen\",\"#gr\\u00fcnerdaumen\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
(827, 48, 3090350828349898914, NULL, 'CrjIbR7IUCi', 2, 35, 107, 0, 0, 0, 0, 0, '0.36', 'Ad: Jeder kann gärtnern 👩‍🌾. Das Konzept von @wearebloomify hat mich überzeugt. Ich bin nicht gerade bekannt für meinen grünen Daumen 😂. \nDas Team ist so sympathisch und wurschtelt so emsig im Garten. Das ist so ansteckend 👍\nJetzt leben Carmen die Calamondinorange, Erdbeere Enno, Wassermelone Werner und Lavendel Lasse bei uns. \nWerner durfte erstmal rein auf die Fensterbank. Der ist noch zu klein zum draußen spielen. Der restlichen Gang macht die Kälte hoffentlich nichts aus. Sicherheitshalber habe ich sie etwas eingepackt. \nDrückt mir die Daumen. \nDie nächste Zeit werde ich hoffentlich nur noch über meine gärtnerischen Erfolge berichten. #staytuned \nNatürlich alles in 🌱Bio Qualität. \n#gärtner #garten #bio #pflanzen @wearebloomify', 1682618620, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343274866_964804574646522_2002489334724004481_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjIbR7IUCi', 0, 0, '[\"#staytuned\",\"#g\\u00e4rtner\",\"#garten\",\"#bio\",\"#pflanzen\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
(828, 48, 3088161918140054052, NULL, 'CrbWucboHok', 2, 33, 69, 0, 0, 0, 0, 0, '0.34', '#frühlingsgefühle🌷 \nEin ganz normaler deutscher April. Wie oft habe ich mich in meiner Jugend gefragt, wie wird das Wetter an meinem Geburtstag Ende April?\nOft war es wie jetzt, wechselhaft, kühl, nass, windig , sonnig ☀️ und das gerne durch gemixt an einem Tag. Daher gibts jetzt die volle Dröhnung Frühlingsgefühle vom gestrigen Sonntag.\nEin Spaziergang im herrlichen Botanischen Garten in @heilbronn.erleben klein aber fein. Herrliche historische Pavillons meet Blütenpracht und 🐝 Bienensummen. Balsam für die Seele, kleine grüne Lunge mitten in der Stadt. #botanischergartenheilbronn #heilbronn #frühling #frühlingserwachen #frühlingsblumen #frühlingsliebe', 1682358094, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/342717604_983885533024167_123189820334152041_n.jpg', NULL, NULL, 'https://instagram.com/p/CrbWucboHok', 0, 0, '[\"#fr\\u00fchlingsgef\\u00fchle\\ud83c\\udf37\",\"#botanischergartenheilbronn\",\"#heilbronn\",\"#fr\\u00fchling\",\"#fr\\u00fchlingserwachen\",\"#fr\\u00fchlingsblumen\",\"#fr\\u00fchlingsliebe\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
(829, 48, 3083101489047035299, NULL, 'CrJYHglIF2j', 12, 59, 330, 0, 0, 0, 0, 0, '0.69', 'Vorsicht 🚨 Betrugsfälle.\nNachdem ich ja bei einer Bank arbeite, möchte ich heute mal auf einige Betrugsmaschen aufmerksam machen, die leider in der Praxis vorkommen and. \n\nNein, es trifft nicht nur ältere Menschen, teilweise trifft Dreistigkeit auf Gutgläubigkeit - eine fatale und zum Teil teure Mischung.\n📞\n- Enkeltrickanruf, ja gibt es immer noch und ja, leider funktioniert er auch noch. Es geht noch schlimmer, nämlich mit dem\n- Schockanruf, hier geben die Betrüger am Telefon vor ein Familienmitglied wäre schwer verletzt und für die Behandlung müsste sofort, um das Leben zu retten, ein meist 5stelliger Betrag überwiesen werden. \n📥\n- authentisch scheinende E-Mail mit dem Betreff “Aussetzung Ihrer Zugänge# wer dann auf die Links klickt holt sich oft Spyware auf den Rechner. Noch blöder wird’s, wenn Ihr PINs und TANS eingebet, die öffnen Tür und Tor zum Konto. Gebt diese sensiblen Daten nie, nie leichtfertig weiter. Auch nicht telefonisch an vermeintliche Bankmitarbeiter. Ruft im Zweifel lieber bei eurer Bank an, um sicherzugehen wen ihr in der Leitung habt.\n💭\n- WhatsApp Nachrichten, wo einer eurer Kontakte plötzlich ne neue Nummer hat und dann schnell für irgendwas Geld benötigt.\n📞📥💭\n- natürlich Gewinnbenachrichtigungen von Gewinnspielen an denen man nie beteiligt war, für die Überführung des z.B. Autos 🚗 erstmal zahlen soll.\nTipps: ℹ️\n- checkt regelmäßig eure Umsätze, nutzt z.B. Benachrichtigsservice funktioniert auch bei Kreditkartenumsätzen\n- hinterlegt bei OnlineShops nicht eure Kontonummer sondern besser eure Kreditkarte. Geiz ist geil, wenn es um eure Daten geht \n- legt ein OnlineLimit für euer Konto fest. Lieber einmal für höhere Beträge das Limit erhöhen. \n- gebt weder PIN noch TAN leichtfertig weiter!!! / wechselt eure Zugangsdaten regelmäßig (lästig aber wichtig)\n- klickt nicht auf jeden Link \n- im Zweifelsfall Karte/Konto sperren lassen\n- überlegt eine Internetversicherung abzuschließen\n\nHoffe die Tipps waren nützlich für euch. Kennt ihr jemanden der schon mal betroffen war? \n\n#internetsicherheit \n#betrüger\n#betrugsmasche \n#bauernfänger', 1681754656, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/341735266_948737086158732_7886196883609178981_n.jpg', NULL, NULL, 'https://instagram.com/p/CrJYHglIF2j', 0, 0, '[\"#internetsicherheit\",\"#betr\\u00fcger\\n#betrugsmasche\",\"#bauernf\\u00e4nger\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
(830, 48, 3077998358642765497, NULL, 'Cq3PzMCIy65', 2, 55, 112, 0, 0, 0, 0, 0, '0.56', 'Frohe Ostern, Leute! 🐰🥚🌷 Ich hoffe, ihr habt schon genug Schokolade, um ein ganzes Dorf zu versorgen (oder zumindest euch selbst). \n🐣🥚🐰Hier war alles eher gechillt und ich genieße meine nahezu Handy freiere Zeit im #realenleben und befasse mich viel mit mir. Lesen #sobinicheben  von @stefaniestahl liegt schon parat. Aber diese wunderschönen Frühlingsboten wollte ich mit euch teilen. \n\n#FroheOstern #SchokoladeSatt #OsterhaseAufDerListeDerVerdächtigen', 1681146269, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/340675285_263869092642818_5308216844854539161_n.jpg', NULL, NULL, 'https://instagram.com/p/Cq3PzMCIy65', 0, 0, '[\"#realenleben\",\"#sobinicheben\",\"#froheostern\",\"#schokoladesatt\",\"#osterhaseaufderlistederverd\\u00e4chtigen\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
