(835, 48, 3047968320325278505, NULL, 'CpMjwnbodsp', 2, 57, 310, 0, 0, 0, 0, 0, '0.58', '#monstergoeshappy\nDanke liebe Uda. Du hast mir so eine große Freude bereitet. Unsere Kinder waren im Kindi aufgefordert die Mamas zu malen und wir mussten uns anhand der Bilder erkennen. Das ist jetzt 22 Jahre her. 😭🥹\nDann bin ich auf Udas @monstergohappy Kanal aufmerksam geworden. Sie häkelt Kinderbilder und will dafür nix. Sondern spendet alles an die Stiftung Kinderhospiz Sternenbrücke. Dieser Verein ermöglicht es Familien gemeinsam würdevoll den letzten Weg zu gehen mit dem Geliebten Kind🥹. \nUnterstütz diese Aktion gerne mit eurer Spende: \nVoba Hamburg / DE65 2019 0003 0019 0991 00 / GENODEF1HH \nWürde mich freuen, wenn ihr dieses großartige Projekt unterstützt. 🥰\nWir können den Leben nicht mehr Tage geben, aber den Tagen mehr Leben. 🌟\n#dankbarkeit', 1677566787, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/333202876_921687462298018_640750693218201371_n.jpg', NULL, NULL, 'https://instagram.com/p/CpMjwnbodsp', 0, 0, '[\"#monstergoeshappy\\ndanke\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
