(837, 48, 3044021951298403505, NULL, 'Co-idY3ofyx', 4, 74, 0, 0, 0, 0, 0, 0, '0.76', 'Ja, ich hab nen Vogel. 🦜\n\nHeimarbeit - nichts anderes ist Homeoffice, remotewok oder mobiles Arbeiten. Knapp 35 Jahre und eine Pandemie später klingen die neuen Bezeichnungen super cool. \n\nBei dem Begriff denke ich sofort unsere Nachbarin aus meinen Kindertagen, die von Zuhause aus Kettenverschlüsse im Akkord zusammengetüddelt hat. \n\nAuch damals galt die Mär - so sind Kinder, Familie und Haushalt super unter einen Hut zu bekommen?!? \n\nNa egal, ob früher oder heute. Weder Kinder noch Haustiere halten sich an Arbeitszeiten und gestalten so manche online Meetings unfreiwillig mit. Unsere Nymphensittiche lassen sich nicht von Vorstandsrunden, Zahlen, Daten, Fakten beeindrucken und sind im Stall manchmal nicht zu bändigen. Gehören praktisch zum Kolleg:innenkreis. \n\nIch persönlich schätze die hybriden Arbeitsmöglichkeiten. Hat beides Vor- und Nachteile. Bin dennoch lieber im Büro statt Zuhause.\n\n #homeoffice #heimarbeit #remotework #mobilesarbeiten #schöneneuearbeitswelt', 1677095715, '{\"city_name\":\"Heilbronn\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'IMAGE', 'images/content/posts/332553521_204918728867679_6597067363275295634_n.jpg', NULL, NULL, 'https://instagram.com/p/Co-idY3ofyx', 0, 0, '[\"#homeoffice\",\"#heimarbeit\",\"#remotework\",\"#mobilesarbeiten\",\"#sch\\u00f6neneuearbeitswelt\"]', 'post', 'profile_scrape', 0, 1683110903, 1683110903),
