(997, 59, 3090347258151063962, NULL, 'CrjHnU6slGa', 29, 347, 197, 0, 0, 0, 0, 0, '3.67', '𝐓𝐡𝐞 𝐁𝐨𝐝𝐲 𝐒𝐡𝐨𝐩\n\nAnzeige @thebodyshop 🍋🪻🌱\n\n𝐍𝐞𝐮𝐞 𝐋𝐢𝐦𝐢𝐭𝐞𝐝 𝐄𝐝𝐢𝐭𝐢𝐨𝐧: 𝐋𝐮𝐬𝐜𝐢𝐨𝐮𝐬 𝐋𝐲𝐜𝐡𝐞𝐞 & 𝐙𝐞𝐬𝐭𝐲 𝐋𝐢𝐦𝐞 𝐁𝐥𝐨𝐬𝐬𝐨𝐦\n\nZesty Lime Blossom Water-Gel Body Yogurt\n\nDer erfrischende, zitronige, blumige Sommerduft erinnert Dich an tolle Sommertage.\n\nZieht schnell ein, ist ultra leicht und versorgt Deine Haut 24 Stunden mit Feuchtigkeit.\n\nLuscious Lychee Body Scrub\n\nDie erfrischende, fruchtige Formulierung lässt sich ganz leicht auftragen, peelt Deine Haut ganz sanft, entfernt abgestorbene Hautzellen und hinterlässt Deine Haut geschmeidig und mit Feuchtigkeit versorgt.\n\nLuscious Lychee Duschcreme\n\nDie milchige Textur schäumt herrlich und reinigt Deine Haut ganz sanft.\n\nZesty Lime Blossom Duschgel\n\nSorgt für eine erfrischende Dusche, duftet herrlich blumig und zitronig nach Lindenblüte und holt Dir die Sonne in Deine Morgenroutine. Hinterlässt Deine Haut erfrischt und geschmeidig: Sommer in der Flasche.\n\nNeue Summer Limited Edition mit neuen Texturen erfrischt Sommerhaut und duftet herrlich!\n_______________\n#thebodyshopgiftedme  #thebodyshop #limitededition #complimentaryfromthebodyshop #influencer #beautyaddict #summertime', 1682619502, '{\"city_name\":\"Nordrhein-Westfalen\",\"country_name\":\"germany\",\"country_code\":\"DE\",\"tagged_location\":true}', 'VIDEO', 'images/content/posts/343277955_567506908823285_7649312308691819364_n.jpg', NULL, NULL, 'https://instagram.com/p/CrjHnU6slGa', 0, 0, '[\"#thebodyshop\",\"#limitededition\",\"#complimentaryfromthebodyshop\",\"#influencer\",\"#beautyaddict\",\"#summertime\"]', 'post', 'profile_scrape', 0, 1683111087, 1683111087),
